INSERT INTO `events` VALUES (41,'Android Study Jams : Getting Started in Android ','Join us to learn how to write your own Android app from scratch! ','Join us to learn how to write your own Android app from scratch! \r\n\r\nAndroid Study jams is a great way to get personal attention and a FREE class to learn a new skill. At the end of the class, you will have your own unique app that YOU MADE and that you can show for your work. Personal instructors are here to help as well and we will try to broadcast the classes online as well for those who may not be able to attend some days. \r\n\r\nhttp://developerstudyjams.com/\r\n\r\nWe will be following through the Udacity Android for Beginners coursework as described here: https://www.udacity.com/course/android-development-for-beginners--ud837\r\n\r\nSTUDENTS ARE REQUIRED TO PARTICIPATE AND ENCOURAGED TO MAKE A SMALL DONATION FOR FOOD/DRINK AND TO THE LOCATION.\r\n\r\nhttp://www.meetup.com/gdgdallas/','','2016-07-26 23:30:00','2016-07-27 02:00:00','2016-07-26 23:15:00','2016-07-27 02:15:00',0.00,NULL,1,0,0,0,0,'2016-07-26 23:30:00',0,1,1,'completed',9,32,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-06-03 04:01:44','2016-07-27 02:00:01'),(42,'Android Study Jams : Getting Started in Android ','Join us to learn how to write your own Android app from scratch! ','Join us to learn how to write your own Android app from scratch! \r\n\r\nAndroid Study jams is a great way to get personal attention and a FREE class to learn a new skill. At the end of the class, you will have your own unique app that YOU MADE and that you can show for your work. Personal instructors are here to help as well and we will try to broadcast the classes online as well for those who may not be able to attend some days. \r\n\r\nhttp://developerstudyjams.com/\r\n\r\nWe will be following through the Udacity Android for Beginners coursework as described here: https://www.udacity.com/course/android-development-for-beginners--ud837\r\n\r\nSTUDEN