nating them to children we serve! So Who will start folding? No need for a kit, just find some paper and get to it!\r\n\r\nWe will teach you how to make the paper cranes. \r\n\r\nwe are inviting HEROIC INNER KIDS to this event, want to see batman and wolverine fold tiny paper cranes? Cosplay event. ','','2016-07-23 00:00:00','2016-07-23 04:00:00','2016-07-23 00:00:00','2016-07-23 04:00:00',0.00,NULL,0,0,0,0,0,'2016-07-23 00:00:00',0,1,1,'completed',8,24,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-06-03 04:42:34','2016-07-23 11:00:55'),(81,'Spice Up Your Life!','Lets make a few spice blends to spice up your life.','Aside from being a SPICE Girls song,  the title says it all. Lets make a few spice blends to spice up your life. From tadkas to 5 spice blends. Tour the world with a little help from a few spices . As we will blend our own mixes please bring  Ziploc bags. ( take that McCormick\'s! )\r\n\r\n10 tickets are available at $6.27 ($5 + fees) each\r\n\r\nRSVP here: https://www.eventbrite.com/e/spice-up-your-life-tickets-24448589389','','2016-07-16 17:00:00','2016-07-16 18:15:00','2016-07-16 16:45:00','2016-07-16 18:30:00',5.00,NULL,0,1,0,0,0,'2016-07-16 17:00:00',0,1,1,'completed',11,33,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-06-03 04:43:10','2016-07-22 18:25:59'),(83,'Finance Committee - Weekly Meeting','Finance Committee: Processing of DMS accounting activities.','Finance Committee: Processing of DMS accounting activities. All members welcome to attend.','','2016-07-24 15:00:00','2016-07-24 19:00:00','2016-07-24 15:00:00','2016-07-24 19:00:00',0.00,NULL,0,0,1,0,0,'2016-07-24 15:00:00',0,1,1,'completed',4,19,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-06-03 04:44:11','2016-07-24 19:00:01'),(84,'Finance Committee -  Weekly Meeting','Finance Committee: Processing of DMS accounting activities. All members welcome to attend.','Finance Committee: Processing of DMS accounting activities. All members welcome t