NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-06-03 04:50:23','2016-07-31 19:00:01'),(98,'CANCELLED - DFW Gaymers (LGBTQ) Meetup','Your one-stop-shop for all things LGBT and gaming.','2nd Saturday meetup for the month! There will be some drinks and light snacks, however, please pitch in and bring some to share!  The Dallas Makerspace also has a Parks Pantry Micro-Market where a big selection of drinks and snacks can be purchased.\r\n\r\nPlease note that a liability waiver MUST be signed upon entry.\r\n\r\nWelcome to DFW Gaymers! Your one-stop-shop for all things LGBT and gaming. Established November 2013, we strive to bring together the LGBT community through our online community and monthly meet-ups.\r\nFacebook:  http://www.facebook.com/groups/dfwgaymers\r\nWebsite: http://dfwgaymers.com\r\nReddit: http://reddit.com/r/dfwgaymers','','2016-07-17 00:30:00','2016-07-17 16:00:00','2016-07-17 00:30:00','2016-07-17 16:00:00',0.00,NULL,0,0,0,0,0,'2016-07-17 00:30:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:19:49','2016-07-22 18:25:59'),(101,'3d Printing Certification Class','A class to show how to properly use the 3d printers.','This class will cover using Dallas Makerspace 3d printers including all hardware and software aspects as well as our policies and best practices.\r\n\r\nHost:  Joseph Bright\r\nContact:  texasboyjmb@yahoo.com','','2016-07-17 17:00:00','2016-07-17 18:00:00','2016-07-17 17:00:00','2016-07-17 18:00:00',0.00,NULL,0,0,1,0,0,'2016-07-17 17:00:00',0,1,0,'completed',1,1,1,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:25:16','2016-07-22 18:25:59'),(106,'Dallas Film Crew 54','Lighting Workshop','Host:  Alex Espinoza\r\nContact:  alex.espinoza@redfogfilms.com\r\n\r\nLighting Workshop','','2016-07-17 18:00:00','2016-07-17 21:00:00','2016-07-17 18:00:00','2016-07-17 21:00:00',0.00,NULL,0,0,0,0,0,'2016-07-17 18:00:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:32:57','2016-07-22 18:25:59'),(107,'ARTEMIS Spaceship Bridge Simulator night','It\'s time to play Artemis again! ','It\'s time to play Artemis again! \r\n\r\nI\'ll be bringing my DMX-controlled lighting that reacts to events in the game. Red alert? The lights flash red. Take ship damage? The lights flash and flicker. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-07-16 02:30:00','2016-07-16 04:59:00','2016-07-16 02:00:00','2016-07-16 05:29:00',0.00,NULL,0,0,0,0,0,'2016-07-15 02:30:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:33:05','2016-07-22 18:25:59'),(108,'ARTEMIS Spaceship Bridge Simulator night','It\'s time to play Artemis again! ','It\'s time to play Artemis again! \r\n\r\nI\'ll be bringing my DMX-controlled lighting that reacts to events in the game. Red alert? The lights flash red. Take ship damage? The lights flash and flicker. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-07-16 02:30:00','2016-07-16 04:59:00','2016-07-16 02:00:00','2016-07-16 05:29:00',0.00,NULL,0,0,0,0,0,'2016-07-15 02:30:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:34:40','2016-07-22 18:25:59'),(110,'Bloody Spiral - Casting','Casting Calls','Casting Calls','','2016-07-15 14:00:00','2016-07-16 22:00:00','2016-07-15 14:00:00','2016-07-16 22:00:00',0.00,NULL,0,0,0,0,0,'2016-07-15 14:00:00',0,1,0,'completed',4,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:38:44','2016-07-22 18:25:59'),(111,'Tag and Policy Workshop for Etsy and eCommerce Shops','Proper tagging of products, images, and pages for Etsy and other eCommerce sites','Host:  Alexis Strickland\r\nContact:  whippedupwonderful@gmail.com\r\n\r\n\r\nTag & Policy Building to Get You Seen & Enhance Customer Trust & Satisfaction\r\n\r\nCalling all: Etsy Shop Owners, Shopify Sellers, Small Business Owners, and eCommerce Shop Owners\r\nLearn with Alexis Clare of Whipped Up Wonderful, the #1 Bath Bomb seller on Etsy. \r\n\r\nThis comprehensive workshop will go over the proper tagging of products, images, and pages, offering helpful hints and \"cheats\" for giving your one-person-show a big helping hand. We will also cover basic policy building, and why your current policies may be driving potential clients away. \r\n\r\nThis workshop will be very thourough, so bring your notebook, and/or tablet or laptop for some group critique. \r\nWorkshop Schedule: \r\n1:00pm Class will begin promptly\r\nOverview of terms and why SEO is important for your shop\r\n2:00pm \r\nPolicy building and why a bad policy = a \"Closed\" sign. \r\n3:00pm\r\nQ&A with some peer critique\r\n3:30pm\r\nWorkshop concludes\r\n\r\nClass is $25 and you can register at the following link:\r\nhttps://www.eventbrite.com/e/tag-policy-workshop-for-etsy-ecommerce-shops-tickets-26398146567\r\n','','2016-07-17 18:00:00','2016-07-17 20:30:00','2016-07-17 18:00:00','2016-07-17 20:30:00',0.00,NULL,0,0,0,0,0,'2016-07-17 18:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:38:58','2016-07-22 18:25:59'),(112,'Beginner Torch- Fired Enameling','Intro to torch-firing enamel on copper','Host:  Rene Perry\r\nContact:  rpnotme42@gmail.com\r\n\r\nThis is a beginner intro to torch-firing enamel on copper. Copper blanks, enamels and tools will be provided. Please bring a dust mask, and wear cotton clothing (fire!). Class is limited to 4 people.\r\n\r\nPurchase tickets here: https://www.eventbrite.com/e/torch-fired-enameling-tickets-required-tickets-26341753895','','2016-07-17 19:00:00','2016-07-17 22:00:00','2016-07-17 19:00:00','2016-07-17 22:00:00',0.00,NULL,0,0,0,0,0,'2016-07-17 19:00:00',0,1,0,'completed',26,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:42:00','2016-07-22 18:25:59'),(113,'Toys for tots dulcimer stick build','We will get together and build as many dulcimer sticks as we have supplies for with the intent of giving them away as holiday presents at the end of the year.','We will get together and build as many dulcimer sticks as we have supplies for with the intent of giving them away as holiday presents at the end of the year.','','2016-07-15 15:00:00','2016-07-16 01:00:00','2016-07-15 14:30:00','2016-07-16 01:30:00',0.00,NULL,0,0,1,0,0,'2016-07-15 15:00:00',0,1,0,'completed',12,1,NULL,4,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:43:31','2016-07-22 18:25:59'),(114,'Code Walkthrough: Onboard ','we will show and discuss sample code in Android Studio','Host:  John Lindsay\r\nContact:  technoprobic@gmail.com\r\n\r\nMost contemporary Android devices have one or more sensors, such as motion, humidity, and light sensors. In this presentation, we will show and discuss sample code in Android Studio for the following steps:\r\n\r\n1. Setting up an activity to display sensor values\r\n2. Enumerating onboard sensors\r\n3. Retrieving sensor values\r\n4. Displaying & storing sensor values ','','2016-07-14 23:00:00','2016-07-15 01:00:00','2016-07-14 22:45:00','2016-07-15 01:15:00',0.00,NULL,0,0,0,0,0,'2016-07-14 23:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:45:03','2016-07-22 18:25:59'),(116,'Simplified Electronics Workshop','Simplified Electronics Workshop','Host: Brandon Dunson\r\nContact: brandondunson@hackaday.com\r\n\r\nSimplified Electronics Workshop\r\n\r\n(Previously called Mrs. Penny\'s Driving School)','','2016-07-16 17:01:00','2016-07-16 23:00:00','2016-07-16 17:01:00','2016-07-16 23:00:00',0.00,NULL,0,0,0,0,0,'2016-07-16 17:01:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:47:58','2016-07-22 18:25:59'),(117,'Freeze Dryer Class','Certification Class for Freeze Dryer','Certification Class for Freeze Dryer\r\n\r\nHost:  Ebony\r\nContact:  jackebony92@gmail.com\r\n','','2016-07-20 00:00:00','2016-07-20 01:00:00','2016-07-20 00:00:00','2016-07-20 01:00:00',0.00,NULL,0,0,1,0,0,'2016-07-20 00:00:00',0,1,0,'completed',18,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:48:58','2016-07-22 18:25:59'),(118,'Silver Ring Fabrication Workshop','In this workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band.','Host:  Joseph Lahoud\r\nContact:  joseph@LaProng.com\r\n\r\nIn this workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band. If you are looking for something more durable than silver upgrade to use 14K white, yellow or rose gold. \r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring that you will form and solder together. You then can stamp, and, polish, your ring to your desired level of finish.\r\n\r\nTotal time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. This is a very small class to allow everyone enough time and attention to create a complete finished piece of jewelry you can wear home! Hope to see you there!!\r\n\r\nBook now and buy your tickets here: \r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1413681','','2016-07-16 19:30:00','2016-07-17 01:30:00','2016-07-16 19:00:00','2016-07-17 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-16 19:30:00',0,1,0,'completed',26,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 00:53:22','2016-07-22 18:25:59'),(120,'sdf/3wa','presentation of new anime','Host:  Tim Black\r\nContact:  stardrakestudios@yahoo.com\r\n\r\npresentation of new anime','','2016-07-16 20:30:00','2016-07-17 01:30:00','2016-07-16 20:15:00','2016-07-17 01:45:00',0.00,NULL,0,0,0,0,0,'2016-07-16 20:30:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:02:22','2016-07-22 18:25:59'),(122,'Introduction to Inkle weaving','This is an introduction to inkle weaving using crochet cotton','Host:  Cairenn Day\r\nContact:  howlingartist@hotmail.com\r\n\r\nThis is an introduction to inkle weaving using crochet cotton. We have a small selection of colors.  \r\n\r\nThe class is limited to 3 folks weaving, due to us only have 3 looms at this time.  We should have kits available for a small cost by that time so you can make your own loom. \r\n\r\n$10 Tickets\r\nhttps://www.eventbrite.com/e/introduction-to-inkle-weaving-tickets-26272523826','','2016-07-16 23:00:00','2016-07-17 01:00:00','2016-07-16 22:45:00','2016-07-17 01:15:00',0.00,NULL,0,0,0,0,0,'2016-07-16 23:00:00',0,1,0,'completed',5,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:05:04','2016-07-22 18:25:59'),(123,'Spinning and Fiberarts','Multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools.','Host:  Jeannie Harwell\r\nContact:  kyrithia@hotmail.com\r\n\r\nCome join us in learning to spin your own yarn and related fiber arts! \r\n\r\nThis is a multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools, check out whatever other related educational 