Guild will present a caricature carving workshop.','Host:  Jerry Neild (Guild Treasurer), Sally Miller (Guild President)\r\nContact:  jerry.neild@gmail.com, smmiller442000@yahoo.com\r\n\r\nThe North Texas Woodcarver\'s Guild will present a caricature carving workshop. A basswood blank and pattern will be provided. Bring your own carving tools (no power carving tools to reduce noise and dust).  Both new and experienced woodcarvers are welcome. There will be beginners projects available for new carvers. For more information on the North Texas Woodcarver\'s Guild, check out our Facebook page - https://www.facebook.com/ntxcarvers/','','2016-07-23 14:00:00','2016-07-23 20:00:00','2016-07-23 13:45:00','2016-07-23 20:15:00',0.00,NULL,0,0,0,0,0,'2016-07-23 14:00:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:31:58','2016-07-23 20:00:02'),(137,'Watercolor Painting (Basics)','For this class we will just use one color and learn how to control and vary the color value. This is very basic however this is a great way to understand how to use watercolor and develop your skills with light and shading.','Host:  Raymond Casady\r\nContact:  raymond.casady@gmail.com\r\n\r\nCome out and learn some basics for painting in watercolor.\r\n\r\nFor this class we will just use one color and learn how to control and vary the color value. This is very basic however this is a great way to understand how to use watercolor and develop your skills with light and shading.\r\n\r\nNo need to bring anything. Paint, brushes, and paper will be provided. You can BYOB of course.\r\n\r\nThere will be some sketching at the beginning so if you have some basic drawing skills it would help.','','2016-07-16 00:00:00','2016-07-16 02:00:00','2016-07-15 23:45:00','2016-07-16 02:15:00',0.00,NULL,0,0,0,0,0,'2016-07-16 00:00:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:32:27','2016-07-22 18:25:59'),(138,'Traditional Woodcarving','part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. New students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.','Host:  Hans Schwalm\r\nContact:  hans@msdesigns.net\r\n\r\nThe class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-07-21 00:00:00','2016-07-21 02:00:00','2016-07-21 00:00:00','2016-07-21 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-21 00:00:00',0,1,0,'completed',20,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:33:03','2016-07-22 18:25:59'),(139,'Dallas Screenwriting Crew - TBD','Screenwriter workshop and critiques.','Host:  Daniel J Wells\r\nContact:  Danwells11@gmail.com\r\n\r\nScreenwriter workshop and critiques.','','2016-07-23 18:00:00','2016-07-23 21:00:00','2016-07-23 18:00:00','2016-07-23 21:00:00',0.00,NULL,0,0,0,0,0,'2016-07-23 18:00:00',0,1,0,'completed',11,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:35:13','2016-07-23 21:00:01'),(140,'Make a Potholder using the Braid-In Rag Rug technique','Learn to make a braid-in rag rug by starting with a smaller project - a potholder','Learn to make a braid-in rag rug by starting with a smaller project - a potholder. Bring a t-shirt to cut up (all cotton if possible). We will make t-shirt yarn, share colors among ourselves and get started with a potholder.\r\n','','2016-07-27 00:00:00','2016-07-27 02:00:00','2016-07-27 00:00:00','2016-07-27 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-27 00:00:00',0,1,0,'completed',5,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:36:03','2016-07-27 02:00:01'),(141,'Inventory Planning/Forecasting Basics for Shop Owners','There is an art and a science to forecasting and this workshop will teach you the basics','Host:  Sabrina Abney\r\nContact:  pigandpeacock@yahoo.com\r\n\r\nHave you ever wondered to yourself \"How much of X should I make for my next craft show\"? There is an art and a science to forecasting and this workshop will teach you the basics to be able to answer that question.\r\nForecasting inventory needs doesn\'t have to be intimidating, in this workshop we will cover topics including:\r\nBasic principals of forecasting\r\nSales forecasting\r\nPlanning inventory needs\r\nPlanning inventory needs based of forecasted sales\r\nSimple spreadsheet tracking\r\nSeasonality\r\nInventory sell thru and turn\r\nThis workshop should provide you the basic building blocks to start planning your own inventory needs better which in turn can help you plan your raw materials and supply needs better, which can help you keep costs down and increase efficiency.\r\n\r\nClass is $15 and you can sign up at the following link:\r\nhttps://www.eventbrite.com/e/inventory-planningforecasting-basics-for-shop-owners-tickets-26257588153','','2016-07-23 18:00:00','2016-07-23 20:00:00','2016-07-23 18:00:00','2016-07-23 20:00:00',0.00,NULL,0,0,0,0,0,'2016-07-23 18:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:37:52','2016-07-23 20:00:02'),(142,'Science Committee Meeting',' Review our July goals and further develop our plans. ***Very Important Meeting***','Review our July goals and further develop our plans. ***Very Important Meeting***','','2016-07-27 00:00:00','2016-07-27 02:00:00','2016-07-27 00:00:00','2016-07-27 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-27 00:00:00',0,1,0,'completed',11,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:37:53','2016-07-27 02:00:01'),(143,'Tires Explained: Vehicle Dynamics with author Paul Haney','Paul Haney, author of several books about racing including The Racing & High-Performance Tire, will be giving an introductory seminar on tires and how they work on a car.','Host:  Brandon Green\r\nContact:  brandonagr@gmail.com\r\n\r\nPaul Haney, author several books about racing including The Racing & High-Performance Tire, will be giving an introductory seminar on tires and how they work on a car.\r\n\r\nRacers are very aware that tires are a big deal, says Haney, But they have a tough time getting good info on tires and how they work on their car. Thats a complex topic and it takes me a whole day to explain it properly. People are amazed to find out that there really are some understandable explanations of topics theyve been wondering about. Throughout the seminar I illustrate explanations with understandable graphics and personal stories gained from years of covering all levels of racing from club track days to Formula 1 races.\"\r\n\r\nTopics covered will include how a car turns a corner; Slip angle, lateral force, and weight transfer; Balance and control; Inflation pressure; Rubber friction; Tire myths and correct explanations; Examples of tire behavior','','2016-07-21 00:30:00','2016-07-21 01:30:00','2016-07-21 00:15:00','2016-07-21 01:45:00',0.00,NULL,0,0,0,0,0,'2016-07-21 00:30:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:39:47','2016-07-22 18:25:59'),(144,'One Piece Silicon Mold Making','This is a beginners class on making a one piece mold using silicon.','Host:  Max Kirkland\r\nContact:  Maxk68@Gmail.com\r\n\r\nThis is a beginners class on making a one piece mold using silicon. Its a hands on class and will cost $10.00 per person. All materials are provided. You will learn how to Mold a small piece for resin casting, If you have a small piece you would like to mold feel free to bring it, it must be under 2.5 inches.','','2016-07-23 19:00:00','2016-07-23 20:00:00','2016-07-23 18:30:00','2016-07-23 20:30:00',0.00,NULL,0,0,0,0,0,'2016-07-23 19:00:00',0,1,0,'completed',5,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:39:51','2016-07-23 20:00:02'),(145,'Introduction to Traditional Woodcarving','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques.','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-07-27 23:00:00','2016-07-28 00:00:00','2016-07-27 23:00:00','2016-07-28 00:00:00',0.00,NULL,0,0,0,0,0,'2016-07-27 23:00:00',0,1,0,'completed',20,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:44:09','2016-07-28 00:00:01'),(146,'Jewelry: Silver Ring Fabrication','In this DIY workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band','Host:  Joseph Lahoud\r\nContact:  Joseph@LaProng.com\r\n\r\nIn this DIY workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band. All materials and supplies are provided. If you are looking for something more durable than silver upgrade to use 14K white, yellow or rose gold for a little extra.\r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring that you will form and solder together. You then can stamp, and, polish, your ring to your desired level of finish.\r\n\r\nTotal time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. This is a very small class to allow everyone enough time and attention to create a complete finished piece of jewelry you can wear home! Hope to see you there!!\r\n\r\nBook now and buy your tickets here: \r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1413681','','2016-07-30 19:30:00','2016-07-31 03:30:00','2016-07-30 19:15:00','2016-07-31 03:45:00',0.00,NULL,0,0,0,0,0,'2016-07-30 19:30:00',0,1,0,'completed',26,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:46:28','2016-07-31 03:30:01'),(147,'Millennium Technology Meeting','Science Discussion  --  Open Meeting','Host:  Ben R Smith\r\nContact:  BenRSmith@sbcglobal.net\r\n\r\nScience Discussion  --  Open Meeting','','2016-07-21 23:30:00','2016-07-22 03:00:00','2016-07-21 23:30:00','2016-07-22 03:00:00',0.00,NULL,0,0,0,0,0,'2016-07-21 23:30:00',0,1,0,'completed',11,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',0,0,'2016-07-09 01:47:17','2016-07-22 18:25:59'),(148,'3d fab meeting','a conference to discuss classes, the room and the future of 3d fab. ','Host:  axeonos\r\nContact:  axeonos@gmail.com\r\n\r\na conference to discuss classes, the room and the future of 3d fab. this is the time to go over what we will be doing moving forward in 3d fab. have something to say about 3d fab? nows your chance to be heard. ','','2016-07-31 00:00:00','2016-07-31 02:00:00','2016-07-31 00:00:00','2016-07-31 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-31 00:00:00',0,1,0,'completed',4,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:48:22','2016-07-31 02:00:01'),(149,'Embedded Workshop Microcontrollers','Come join us as we explore using an Arduino connected to different Motors.','Arduino & Motors. Exploring Arduino with the Motor Pack for Arduino \r\nCome join us as we explore using an Arduino connected to different Motors.\r\nWe will cover how to connect a Servo Motor and if time permitting we will also work with the Seeed Studio Motor Shield and load the supporting libraries.\r\nTanner has both of these kits for sale and is giving anyone who states they are attending this workshop a discounted price for the kits.   \r\nFor more info go here: www.thecains-group.net\r\nWhat to Bring:  \r\nLaptop computer  Windows  Mac - Linux   \r\n1 - Arduino Uno, Breadboard & Wires,   \r\n1  Arduino Motor Pack or a Servo Motor or a Low voltage DC motor.\r\n1  Seeed Studio Motor Shield:  http://www.seeedstudio.com/wiki/Motor_Shield\r\nFor more info go here: www.thecains-group.net ','','2016-07-28 00:00:00','2016-07-28 02:00:00','2016-07-28 00:00:00','2016-07-28 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-28 00:00:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:50:41','2016-07-28 02:00:01'),(150,'Traditional Woodcarving',' The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. ','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-07-28 00:01:00','2016-07-28 02:00:00','2016-07-28 00:01:00','2016-07-28 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-28 00:01:00',0,1,0,'completed',20,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:55:43','2016-07-28 02:00:01'),(151,'Inkscape Tutorial: Creating an SVG from Text','Come learn how to navigate Inkscape by creating your name or company name (or any text) as a scalable vector!','Come learn how to navigate Inkscape by creating your name or company name (or any text) as a scalable vector!  These SVGs can later be used on the laser cutter or vinyl cutter. \r\n\r\nPlease bring a computer with you and download Inkscape PRIOR to coming to the class.  (Note: Mac users must also download X11)','','2016-07-29 00:00:00','2016-07-29 00:45:00','2016-07-29 00:00:00','2016-07-29 00:45:00',0.00,NULL,0,0,0,0,0,'2016-07-29 00:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 01:58:35','2016-07-29 00:45:01'),(152,'3D Printing Files: Inkscape/Tinkercad Tutorial','Come learn how to create a file for 3D printing!  This class will teach you the basis of Tinkercad.  ','Come learn how to create a file for 3D printing!  This class will teach you the basis of Tinkercad.  \r\n\"Tinkercad is used by designers, hobbyists, teachers, and kids, to make toys, prototypes, home decor, Minecraft models, jewelry  the list is truly endless!\"\r\nPlease bring your own computer.','','2016-07-29 01:00:00','2016-07-29 02:00:00','2016-07-29 01:00:00','2016-07-29 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-29 01:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 02:01:31','2016-07-29 02:00:01'),(153,'3D Printing Training Class','3d printing class to train for use of DMS 3d printers','3d printing class to train for use of DMS 3d printers. there are NO tickets needed but membership required to use 3d printers.','','2016-07-29 02:00:00','2016-07-29 04:00:00','2016-07-29 02:00:00','2016-07-29 04:00:00',0.00,NULL,0,0,1,0,0,'2016-07-29 02:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 02:04:12','2016-07-29 04:00:01'),(154,'Alex Messers Eagle Scout Project Workday #2','Workday #2','Workday #2\r\n\r\nDuring this workday we will:\r\n-Countersink all visible screws\r\n-Cut 5 more panels\r\n-Assemble the cabinets\r\n\r\nThis event is open to all volunteers! Please email me at alexmesser@mac.com if you are interest.','','2016-07-30 14:00:00','2016-07-30 19:00:00','2016-07-30 14:00:00','2016-07-30 19:00:00',0.00,NULL,0,0,0,0,0,'2016-07-30 14:00:00',0,1,0,'completed',8,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 02:06:07','2016-07-30 19:00:01'),(155,'PCB Etching','Printed Circuit Board Etching Class. ','Printed Circuit Board Etching Class.   The class will include demonstrating and walking those in attendance through the use of KiCad software to design a basic blinking LED RC circuit. From there those in attendance will be instructed on how to prepare, etch, and post process their boards.  Finally, you will be taught how to populate the boards with components.  The goal would be to explain, through this entire process, what is going on with the chemistry and the electronics so those in attendance will walk away learning more than just the practical skills of the etching process.  The entire class will cost those in attendance $50 to cover the costs of the numerous consumables involved in the process.  Please contact me in advance by email if you would like to attend.','','2016-07-30 17:00:00','2016-07-30 20:00:00','2016-07-30 16:45:00','2016-07-30 20:15:00',0.00,NULL,0,0,0,0,0,'2016-07-30 17:00:00',0,1,0,'completed',11,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 02:10:37','2016-07-30 20:00:01'),(156,'How to Grow Your Business via Social Media','Grow Your Business via Social Media','Host:  Saratta Reeves\r\nContact:  expressionsbracelets@yahoo.com\r\n\r\nIf you want to build brand awareness, create a buzz and increase your sales this is the class for you. Social Media is one of the best tools to use to help grow your business. From increasing brand awareness to driving sales, social media can help you spread the word about your small business. Whether you have owned a business for 2 weeks or 10 years, there is always something to learn about marketing your business via social media.\r\n\r\nIn this class you will \r\nLearn Why and How to Use Social Media for Business\r\nLearn Social Media Management\r\nLearn How to Grow Your Audience\r\nLearn How to Set up Your Social Media Accounts and Social Media Management Account\r\n\r\nAnd that\'s just the tip of the iceberg. Learning how to make social media work for you is essential to the success of your business. Please bring your laptop/tablet, your log in and password for all current social media accounts and your willingness to learn!!\r\n\r\nClass is $25 and tickets can be purchased at the following link:\r\nhttps://www.eventbrite.com/e/how-to-grow-your-business-via-social-media-tickets-26361988417','','2016-07-30 18:00:00','2016-07-30 20:00:00','2016-07-30 17:45:00','2016-07-30 20:15:00',0.00,NULL,0,0,0,0,0,'2016-07-30 18:00:00',0,1,0,'completed',9,1,NULL,NULL,NULL,NULL,NULL,NULL,'Mass Assignment Team',1,0,'2016-07-09 02:13:14','2016-07-30 20:00:01'),(157,'Wood Shop Basics','Required Class to use the large powertools in the woodshop.  ','This class now has a $5 charge.  Wood shop has decided to charge because people would sign up and not show up. \r\n\r\nThis class will help you get started on your woodworking projects in the DMS wood shop. This class will be hands-on and is required to use the power tools in the Woodshop, excluding the CNC router and lathes. You must demonstrate competency and safe operation of the tools to pass this class and be \"let loose\" in the shop.\r\n\r\nThese classes is  limited to 5 students to allow us to keep the quality of the instruction as high as possible. Please get your ticket.  \r\n\r\nIt is OK to \"fly standby\" at the beginning of the class to take an available spot if there is a no show, but we will limit the class size to 5 students. You should leave this class feeling safe and comfortable working in the DMS wood shop.\r\n','No open toed Shoes.   Tie back hair and no loose clothing.  ','2016-07-24 16:00:00','2016-07-24 18:00:00','2016-07-24 15:45:00','2016-07-24 18:00:00',5.00,NULL,0,5,1,18,0,'2016-07-24 16:00:00',0,1,0,'cancelled',12,4,4,NULL,NULL,NULL,NULL,NULL,'alexrhodes',0,0,'2016-07-22 21:46:41','2016-07-23 06:02:18'),(158,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop.    We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space','2016-07-30 16:00:00','2016-07-31 18:30:00','2016-07-30 16:00:00','2016-07-31 18:30:00',5.00,NULL,0,5,1,18,0,'2016-07-28 16:00:00',0,1,1,'cancelled',12,47,4,NULL,NULL,NULL,NULL,NULL,'tapper',0,0,'2016-07-23 16:15:39','2016-07-27 15:17:14'),(159,'screen printing tshirts','screen printing ts','tshirtsss','','2016-08-04 00:00:00','2016-08-04 01:00:00','2016-08-04 00:00:00','2016-08-04 01:00:00',0.00,NULL,0,0,0,0,0,'2016-08-04 00:00:00',0,1,0,'rejected',24,48,NULL,NULL,NULL,NULL,'alexrhodes',NULL,'talkers',0,0,'2016-07-24 03:36:17','2016-07-24 03:37:28'),(160,'240sx KA24DE engine teardown','We pulled the engine out of our 240sx last wee