ts Studio ...  so plan to be on your feet for much of this time.  Bring glasses suitable for a distance of 3-4 feet if needed.   \r\n\r\nAttendees are restricted to those who have an EventBrite ticket for the actual embroidery class. ','2016-07-31 20:00:00','2016-07-31 22:00:00','2016-07-31 20:00:00','2016-07-31 22:15:00',0.00,NULL,1,0,0,0,0,'2016-07-31 20:00:00',0,1,0,'completed',11,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',1,0,'2016-07-27 02:56:06','2016-07-31 22:00:01'),(197,'Set-up for Embroidery Class (closed attendance)','Set-up and file transfer for Embroidery class.','Set-up and file transfer for Embroidery class, using the Large-Format printer computer.    Attendees are restricted to those who have an EventBrite ticket for the actual embroidery class. ','Attendees are restricted to those who have an EventBrite ticket for the actual embroidery class. ','2016-07-31 19:45:00','2016-07-31 20:15:00','2016-07-31 19:45:00','2016-07-31 20:15:00',0.00,NULL,1,0,0,0,0,'2016-07-31 19:45:00',0,1,0,'completed',5,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',1,0,'2016-07-27 03:00:02','2016-07-31 20:15:02'),(198,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.  ','All experience levels welcome!  If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session.  Bring your projects, ideas, questions, answers, tips & tricks.  This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.','','2016-08-21 20:00:00','2016-08-21 21:00:00','2016-08-21 20:00:00','2016-08-21 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-21 20:00:00',0,1,0,'completed',5,54,NULL,NULL,NULL,NULL,NULL,NULL,'bitta',1,0,'2016-07-27 12:06:42','2016-08-21 21:00:02'),(199,'Personalizing Shirts, Mugs, & More: Dye Sub 101 (CLASS FULL)','Want to put pictures or logos on shirts, key chains, mugs, or other items? Dye Sublimation is a great way to do this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience.','Have you ever wanted to put pictures or logos on shirts, hats, key chains, mugs, or other items? Dye Sublimation is a great way to accomplish this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience. I will be teaching you about the process, and everyone that attends will leave with a shirt, coffee mug, and their choice of mousepad, hat or two coasters that they make themselves. Bring your own photos and/or logos for your items on a flash drive or other media. I will supply the blanks to be decorated. Class cost is $20, to comer the cost of the blank items and consumables.\r\n\r\nYou must be a member of the Dallas Makerspace to take this class, and use the equipment.','','2016-07-30 00:00:00','2016-07-30 03:00:00','2016-07-29 23:30:00','2016-07-30 03:30:00',20.00,NULL,0,6,1,0,0,'2016-07-29 00:00:00',0,1,0,'cancelled',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',0,0,'2016-07-27 13:54:23','2016-07-27 18:17:24'),(200,'Personalizing Shirts, Mugs & More: Dye Sub 101 (CLASS FULL)','Want to put pictures or logos on shirts, key chains, mugs, or other items? Dye Sublimation is a great way to do this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience.','Have you ever wanted to put pictures or logos on shirts, hats, key chains, mugs, or other items? Dye Sublimation is a great way to accomplish this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience. I will be teaching you about the process, and eveyone that attends will leave with a shirt, coffee mug, and their choice of mousepad, hat or two coasters that they make themselves. Bring your own photos and/or logos for your items on a flash drive or other media. I will supply the blanks to be decorated. Class cost is $20, to comer the cost of the blank items and consumables.\r\n\r\nYou must be a member of the Dallas Makerspace to take this class, and use the equipment.','','2016-07-31 22:30:00','2016-08-01 01:30:00','2016-07-31 22:00:00','2016-08-01 02:00:00',20.00,NULL,0,6,1,0,0,'2016-07-28 22:30:00',0,1,0,'cancelled',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',0,0,'2016-07-27 14:13:02','2016-07-27 18:21:14'),(201,'Introduction to the National Instruments Virtual Bench','This will be a basic introduction to the use of the virtual bench and its primary software interface','The new National Instruments virtual bench is a great tool with a number of features built-in; Dual power supplies, Signal Generator, 2 channel 100 MHz oscilloscope, 32 channel logic analyser, etc...\r\n\r\nThis class will be a basic introduction into how to use the device and its primary software.  It will cover where the probes, adapters are kept, basics on how to hook up typical circuits for testing, etc...','','2016-08-18 00:00:00','2016-08-18 01:00:00','2016-08-17 23:30:00','2016-08-18 01:30:00',0.00,NULL,5,0,1,0,0,'2016-08-18 00:00:00',0,1,0,'completed',7,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-07-27 14:20:11','2016-08-18 01:00:01'),(202,'Build a Michigan Mighty Mite Radio Transmitter','Build a morse code radio transmitter from scratch!','THIS CLASS IS FULL, DO NOT PURCHASE TICKETS! ONLY ADDED HERE TO ACCOMODATE NEW EVENT SYSTEM!\r\n\r\nIn this class you will receive a sandwich bag of nine parts and use them to assemble your own half watt radio transmitter. Since this transmitter will be connected to a \'dummy load\' (two of the parts), you do not need to be a licensed Amateur Radio operator to build and operate this transmitter. But it can transmit to a nearby (few feet) radio receiver to allow you to hear the morse code! If you are a licensed operator we will be discussing the modifications you can make to put the radio on the air and make contacts with others across the globe! The class will provide introduction to the basics of radio transmitter operation, manhattan circuit building (a technique for prototyping analog circuits), soldering, and using a test bench (oscilliscope, meter, etc...) to test and characterize your circuits. \r\n\r\nThere are six seats in the class, that are available on a first come, first served basis. Email me at wandrson01@gmail.com to reserve your seat. There will be a fee of $10 to cover the cost of the parts, which can be paid (in cash) at the start of the class.\r\n\r\nTHIS CLASS IS FULL, DO NOT PURCHASE TICKETS! ONLY ADDED HERE TO ACCOMODATE NEW EVENT SYSTEM!','','2016-08-04 00:00:00','2016-08-04 03:00:00','2016-08-03 23:45:00','2016-08-04 03:15:00',0.00,NULL,0,6,0,0,0,'2016-08-04 00:00:00',0,1,0,'completed',7,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-07-27 14:53:17','2016-08-04 03:00:01'),(203,'Build a Michigan Mighty Mite Radio Transmitter','Build a morse code radio transmitter from scratch!','DO NOT USE NEW SIGNUP SYSTEM FOR THIS CLASS.  THIS POSTING IS ONLY BEING USED TO ADD CLASS TO CALENDAR.  PLEASE CONTACT TEACHER TO SEE IF SEATS ARE STILL AVAILABLE\r\n\r\nIn this class you will receive a sandwich bag of nine parts and use them to assemble your own half watt radio transmitter. Since this transmitter will be connected to a \'dummy load\' (two of the parts), you do not need to be a licensed Amateur Radio operator to build and operate this transmitter. But it can transmit to a nearby (few feet) radio receiver to allow you to hear the morse code! If you are a licensed operator we will be discussing the modifications you can make to put the radio on the air and make contacts with others across the globe! The class will provide introduction to the basics of radio transmitter operation, manhattan circuit building (a technique for prototyping analog circuits), soldering, and using a test bench (oscilliscope, meter, etc...) to test and characterize your circuits. \r\n\r\nThere are six seats in the class, that are available on a first come, first served basis. Email me at wandrson01@gmail.com to reserve your seat. There will be a fee of $10 to cover the cost of the parts, which can be paid (in cash) at the start of the class.\r\n\r\nDO NOT USE NEW SIGNUP SYSTEM FOR THIS CLASS.  THIS POSTING IS ONLY BEING USED TO ADD CLASS TO CALENDAR.  PLEASE CONTACT TEACHER TO SEE IF SEATS ARE STILL AVAILABLE','','2016-08-20 20:00:00','2016-08-20 23:00:00','2016-08-20 19:45:00','2016-08-20 23:30:00',10.00,NULL,0,0,0,0,0,'2016-08-20 20:00:00',0,1,0,'completed',7,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-07-27 14:57:20','2016-08-20 23:00:01'),(204,'Woodshop Basics 7:00PM 7:00PM 7:00PM','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.\r\nWe expect to accept several standbys for this class as a result of the goofed up event time\r\n\r\nNote:  11:00AM is an error!  The class ruuns from 7:00PM to 9:30PM.','Please bring eye protection, or plan to borrow it from Space.  No open toed shoes, dangling jewelry, or gloves.','2016-08-03 16:00:00','2016-08-03 18:30:00','2016-08-03 16:00:00','2016-08-03 18:30:00',5.00,NULL,0,5,0,18,0,'2016-08-01 16:00:00',0,1,1,'completed',12,59,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-27 15:07:05','2016-08-03 18:30:01'),(205,'Lathe Basics','Required class in order to use the wood lathes in the Woodshop','Learn how to safely use the woodworking lathes in the woodshop.','Please bring eye protection, or plan to borrow it from Space.  No open toed shoes, dangling jewelry, or gloves.  Please tie up hair.','2016-07-30 15:00:00','2016-07-30 17:00:00','2016-07-30 15:00:00','2016-07-30 17:00:00',0.00,NULL,0,0,1,18,0,'2016-07-29 15:00:00',0,1,1,'completed',12,61,NULL,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-27 15:17:55','2016-07-30 17:00:01'),(206,'Leather Belt Making ( SOLD OUT )','You will learn how to make a leather belt using several techniques.','During this class you will make a leather belt, finished to your liking, that you will keep. \r\n\r\n** CLASS IS SOLD OUT **\r\nThere is a $22 fee and a class limit of 8 so everyone gets the attention they need to complete their belt. The fee covers a belt length strip of leather, buckle, hardware, dyes, and finishing products used to make the belt. \r\n\r\nPurchase tickets here: https://www.eventbrite.com/e/leather-belt-making-tickets-26722953072\r\n\r\nChoose your leather\r\nVegetable Tan - This leather can be dyed any available color, and will need to be finished to seal it.\r\nWicket and Craig Bridle Leather in Medium Brown - This leather is a premium leather and is already finished.\r\nChoose your buckle\r\n1.5\" Solid Brass Midtown Belt Buckle \r\n1.5\" Solid Brass Nickel Plated Midtown Belt Buckle\r\n\r\nSee the two buckle types here: https://www.tandyleather.com/en/product/midtown-belt-buckles\r\n\r\nFor those that choose to dye or tool their leather, note that drying time may take longer than the available class time. We may end up going past the scheduled time, space and other scheduled events permitting.','- We will be working with Dye so wear something you don\'t mind ruining. \r\n- Tickets are required to cover the supply cost. \r\n- The amount of time it actually takes to complete a belt will vary based on the kind you choose to make.','2016-08-07 20:00:00','2016-08-07 22:30:00','2016-08-07 19:30:00','2016-08-07 23:00:00',0.00,NULL,0,0,0,0,0,'2016-08-07 20:00:00',0,1,0,'completed',5,60,NULL,NULL,NULL,NULL,NULL,NULL,'webdevel',1,0,'2016-07-27 15:22:56','2016-08-07 22:30:02'),(207,'Woodshop Basics','	Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We co