air monitors around DMS','We have $300 in funding to build 3 raspberry pi based air monitors that will be deployed around DMS. This meeting will be to assemble the initial hardware as well as plan for future expansion and use of the data.\r\n\r\nSee this talk thread for more information https://talk.dallasmakerspace.org/t/dms-air-monitor-group-project-looking-for-participants/11106','','2016-08-05 03:00:00','2016-08-05 04:55:00','2016-08-05 03:00:00','2016-08-05 04:55:00',0.00,NULL,0,0,0,0,0,'2016-08-05 03:00:00',0,1,0,'completed',3,49,NULL,NULL,NULL,NULL,NULL,NULL,'brandonagr',1,0,'2016-07-27 19:35:01','2016-08-05 04:55:01'),(223,'Open Tour Night','Open Tours for anyone interested in learning more about the Dallas Makerspace','Open Tours for anyone interested in learning more about the Dallas Makerspace','','2016-08-05 00:00:00','2016-08-05 02:00:00','2016-08-05 00:00:00','2016-08-05 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-05 00:00:00',0,1,0,'completed',27,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:01:35','2016-08-05 02:00:01'),(224,'Open Tour Night','Open Tours for anyone interested in learning more about the Dallas Makerspace','Open Tours for anyone interested in learning more about the Dallas Makerspace','','2016-07-29 00:00:00','2016-07-29 02:00:00','2016-07-29 00:00:00','2016-07-29 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-29 00:00:00',0,1,0,'completed',27,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:05:16','2016-07-29 02:00:01'),(225,'Open Tour Night','Open Tours for anyone interested in learning more about the Dallas Makerspace','Open Tours for anyone interested in learning more about the Dallas Makerspace','','2016-08-12 00:00:00','2016-08-12 02:00:00','2016-08-12 00:00:00','2016-08-12 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-12 00:00:00',0,1,0,'completed',27,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:14:49','2016-08-12 02:00:01'),(226,'Open Tour Night','Open Tours for anyone interested in learning more about the Dallas Makerspace','Open Tours for anyone interested in learning more about the Dallas Makerspace','','2016-08-19 00:00:00','2016-08-19 02:00:00','2016-08-19 00:00:00','2016-08-19 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-19 00:00:00',0,1,0,'completed',27,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:15:54','2016-08-19 02:00:01'),(227,'Open Tour Night','Open Tours for anyone interested in learning more about the Dallas Makerspace','Open Tours for anyone interested in learning more about the Dallas Makerspace','','2016-08-26 00:00:00','2016-08-26 02:00:00','2016-08-26 00:00:00','2016-08-26 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-26 00:00:00',0,1,0,'completed',27,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:17:23','2016-08-26 02:00:01'),(228,'Storage Committee meeting','Project Storage extensions and general Logistics Committee discussion','Logistics Committee\'s monthly storage committee meeting.  The usual topics will be project storage and general Logistics Committee issues.\r\n\r\nIf you would like to extend project storage, attend this meeting (or send an agent).  Note that this is the *ONLY* way to extend project storage.\r\n\r\nNote that the meeting is scheduled for 2 hours, but typically breaks up after 15-30 minutes.  The Logistics Chair plans to be on-site for the duration of the scheduled time to issue extensions.','','2016-08-06 21:00:00','2016-08-06 23:00:00','2016-08-06 20:45:00','2016-08-06 23:00:00',0.00,NULL,0,0,0,0,0,'2016-08-06 21:00:00',0,1,0,'completed',4,66,NULL,NULL,NULL,NULL,NULL,NULL,'eriksmith',1,0,'2016-07-27 20:23:55','2016-08-06 23:00:01'),(229,'Intro to ZFS on Linux','Learn everything you need to know to start using ZFS on Linux on a file server or workstation','ZFS on Linux is a kernel level port of ZFS to the Linux platform. ZFS is a modern, scalable, high performance, reliable, hardware agnostic, and flexible file system with data integrity and ease of use at it\'s heart. Whether it\'s 2 drives or 200 drives do yourself a favor and learn about this modern file system now!\r\n\r\nWe\'ll cover setting up ZFS on Linux with Ubuntu Server 16.04 LTS and go through the basics of ZFS. Most of the curriculum applies to other platforms like Solaris, FreeBSD and their derivatives like illumos and FreeNAS.\r\n\r\nIf you\'d like to bring a laptop and follow along with some of the examples please install VirtualBox. The examples in the class will be conducted with VirtualBox.','','2016-08-20 19:00:00','2016-08-20 20:00:00','2016-08-20 18:45:00','2016-08-20 20:00:00',0.00,NULL,30,0,0,0,0,'2016-08-20 19:00:00',0,1,0,'completed',8,51,NULL,NULL,NULL,NULL,NULL,NULL,'lukeiamyourfather',1,0,'2016-07-27 20:25:39','2016-08-20 20:00:01'),(230,'Philosophy Meet Up - 38','Open discussion on life, the universe, and everything. ','Host:  Colin McGinn\r\nContact:  Colin.K.McGinn@Gmail.com\r\n\r\nAll are welcome. \r\n\r\nOpen discussion on life, the universe, and everything. \r\n\r\nCome and go as you please.','','2016-07-28 00:00:00','2016-07-28 02:00:00','2016-07-28 00:00:00','2016-07-28 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-28 00:00:00',0,1,0,'completed',4,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:54:03','2016-07-28 02:00:01'),(231,'A pilots life','How to become a pilot. ','Host:  Jennifer Goss\r\nContact:  jennifer_goss@verizon.net\r\n\r\nHow to become a pilot. \r\n\r\nWe will talk about \r\n- Things pilots learn in ground school and in flight training. \r\n- The various pilot certifications;  Private Pilot,  Instrument, Night and Multi Engine ratings,  Commercial Pilot, Airline Transport Rating\r\n- and what to expect from a career as a pilot.\r\n\r\n','','2016-07-29 00:00:00','2016-07-29 01:00:00','2016-07-29 00:00:00','2016-07-29 01:00:00',0.00,NULL,0,0,0,0,0,'2016-07-29 00:00:00',0,1,0,'completed',8,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 20:59:37','2016-07-29 01:00:01'),(232,'Laser Basics+LaserSaur, Epilog, & Thunder!','Learn to use all our lasers!','Learn to use all our lasers! The LaserSaur! The Thunder! And the Epilog Zing!  We will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can engrave, raster, and cut.  Then we walk thru each machine.\r\n\r\nThere is a hard limit of 8 students per class. Students must be a member of the MakerSpace.\r\nRegister here:  http://www.meetup.com/dallasmakerspace/events/232798045/','','2016-07-29 23:30:00','2016-07-30 01:30:00','2016-07-29 23:30:00','2016-07-30 01:30:00',0.00,NULL,0,0,1,0,0,'2016-07-29 23:30:00',0,1,0,'completed',11,16,2,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 21:03:24','2016-07-30 01:30:01'),(233,'Epilog Zing & Thunder laser certification','Learn to use the new Epilog Zing & Thunder laser! ','Host: john a. gorman Contact: c22sailor@gmail.com\r\n\r\nLearn to use the new Epilog Zing & Thunder laser!  We meet at the lasers in the workshop.\r\nThis class is for members that have already taken the Laser Basics, and are checked out on the old lasers.\r\nRegister here:\r\nhttp://www.meetup.com/dallasmakerspace/events/232798076/','','2016-07-30 02:00:00','2016-07-30 03:00:00','2016-07-30 02:00:00','2016-07-30 03:00:00',0.00,NULL,0,0,1,0,0,'2016-07-30 02:00:00',0,1,0,'completed',16,16,2,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 21:20:09','2016-07-30 03:00:03'),(234,'ARTEMIS Spaceship Bridge Simulator night','It\'s time to play Artemis again! ','Host:  David Smart\r\nContact:  dawsmart@gmail.com\r\n\r\nIt\'s time to play Artemis again! \r\n\r\nNEW THIS MONTH:  Ping pong ball launcher\r\n\r\nI\'ll also be bringing my DMX-controlled lighting that reacts to events in the game. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-07-30 01:00:00','2016-07-30 04:59:00','2016-07-30 01:00:00','2016-07-30 04:59:00',0.00,NULL,0,0,0,0,0,'2016-07-30 01:00:00',0,1,0,'completed',9,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 21:23:50','2016-07-30 05:00:01'),(235,'ARTEMIS Spaceship Bridge Simulator night','It\'s time to play Artemis again! ','Host:  David Smart\r\nContact:  dawsmart@gmail.com\r\n\r\nIt\'s time to play Artemis again! \r\n\r\nNEW THIS MONTH:  Ping pong ball launcher\r\n\r\nI\'ll also be bringing my DMX-controlled lighting that reacts to events in the game. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-07-30 01:00:00','2016-07-30 04:59:00','2016-07-30 01:00:00','2016-07-30 04:59:00',0.00,NULL,0,0,0,0,0,'2016-07-30 01:00:00',0,1,0,'completed',8,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-27 21:25:13','2016-07-30 05:00:01'),(236,'Intro to Bridgeport Part 2','Demo portion of Bridgeport','Part 2 Demo at Bridgeport','Closed shoes, No shorts, wear long pants','2016-08-03 01:30:00','2016-08-03 02:30:00','2016-08-03 01:15:00','2016-08-03 03:00:00',0.00,NULL,5,0,1,0,0,'2016-08-03 01:30:00',0,1,0,'completed',17,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-07-27 22:02:23','2016-08-03 02:30:01'),(237,'Intro to Bridgeport Part 1','Classroom portion of Bridgeport','Classroom portion of Bridgeport instruction. \r\n\r\nPart two at machine.','Classroom portion does not require special clothing.  Second part requires closed toed shoes and long pants (no shorts).  If you have a favorite pair of safety glasses feel free to bring them.','2016-08-03 00:00:00','2016-08-03 01:15:00','2016-08-02 23:30:00','2016-08-03 01:30:00',0.00,NULL,5,0,1,0,0,'2016-08-03 00:00:00',0,1,0,'completed',11,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-07-27 22:37:33','2016-08-03 01:15:01'),(238,'Jewelry: Silver Ring Fabrication Workshop ','In this DIY workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band!','In this DIY workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band.  You will have the opportunity to see and use many of the common tools used for jewelry fabrication and available to all DMS members. All materials and supplies are provided.  \r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring that you will form and solder together. You then can stamp, and, polish, your ring to your desired level of finish.\r\n\r\nTotal time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. This is a very small class to allow everyone enough time and attention to create a complete finished piece of jewelry you can wear home! Hope to see you there!! If you are looking for something more durable than silver contact me for more information to upgrade and use 14K white, yellow or rose gold for an additional cost.\r\n\r\nBook now and buy your tickets here: \r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1413681','Please wear closed-toe shoes and pants. Safety glasses, aprons, and dust masks will be provided.','2016-08-06 19:00:00','2016-08-07 02:00:00','2016-08-06 18:45:00','2016-08-07 02:15:00',75.00,NULL,0,4,0,0,0,'2016-08-06 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-07-27 22:43:11','2016-07-27 23:29:10'),(239,'Jewelry making (closed workshop)','We will be making wedding bands for a DMS couple that is soon to be married!','Although this is a closed workshop, the jewelry and small metals area, tools, and equipment will all remain available for all other members to use.','','2016-08-20 19:00:00','2016-08-21 02:00:00','2016-08-20 19:00:00','2016-08-21 02:00:00',0.00,NULL,0,0,0,0,1,'2016-08-20 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-07-27 23:21:11','2016-08-10 20:40:57'),(240,'Who Ever Knew - Auditions','Auditions for Who Ever Knew short film','Host:  Mark Andrew\r\nContact:  markandrewx@gmail.com\r\n\r\nAuditions for Who Ever Knew short film','','2016-07-30 14:00:00','2016-07-30 22:00:00','2016-07-30 14:00:00','2016-07-30 22:00:00',0.00,NULL,0,0,0,0,0,'2016-07-30 14:00:00',0,1,1,'completed',4,77,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-28 03:35:17','2016-07-30 22:00:01'),(241,'GEM - Meeting','Meeting for team on cameras','Host:  Scott Daly\r\nContact:  luzpictura@gmail.com\r\n\r\nMeeting for team on cameras','','2016-07-30 16:00:00','2016-07-30 20:00:00','2016-07-30 16:00:00','2016-07-30 20:00:00',0.00,NULL,0,0,0,0,0,'2016-07-30 16:00:00',0,1,1,'completed',6,78,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-28 03:40:44','2016-07-30 20:00:01'),(242,'Shapeoko 2 Basic Training','Basic operation and safety for the Shapeoko 2 ','Host:  Jay Phelps\r\nContact:  jay@jayphelps.name\r\n\r\nBasic operation and safety for the Shapeoko 2 in the CA room','','2016-07-30 18:00:00','2016-07-30 19:00:00','2016-07-30 18:00:00','2016-07-30 19:00:00',0.00,NULL,0,0,0,0,0,'2016-07-30 18:00:00',0,1,1,'completed',5,79,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-28 03:44:48','2016-07-30 19:00:01'),(243,'Morningside auditions','Casting for Morningside','Requester Name: Alex Espinoza\r\nRequester E-mail: alex.espinoza@redfogfilms.com\r\n\r\nCasting for Morningside\r\n','','2016-07-30 20:00:00','2016-07-31 02:00:00','2016-07-30 20:00:00','2016-07-31 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-30 20:00:00',0,1,1,'completed',11,80,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-28 03:58:15','2016-07-31 02:00:01'),(244,'WoodShop Basics','Required Class to use the large power tools in the woodshop','\r\nThis class now has a $5 charge.  Wood shop has decided to charge because people would sign up and not show up. \r\n\r\nThis class will help you get started on your woodworking projects in the DMS wood shop. This class will be hands-on and is required to use the power tools in the Woodshop, excluding the CNC router and lathes. You must demonstrate competency and safe operation of the tools to pass this class and be \"let loose\" in the shop.\r\n\r\nThese classes will be limited to 5 students to allow us to keep the quality of the instruction as high as possible. \r\n\r\nIt is OK to \"fly standby\" at the beginning of the class to take an available spot if there is a no show, but we will limit the class size to 5 students. You should leave this class feeling safe and comfortable working in the DMS wood shop.','Must wear closed toed shoes and no loose clothing.  ','2016-07-31 16:00:00','2016-07-31 18:00:00','2016-07-31 16:00:00','2016-07-31 18:00:00',5.00,NULL,0,5,1,18,0,'2016-07-31 16:00:00',0,1,0,'completed',12,4,4,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-07-28 04:55:51','2016-07-31 18:00:01'),(245,'July Potluck','Bring food. Eat Food. Have Fun Getting to Know People. ','Bring a dish to share. \r\nBring a show and tell item. \r\nBring a friend. \r\n\r\nFood is good. \r\nFriends are better. \r\n','Don\'t be the person who never brings anything and just eats....that\'s not the nicest thing. Although, if you are hungry I understand. But for real we have some serious repeat dinner seekers - if you don\'t have the funds come help setup - contribute somehow. ','2016-07-30 23:30:00','2016-07-31 00:30:00','2016-07-30 22:45:00','2016-07-31 00:45:00',0.00,NULL,0,0,0,0,0,'2016-07-30 23:30:00',0,1,0,'completed',8,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-07-28 14:16:39','2016-07-31 00:30:01'),(246,'Paint Day - Touchup the Halls for 10X10 ','It\'s been a year and our hallways are a bit worn we need to freshen up','In anticipation with the open house and just general upkeep let\'s take some time to care for a clean sweep of the \"art\" hallway. \r\n\r\nGoals: \r\nPatch the holes created by artwork. \r\nPaint the other side of the hallway that is currently the color of flesh. \r\nTouch up the current white walls to make them look fresh. \r\n\r\nWear clothing that you are ok getting spattered. \r\n\r\n*putting the meeting room as the lobby so we don\'t lock up the function of a room* ','','2016-09-06 22:30:00','2016-09-07 01:30:00','2016-09-06 22:30:00','2016-09-07 01:30:00',0.00,NULL,0,0,0,0,0,'2016-09-06 22:30:00',0,1,0,'completed',27,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-07-28 14:28:25','2016-09-07 01:30:01'),(247,'10X10 Art Hanging Party ','Help is needed to correctly hang up the 10X10 pieces ','Laser level and L-pins are our best friends for this day. \r\nGetting them up on the walls plus adding labels to the proper work. \r\n\r\nWork is quick but takes a bit to make it nice. \r\n\r\n*Saying class is in the lobby so we don\'t lock a room up but in all actuality we will be in the main hallway outside of the CA room. ','','2016-09-11 20:00:00','2016-09-11 21:30:00','2016-09-11 20:00:00','2016-09-11 21:30:00',0.00,NULL,0,0,0,0,0,'2016-09-11 20:00:00',0,1,0,'completed',27,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-07-28 14:33:45','2016-09-11 21:30:01'),(248,'Personalizing Shirts, Mugs & More: Dye Sub 101 (CLASS FULL)','Want to put pictures or logos on shirts, key chains, mugs, or other items? Dye Sublimation is a great way to do this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience.','Have you ever wanted to put pictures or logos on shirts, hats, key chains, mugs, or other items? Dye Sublimation is a great way to accomplish this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience. I will be teaching you about the process, and eveyone that attends will leave with a shirt, coffee mug, and their choice of mousepad, hat or two coasters that they make themselves. Bring your own photos and/or logos for your items on a flash drive or other media. I will supply the blanks to be decorated. Class cost is $20, to comer the cost of the blank items and consumables.\r\n\r\nYou must be a member of the Dallas Makerspace to take this class, and use the equipment.','','2016-07-31 22:30:00','2016-08-01 01:30:00','2016-07-31 22:00:00','2016-08-01 02:00:00',20.00,NULL,0,1,1,0,1,'2016-07-29 22:30:00',0,1,0,'completed',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',1,0,'2016-07-28 15:22:12','2016-08-01 01:30:01'),(249,'Amateur Radio SIG','Weekend work meeting of the DMS Amateur Radio Special Interest Group','(Note: You must be a DMS member to participate in this event due to the level of work we\'re doing.)\r\n\r\nLet\'s meet and check out the antenna situation on the DMS roof. Only adults (age >= 18 years) will be allowed to do this work. We\'ll be doing dirty, hot work, so dress appropriately. Please wear closed-toe work shoes with plenty of grip, and a pair of leather or synthetic automotive-style gloves will come in handy.\r\n\r\nAnother group will work in the Electronics room to set up the the BYOR (Bring Your Own Radio) workbench. We\'ll be looking for a cable path from the roof penetration in Hatcher\'s back over to Electronics.','Please wear closed-toe work shoes with plenty of grip, and a pair of leather or synthetic automotive-style gloves will come in handy.','2016-08-13 13:00:00','2016-08-13 17:00:00','2016-08-13 13:00:00','2016-08-13 17:00:00',0.00,NULL,0,0,1,0,0,'2016-08-13 13:00:00',0,1,0,'completed',7,86,NULL,NULL,NULL,NULL,NULL,NULL,'zmetzing',1,0,'2016-07-28 16:05:30','2016-08-13 17:00:01'),(250,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves.  Please ping up long hair.','2016-08-14 16:00:00','2016-08-14 18:30:00','2016-08-14 16:00:00','2016-08-14 18:30:00',5.00,NULL,0,5,1,18,0,'2016-08-12 16:00:00',0,1,1,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-28 16:42:20','2016-08-14 18:30:01'),(251,'Woodshop Basics','	Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves.','2016-08-07 16:00:00','2016-08-07 18:30:00','2016-08-07 16:00:00','2016-08-07 18:30:00',5.00,NULL,0,5,1,18,0,'2016-08-05 16:00:00',0,1,1,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-28 16:48:32','2016-08-07 18:30:01'),(252,'Lifecasting 101','Begginers guide to lifecasting using plaster and alginate','This is a hands on class where attendees will be able to make a life-cast of one of several volunteers faces, in the end there will be several life masks for display in Creative Arts. We will be working with plaster and dental alienate so  wear old clothes. everyone should be able to participate.  There will be a 30 min slideshow presentation on life-casting techniques and its uses in costuming and cosplay.','We will be working with dental algenate and plaster, please wear OLD CLOTHES','2016-08-14 21:00:00','2016-08-14 23:00:00','2016-08-14 20:45:00','2016-08-14 23:15:00',5.00,NULL,0,0,0,0,0,'2016-08-14 21:00:00',0,1,0,'completed',8,70,NULL,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-07-28 18:42:56','2016-08-14 23:00:01'),(253,'Special Effects Make-Up 101 ','This is a begginers class on how to do special effects make-up for cosplay','Special FX Makeup 101\r\nNote: this class will also be held on Sunday the 14th following the Life Casting 101 class- in same room.\r\n\r\nThis will be a beginner to intermediate class for special effects and character makeup. We will be covering the following at a fairly high-level.\r\n\r\n- tools of the trade (airbrush types, brushes, sponges, liquid latex, adhesives, powders, crepe hair, etc)\r\n- makeup types (creams, alcohol activated, pax paint, etc)\r\n- selecting a color palette for your project (which also includes highlights, shadows, etc)\r\n- applying (sponge, brush, airbrushing, blending, stippling, freckling, splattering, etc)\r\n- laying facial hair \r\n- out of the kit effects (scarring, trauma effects, blood, etc)\r\n- using pre-made prosthetics (attaching, hiding edges, painting, etc)\r\n- common mistakes and pitfalls of beginners and what to avoid.\r\n- Q&A','','2016-08-13 23:00:00','2016-08-14 01:00:00','2016-08-13 23:00:00','2016-08-14 01:00:00',0.00,NULL,0,0,0,0,0,'2016-08-13 23:00:00',0,1,0,'completed',8,70,NULL,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-07-28 18:47:07','2016-08-14 01:00:01'),(254,'Workshop: Onboard Android Sensor Access','Accessing Built-In Sensors in Android Smartphone or Tablet Development','Most contemporary Android devices have one or more sensors, such as motion, humidity, and light sensors. The July session was a presentation format. This session will be hands-on where you bring a laptop and Android device and step through the same. We will step through the following:\r\n\r\n1. Setting up an activity to display sensor values\r\n2. Enumerating onboard sensors\r\n3. Retrieving sensor values\r\n4. Displaying sensor values\r\n\r\nIn order to have the best odds of making it through all of the steps, you should be familiar with classes/objects/properties and conditional statements.\r\n\r\nYou\'ll need a laptop, recent Android device, and the USB connector cable. You should install Android Studio and have installed the driver for your Android device, which you\'ll normally find by searching on \"your phone model drivers\". You should also know the version of Android on your device.\r\n\r\nPresenters\r\nStacy Devino - Android Innovator at The Home Depot\r\nLeroy Levin - Mobile app developer\r\nJohn Lindsay - Novice Android developer\r\n\r\nAgenda\r\n6:00 - 6:30 Check-In, Networking, Android Studio and driver install\r\n6:30 - 8:00 Workshop ','','2016-08-04 23:00:00','2016-08-05 01:00:00','2016-08-04 22:45:00','2016-08-05 01:15:00',0.00,NULL,45,0,0,0,0,'2016-08-04 23:00:00',0,1,0,'completed',8,91,NULL,NULL,NULL,NULL,NULL,NULL,'technoprobic',1,0,'2016-07-28 20:50:55','2016-08-05 01:00:01'),(255,'D&D Session (Private)','D&D Gaming Session','Private D&D Gaming session','','2016-07-29 00:00:00','2016-07-29 04:00:00','2016-07-29 00:00:00','2016-07-29 04:00:00',0.00,NULL,0,0,0,0,0,'2016-07-29 00:00:00',0,1,1,'completed',11,93,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-28 22:09:45','2016-07-29 04:00:01'),(256,'Active Shooter Preparation','What to do in an event of active shooter','With the current event of rampant active shooter happening on a regular basis around the world, this class goes into what to do and how to prepare during a active shooter event.','The presentation does not have graphic details, but does go into discussion on how people are hurt or killed during an active shooter event.','2016-08-18 00:00:00','2016-08-18 01:30:00','2016-08-18 00:00:00','2016-08-18 01:30:00',0.00,NULL,0,0,0,0,0,'2016-08-18 00:00:00',0,1,1,'rejected',9,95,NULL,NULL,NULL,NULL,'stansimmons',NULL,'rhett',0,0,'2016-07-28 22:30:07','201