2016-08-20 23:15:00','2016-08-21 02:30:00',2.00,NULL,0,30,0,0,0,'2016-08-21 00:00:00',0,1,1,'completed',8,108,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-07-29 16:27:37','2016-08-21 02:00:01'),(269,'BYOB Painting: Coral Reef','Come have a drink, paint a pretty coral reef scene with us AND help secure safe passage for sea creatures along the Great Barrier Reef! All profits go to the World Wildlife Fund Australia for their efforts on the Great Barrier Reef.','Come have a drink, paint a pretty coral reef scene with us AND help secure safe passage for sea creatures along the Great Barrier Reef! All profits go to the World Wildlife Fund Australia for their efforts on the Great Barrier Reef (Details below).\r\n\r\nBrought to you by Drink and Draw DFW and the Dallas Makerspace, and taught by myself, Gina Pyon.\r\n\r\nYou MUST do the following to get on the RSVP list:\r\n\r\n1) Donate a minimum of $15 (per person) to the World Wildlife Fund\'s Safe Passage For Sea Creatures campaign here:\r\nhttp://go.sparkpostmail.com/f/a/puSf-sls8oRJACsX2zfSIw~~/AACJHAA~/RgRZcEzFP0EIAOvG1-6D19ZXA3NwY1gEAAAAAFkGc2hhcmVkYA01Mi4zOC4xOTEuMjM3QgoAA8zHjVe_WmVyUiFzY29ycGlvZ3VzdHhAZGFsbGFzbWFrZXJzcGFjZS5vcmcJUQQAAAAARDZodHRwczovL2RvbmF0ZS53d2Yub3JnLmF1L2NhbXBhaWducy9zYXZlc2hhcmtzLyNkb25hdGVHAnt9\r\n\r\n2) Take a screenshot of your donation and post it on the wall of the event at https://www.facebook.com/events/529176730626228/ or contact raymond.casady@gmail.com. If you\'re bringing a friend, tag them or include their name in your post/email.That\'s it :)','','2016-08-20 00:00:00','2016-08-20 02:00:00','2016-08-19 23:00:00','2016-08-20 02:30:00',0.00,NULL,30,0,0,0,0,'2016-08-20 00:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-07-29 16:34:25','2016-08-20 02:00:01'),(270,'Drawing Basics',' Come on out and draw draw draw. I\'ll be teaching some basic drawing techniques but experienced artist\'s are welcome to come and just hang out.',' Come on out and draw draw draw. I\'ll be teaching some basic drawing techniques but experienced artist\'s are welcome to come and just hang out.','','2016-08-09 01:00:00','2016-08-09 03:00:00','2016-08-09 01:00:00','2016-08-09 03:00:00',0.00,NULL,0,0,0,0,0,'2016-08-09 01:00:00',0,1,0,'completed',11,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-07-29 16:37:56','2016-08-09 03:00:01'),(271,'Work on Coloring Book Illustrations','Work begins on the coloring book collaboration.','Work begins on the coloring book collaboration. We will discuss how we will publish it and what to do with the profits (if any). And we will begin sketching out a page for the book.\r\n\r\nIf you are good at Illustrator, Inkscape, CorelDraw, Affinity or any other vector graphics program. Then you will be expected to make a vector image of your page. If not, then please ink your drawing so I can use Adobe Capture to make a vector of it.\r\n\r\nCheck out Adobe Capture App. If you ink your image and use this you can get a good vector image and not have to retrace the image if you are not very good at that.\r\n\r\nThis is not a class for teaching vector art. I\'ll help you a little but that\'s not the point if this class, we are here to make a coloring book.\r\n\r\nAt the moment there is no limit to how many pages one artist can make. However if this ends up having a huge amount of artists then we may need to work something out.\r\n\r\nThe most important thing! You have to attend the class to submit work and no stealing/copying other\'s work! We will probably need some sort of leagal release form for all that and stuff. If anyone is good with that please contact me so we can figure things out.','','2016-07-31 23:00:00','2016-08-01 02:00:00','2016-07-31 23:00:00','2016-08-01 02:00:00',0.00,NULL,0,0,0,0,0,'2016-07-31 23:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-07-29 16:42:59','2016-08-01 02:00:01'),(272,'Summer Crafting Workshop - Learn to Sew a Reusable Tote','Learn to Sew a Reusable Tote','Beat the summer heat and learn some new skills while you\'re at it! In this workshop you will learn how to make a reusable tote bag. Taught by Mia, of Mia Maria (who also happens to be an amazing costume designer) she will supply the pattern, tutorial, and walk you through all the steps!\r\n\r\nWhat you will need to bring:\r\n1 yard of the fabric of your choice\r\nThread of your choice\r\nSewing machine-Optional (DMS has about 5 on hand, but if you like yours or are trying to learn yours you can bring it)\r\n\r\nBy the end of the class you will have your very own reusable tote and you can take the skills you learned to make more for yourself at home!\r\n\r\nTickets can be purchased at the following link:\r\nhttps://www.eventbrite.com/e/summer-crafting-workshop-learn-to-sew-a-tote-bag-tickets-26740917805\r\n','Be sure to bring one yard of your fabric of choice','2016-08-20 19:00:00','2016-08-20 21:00:00','2016-08-20 19:00:00','2016-08-20 21:00:00',15.00,NULL,0,20,0,0,0,'2016-08-19 19:00:00',0,1,0,'completed',5,109,NULL,NULL,NULL,NULL,NULL,NULL,'abneysc',1,0,'2016-07-29 17:03:58','2016-08-20 21:00:01'),(273,'Product Photography Tips & Tricks','Product Photography Tips & Tricks','Do you ever feel like you want to amp up your product photos, but are not sure how to make them look more professional? Have you ever spent hours on youtube and google watching tutorials only to be more confused?\r\n\r\nThis Workshop will go over some simple, yet detailed, tips & tricks anyone can accomplish no matter their skill level or budget. \r\n\r\nTopics include: \r\nGeneral dos and don\'ts\r\nEquipmet to have\r\nUsing the camera\r\nSetting up a shot\r\nFinding a style\r\nEditing\r\n\r\nCome ready to ask any questions you might have. If you have one, bring your camera. It is not required to have a DSLR camera (camera with interchangable lenses), but many of the tips will be focused on DSLRs and not point and shoots. \r\n\r\nTickets can be purchased at the following link:\r\nhttps://www.eventbrite.com/e/photography-tips-tricks-tickets-26381623145','','2016-08-21 18:30:00','2016-08-21 20:30:00','2016-08-21 18:15:00','2016-08-21 20:30:00',20.00,NULL,0,0,0,0,0,'2016-08-21 18:30:00',0,1,0,'completed',9,109,NULL,NULL,NULL,NULL,NULL,NULL,'abneysc',1,0,'2016-07-29 17:08:34','2016-08-21 20:30:02'),(274,'Craft Show Like a Pro','Craft Show Like a Pro','Do you ever wonder what goes into prepping for a craft show? Have you been thinking about signing up for your first one, or have been doing shows but want to improve your booths appeal?\r\n\r\nCraft shows are your chance to set up a mini pop up shop showcasing your work and it takes a lot of preparation to put your best foot forward, and not be passed up on show day.\r\n\r\nJoin seasoned craft show vetrans, and Etsy Dallas members, The Pig and the Peacock for a comprehensive class that covers all the in\'s and out\'s of preparing for a successful craft show. \r\n\r\nIn this workshop we will cover topics including:\r\nHow to select the right show for you\r\nInventory needs\r\nBooth layout and set up\r\nDisplays\r\nMerchandising rules\r\nSignage\r\nDoing business the day of the event\r\nTaking payments\r\nPromotion\r\nExamples of Do\'s and Don\'ts\r\nHelpful tips\r\nPreparation timelines\r\n\r\nEveryone will be encouraged to ask questions and feel free to bring in photos or examples of your own booths for open discussion/feedback\r\n\r\nTickets can be purchased at the following link:\r\nhttps://www.eventbrite.com/e/craft-show-like-a-pro-tickets-26257564081','','2016-09-10 18:00:00','2016-09-10 20:00:00','2016-09-10 17:45:00','2016-09-10 20:00:00',15.00,NULL,0,0,0,0,0,'2016-09-10 18:00:00',0,1,0,'completed',9,109,NULL,NULL,NULL,NULL,NULL,NULL,'abneysc',1,0,'2016-07-29 17:11:55','2016-09-10 20:00:01'),(275,'Vector Committee meetting ','Committee Meeting','Committee meeting ','','2016-08-06 21:00:00','2016-08-07 00:00:00','2016-08-06 21:00:00','2016-08-07 00:00:00',0.00,NULL,0,0,1,0,0,'2016-08-06 21:00:00',0,1,0,'completed',19,110,NULL,NULL,NULL,NULL,NULL,NULL,'dallas0606',1,0,'2016-07-29 18:42:51','2016-08-07 00:00:02'),(276,'Dallas Area Robot Combat Monthly Meeting','Dallas Area Robot Combat August Meeting','Dallas Area Robot Combat August Meeting','','2016-08-07 17:00:00','2016-08-07 19:00:00','2016-08-07 17:00:00','2016-08-07 19:00:00',0.00,NULL,0,0,0,0,0,'2016-08-07 17:00:00',0,1,0,'completed',8,111,NULL,NULL,NULL,NULL,NULL,NULL,'cd_morris',1,0,'2016-07-29 18:44:09','2016-08-07 19:00:01'),(277,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-04 00:00:00','2016-08-04 02:00:00','2016-08-04 00:00:00','2016-08-04 02:00:00',20.00,NULL,0,0,0,16,1,'2016-08-04 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-07-29 19:38:49','2016-08-04 02:00:02'),(278,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-03 23:00:00','2016-08-04 00:00:00','2016-08-03 22:45:00','2016-08-04 00:00:00',10.00,NULL,0,6,0,16,0,'2016-08-03 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-07-29 19:44:37','2016-08-04 00:00:01'),(279,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-11 00:00:00','2016-08-11 02:00:00','2016-08-11 00:00:00','2016-08-11 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-11 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-07-29 20:13:54','2016-08-11 02:00:02'),(280,'DFW Grotto: learn about caves and caving','DFW caving group monthly meeting. We will be discussing past and upcoming trips, and will have an educational program that varies month to month.','Meetings are usually held on the second Wednesday of each month. There is no meeting in December; instead there is a holiday party on a date to be determined in the fall.\r\n\r\nMeetings start at 7 p.m. and end just before 9:00 p.m., when members migrate to a local eating establishment for after-meeting dining and socializing.','','2016-08-11 00:00:00','2016-08-11 02:00:00','2016-08-11 00:00:00','2016-08-11 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-11 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-07-29 20:15:53','2016-08-11 02:00:02'),(281,'DFW Grotto: learn about caves and caving','DFW caving group monthly meeting. We will be discussing past and upcoming trips, and will have an educational program that varies month to month.','Meetings are usually held on the second Wednesday of each month. There is no meeting in December; instead there is a holiday party on a date to be determined in the fall.\r\n\r\nMeetings start at 7 p.m. and end just before 9:00 p.m., when members migrate to a local eating establishment for after-meeting dining and socializing.','','2016-09-15 00:00:00','2016-09-15 02:00:00','2016-09-15 00:00:00','2016-09-15 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-15 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-07-29 20:18:05','2016-09-15 02:00:01'),(282,'Dallas Film Crew #58','Flash Film Presentations','A combination of Hands On events and workshops for new and experienced filmmakers','','2016-08-07 18:00:00','2016-08-07 21:00:00','2016-08-07 17:30:00','2016-08-07 21:15:00',0.00,NULL,0,0,0,0,0,'2016-08-07 18:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-07-30 03:05:29','2016-08-07 21:00:01'),(283,'Midnight Makers Lathe Basics','Lathe safety ','Safety course for lathe','Please wear closed toe non slip shoes.  No loose or flowing clothing, jewelry or hair.','2016-08-12 05:00:00','2016-08-12 06:15:00','2016-08-12 04:45:00','2016-08-12 06:30:00',0.00