e if they are interested in rocketry; minors need to have a parent or guardian present. If you are not a member of Dallas Makerspace and need to get in the front door, please call me at 972-985-5034.  We are scheduled to 10, but if there is interest and the room is available, we can stay later.','','2016-08-17 00:00:00','2016-08-17 03:00:00','2016-08-17 00:00:00','2016-08-17 03:00:00',0.00,NULL,0,0,0,0,0,'2016-08-17 00:00:00',0,1,0,'completed',4,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',1,0,'2016-07-30 05:02:44','2016-08-17 03:00:01'),(288,'Rocketry Open Build - Postponed to Sep 20','Postponed to Sep 20 due to room unavailability','Postponed to Sep 20 due to room unavailability.','','2016-09-14 00:00:00','2016-09-14 03:00:00','2016-09-14 00:00:00','2016-09-14 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-14 00:00:00',0,1,0,'completed',4,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',1,0,'2016-07-30 05:04:44','2016-09-14 03:00:01'),(289,'Fairy Jars','Fairy jars imprisoned for you ','by making fairy jars we are imprisoning fairies for your amusement and light. each person will take home from this class 1 jar with one fairy inside.  you\'ll be responsible for a fairy of your very own. feed and take care of it. \r\n\r\n$15. for supplies ','will be using sharp exacto blades and mason jars which could break.','2016-08-14 00:00:00','2016-08-14 04:00:00','2016-08-13 23:30:00','2016-08-14 04:30:00',15.00,NULL,0,20,0,0,0,'2016-08-13 00:00:00',0,1,0,'completed',5,24,NULL,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-07-30 06:53:05','2016-08-14 04:00:01'),(290,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves. Please ping up long hair.','2016-08-18 00:00:00','2016-08-18 02:30:00','2016-08-18 00:00:00','2016-08-18 02:30:00',5.00,NULL,0,5,1,18,0,'2016-08-16 00:00:00',0,1,1,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-30 16:09:18','2016-08-18 02:30:01'),(291,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves. Please ping up long hair.','2016-08-25 00:00:00','2016-08-25 02:30:00','2016-08-25 00:00:00','2016-08-25 02:30:00',5.00,NULL,0,5,1,0,0,'2016-08-23 00:00:00',0,1,1,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-07-30 16:12:28','2016-08-25 02:30:01'),(292,'Laser Basics','Learn to Laser with the LaserSaur, Zing, & Thunder','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing!  \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut.  Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki.  Search for Laser Committee.','','2016-08-12 23:30:00','2016-08-13 02:00:00','2016-08-12 23:30:00','2016-08-13 02:00:00',0.00,NULL,8,0,1,0,0,'2016-08-12 23:30:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-07-30 21:30:58','2016-08-13 02:00:01'),(293,'Shapeoko 2 Basic Training','Introduction to the Shapeoko - required training','A brief introduction to CNC concepts, how they apply to the Shapeoko 2 in Creative Arts and it\'s safe operation. Includes a live demo using the Easel environment and a discussion of migrating to more advanced options.\r\n\r\nThis is required training to use the Shapeoko 2.','','2016-08-25 00:00:00','2016-08-25 01:00:00','2016-08-24 23:45:00','2016-08-25 01:15:00',0.00,NULL,12,0,1,0,0,'2016-08-25 00:00:00',0,1,0,'cancelled',5,178,NULL,NULL,NULL,NULL,NULL,NULL,'jphelps',0,0,'2016-07-30 21:31:12','2016-08-09 18:05:20'),(294,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing!  \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut.  Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki.  Search for Laser Committee.','','2016-08-12 19:00:00','2016-08-12 21:30:00','2016-08-12 19:00:00','2016-08-12 21:30:00',0.00,NULL,8,0,1,0,0,'2016-08-12 19:00:00',0,1,0,'cancelled',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',0,0,'2016-07-30 21:36:15','2016-07-31 04:11:47'),(295,'PhotoShop 101','basics class','this class will be going over the basics of Photoshop, I will be covering the basic tools and functions of Photoshop. from pixel aspect ratio, to file format, and basic masking techniques. ','','2016-08-09 22:00:00','2016-08-10 01:00:00','2016-08-09 21:45:00','2016-08-10 01:00:00',0.00,NULL,15,0,0,18,0,'2016-08-09 22:00:00',0,1,0,'completed',9,122,NULL,NULL,NULL,NULL,NULL,NULL,'daydream',1,0,'2016-07-30 21:43:52','2016-08-10 01:00:01'),(296,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing!  \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut.  Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki.  Search for Laser Committee.','','2016-08-16 17:00:00','2016-08-16 19:30:00','2016-08-16 17:00:00'