w to use the old lasers and took this basics class, but need to learn how to use the Thunder and Epilog Zing, this hands on class is for you.','','2016-08-03 17:00:00','2016-08-03 18:00:00','2016-08-03 17:00:00','2016-08-03 18:00:00',0.00,NULL,8,0,1,0,0,'2016-08-03 17:00:00',0,1,0,'completed',16,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-07-31 04:08:20','2016-08-03 18:00:02'),(303,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing!  \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut.  Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki.  Search for Laser Committee.','','2016-08-14 19:00:00','2016-08-14 21:30:00','2016-08-14 19:00:00','2016-08-14 21:30:00',0.00,NULL,8,0,1,0,0,'2016-08-14 19:00:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-07-31 04:11:29','2016-08-14 21:30:01'),(304,'The End of Bloody Spiral - Auditions','Auditions for The End of Bloody Spiral short film.','Host:  Mark Andrew\r\nContact:  markandrewx@gmail.com\r\n\r\nAuditions for The End of Bloody Spiral short film.','','2016-07-31 14:00:00','2016-07-31 22:00:00','2016-07-31 14:00:00','2016-07-31 22:00:00',0.00,NULL,0,0,0,0,0,'2016-07-31 14:00:00',0,1,1,'completed',6,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-31 04:18:59','2016-07-31 22:00:01'),(305,'3d printing certification class','3d printing certification class','Host:  Joseph Bright\r\nContact:  texasboyjmb@yahoo.com\r\n3d printing certification class\r\nmax capacity 6','','2016-07-31 17:00:00','2016-07-31 18:00:00','2016-07-31 17:00:00','2016-07-31 18:00:00',0.00,NULL,0,0,0,0,0,'2016-07-31 17:00:00',0,1,1,'completed',1,127,1,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-31 04:28:25','2016-07-31 18:00:01'),(306,'DMS Pottery: Sgraffito Tile Class','Sgrafitto is an ancient technique of decorating pottery where a colored slip (liquid clay) is brushed onto a different colored base clay.','Host:  Nathan Jones\r\nContact:  bigbeartx@gmail.com\r\n\r\nSgrafitto is an ancient technique of decorating pottery where a colored slip (liquid clay) is brushed onto a different colored base clay.  The colored slip is then scraped away to create the decoration for the piece.\r\n\r\nAttendance is free.  There is a $10 materials fee will be collected during class to cover the cost of clay and glazes for your piece. \r\n\r\nClass size is limited to ten reservations. Auditing the class is always available without a reservation, but materials will be only be able for participants with reservations.\r\n\r\nClass will be in the Foundry area of the open workshop. Please wear closed toe shoes and clothes that you don\'t mind getting mud on. Feel free to bring an apron, towel, or both.\r\n\r\nReserve a ticket at https://www.eventbrite.com/e/dms-pottery-sgraffito-tile-class-tickets-26714476719','Please wear closed toe shoes and clothes that you don\'t mind getting mud on. Feel free to bring an apron, towel, or both.','2016-08-02 18:00:00','2016-08-02 21:00:00','2016-08-02 18:00:00','2016-08-02 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-02 18:00:00',0,1,1,'completed',15,128,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-31 04:36:51','2016-08-02 21:00:01'),(307,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing!  \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut.  Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki.  Search for Laser Committee.','','2016-08-04 04:00:00','2016-08-04 06:30:00','2016-08-04 04:00:00','2016-08-04 06:30:00',0.00,NULL,7,0,1,0,0,'2016-08-04 04:00:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-07-31 04:48:17','2016-08-04 06:30:02'),(308,'Flights of Fantasy walkthru','Planning and stage prep for presentation','Script review, walk thru and stage direction\r\n\r\nBring blue tape, costume parts, ideas','','2016-08-06 15:00:00','2016-08-06 18:30:00','2016-08-06 15:00:00','2016-08-06 18:30:00',0.00,NULL,0,0,0,0,0,'2016-08-06 15:00:00',0,1,0,'completed',8,131,NULL,NULL,NULL,NULL,NULL,NULL,'tnmorgan',1,0,'2016-07-31 16:31:46','2016-08-06 18:30:01'),(309,'Board of Directors Meeting for August 2016','This Will be the Board of Directors Meeting for August 2016','This Will be the Board of Directors Meeting for August 2016','','2016-08-28 19:00:00','2016-08-28 23:00:00','2016-08-28 18:45:00','2016-08-28 23:15:00',0.00,NULL,0,0,0,0,0,'2016-08-28 19:00:00',0,1,1,'completed',9,132,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-07-31 16:35:30','2016-08-28 23:00:01'),(310,'Dallas Screenwriting Crew - Icon Scenes from The Greats','Join us August 6th for table reads of The Greats, as we explore the most iconic scenes from blockbuster films, and discuss what made their scripts a success.','Ripley\'s encounter in \'Aliens\' with the Alien Queen.\r\nThe faces of Alan and Ellie before the dinosaur reveal in \'Jurassic Park\'.\r\nThe Cantina scene from \'Star Wars\'.\r\nThe exorcism scene from \'The Exorcist\'.\r\nRhett\'s final line in \'Gone With the Wind\': \"Frankly, my dear, I don\'t give a damn.\"\r\n\r\nJoin us August 6th for table reads of The Greats, as we explore the most iconic scenes from blockbuster films, and discuss what made their scripts a success.\r\n\r\n\r\nIf you find an iconic film\'s script that you\'d like to discuss, please email it to me: danwells11@gmail.com.\r\n\r\n\r\nIf you have a Work-in-Progress for critique, please bring copies for everyone--in standard script format--up to 10 pages in length.\r\n\r\n\r\n*A quick note about our Flash Screenplay Contest: we will be postponing the deadline of our next contest. Look out for those meetings posted to Meetup soon! ','','2016-08-06 18:00:00','2016-08-06 21:00:00','2016-08-06 17:45:00','2016-08-06 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-06 18:00:00',0,1,0,'completed',9,134,NULL,NULL,NULL,NULL,NULL,NULL,'luz_pictura',1,0,'2016-07-31 17:02:24','2016-08-06 21:00:01'),(311,'lauckDesign Meeting','Giving a tour for lauckgroup, a design firm in Downtown Dallas, to meet new artists and local designers, and to check out the makerspace community','Giving a tour for lauckgroup, a design firm in Downtown Dallas, to meet new artists and local designers, and to check out the makerspace community. Every month, we decide to go to a creative space where we can interact with others so that we can inspire but also become inspired.\r\n\r\nwww.lauckgroup.com\r\n','','2016-08-18 22:00:00','2016-08-19 00:00:00','2016-08-18 22:00:00','2016-08-19 00:00:00',0.00,NULL,0,0,0,21,0,'2016-08-18 22:00:00',0,1,0,'completed',9,136,NULL,NULL,NULL,NULL,NULL,NULL,'dankimf07',1,0,'2016-07-31 22:00:29','2016-08-19 00:00:01'),(312,'Fired Arts/Handbuilding pottery','The 3 major handbuilding techniques will be demonstrated, and the student will pick a technique (or two) to make an item with.  $10 materials fee paid at class.','Handbuilding:\r\nPinch pots, coil and slab building.\r\nIf you want to make something in pottery, handbuilding is your best bet.  Learning to use the wheel for thrown pottery takes some time.  Useful or decorative items can be made, or decorated useful items.','','2016-08-20 19:00:00','2016-08-20 22:00:00','2016-08-20 19:00:00','2016-08-20 22:00:00',0.00,NULL,8,0,0,0,0,'2016-08-20 19:00:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-07-31 23:58:35','2016-08-20 22:00:02'),(313,'ARTEMIS Spaceship Bridge Simulator night','Come and play this immersive LAN party game!','It\'s time to play Artemis again! \r\n\r\nNEW THIS MONTH: Neopixel strips for Ship 2! \r\n\r\nI\'ll also be bringing my DMX-controlled lighting that reacts to events in the game. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-08-27 01:00:00','2016-08-27 04:59:00','2016-08-27 01:00:00','2016-08-27 04:59:00',0.00,NULL,0,0,0,0,0,'2016-08-27 01:00:00',0,1,0,'completed',8,117,NULL,NULL,NULL,NULL,NULL,NULL,'dawsmart',1,0,'2016-08-01 01:04:13','2016-08-27 05:00:01'),(314,'ARTEMIS Spaceship Bridge Simulator night','Come and play this immersive LAN party game!',' It\'s time to play Artemis again! \r\n\r\nI\'ll be bringing my DMX-controlled lighting that reacts to events in the game, along with other peripherals. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-09-24 01:00:00','2016-09-24 04:59:00','2016-09-24 01:00:00','2016-09-24 04:59:00',0.00,NULL,0,0,0,0,0,'2016-09-24 01:00:00',0,1,0,'cancelled',9,117,NULL,NULL,NULL,NULL,NULL,NULL,'dawsmart',0,0,'2016-08-01 01:08:42','2016-09-09 16:47:37'),(315,'ARTEMIS Spaceship Bridge Simulator night','Come and play this immersive LAN party game!','It\'s time to play Artemis again! \r\n\r\nI\'ll be bringing my DMX-controlled lighting that reacts to events in the game, along with other peripherals. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-09-24 01:00:00','2016-09-24 04:59:00','2016-09-24 01:00:00','2016-09-24 04:59:00',0.00,NULL,0,0,0,0,0,'2016-09-24 01:00:00',0,1,0,'cancelled',8,117,NULL,NULL,NULL,NULL,NULL,NULL,'dawsmart',0,0,'2016-08-01 01:10:51','2016-09-09 16:53:39'),(316,'Jewelry: Silver Ring Fabrication ','This class will be working with sterling silver to fabricate silver rings!','This is a small class and is already full! However spectators and visitors are welcome to come by and check out the class!!','','2016-08-13 19:00:00','2016-08-14 00:00:00','2016-08-13 18:30:00','2016-08-14 00:30:00',0.00,NULL,0,1,0,0,0,'2016-08-13 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-08-01 02:10:01','2016-08-14 00:00:01'),(317,'Work on Coloring Book Illustrations','Work continues on the coloring book collaboration. ','We will discuss how we will publish it and what to do with the profits (if any). And we will continue sketching out a pages for the book.\r\n\r\nYou are welcomed to use any vector graphics program or use pencil or ink on Bristol paper and give/loan it to Raymond to scan for use.\r\n\r\nThis is not a class for teaching art. I\'ll help you a little but that\'s not the point if this class, we are here to make a coloring book. At the moment there is no limit to how many pages one artist can make. However if this ends up having a huge amount of artists then we may need to work something out.\r\n\r\nThe most important thing! You have to attend the class to submit work and no stealing/copying other\'s work! We will probably need some sort of legal release form for all that and stuff. If anyone is good with that please contact me so we can figure things out.','','2016-08-06 01:00:00','2016-08-06 03:00:00','2016-08-06 01:00:00','2016-08-06 03:00:00',0.00,NULL,0,0,0,0,0,'2016-08-06 01:00:00',0,1,0,'completed',5,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-08-01 02:13:49','2016-08-06 03:00:02'),(318,'Jewelry: Silver Ring Fabrication ','This class will be working with sterling silver to fabricate silver rings!','In this workshop you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band. \r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 4 to 6 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using 14K white, yellow or rose gold. ','Please wear closed toe shoes and pants. Safety glasses and aprons will be provided.','2016-08-27 19:00:00','2016-08-28 01:00:00','2016-08-27 18:30:00','2016-08-28 01:30:00',75.00,NULL,0,4,0,0,0,'2016-08-27 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-08-01 02:29:59','2016-08-22 00:15:03'),(319,'August Potluck','Bring food. Eat Food. Meet Makers. ','Bring a dish to share and come meet some fellow DMS members. \r\n','If you don\'t have the means to get food to participate please come early or stay later to help clean up. ','2016-08-27 23:30:00','2016-08-28 02:30:00','2016-08-27 23:00:00','2016-08-28 02:45:00',0.00,NULL,0,0,0,0,0,'2016-08-27 23:30:00',0,1,0,'completed',8,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-08-01 03:31:09','2016-08-28 02:30:02'),(320,'Creative Arts Committee  August Meeting','Planning and plotting our next big thang ','Let\'s figure out our part of open house\r\nTalk about recent tool acquisitions/plan on furthering mediums\r\nDiscuss new calendar system','Snacks and humor always welcome ','2016-08-27 20:00:00','2016-08-27 21:00:00','2016-08-27 19:45:00','2016-08-27 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-27 20:00:00',0,1,0,'completed',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-08-01 03:33:54','2016-08-27 21:00:01'),(321,'Neural Electric Interfacing Working Group','Prosthetic','Building a upper limb prosthesis. Updates on experiments.','','2016-08-04 01:30:00','2016-08-04 03:30:00','2016-08-04 01:30:00','2016-08-04 03:30:00',0.00,NULL,0,0,0,0,0,'2016-08-04 01:30:00',0,1,0,'completed',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',1,0,'2016-08-01 05:49:56','2016-08-04 03:30:01'),(322,'CNC Router Class (Wood Only)','Learn the Multicam CNC Router in the Woodshop.  (wood only)','Learn the Multicam CNC Router in the Woodshop.  This class will go over the basics in the Vcarve software and how to operate the machine.   You must be a DMS member to take the class.  Once the class is completed you will need to follow up at a later date with a test project.   Once the test project is completed you will have full access to the machine.  \r\n','','2016-08-14 23:30:00','2016-08-15 03:00:00','2016-08-14 23:15:00','2016-08-15 03:00:00',50.00,NULL,0,12,1,16,0,'2016-08-13 23:30:00',0,1,0,'rejected',9,4,3,NULL,NULL,NULL,'alexrhodes',NULL,'alexrhodes',0,0,'2016-08-01 14:34:12','2016-08-04 14:17:06'),(323,'Advanced CNC Router','Advanced topics in CNC Routing. ','This course covers advanced topics in CNC routing, and is required in order to cut plastics or use the Diamond Drag bit.\r\nAttendees must have taken the Basic CNC Routing Class, and have been tested/Have their key.  This will be checked at the start of class.\r\n\r\nNot recommended for persons with limited amounts of machine time.  You should be reasonably experienced in the use of the machine prior to taking this class.','Please bring or borrow eye protection.','2016-08-24 00:00:00','2016-08-24 02:30:00','2016-08-24 00:00:00','2016-08-24 02:30:00',10.00,NULL,0,10,1,0,0,'2016-08-21 00:00:00',0,1,1,'completed',9,46,NULL,3,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-08-01 15:36:49','2016-08-24 02:30:01'),(324,'Personalizing Shirts, Mugs & More: Dye Sub 101 - Ticket Required','Eventbrite Ticket Required. Learn to decorate t-shirts, mugs, and a lot more during this hands on class.','This class is open to Dallas Makerspace members only, and you must get a ticket through Eventbrite at https://www.eventbrite.com/e/personalizing-shirts-mugs-more-dye-sub-101-tickets-26879371925. \r\n\r\nHave you ever wanted to put pictures or logos on shirts, hats, key chains, mugs, or other items? Dye Sublimation is a great way to accomplish this. Makerspace members, come to this class to learn more about this cool technology, and get some hands on experience. I will be teaching you about the process, and everyone that attends will leave with a shirt, coffee mug, and their choice of mousepad, hat or two coasters that they make themselves. Bring your own photos and/or logos for your items on a flash drive or other media. I will supply the blanks to be decorated.\r\n\r\nYou must be a member of the Dallas Makerspace to take this class, and use the equipment.','','2016-08-20 14:00:00','2016-08-20 17:00:00','2016-08-20 13:30:00','2016-08-20 17:30:00',0.00,NULL,1,0,1,0,1,'2016-08-18 14:00:00',0,1,0,'completed',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',1,0,'2016-08-01 16:01:29','2016-08-20 17:00:01'),(325,'Personalizing Shirts Mugs, & More: Dye Sub 101 - Ticket Required','Eventbrite Ticket Required. Learn to decorate t-shirts, mugs, and a lot more during this hands on class.','This class is open to Dallas Makerspace members only, an