decorated.\r\n\r\nYou must be a member of the Dallas Makerspace to take this class, and use the equipment.','','2016-08-27 00:00:00','2016-08-27 03:00:00','2016-08-26 23:30:00','2016-08-27 03:30:00',0.00,NULL,1,0,1,0,1,'2016-08-25 00:00:00',0,1,0,'completed',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',1,0,'2016-08-01 16:17:41','2016-08-27 03:00:01'),(327,'Engine Turning (Jeweling) metals','Engine Turning /Jeweling is an old school decorative technique for generating repeating circular patterns on metals.','Engine Turning /Jeweling is an old school decorative  technique for generating repeating circular patterns on metals. There are several ways to do this and I will demonstrate 2 methods and also show how it applies today using both manual machine and a CNC to accomplish the same.  The use of masking to generate unique outlines will also be demonstrated. \r\nThis will be an interactive class. Once the demo is done, everyone is invited to try thier hand at it.  The class should be of most interest to machinist, metal workers and jewelry makers, but all are welcome.','none.  I will supply safety glasses as needed.','2016-08-27 15:00:00','2016-08-27 17:00:00','2016-08-27 15:00:00','2016-08-27 17:00:00',0.00,NULL,10,0,0,0,0,'2016-08-25 15:00:00',0,1,0,'completed',11,57,NULL,NULL,NULL,NULL,NULL,NULL,'nicksilva',1,0,'2016-08-01 18:55:12','2016-08-27 17:00:01'),(328,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n\r\n','','2016-08-10 23:00:00','2016-08-11 00:00:00','2016-08-10 22:45:00','2016-08-11 00:00:00',0.00,NULL,0,0,0,16,0,'2016-08-10 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-01 20:49:36','2016-08-11 00:00:01'),(329,'CNC Router Workshop','Hands-on training to accompany the Basic CNC Router Course','This is a hands-on workshop primarily aimed at persons who have taken the Basic CNC Router class, but who would like some hands-on experience prior to taking the key test, or who feel uncertain when using the machine.\r\n\r\nYou MUST have taken the Basic CNC Router class prior to attending this class.  No exceptions.\r\n\r\nThis class meets at the Machine, no classroom.','Please wear eye protection, and follow the Woodshop safety rules with respect to attire.','2016-08-17 00:00:00','2016-08-17 02:00:00','2016-08-17 00:00:00','2016-08-17 02:00:00',0.00,NULL,5,0,1,0,0,'2016-08-15 00:00:00',0,1,1,'completed',12,46,NULL,3,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-08-01 21:47:25','2016-08-17 02:00:01'),(330,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves.  Please pin or tie up long hair.','2016-08-28 18:00:00','2016-08-28 20:30:00','2016-08-28 18:00:00','2016-08-28 20:30:00',5.00,NULL,0,5,1,18,0,'2016-08-26 18:00:00',0,1,1,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-08-01 23:17:20','2016-08-28 20:30:01'),(331,'Basic Chain Mail Construction','Intro To Chain Mail construction.  ','Host:  Axel Ohmstede\r\nContact:  Axel@Greylion.com\r\n\r\nBasic chainmail construction - materials, tools, sources, some history, several patterns, assembly training - can be used to make jewelry, clothing accents, dice pouches, costuming, reproduction armor and more. 30 plus years making chainmail - I will be bringing in a number of pieces as examples of what is possible plus a photo album of more to share.','','2016-08-06 19:00:00','2016-08-06 21:00:00','2016-08-06 18:45:00','2016-08-06 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-06 19:00:00',0,1,1,'completed',8,150,NULL,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-08-02 04:17:33','2016-08-06 21:00:01'),(332,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn to use all our lasers!\r\nThe LaserSaur!\r\nThe Thunder!\r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can engrave, raster, and cut. Then we walk thru each machine.','','2016-08-17 23:30:00','2016-08-18 02:00:00','2016-08-17 23:15:00','2016-08-18 02:00:00',0.00,NULL,8,0,1,0,0,'2016-08-17 23:30:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-08-02 06:11:02','2016-08-18 02:00:02'),(333,'3d fab down for maintenance ','down for maintenance ','3d fab will be down so we can switch over the pi\'s and test before we bring them fully online','any print still printing will be canceled at 9pm for the printers to be changed over','2016-08-05 02:00:00','2016-08-05 04:59:00','2016-08-05 02:00:00','2016-08-05 04:59:00',0.00,NULL,0,0,0,0,0,'2016-08-05 02:00:00',0,1,0,'completed',1,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-08-02 19:44:30','2016-08-05 05:00:01'),(334,'3d felting','learn to felt a small animal sculpture with wool and felting needles','learn to make a 3D animal out of wool with needle felting','','2016-08-18 00:00:00','2016-08-18 02:00:00','2016-08-18 00:00:00','2016-08-18 02:00: