4 18:00:00',0,2,0,'approved',9,118,NULL,NULL,341,NULL,NULL,NULL,'patrickm',0,0,'2016-08-03 18:38:16','2016-08-03 18:38:16'),(343,'Mojito Night','Science will be harvesting the mint in our aquaponics\' system.','We are keeping the party going by conintuing Mojito Night, in honor of Science\'s previous Chair,  Ashley F.N. Newland. We will harvest mint from our aquaponics\' system to make Mojitos and our non-alcoholic drink: Mint Lemonade. This is also a get together to talk about gardening and our feelings. Come, come.\r\n\r\n$2.00 entry fee. All proceeds will go towards the Science Committee.\r\n','','2016-08-12 00:00:00','2016-08-12 01:00:00','2016-08-11 23:45:00','2016-08-12 01:15:00',2.00,NULL,0,0,0,0,1,'2016-08-12 00:00:00',0,1,0,'cancelled',18,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-03 20:21:53','2016-08-04 16:12:22'),(344,'Table Read - Circle of One','Table Reads with actors','Table reads for Circle of One with actors and crew','','2016-08-06 15:00:00','2016-08-06 18:00:00','2016-08-06 15:00:00','2016-08-06 18:30:00',0.00,NULL,0,0,0,0,0,'2016-08-06 15:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-03 21:06:06','2016-08-06 18:00:01'),(345,'Table Read 1 - Money Shot','Table Read for Money Shot','Rehearsal/Script Changes','','2016-08-13 16:00:00','2016-08-13 21:00:00','2016-08-13 16:00:00','2016-08-13 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-13 16:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-03 21:15:55','2016-08-13 21:00:01'),(346,'Table Read #2 - Money Shot','Table read with Actors','Rehearsal/Script Changes','','2016-08-20 18:00:00','2016-08-20 21:00:00','2016-08-20 18:00:00','2016-08-20 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-20 18:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-03 21:18:53','2016-08-20 21:00:01'),(347,'Table Read #3 - Money Shot','Table Read with Actors','Rehearsal/Script Changes','','2016-08-27 18:00:00','2016-08-27 21:00:00','2016-08-27 18:00:00','2016-08-27 21:00:00',0.00,NULL,0,0,0,0,0,'2016-08-27 18:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-03 21:20:06','2016-08-27 21:00:01'),(348,'test','test','test','','2016-09-09 17:00:00','2016-09-09 18:00:00','2016-09-09 17:00:00','2016-09-09 18:00:00',0.00,NULL,0,0,0,0,0,'2016-09-09 17:00:00',0,1,0,'cancelled',2,44,NULL,NULL,NULL,NULL,NULL,NULL,'scorpiogustx',0,0,'2016-08-03 22:08:04','2016-08-11 01:48:14'),(349,'Sewing SIG meeting','Sewing class coordination and planning meeting','This is a meeting for the Sewing SIG (special interest group) and you are welcome to come if you are interested in particular sewing classes or willing to teach.\r\n\r\nWe will be planning some potential classes and schedule. Please come and give us your input.','','2016-08-09 23:00:00','2016-08-10 00:00:00','2016-08-09 23:00:00','2016-08-10 00:00:00',0.00,NULL,0,0,0,0,0,'2016-08-09 23:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-04 01:11:18','2016-08-10 00:00:01'),(350,'Embedded Workshop','Using Arduino IDE and the Wemos D1 Mini ','Where	Interactive Classroom\r\n	1825 Monetary Ln #104 Carrollton, TX 75006\r\nHost	Jim Merkle (jim@merkles.com)\r\nDetails	Using the free Arduino IDE to program the Wemos mini D1 board, we will be working with several of the different shields that WeMos has available.\r\n\r\nDigital Humidity / Temperature (DHT) Shield  using DHT11\r\nOLED Shield\r\nRelay Shield\r\nMicro SD Shield\r\n\r\nOf course, the cute little WeMos shield boards themselves aren\'t necessary, so you\'re welcome to bring a generic version of the same board to interface to.  (A DHT11 or DHT22 device as an example)\r\n\r\nSince this little $4 board supports WiFi, we will be interacting with this device using a web page.\r\n\r\nThese boards come from China.  You need to get your parts ordered NOW.  It takes about 2-1/2 weeks to get the parts.  We will have some extra boards available for purchase if you don\'t get your parts in time.\r\n\r\nUsing the \"HelloServer\" example as a starting point, we\'ve been able to create some code that demonstrates interactive control via web pages served by the WeMos.\r\n\r\nPlaces to look:\r\nESP8266 WeMos Board - http://www.wemos.cc/Products/d1_mini.html\r\nJim\'s Webpage - http://www.merkles.com\r\nRusty\'s Webpage  http://www.thecains-group.net\r\n\r\nBring your laptop and WeMos parts (Don\'t forget the USB cable)\r\n\r\nFor those of you that have been playing with the WeMos for a while, I\'d like to see the code you\'ve written.  Feel free to contact me, jim@merkles.com.\r\n','','2016-08-25 00:00:00','2016-08-25 02:00:00','2016-08-24 23:30:00','2016-08-25 02:30:00',0.00,NULL,20,0,0,0,0,'2016-08-25 00:00:00',0,1,0,'completed',8,174,NULL,NULL,NULL,NULL,NULL,NULL,'microrustyc',1,0,'2016-08-04 02:12:03','2016-08-25 02:00:01'),(351,'Learn to use the sewing machines','Learn to use our 5 new sewing machines or bring your own.   Basic sewing techniques,  materials will be provided.   limit of 5 students to be able to use the DMS sewing machines','Content includes Threading the machines,  winding bobbins,  picking the right stitch for the job and sewing straight lines. ','','2016-08-18 00:00:00','2016-08-18 02:00:00','2016-08-17 23:45:00','2016-08-18 02:15:00',0.00,NULL,5,0,0,13,0,'2016-08-18 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-08-04 02:16:16','2016-08-18 02:00:02'),(352,'Spiceworks SpiceCorp DFW Meeting','Local I.T. Admins and Techs meetup','This is an unsponsored meeting, but we will have a few technical presentations. We will also be raffling off a free ticket to Spiceworld Austin. Bring your questions.\r\n1. Technical Overview of Spiceworks Remote Collector Functionality / Spiceworks Application Q & A\r\n2. VDI Use Cases - Determining if It Is Right for Your Business\r\n3. Advanced Features of Ubiquiti Unifi Access Points \r\n\r\n         6:30 PM - ice breaker for attendees (everyone introduce themselves) and general announcements\r\n         7 PM - first presentation \r\n                Technical Overview of Spiceworks Remote Collector Functionality)\r\n         7:45 PM - second presentation \r\n                VDI Use Cases and How to Determine if It Is Right for Your Business)\r\n         8:30 PM - Makerspace tour for attendees\r\n','','2016-08-04 23:30:00','2016-08-05 01:30:00','2016-08-04 23:30:00','2016-08-05 01:30:00',0.00,NULL,0,0,0,0,0,'2016-08-04 23:30:00',0,1,1,'completed',9,179,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-04 06:30:45','2016-08-05 01:30:01'),(353,'Coffee Basics','Come learn, talk about, and drink coffee.','I\'m going to teach and lead a discussion about coffee. Coffee will be made but served as samples.','','2016-08-14 22:00:00','2016-08-14 23:00:00','2016-08-14 21:30:00','2016-08-14 23:15:00',0.00,NULL,0,0,0,0,0,'2016-08-14 22:00:00',0,1,0,'completed',11,180,NULL,NULL,NULL,NULL,NULL,NULL,'pringle',1,0,'2016-08-04 13:36:02','2016-08-14 23:00:01'),(354,'Coffee basics','Come learn, talk about, and drink coffee.','I\'m going to teach and lead a discussion about coffee. Coffee will be made but served as samples.','','2016-08-18 23:00:00','2016-08-19 00:00:00','2016-08-18 22:30:00','2016-08-19 00:15:00',0.00,NULL,0,0,0,0,0,'2016-08-18 23:00:00',0,1,0,'completed',11,180,NULL,NULL,NULL,NULL,NULL,NULL,'pringle',1,0,'2016-08-04 13:42:39','2016-08-19 00:00:01'),(355,'CNC Router Class (Wood Only)','Learn the Multicam CNC Router in the Woodshop. (wood only)','Learn the Multicam CNC Router in the Woodshop. This class will go over the basics in the Vcarve software and how to operate the machine. You must be a DMS member to take the class. Once the class is completed you will need to follow up at a later date with a test project. Once the test project is completed you will have full access to the machine. ','','2016-08-15 23:30:00','2016-08-16 03:00:00','2016-08-15 23:15:00','2016-08-16 03:00:00',50.00,NULL,0,12,1,16,0,'2016-08-14 23:30:00',0,1,0,'completed',9,4,3,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-08-04 14:21:21','2016-08-16 03:00:01'),(356,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves.  Please pin up long hair.','2016-08-21 16:00:00','2016-08-21 18:30:00','2016-08-21 16:00:00','2016-08-21 18:30:00',5.00,NULL,0,5,1,18,0,'2016-08-19 16:00:00',0,1,1,'completed',12,182,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-08-04 15:11:01','2016-08-21 18:30:01'),(357,'Mojito Night','Science will be harvesting our mint to make drinks.','We will continue the tradition of Nojito night in honor of our previous Science chair, Ashley F.N. Newland. We will harvest the mint from our aquaponics system and make nojitos-(non-alcoholic mojito\'s). Come out and talk about gardening and your feelings.','','2016-08-12 00:00:00','2016-08-12 01:00:00','2016-08-11 23:45:00','2016-08-12 01:00:00',0.00,NULL,0,0,0,0,0,'2016-08-12 00:00:00',0,1,0,'completed',18,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',1,0,'2016-08-04 16:46:36','2016-08-12 01:00:02'),(358,'EmachineShop 101 for 3D Prnting','A begginers guide to using emachine shop for 3D printing','Emachine shop is a free to use program that will allow you to import stl file into other programs like Tinkercad. It has a lot more ability\'s than Tinkercad and works well in conjunction with Tinkercad. Emachineshop can also be used for laser cutting and cnc mill projects.','','2016-08-20 22:35:00','2016-08-20 23:35:00','2016-08-20 22:20:00','2016-08-20 23:35:00',0.00,NULL,20,0,0,0,0,'2016-08-20 22:35:00',0,1,0,'completed',9,70,NULL,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-08-04 22:37:00','2016-08-20 23:35:01'),(359,'Spinning and Fiberarts','Learn to spin your own yarn, use various fiber tools, and great ways to use the yarn you create. Or bring your current project and get help or inspiration.','\r\nCome join us in learning to spin your own yarn and related fiber arts! \r\n\r\nThis is a multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools, check out whatever other related educational topic we\'re covering, or just bring your current fiber project, get help or hang out with like-minded folks.\r\n\r\nIf you\'re learning to spin, I have beginner cd drop-spindle and fiber kits for $5. Also, some topics for any session may have modest supply fees. Of course, you\'re welcome to bring your own tools and supplies. \r\n\r\nIf you have questions, want to follow our online discussions, or curious what fiber topic we\'re covering that session (I post details a day or two before class), check out the Facebook group \"Dallas Makerspace Fiberholics\".   \r\n\r\nYou can also contact me directly  \r\nkyrithia@hotmail.com or text 469-831-0916\r\n','','2016-08-24 00:00:00','2016-08-24 02:00:00','2016-08-23 23:45:00','2016-08-24 02:15:00',0.00,NULL,0,0,0,0,0,'2016-08-24 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-05 02:03:15','2016-08-24 02:00:01'),(360,'Spinning and Fiberarts','Learn to spin your own yarn, use various fiber tools, and great ways to use the yarn you create. Or bring your current project and get help or inspiration.','\r\nCome join us in learning to spin your own yarn and related fiber arts! \r\n\r\nThis is a multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools, check out whatever other related educational topic we\'re covering, or just bring your current fiber project, get help or hang out with like-minded folks.\r\n\r\nIf you\'re learning to spin, I have beginner cd drop-spindle and fiber kits for $5. Also, some topics for any session may have modest supply fees. Of course, you\'re welcome to bring your own tools and supplies. \r\n\r\nIf you have questions, want to follow our online discussions, or curious what fiber topic we\'re covering that session (I post details a day or two before class), check out the Facebook group \"Dallas Makerspace Fiberholics\".   \r\n\r\nYou can also contact me directly  \r\nkyrithia@hotmail.com or text 469-831-0916\r\n','','2016-09-07 00:00:00','2016-09-07 02:00:00','2016-09-06 23:45:00','2016-09-07 02:15:00',0.00,NULL,0,0,0,0,0,'2016-09-07 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-05 02:09:50','2016-09-07 02:00:01'),(361,'Spinning and Fiberarts','Learn to spin your own yarn, use various fiber tools, and great ways to use the yarn you create. Or bring your current project and get help or inspiration.','Come join us in learning to spin your own yarn and related fiber arts! \r\n\r\nThis is a multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools, check out whatever other related educational topic we\'re covering, or just bring your current fiber project, get help or hang out with like-minded folks.\r\n\r\nIf you\'re learning to spin, I have beginner cd drop-spindle and fiber kits for $5. Also, some topics for any session may have modest supply fees. Of course, you\'re welcome to bring your own tools and supplies. \r\n\r\nIf you have questions, want to follow our online discussions, or curious what fiber topic we\'re covering that session (I post details a day or two before class), check out the Facebook group \"Dallas Makerspace Fiberholics\".   \r\n\r\nYou can also contact me directly  \r\nkyrithia@hotmail.com or text 469-831-0916\r\n\r\n\r\n','','2016-09-21 00:00:00','2016-09-21 02:00:00','2016-09-20 23:45:00','2016-09-21 02:15:00',0.00,NULL,0,0,0,0,0,'2016-09-21 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-05 02:15:04','2016-09-21 02:00:01'),(362,'Building a wood hand plane II - tuning and shaping a smoothing plane','In this class we will finish the hand planes made in the first class','In this class we will complete the planes we created in the first class.  We will create a wedge, flatten the bottom and open the mouth of the plane for the shaving to pass through.  Once tuned and tested we will shape the planes to fit your hand.\r\n\r\nWhile this class is meant for students who took the first class it is open to anyone who wants to watch and learn.','','2016-08-18 23:30:00','2016-08-19 02:00:00','2016-08-18 23:30:00','2016-08-19 02:00:00',0.00,NULL,0,0,1,0,0,'2016-08-18 23:30:00',0,1,0,'completed',12,192,NULL,4,NULL,NULL,NULL,NULL,'mkart',1,0,'2016-08-05 13:26:21','2016-08-19 02:00:01'),(363,'Freeze Dryer Class','Certification class to use the freeze dryer.','We will go over how to use the freeze dryer and scheduling.','','2016-08-20 15:00:00','2016-08-20 16:00:00','2016-08-20 14:45:00','2016-08-20 16:00:00',5.00,NULL,0,10,1,0,0,'2016-08-20 15:00:00',0,1,0,'completed',18,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',1,0,'2016-08-05 15:13:18','2016-08-20 16:00:01'),(364,'Introduction to Electronics for Kids (Arduino)','Learn the basics of electronics and programming in a fun hands on class geared towards kids (and adults)','This is a multi-part hands on interactive class teaching kids (and adults) electronics through a series of engaging experiments.  Using an Arduino UNO R3, breadboards and numerous electronic components you will learn how to:\r\n\r\nUnderstand the basic concepts of electronics (Watts, Volts, Amps, Resistance, etc)\r\nLearn the basics of programming micro controllers\r\nLearn circuit and PCB design (Eagle CAD)\r\nCreate a number of experiments starting with the basics of a blinking LED to advanced motor and sensor control.\r\n\r\nAges 10+\r\n\r\nThere is a $60 supplies fee that covers all the parts and supplies you will need, which will be yours to keep, including the Arduino Uno R3 and all experiments.  If you have a laptop please bring it for use in programming your micro controller, we will have some on hand for those that do not.\r\n\r\nClasses will be held:\r\n\r\n10/2/2016 - Part 1\r\n10/9/2016 - Part 2\r\n10/16/2016 - Part 3\r\n10/23/2016 - Part 4\r\n\r\nAll classes will be from 1pm - 4pm CST.\r\n\r\nAbout the instructor:\r\n\r\nAndrew is a seasoned software engineer with a background in electronics including AC/DC/Solid State.  With 5 children he is experienced in explaining technical subjects in an easy to learn manor.','This is a mutli-part class.  You will need to attend all parts to get the most benefit.  ','2016-10-02 18:00:00','2016-10-02 21:00:00','2016-10-02 17:00:00','2016-10-02 21:30:00',60.00,NULL,0,10,0,0,0,'2016-09-22 18:00:00',0,1,0,'cancelled',8,172,NULL,NULL,NULL,NULL,NULL,NULL,'ataylorm',0,0,'2016-08-05 16:12:41','2016-08-08 18:32:00'),(365,'Make Your Own Earrings and Findings with Wire','In this workshop you will learn several different ways to make custom earrings with round wire and complete three pairs.','In this workshop you with learn how to make three different versions of earrings out of round Silver wire.  You will learn how to make the earring hooks & posts and put components together and complete three pairs. The fee charged is a $7.00 kit fee. \r\n\r\nIf you have any of the following pliers please bring them :)\r\n\r\n*Flat nose pliers\r\n*Round nose pliers\r\n*Chain nose pliers\r\n*Flush cutters\r\n\r\n','','2016-08-16 00:00:00','2016-08-16 02:00:00','2016-08-16 00:00:00','2016-08-16 02:00:00',7.00,NULL,0,6,0,0,0,'2016-08-16 00:00:00',0,1,0,'cancelled',11,124,NULL,NULL,NULL,NULL,NULL,NULL,'katiri',0,0,'2016-08-05 23:13:08','2016-08-06 04:47:52'),(366,'Work on Adult Coloring Book Illustrations','Drawing and illustrating pages for a coloring book collaboration','This is not a class for teaching art. I\'ll help you a little but that\'s not the point if this class, we are here to make a coloring book. At the moment there is no limit to how many pages one artist can make. However if this ends up having a huge amount of artists then we may need to work something out.\r\n\r\nThe most important thing! You have to attend the class to submit work and no stealing/copying other\'s work!\r\n\r\nThe plan so far is to use the profits (if any) to pay for other classes like hiring a model for life drawing, etc.','','2016-08-20 18:00:00','2016-08-20 20:00:00','2016-08-20 18:00:00','2016-08-20 20:00:00',0.00,NULL,0,0,0,0,0,'2016-08-20 18:00:00',0,1,0,'completed',11,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-08-06 16:00:54','2016-08-20 20:00:01'),(367,'Raman Build','Building a Raman Spectrometer','The spectrometer will most likely be aligned and ready to go so hopefully we can focus on acquiring our first Raman spectrum.  ','','2016-08-09 00:00:00','2016-08-09 02:00:00','2016-08-09 00:00:00','2016-08-09 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-09 00:00:00',0,1,0,'completed',4,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-08-06 16:23:58','2016-08-09 02:00:01'),(368,'Build your own Wordpress website for Free','Learn how to build and host your own Wordpress based website for your company, personal portfolio/blog, eCommerce or for anything amazing! ','Build your own Wordpress website for Free! (No programming experience required)\r\n\r\nLearn how to build and host your own Wordpress based website for your company, personal portfolio/blog, eCommerce or for anything amazing! \r\n\r\nWe will start with the basics of Wordpress: menus, pages, posts, themes, plugins, hosting etc. Will also learn the difference between wordpress.com and wordpress.org\r\nAnd then we will do a hands-on exercise to host a Wordpress website which would be running 24X7 for you!\r\nIf time permits, we might delve deeper.\r\n\r\nRequired: Laptop in case you want to start alongside.\r\nIf you already own a custom domain, that would be great but not necessary!\r\n\r\n*No programming experience required\r\n\r\nPresenter: Varun Khandelwal - eCommerce Consultant\r\nhttps://www.linkedin.com/in/kwlvarun\r\n\r\nAgenda:\r\n5:00 - Basics of Wordpress\r\n5:45 - Host your wordpress website\r\n6:30 - QnA','','2016-08-21 22:00:00','2016-08-22 00:00:00','2016-08-21 22:00:00','2016-08-22 00:00:00',0.00,NULL,0,0,0,0,0,'2016-08-21 22:00:00',0,1,0,'completed',8,116,NULL,NULL,NULL,NULL,NULL,NULL,'kwlvarun',1,0,'2016-08-06 23:34:41','2016-08-22 00:00:01'),(369,'Router Basics','This class will cover the basics of the hand held router and the INCRA router table.','In this class we will cover the hand held routers and the INCRA router table.\r\n\r\nSpecifically we will cover;\r\n\r\nBasic operation \r\n\r\nBit options\r\n\r\nThe Dewalt small hand held router\r\n\r\nThe Porter Cable which has both the fixed base and the plunge base\r\n\r\nThe INCRA Router table','','2016-08-17 23:00:00','2016-08-18 00:00:00','2016-08-17 23:00:00','2016-08-18 00:00:00',0.00,NULL,3,0,1,18,0,'2016-08-17 23:00:00',0,1,0,'completed',12,166,NULL,4,NULL,NULL,NULL,NULL,'hawaiianmike',1,0,'2016-08-07 13:35:51','2016-08-18 00:00:01'),(370,'Router Basics','This class will cover the basics of the hand held router and the INCRA router table.','In this class we will cover the hand held routers and the INCRA router table.\r\n\r\nSpecifically we will cover;\r\n\r\nBasic operation \r\n\r\nBit options\r\n\r\nThe Dewalt small hand held router\r\n\r\nThe Porter Cable which has both the fixed base and the plunge base\r\n\r\nThe INCRA Router table\r\n','','2016-08-18 00:30:00','2016-08-18 01:30:00','2016-08-18 00:30:00','2016-08-18 01:30:00',0.00,NULL,3,0,1,18,0,'2016-08-18 00:30:00',0,1,0,'completed',13,166,NULL,4,NULL,NULL,NULL,NULL,'hawaiianmike',1,0,'2016-08-07 13:38:32','2016-08-18 01:30:02'),(371,'Pinball event - IFPA Tourney of the EM\'s','Dallas Makerspace is hosting its first IFPA \"all-EM\" pinball tournament!','The Dallas Makerspace is hosting its first IFPA \"all-EM\" pinball tournament! Play will be 4-player match play. No cost to enter and winners will be qualified for IFPA points.\r\n\r\nThis tournament will be held back-to-back with Louis Marx\'s tourney on the following Sunday (Sep 11). That\'s two IFPA tourneys in the same area for the price of one. Don\'t miss it!\r\n\r\nTournament begins at 2pm.','','2016-09-10 19:00:00','2016-09-11 01:00:00','2016-09-10 19:00:00','2016-09-11 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-10 19:00:00',0,1,0,'completed',11,36,NULL,NULL,NULL,NULL,NULL,NULL,'nickdangerous',1,0,'2016-08-07 15:32:07','2016-09-11 01:00:01'),(372,'Packaging Class for Indie and Etsy Shops ','Packaging Class for Indie and Etsy Shops ','Packaging is an important part of your brand.\r\n\r\nIn this class, we will cover:\r\n Why packaging is so important\r\n How to create your own packaging that is cohesive conveys your style. \r\n Ideas and resources for packaging\r\n\r\nGreat packaging does not have to be expensive either! There are many options available when you think \"outside the box\"!\r\n\r\nThis is a free class! Register at the following link:\r\nhttps://www.eventbrite.com/e/a-packaging-class-for-indie-shops-tickets-26990799207','','2016-09-18 19:00:00','2016-09-18 21:00:00','2016-09-18 18:45:00','2016-09-18 21:00:00',0.00,NULL,30,0,0,0,0,'2016-09-18 19:00:00',0,1,0,'completed',9,109,NULL,NULL,NULL,NULL,NULL,NULL,'abneysc',1,0,'2016-08-07 17:38:33','2016-09-18 21:00:01'),(373,'Storage Committee Meeting','Logistics hosts the monthly storage committee meeting for project storage extensions and general logistics discussion','The purpose of this meeting is to discuss issues relating to project storage (i.e. extensions) as well as a venue for general logistics issues.\r\n\r\nNote that for project storage extensions, you or an agent must be present in-person to make the request.  Requests are typically automatic; however projects making little progress, pallet storage, and floor storage projects will be subject to steadily intensifying scrutiny.\r\n\r\nNote that the formal meeting itself typically lasts no more than 30 minutes, but the Logistics Chair will be onsite to accept extension  requests for the full duration of the meeting.','','2016-09-03 21:00:00','2016-09-03 23:00:00','2016-09-03 20:45:00','2016-09-03 23:00:00',0.00,NULL,0,0,1,0,0,'2016-09-03 21:00:00',0,1,0,'completed',4,66,NULL,NULL,NULL,NULL,NULL,NULL,'eriksmith',1,0,'2016-08-07 19:46:43','2016-09-03 23:00:01'),(374,'The End of Bloody Spiral - Auditions','Open and closed auditions for the Dallas-based short film \"The End of Bloody Spiral\".','We will be hosting open and closed auditions for the Dallas-based short film \"The End of Bloody Spiral\".','','2016-08-13 14:00:00','2016-08-13 20:00:00','2016-08-13 13:45:00','2016-08-13 20:15:00',0.00,NULL,0,0,0,0,0,'2016-08-13 14:00:00',0,1,0,'completed',9,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',1,0,'2016-08-08 02:27:07','2016-08-13 20:00:01'),(375,'Amazon Sellers Networking and Meetup','Meetup and network with other Amazon sellers. ','Meetup and network with other Amazon sellers. What did you get done since the last meeting? What did you have trouble with? We\'re here to help and support each other.','','2016-08-19 00:00:00','2016-08-19 02:00:00','2016-08-19 00:00:00','2016-08-19 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-19 00:00:00',0,1,0,'completed',8,118,NULL,NULL,NULL,NULL,NULL,NULL,'patrickm',1,0,'2016-08-08 02:30:13','2016-08-19 02:00:01'),(376,'Who Ever Knew - Auditions','Open and closed auditions for the Dallas-based short film \"Who Ever Knew\".','We will be hosting open and closed auditions for the Dallas-based short film \"Who Ever Knew\".','','2016-08-14 22:00:00','2016-08-15 02:30:00','2016-08-14 21:45:00','2016-08-15 02:45:00',0.00,NULL,0,0,0,0,0,'2016-08-14 22:00:00',0,1,0,'completed',4,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',1,0,'2016-08-08 02:38:12','2016-08-15 02:30:01'),(377,'Woodcarving by hand ','North Texas Woodcarvers Guild. Class 2. Great group and wonderful instruction. ','The North Texas Woodcarver\'s Guild will present a continuation of a caricature carving workshop with award winning carver, David Borg. The class is limited to 12 participants with preference going to those who attended day one, so David will be able to give one-on-one instruction. Contact Guild President, Sally Miller at smdglo@yahoo.com to sign up. \r\n\r\n \r\n\r\n A basswood blank and pattern was provided during first class, but others are available for purchase at the class. Bring your own carving tools (no power carving tools to reduce noise and dust).  Both new and experienced woodcarvers are welcome. There will be beginners projects available for new carvers. For more information on the North Texas Woodcarver\'s Guild, check out our Facebook page - https://www.facebook.com/ntxcarvers/.','','2016-08-27 14:05:00','2016-08-27 22:00:00','2016-08-27 13:05:00','2016-08-27 23:00:00',0.00,NULL,0,0,0,0,0,'2016-08-27 14:05:00',0,1,1,'completed',8,225,NULL,NULL,NULL,NULL,NULL,NULL,'ebvsbdms',1,0,'2016-08-08 13:27:54','2016-08-27 22:00:01'),(378,'Inkscape Tutorial: Creating an SVG from an Online Image','Come learn how to navigate Inkscape by recreating an image as a scalable vector!  These SVGs can later be used on the laser cutter, vinyl cutter, or 3D printer. ','Come learn how to navigate Inkscape by recreating an image as a scalable vector!  These SVGs can later be used on the laser cutter, vinyl cutter, or 3D printer. \r\n\r\nPlease bring a computer with you and download Inkscape PRIOR to coming to the class.  (Note: Mac users must also download X11)','','2016-08-13 01:00:00','2016-08-13 02:00:00','2016-08-13 01:00:00','2016-08-13 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-13 01:00:00',0,1,0,'completed',9,89,NULL,NULL,NULL,NULL,NULL,NULL,'baileyfry',1,0,'2016-08-09 04:52:23','2016-08-13 02:00:01'),(379,'DMS Monthly Membership meeting.  ','Monthly Membership meeting for ','Monthly Membership Meeting\r\n\r\nhttps://dallasmakerspace.org/wiki/Category:Meetings','','2016-08-12 01:00:00','2016-08-12 03:00:00','2016-08-12 01:00:00','2016-08-12 03:00:00',0.00,NULL,0,0,0,0,0,'2016-08-12 01:00:00',0,1,0,'completed',8,4,NULL,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-08-09 15:20:40','2016-08-12 03:00:01'),(380,'Raspberry Pi (the computer) for Beginners','Getting Raspberry Pi up and Running, plus a brief HIGH LEVEL overview of the Raspbian OS','In this class we will go over the information at the following link from The Raspberry Pi\'s own publishing. \r\n\r\nhttps://www.raspberrypi.org/learning/getting-started-with-raspberry-pi-lesson/\r\n\r\nWe will also go over the Raspbian Operating System as much as possible. \r\n\r\nIf there is time, we will look at at example of how to use the Raspberry Pi to communicate with a micro controller like the Arduino. \r\n\r\n','**PLEASE DO NOT WASTE YOUR TIME COMING TO THIS CLASS IF YOU ARE AN ADVANCED USER**\r\n*THIS CLASS MAY NOT ALWAYS BE FREE. ','2016-08-23 00:00:00','2016-08-23 01:00:00','2016-08-23 00:00:00','2016-08-23 01:00:00',0.00,NULL,8,0,0,0,0,'2016-08-23 00:00:00',0,1,0,'completed',11,231,NULL,NULL,NULL,NULL,NULL,NULL,'toppcatt22',1,0,'2016-08-09 19:53:37','2016-08-23 01:00:01'),(381,'Introduction to the Colchester Bantam 2000 metal lathe','Learn about the operational basics of the machine shop\'s Colchester Bantam 2000 lathe, its capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe includes:\r\n\r\nSome safety pointers and cautions\r\nDescription of the various parts of this lathe\r\nLoading the work piece\r\nSelecting and loading cutting tools; what is \"turning\", \"facing\" and \"boring\"\r\nSelecting and setting the rotational direction and speed of the spindle\r\nUses of the tail stock\r\nHow to set the automatic feeds on each the saddle and the cross side\r\nHow to set the angle of the compound\r\nThe use of the micrometers\r\n\r\nClass will include one hour in the lecture hall followed by an hour at the lathe in the machine shop.','Safety glasses must be worn in the machine shop whenever machinery is in use.  NOTE:  The machine shop area can be a bit grimy.','2016-08-28 15:00:00','2016-08-28 17:00:00','2016-08-28 14:45:00','2016-08-28 17:00:00',0.00,NULL,0,0,0,0,0,'2016-08-28 15:00:00',0,1,0,'completed',9,235,NULL,NULL,NULL,NULL,NULL,NULL,'bobkarnaugh',1,0,'2016-08-09 23:12:04','2016-08-28 17:00:01'),(382,'Making a Leather Bi-fold Card Wallet','We will make a leather bifold card wallet you get to keep.','During this 2 hour class we will be making a Leather Bi-fold Card Wallet that you will get to keep. \r\n\r\nClass Size:\r\n- There is a class limit of 5 so we have enough tools and time for everyone to complete their project. \r\n\r\nTime:\r\n- This process will take 1-2 hours depending on the leather option chosen. (Dyeing leather will take longer)\r\n\r\nCost:\r\n- The class is free and we will be using DMS leather and thread. This leather can be dyed any available color, and will use black thread for stitching.\r\n- I will also have Premium materials available for $15. This includes a piece of Horween Leather and either Ritza 25 Tiger thread or Maine Thread Company thread for stitching. The Premium material upgrade is completely optional, and the fee covers my cost as this is coming out of my personal stock. \r\n\r\nTechniques:\r\nYou will learn a few different techniques that can be applied to multiple leather crafting projects.\r\n- Cutting Leather \r\n- Using a Stitch Groover\r\n- Saddle Stitching\r\n- Dyeing Leather (Free Option)\r\n- Burnishing Edges\r\n- Finishing Leather (Free Option)','We will be using leather dye, so wear something you don\'t mind staining in case there is an accident. There are aprons available, but better to be safe than sorry.\r\n\r\n I will also have Premium materials available for $15. If you choose to upgrade to the Premium Materials I will accept cash or PayPal. You will also get to choose from the 10 different colors of thread I have. ','2016-08-21 13:30:00','2016-08-21 15:30:00','2016-08-21 13:00:00','2016-08-21 16:00:00',0.00,NULL,5,0,0,16,0,'2016-08-18 13:30:00',0,1,0,'completed',5,60,NULL,NULL,NULL,NULL,NULL,NULL,'webdevel',1,0,'2016-08-10 00:01:38','2016-08-21 15:30:01'),(383,'Learn to use the sewing machines','Learn to use our 5 new sewing machines or bring your own.   Basic sewing techniques,  materials will be provided.   limit of 5 students to be able to use the DMS sewing machines','Content includes Threading the machines, winding bobbins, picking the right stitch for the job and sewing straight lines. ','','2016-09-22 00:00:00','2016-09-22 02:00:00','2016-09-21 23:45:00','2016-09-22 02:15:00',0.00,NULL,7,0,0,13,0,'2016-09-22 00:00:00',0,1,0,'completed',11,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-08-10 17:15:48','2016-09-22 02:00:01'),(384,'Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','All visitors must sign liability waiver in front lobby.','2016-09-17 16:00:00','2016-09-18 00:00:00','2016-09-17 15:00:00','2016-09-18 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,0,'completed',8,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-08-10 17:56:56','2016-09-18 00:00:01'),(385,'Pinball PARTY!','Pinball by Dallas Makerspace VECTOR committee ','Open play pinball machines all day long!\r\n\r\nThe Dallas Makerspace VECTOR committee focuses on technologies developed from the turn of the 20th century onward and specifically electro-mechanical pinball machines.  \r\n\r\nVECTOR provides a place to learn, restore, experiment, and build \"arcade tech\" and encourages the development of new unique projects.\r\n\r\n\r\n','All visitors must sign liability waiver in front lobby.','2016-09-17 16:00:00','2016-09-17 22:00:00','2016-09-17 15:00:00','2016-09-17 23:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,0,'completed',11,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-08-10 18:01:51','2016-09-17 22:00:01'),(386,'Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','All visitors must sign liability waiver in front lobby.','2016-09-17 16:00:00','2016-09-18 00:00:00','2016-09-17 15:00:00','2016-09-18 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,0,'cancelled',9,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',0,0,'2016-08-10 18:28:10','2016-09-10 20:42:39'),(387,'Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','Dallas Makerspace Anniversary Open House','All visitors must sign liability waiver in front lobby.','2016-09-17 16:00:00','2016-09-18 00:00:00','2016-09-17 15:00:00','2016-09-18 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,0,'completed',4,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-08-10 18:31:25','2016-09-18 00:00:01'),(388,'Creative Arts - Disco Style ','Blocking off the rooms for Creative Arts Demo ','Come by and see demonstrations and explanations of how Creative Arts is woven into the workings of a makerspace. Different demos during the day and at the time of this posting I\'m unsure of that exact schedule. ','','2016-09-17 06:00:00','2016-09-17 07:00:00','2016-09-17 06:00:00','2016-09-17 07:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 06:00:00',0,1,0,'cancelled',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',0,0,'2016-08-10 20:48:59','2016-08-22 02:30:59'),(389,'CA cleanout/organization party (cancelled - moved to Friday) ','Need bodies on the ground to make our room the best possible example of what it can be ','Depending on the progress from the paint party we might be touching up/still painting some of the walls so be prepared for that to potentially happen. I need people who are willing to work independently and clean like they\'ve never cleaned before. \r\n\r\nA to-do list will be available','','2016-09-14 22:00:00','2016-09-15 02:00:00','2016-09-14 22:00:00','2016-09-15 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-14 22:00:00',0,1,0,'completed',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-08-10 20:52:48','2016-09-15 02:00:01'),(390,'Jewelry: Silver Ring Fabrication','Silversmithing 101 - Create a basic sterling silver ring from scratch!','With an overview of basic jewelery making tools and techniques, you will work with raw sterling silver casting grain and transform it into a classic style band much like a wedding band. \r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 5 to 6 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using 14K white, yellow or rose gold. ','Please wear closed toe shoes and pants. Aprons, eye protection, and dust masks will be provided along with all other necessary supplies.','2016-08-21 19:00:00','2016-08-22 01:00:00','2016-08-21 18:30:00','2016-08-22 01:30:00',75.00,NULL,0,5,0,0,0,'2016-08-21 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-08-10 20:57:22','2016-08-19 22:25:58'),(391,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-18 00:00:00','2016-08-18 02:00:00','2016-08-18 00:00:00','2016-08-18 02:00:00',0.00,NULL,0,0,0,16,1,'2016-08-18 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-10 21:39:31','2016-08-18 02:00:02'),(392,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n\r\n','','2016-08-17 23:00:00','2016-08-18 00:00:00','2016-08-17 22:45:00','2016-08-18 00:00:00',0.00,NULL,0,0,0,0,1,'2016-08-17 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-10 21:41:36','2016-08-18 00:00:01'),(393,'Circle Of One Rehearsal ','rehearsal and Film Planning meeting','Actor Rehearsal for short film \"Circle of One\"','','2016-08-12 23:17:00','2016-08-13 02:17:00','2016-08-12 22:32:00','2016-08-13 02:17:00',0.00,NULL,0,0,0,0,0,'2016-08-12 23:17:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-10 23:16:31','2016-08-13 02:20:02'),(394,'Production Meeting','Setup for Film Crew events','Discuss the upcoming events and competitions','','2016-08-18 01:00:00','2016-08-18 04:00:00','2016-08-18 01:00:00','2016-08-18 04:00:00',0.00,NULL,0,0,0,0,0,'2016-08-18 01:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-10 23:20:36','2016-08-18 04:00:01'),(395,'Production Meeting','Planning for DFC events and Competitions','Planning, discussion, and improvements for DFC','','2016-08-25 01:00:00','2016-08-25 04:00:00','2016-08-25 01:00:00','2016-08-25 04:00:00',0.00,NULL,0,0,0,0,0,'2016-08-25 01:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-10 23:26:30','2016-08-25 04:00:01'),(396,'PhotoShop 101','basics class','this class will be going over the basics of Photoshop, I will be covering the basic tools and functions of Photoshop. from pixel aspect ratio, to file format, and basic masking techniques. \r\n\r\nthis class is also for those who have missed the last class. I also relized that my time for the slot was bad, due to traffic.  hopefully this will help with that problem. ','','2016-08-31 00:00:00','2016-08-31 03:00:00','2016-08-30 23:45:00','2016-08-31 03:00:00',0.00,NULL,10,0,0,18,0,'2016-08-31 00:00:00',0,1,0,'completed',9,122,NULL,NULL,NULL,NULL,NULL,NULL,'daydream',1,0,'2016-08-10 23:47:43','2016-08-31 03:00:02'),(397,'Alex Messer\'s Eagle Project [Stage 3]','Final assembly day of the cabinets.','In the previous work days we have dimensioned and cut the lumber, today we will be drilling holes for wood plugs and assembling both cabinets.\r\n\r\nAnyone is welcome to join, food and drinks will be provided for all volunteers. ','','2016-08-28 13:00:00','2016-08-28 17:45:00','2016-08-28 13:00:00','2016-08-28 17:45:00',0.00,NULL,10,0,0,0,0,'2016-08-27 13:00:00',0,1,0,'completed',8,244,NULL,NULL,NULL,NULL,NULL,NULL,'amesser',1,0,'2016-08-11 01:53:34','2016-08-28 17:45:01'),(398,'DIY Microscope','Build your own microscope using your smartphone camera.','Build your own microscope stand and use your smartphone camera as an eyepiece lens. The cost of class is in materials.','','2016-08-21 20:00:00','2016-08-21 21:00:00','2016-08-21 19:45:00','2016-08-21 21:00:00',12.00,NULL,0,12,0,0,0,'2016-08-21 20:00:00',0,1,0,'cancelled',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-11 04:13:22','2016-08-11 04:13:53'),(399,'DIY Microscope','Build your own Microscope stand and use your Smart phone as an eyepiece lens','A simple DIY Science project. When finished you will be able to use your camera as an eyepiece lens to observe cells, hair follicles and plant stems! \r\n\r\nThe cost covers the materials. ','','2016-08-21 20:00:00','2016-08-21 21:00:00','2016-08-21 19:45:00','2016-08-21 21:00:00',12.00,NULL,0,12,0,0,0,'2016-08-21 20:00:00',0,1,0,'cancelled',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-11 04:18:35','2016-08-11 19:06:58'),(400,'Open Source Saturday','Neeeerds!  Informal/loosely structured but social group that demos and uses all manner of open technologies.  Also lunch.','First Saturday of every month, with exceptions for conflicting holidays.\r\n\r\nWe are a group of some serious, and some not-so-serious, geeks that want to see the Open Source Ethos spread and help as many people as will let it.  During the meetings, which are pretty much an excuse to get together and have fun, we catch up on topical and industry news, projects, code releases, recent technical problems and solutions...\r\n\r\nThere are sometimes presentations - anything open source but if it is software then running on more than 1 platform is preferred (Linux, Mac, Win, etc.).  Mobile is an exception due to Apple\'s refusal to let FOSS code onto their IOS platform - so we talk about Android a lot more.\r\n\r\nIf you have an itch to scratch that can be solved by technology, bring it on in!  You well always get an educated opinion and sometimes a useful answer too.  The group is not homogeneous around one specific technology, or industry, or language or nationality.  What we have in common is our desire to make our lives better, and the set of people in \"our\" is everyone, everywhere.\r\n\r\nJoin us afterwards for lunch! Hope you have a hunger for adventure. ;)\r\n\r\n98.519% Geek content by volume.','','2016-09-03 15:00:00','2016-09-03 17:00:00','2016-09-03 14:45:00','2016-09-03 17:00:00',0.00,NULL,0,0,0,13,0,'2016-09-03 15:00:00',0,1,0,'completed',9,22,NULL,NULL,NULL,NULL,NULL,NULL,'jfields',1,0,'2016-08-11 04:27:55','2016-09-03 17:00:01'),(401,'Raman Build','Building a Raman Spectrometer for the Space','The damn thing\'s aligned, let\'s take a spectrum!','','2016-08-16 00:00:00','2016-08-16 02:00:00','2016-08-16 00:00:00','2016-08-16 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-16 00:00:00',0,1,0,'completed',4,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-08-11 15:51:23','2016-08-16 02:00:01'),(402,'Special FX Makeup 101  This will be a beginner to intermediate class for special','This will be a beginner to intermediate class for special effects and character makeup. ','Special FX Makeup 101\r\nNote: this is the for the class Mis-scheduled for Saturday the 13th. \r\nThis will be a beginner to intermediate class for special effects and character makeup. We will be covering the following at a fairly high-level.\r\n\r\n- tools of the trade (airbrush types, brushes, sponges, liquid latex, adhesives, powders, crepe hair, etc)\r\n- makeup types (creams, alcohol activated, pax paint, etc)\r\n- selecting a color palette for your project (which also includes highlights, shadows, etc)\r\n- applying (sponge, brush, airbrushing, blending, stippling, freckling, splattering, etc)\r\n- laying facial hair\r\n- out of the kit effects (scarring, trauma effects, blood, etc)\r\n- using pre-made prosthetics (attaching, hiding edges, painting, etc)\r\n- common mistakes and pitfalls of beginners and what to avoid.\r\n- Q&A\r\n','Make-up class, wear clothes that can get messy.  Folks sensitive to allergens be aware ','2016-08-14 23:00:00','2016-08-15 01:30:00','2016-08-14 23:00:00','2016-08-15 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-14 23:00:00',0,1,1,'completed',8,246,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-08-11 17:48:16','2016-08-15 01:30:02'),(403,'DIY Microscope','Build your own microscope stand using your smartphone','Build your own microscope stand for your smartphone.','','2016-08-21 20:00:00','2016-08-21 21:00:00','2016-08-21 20:00:00','2016-08-21 21:00:00',12.00,NULL,0,12,0,0,0,'2016-08-21 20:00:00',0,1,0,'cancelled',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-11 19:10:57','2016-08-18 02:01:55'),(404,'DMS Woodshop Basics','Required class for using the power tools in the Dallas Makerspace Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nStand-bys are allowed, but class will be strictly limited to 6 people to ensure everyone get the most out of the training and that it ends on time. ','Please bring eye protection, or plan to borrow it from Space. No open toed shoes, dangling jewelry, or gloves. Please pin or tie up long hair. ','2016-08-23 17:00:00','2016-08-23 20:00:00','2016-08-23 17:00:00','2016-08-23 20:00:00',5.00,NULL,0,6,1,18,0,'2016-08-21 17:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-08-12 04:24:47','2016-08-23 20:00:01'),(405,'HAAS Mill Training','Training for HAAS VF2 VMC','NOTE: This class is only available to Dallas Makerspace Members in good standing.\r\n\r\nTraining for HAAS VF2 VMC (Vertical Machining Center).  This class spans 5 sessions.  The 8/31, 9/7, and 9/14 classes will be in the Lecture Hall.  The 9/21 and 9/28 classes will be in the Machine 