m 2000 Metal Lathe for day timers','Learn about the operational basics of the machine shop\'s Colchester Batam 2000 lathe, capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe\r\nIncludes:\r\n\r\nSome safety pointers and cautions\r\ndescription of the various parts of this lathe\r\nloading the work piece\r\nSelecting and loading cutting tools; what is \"turning\", \"facing\" and \"boring\".\r\nSelecting and setting the rotational direction and speed of the spindle\r\nUses of the tail stock\r\nHow to set the automatic feeds on each the saddle and the cross slide\r\nHow to set the angle of the compound\r\nThe use of the micrometers\r\n\r\nClass will include one hour in the lecture hall followed by an hour at the lathe in the machine shop','Safety glasses must be worn in the machine shop whenever machinery is in use.  NOTE:  the machine shop area can be a bit grimy. ','2016-08-24 18:00:00','2016-08-24 20:00:00','2016-08-24 17:45:00','2016-08-24 20:00:00',0.00,NULL,0,0,0,0,0,'2016-08-24 18:00:00',0,1,0,'completed',9,235,NULL,NULL,NULL,NULL,NULL,NULL,'bobkarnaugh',1,0,'2016-08-13 22:14:57','2016-08-24 20:00:01'),(425,'Morningside Table Read','Table read with Tom & Claire','Table read for Short FIlm \"A Trip to Morningside\"','','2016-08-20 15:00:00','2016-08-20 16:00:00','2016-08-20 15:00:00','2016-08-20 16:15:00',0.00,NULL,0,0,0,0,0,'2016-08-20 15:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-14 02:36:53','2016-08-20 16:00:01'),(426,'Rehearsal - Morningside','Rehearsal for actors','A \"Trip to Morningside\" actor Rhearsals','','2016-08-27 15:00:00','2016-08-27 17:30:00','2016-08-27 14:45:00','2016-08-27 17:30:00',0.00,NULL,0,0,0,0,0,'2016-08-27 15:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-14 02:39:58','2016-08-27 17:30:02'),(427,'Shapeoko 2 Basic Training','Basic operation and safety for the Shapeoko 2','Basic operati