purchased lab hardware to do a group-build and generally help each other get pointed in the right direction.\r\n\r\nRelated discussion here: https://talk.dallasmakerspace.org/t/introduction-to-control-system-design-a-first-look/11441','Participants should bring their lab hardware they have purchased. Others are welcome to attend, observe, and ask questions, but please be respectful that we\'re primarily trying to help each other with a class project.','2016-08-17 23:30:00','2016-08-18 01:30:00','2016-08-17 23:30:00','2016-08-18 01:30:00',0.00,NULL,0,0,0,0,0,'2016-08-17 23:30:00',0,1,0,'completed',3,263,NULL,NULL,NULL,NULL,NULL,NULL,'cowboy_dan',1,0,'2016-08-15 21:49:52','2016-08-18 01:30:02'),(432,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-08-26 23:30:00','2016-08-27 02:00:00','2016-08-26 23:30:00','2016-08-27 02:00:00',0.00,NULL,8,0,1,0,0,'2016-08-26 23:30:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-08-16 02:58:31','2016-08-27 02:00:01'),(433,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-08-28 23:00:00','2016-08-29 02:00:00','2016-08-28 22:45:00','2016-08-29 02:00:00',0.00,NULL,8,0,1,0,0,'2016-08-28 23:00:00',0,1,0,'completed',11,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-08-16 03:01:10','2016-08-29 02:00:01'),(434,'Serger 101','Class required before using the Makerspace serger','Class required before using the Makerspace serger','','2016-08-27 16:00:00','2016-08-27 17:00:00','2016-08-27 15:45:00','2016-08-27 17:15:00',0.00,NULL,6,0,0,0,0,'2016-08-26 16:00:00',0,1,0,'completed',5,52,NULL,NULL,NULL,NULL,NULL,NULL,'kriskat30',1,0,'2016-08-16 03:55:15','2016-08-27 17:00:01'),(435,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-08-30 00:00:00','2016-08-30 02:00:00','2016-08-29 23:45:00','2016-08-30 02:15:00',0.00,NULL,0,0,1,0,0,'2016-08-30 00:00:00',0,1,0,'completed',9,189,NULL,NULL,NULL,NULL,NULL,NULL,'eek_kadef',1,0,'2016-08-16 04:37:28','2016-08-30 02:00:01'),(436,'Effective Social Media Marketing for Your Small Business','Effective Social Media Marketing for Your Small Business','Social Media is constantly evolving and as small business owners we must adapt to those changes, QUICKLY. If you want to stay ahead of the game and learn how to continue to grow your business via social media, this class is for you!  If you want to build brand awareness, grow your audience, create a buzz and increase your sales this is the class for you. Social Media is one of the best tools to use to help grow your business. From increasing brand awareness to driving sales, social media can help you spread the word about your small business. Whether you have owned a business for 2 weeks or 10 years, there is always something to learn about marketing your business via social media.\r\nIn this class you will \r\nLearn How to Leverage Instagram, Twitter, Facebook and Snapchat for Business\r\nLearn which Social Media Platforms are Right for Your Business\r\nLearn How to Manage Your Social Media Accounts (Scheduling Posts, Content Help, Etc)\r\nLearn How to Grow An Audience of Engaged Followers\r\nLearn About Sponsored Ads on Instagram, Facebook and Twitter\r\nLearn How to Grow/Increase Sales on Social Media \r\nAnd that\'s just the tip of the iceberg. Learning how to make social media work for you is essential to the success of your business. Please bring your notepad, pen, laptop/tablet, your log in and password for all current social media accounts and your willingness to learn!!\r\n\r\nClass is $25. Register at the following link:\r\nhttps://www.eventbrite.com/e/effective-social-media-marketing-or-your-small-business-tickets-27091930694','','2016-08-27 18:00:00','2016-08-27 20:30:00','2016-08-27 18:00:00','2016-08-27 20:30:00',0.00,NULL,0,0,0,0,0,'2016-08-27 18:00:00',0,1,0,'completed',11,109,NULL,NULL,NULL,NULL,NULL,NULL,'abneysc',1,0,'2016-08-16 14:33:51','2016-08-27 20:30:01'),(437,'Introduction to the Colchester Bantam 2000 Metal Lathe for day timers','Learn about the operational basics of the machine shop\'s Colchester Batam 2000 lathe, capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe\r\nIncludes:\r\n\r\nSome safety pointers and cautions\r\nDescription of the various parts of this lathe\r\nLoading the work piece\r\nSelecting and loading cutting tools for \"turning/facing\", \"boring\", \"knurling\" and \"separation\"\r\nSelecting and setting the speed and rotational direction of the spindle.\r\nUses of the tail stock\r\nHow to set the angle of the compound\r\nHow to set the automatic feeds on the saddle and the cross slide\r\nThe use of the micrometers\r\n\r\nClass will include one hour in the lecture hall followed by an hour at the lathe in the machine shop','Safety glasses must be worn in the machine shop whenever machinery is in use.  Note: The machine shop area can be a bit grimy.','2016-08-31 18:00:00','2016-08-31 19:00:00','2016-08-31 17:45:00','2016-08-31 19:00:00',0.00,NULL,0,0,0,0,0,'2016-08-31 18:00:00',0,1,0,'cancelled',9,235,NULL,NULL,NULL,NULL,NULL,NULL,'bobkarnaugh',0,0,'2016-08-16 15:35:42','2016-08-19 14:10:58'),(438,'Dallas Area Robot Combat Monthly Meeting','DARC September Meeting','DARC September Meeting','','2016-09-04 17:00:00','2016-09-04 19:00:00','2016-09-04 17:00:00','2016-09-04 19:00:00',0.00,NULL,0,0,0,0,0,'2016-09-04 17:00:00',0,1,0,'completed',8,111,NULL,NULL,NULL,NULL,NULL,NULL,'cd_morris',1,0,'2016-08-16 15:53:48','2016-09-04 19:00:01'),(439,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-24 23:00:00','2016-08-25 00:00:00','2016-08-24 22:45:00','2016-08-25 00:00:00',10.00,NULL,0,6,0,16,1,'2016-08-24 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-16 17:59:52','2016-08-25 00:00:01'),(440,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-25 00:00:00','2016-08-25 02:00:00','2016-08-25 00:00:00','2016-08-25 02:00:00',20.00,NULL,0,8,0,0,1,'2016-08-25 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-16 18:03:56','2016-08-25 02:00:02'),(441,'North Texas SolidWorks User Group Meeting','Come out an join the North Texas SolidWorks group. We will have 2 technical presentations scheduled for the night','Host:  Christie Buresh\r\nContact:  Christie.Reed@Gmail.com\r\n\r\nCome out an join the North Texas SolidWorks group. We will have 2 technical presentations scheduled for the night. This is a great opportunity for free Soldworks CAD training and a great Networking event.  I will send the agenda out in a couple of weeks. Please RSVP to ntswug@gmail.com I need a headcount to make sure we have enough seating and food for the event. \r\nChristie Buresh\r\nThomas Allsup','','2016-08-16 22:30:00','2016-08-17 02:00:00','2016-08-16 22:30:00','2016-08-17 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-16 22:30:00',0,1,1,'completed',9,267,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-16 19:39:11','2016-08-17 02:00:01'),(442,'Robot Builders Night Out (RBNO)','Weekly Robotics Builders Meetup','Bring your robot and join us for an informal evening of robot building. Get help with your robotics project or help others with their projects.','','2016-12-06 23:30:00','2016-12-07 05:59:00','2016-12-06 23:30:00','2016-12-07 05:59:00',0.00,NULL,0,0,0,0,0,'2016-12-06 23:30:00',0,1,1,'cancelled',8,268,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',0,0,'2016-08-16 22:29:08','2016-08-16 22:39:35'),(443,'Robot Builders Night Out (RBNO)','Weekly Robotics Builders Meetup','Bring your robot and join us for an informal evening of robot building. Get help with your robotics project or help others with their projects.','','2016-12-13 23:30:00','2016-12-14 05:59:00','2016-12-13 23:30:00','2016-12-14 05:59:00',0.00,NULL,0,0,0,0,0,'2016-12-13 23:30:00',0,1,1,'cancelled',8,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',0,0,'2016-08-16 22:31:44','2016-08-16 22:34:33'),(444,'Robot Builders Night Out (RBNO)','Weekly Robotics Builders Meetup','Bring your robot and join us for an informal evening of robot building. Get h