r robotics project or help others with their projects.','','2016-12-27 23:00:00','2016-12-28 05:59:00','2016-12-27 23:00:00','2016-12-28 05:59:00',0.00,NULL,0,0,0,0,0,'2016-12-27 23:00:00',0,1,1,'approved',8,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',0,0,'2016-08-17 01:52:05','2016-08-17 01:52:39'),(471,'Linux Install Project & Monthly Meeting','The Linux Install Project helps people install Linux operating systems and the monthly meeting includes discussion and presentations.','The Linux Install Project (9AM-11AM) provides assistance to people who want to install Linux operating systems on laptops, desktops, and servers.  Almost any computer can run some form of Linux.  Bring that old SP machine to the meeting and give it a new lease on life!  Please see our website at www.ntlug.org for information on what to do if you want to install Linux.\r\n\r\nThe monthly meeting (11AM-12PM) includes discussion and presentations on Linux systems.','Please see our website at www.ntlug.org for information on what to do if you want to install Linux.','2016-08-20 14:00:00','2016-08-20 17:01:00','2016-08-20 14:00:00','2016-08-20 17:01:00',0.00,NULL,0,0,0,0,0,'2016-08-20 14:00:00',0,1,0,'completed',8,25,NULL,NULL,NULL,NULL,NULL,NULL,'dallasmagna',1,0,'2016-08-17 14:50:31','2016-08-20 17:05:01'),(472,'Linux Install Project & Users Group Monthly Meeting','The Linux Install Project helps people install Linux operating systems and the monthly meeting includes discussion and presentations.','The Linux Install Project (9AM-11AM) provides assistance to people who want to install Linux operating systems on laptops, desktops, and servers. Almost any computer can run some form of Linux. Bring that old SP machine to the meeting and give it a new lease on life! Please see our website at www.ntlug.org for information on what to do if you want to install Linux.\r\n\r\nThe monthly meeting (11AM-12PM) includes discussion and presentations on Linux systems.\r\n','Please see our website at www.ntlug.org for information on what to do if you want to install Linux.','2016-10-15 14:00:00','2016-10-15 17:01:00','2016-10-15 14:00:00','2016-10-15 17:01:00',0.00,NULL,0,0,0,0,0,'2016-10-15 14:00:00',0,1,0,'completed',8,25,NULL,NULL,NULL,NULL,NULL,NULL,'dallasmagna',1,0,'2016-08-17 16:21:29','2016-10-15 17:05:01'),(473,'No Stress All Mess: You drink, you dye (easy cheesy tie-dye)','Learn about different techniques of tie-dye pattern making ','It\'s a return to the ways of building community and having some fun while doing so! \r\nLearn about different tie-dye pattern making techniques and create a tie-dye shirt to take home to wear. This would be a fun little thing to do for a date night or family event - not complex and high success. This will be a kid friendly event as long as they are with an adult. \r\n\r\nFee includes 1 shirt please email: uglyknees@me.com with your shirt size (and quantity if you want to make more) If you don\'t email I can\'t assure I will have your size at the event. \r\nShirts will be either hanes or whatever they sell at Hobby Lobby. Feel free to bring socks to match. ','Dye stains clothing- please wear something you want \"embellished\" or put on one of our many aprons. This is not high end shibori dying techniques - this is just to have some fun and learn a thing or two. ','2016-09-07 23:00:00','2016-09-08 01:00:00','2016-09-07 22:30:00','2016-09-08 01:15:00',6.00,NULL,0,15,0,0,0,'2016-09-04 23:00:00',0,1,0,'completed',8,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-08-17 21:23:13','2016-09-08 01:00:01'),(474,'Millennium Technology Science Discussion','Discussion of science and technology that is not normally covered in the media or taught in school. Bring your info to share or just join in on the discussion.  Open to all.','Discussion of science and technology that is not normally covered in the media or taught in school. Bring your info to share or just join in on the discussion.  Open to all.','','2016-09-15 23:30:00','2016-09-16 00:30:00','2016-09-15 23:30:00','2016-09-16 00:30:00',0.00,NULL,0,0,0,0,0,'2016-09-15 23:30:00',0,1,0,'completed',8,273,NULL,NULL,NULL,NULL,NULL,NULL,'benhere',1,0,'2016-08-18 00:47:24','2016-09-16 00:30:01'),(475,'Millennium Technology Science Discussion','Discussion of science and technology that is not normally covered in the media or taught in school.  Open to all.','Discussion of science and technology that is not normally covered in the media or taught in school.  Open to all.','','2016-08-19 00:00:00','2016-08-19 01:00:00','2016-08-19 00:00:00','2016-08-19 01:00:00',0.00,NULL,0,0,0,0,0,'2016-08-19 00:00:00',0,1,0,'completed',11,273,NULL,NULL,NULL,NULL,NULL,NULL,'benhere',1,0,'2016-08-18 00:59:04','2016-08-19 01:00:01'),(476,'Button Making Mania ','Learn how to make a 1\" button with the button machine ','Come down and learn how to maintain the machine and make some beautiful buttons. ','Bring some small images if you would like .  All visitors must sign liability waiver in front lobby.','2016-09-17 18:00:00','2016-09-17 21:00:00','2016-09-17 18:00:00','2016-09-17 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 18:00:00',0,1,0,'completed',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-08-18 03:44:57','2016-09-17 21:00:01'),(477,'Etching Stainless Steel Tumblers','Going through the process of etching stainless steel tumblers','We will be going through the processes of vinyl cutting (experience on the vinyl cutter not required), masking the tumbler, and etching via sandblasting.\r\n\r\nYou will come away with your own, personalized, vacuum insulated stainless steel tumbler (Ozark Trail)\r\n\r\nPlease have a design in mind before the class, an SVG or AI file would be perfect.\r\n','Note, you will be using the sandblaster in the metal shop. We will have safety equipment available but you will still get dirty.  Wear old clothing','2016-09-08 23:30:00','2016-09-09 02:00:00','2016-09-08 23:30:00','2016-09-09 02:00:00',15.00,NULL,0,4,0,0,0,'2016-09-01 23:30:00',0,1,0,'completed',5,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',1,0,'2016-08-18 04:12:17','2016-09-09 02:00:02'),(478,'Etching Stainless Steel Tumblers','Going through the process of etching stainless steel tumblers','We will be going through the processes of vinyl cutting (experience on the vinyl cutter not required), masking the tumbler, and etching via sandblasting.\r\n\r\nYou will come away with your own, personalized, vacuum insulated stainless steel tumbler (Ozark Trail)\r\n\r\nPlease have a design in mind before the class, an SVG or AI file would be perfect.','Note, you will be using the sandblaster in the metal shop. We will have safety equipment available but you will still get very dirty.  Wear old clothing','2016-09-11 22:00:00','2016-09-12 01:00:00','2016-09-11 22:00:00','2016-09-12 01:00:00',15.00,NULL,0,4,0,0,0,'2016-09-04 22:00:00',0,1,0,'completed',5,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',1,0,'2016-08-18 04:20:11','2016-09-12 01:00:01'),(479,'Silversmithing Jewelry:  Silver Pendant Fabrication','This is a workshop where you will learn and make a pendant in silver with a bezel set stone','This is a workshop where you will learn how to design and make a pendant with a bezel set stone in silver.  First you will start by designing around your stone and making a bezel setting for it, then picking what shape or form you like,  planning how you want it hang with a bail and then you will proceed to cutting out your pendant.  Depending on how you wish to create your piece you will then continue on with other steps like filing, sanding , soldering, stamping in designs, adding cut out designs and however you wish to finish your pendant including the polishing.  \r\n\r\nWe will be creating the pendant in fine silver and sterling silver.  You will be able to choose from a variety of cabochons.\r\n\r\nCome learn how and create your own pendant in Silver :)','Please wear closed toe shoes, pants and if you have long hair bring a hair tie to protect your hair when using a torch.','2016-08-28 16:00:00','2016-08-28 23:00:00','2016-08-28 16:00:00','2016-08-28 23:00:00',75.00,NULL,0,6,0,16,0,'2016-08-28 16:00:00',0,1,0,'completed',26,124,NULL,NULL,NULL,NULL,NULL,NULL,'katiri',1,0,'2016-08-18 07:12:34','2016-08-28 23:00:01'),(480,'3d printing class','3d printing class','printing class for use of 3d printers at the space. ','','2016-09-02 02:00:00','2016-09-02 04:00:00','2016-09-02 01:30:00','2016-09-02 04:30:00',0.00,NULL,0,0,1,16,0,'2016-09-02 02:00:00',0,1,0,'completed',9,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-08-18 07:51:20','2016-09-02 04:00:01'),(481,'How to Print with Ninjaflex','Learn how to use Ninjaflex (flexible TPU filament) at 3D fab.','Learn how to use Ninjaflex (flexible TPU filament) at 3D fab.','','2016-09-02 04:00:00','2016-09-02 05:00:00','2016-09-02 04:00:00','2016-09-02 05:00:00',0.00,NULL,10,0,1,0,0,'2016-09-02 04:00:00',0,1,0,'completed',1,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-08-18 07:55:50','2016-09-02 05:00:01'),(482,'3D Printer Basics','This is the prerequisite class for using the 3D printers','Short class on how to use the Polyprinter 3d printers, we will go over modeling, slicing, and printing. This is a must class for using the 3D printing lab.','','2016-08-29 18:00:00','2016-08-29 19:30:00','2016-08-29 18:00:00','2016-08-29 19:30:00',0.00,NULL,5,0,1,16,0,'2016-08-29 18:00:00',0,1,0,'completed',1,70,1,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-08-18 17:00:22','2016-08-29 19:30:01'),(483,'Science Meeting','Discuss upcoming and ongoing projects.','Discussing projects, classes, administration, fume hood and other equipment needs.','','2016-09-07 00:00:00','2016-09-08 00:30:00','2016-09-07 00:00:00','2016-09-08 00:30:00',0.00,NULL,0,0,0,0,0,'2016-09-07 00:00:00',0,1,0,'cancelled',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-18 21:12:24','2016-08-18 21:13:53'),(484,'Science Meeting','Discussing upcoming and current projects/classes.','Discussing upcoming and current projects/classes.','','2016-09-06 23:30:00','2016-09-07 00:30:00','2016-09-06 23:30:00','2016-09-07 00:30:00',0.00,NULL,0,0,0,0,0,'2016-09-06 23:30:00',0,1,0,'cancelled',11,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',0,0,'2016-08-18 21:16:18','2016-08-23 19:01:50'),(485,'ARTEMIS Spaceship Bridge Simulator night','Come and play this immersive LAN party game!','It\'s time to play Artemis again! \r\n\r\nNEW THIS MONTH: Neopixel strips for Ship 2! \r\n\r\nI\'ll also be bringing my DMX-controlled lighting that reacts to events in the game. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Science, Communication, Engineering, and Weapon Control. Together you operate your ship and defend the sector from evil aliens.\" \r\n\r\nWHAT TO BRING: \r\n-You\'ll need your own Windows laptop or PC to play. I have a game license for everyone on one ship. \r\n-Cash for the kind souls buying food/drink is voluntary but appreciated!','','2016-08-27 01:00:00','2016-08-27 04:59:00','2016-08-27 01:00:00','2016-08-27 04:59:00',0.00,NULL,0,0,0,0,0,'2016-08-27 01:00:00',0,1,0,'completed',9,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-18 21:30:57','2016-08-27 05:00:01'),(486,'Air Brush 101','basics class','Hello again, by popular demand I am doing another air brush class but smaller, but dont worry I will be hosting more classes shortly and will post them in DMS talk.\r\nwith good advice from John Gorman. Ive reduced the class to be smaller so I have more one on one time with attendees, this will allow me to show you how to properly take apart the air bush to maintenance it and to clean it correctly. \r\nIn this class ill show how to take apart and clean the air brush\r\nIll discuss the different types of airbrushes.\r\nDiscuss the kind of paint  you should use and should not. \r\nThe different type of compressors. \r\nI will demo how to paint miniatures, nails, and paper. \r\nBut remember this is a basics class. \r\n\r\n8 spaces available \r\n','','2016-09-06 00:00:00','2016-09-06 01:00:00','2016-09-05 23:45:00','2016-09-06 01:00:00',8.00,NULL,0,0,0,18,1,'2016-09-06 00:00:00',0,1,0,'cancelled',11,122,NULL,NULL,NULL,NULL,NULL,NULL,'daydream',0,0,'2016-08-18 21:59:47','2016-08-24 18:03:11'),(487,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-01 00:00:00','2016-09-01 02:00:00','2016-09-01 00:00:00','2016-09-01 02:00:00',20.00,NULL,0,8,0,16,1,'2016-09-01 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-19 03:38:29','2016-09-01 02:00:01'),(488,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-08-31 23:00:00','2016-09-01 00:00:00','2016-08-31 22:45:00','2016-09-01 00:00:00',10.00,NULL,0,6,0,16,0,'2016-08-31 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-08-19 03:40:56','2016-09-01 00:00:02'),(489,'Introduction to the Colchester Bantam 2000 Metal Lathe for day timers','Learn about the operational basics of the machine shop\'s Colchester Batam 2000 lathe, capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe\r\nIncludes:\r\n\r\nSome safety pointers and cautions\r\nDescription of the various parts of this lathe\r\nLoading the work piece\r\nSelecting and loading cutting tools for \"turning/facing\", \"boring\", \"knurling\" and \"separation\"\r\nSelecting and setting the speed and rotational direction of the spindle.\r\nUses of the tail stock\r\nHow to set the angle of the compound\r\nHow to set the automatic feeds on the saddle and the cross slide\r\nThe use of the micrometers\r\n\r\nClass will include one hour in the lecture hall followed by an hour at the lathe in the machine shop','Safety glasses must be worn in the machine shop whenever machinery is in use.  Note: The machine shop can be a bit grimy.','2016-08-31 00:00:00','2016-08-31 02:00:00','2016-08-30 23:45:00','2016-08-31 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-31 00:00:00',0,1,0,'completed',11,235,NULL,NULL,NULL,NULL,NULL,NULL,'bobkarnaugh',1,0,'2016-08-19 14:25:40','2016-08-31 02:00:02'),(490,'Raman Build','Building a Raman Spectrometer for the Space','We\'ll be reviewing how the CCD detector reads out signal to the STM32 and Raspberry Pi, checking out the Peltier cooler action on the CCD, and housing up the new spectrometer chamber.','','2016-08-23 00:00:00','2016-08-23 02:00:00','2016-08-23 00:00:00','2016-08-23 02:00:00',0.00,NULL,0,0,0,0,0,'2016-08-23 00:00:00',0,1,0,'completed',4,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-08-19 19:11:10','2016-08-23 02:00:02'),(491,'The End of Bloody Spiral - Table Read','Table read for cast and crew for the Dallas-based short film \"The End of Bloody Spiral\".','We will be holding a table read for cast and crew of the Dallas-based short film \"The End of Bloody Spiral.\"','','2016-08-27 21:30:00','2016-08-27 22:30:00','2016-08-27 21:15:00','2016-08-27 22:45:00',0.00,NULL,0,0,0,0,0,'2016-08-27 21:30:00',0,1,0,'cancelled',4,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',0,0,'2016-08-19 20:17:35','2016-08-19 20:18:12'),(492,'The End of Bloody Spiral - Table Read','Table read for cast and crew for the Dallas-based short film \"The End of Bloody Spiral\".','We will be holding a table read for cast and crew for the Dallas-based short film \"The End of Bloody Spiral\".','','2016-08-27 21:30:00','2016-08-28 03:00:00','2016-08-27 21:15:00','2016-08-28 03:15:00',0.00,NULL,0,0,0,0,0,'2016-08-27 21:30:00',0,1,0,'cancelled',4,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',0,0,'2016-08-19 20:19:38','2016-08-19 20:22:44'),(493,'The End of Bloody Spiral - Table Read','Table read for cast and crew for the Dallas-based short film \"The End of Bloody Spiral\".','We will be holding a table read for cast and crew for the Dallas-based short film \"The End of Bloody Spiral\".','','2016-08-27 20:45:00','2016-08-28 03:00:00','2016-08-27 20:30:00','2016-08-28 03:15:00',0.00,NULL,0,0,0,0,0,'2016-08-27 20:45:00',0,1,0,'completed',11,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',1,0,'2016-08-19 20:24:23','2016-08-28 03:00:01'),(494,'Ingress Meetup','Ingress Resistance meetup 11am-5:30pm','Ingress Resistance meetup 11:30am-5:30pm\r\nTour of the MakerSpace included.','','2016-08-27 16:30:00','2016-08-27 17:30:00','2016-08-27 16:30:00','2016-08-27 17:30:00',0.00,NULL,0,0,0,0,0,'2016-08-27 16:30:00',0,1,0,'completed',3,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-08-19 23:23:54','2016-08-27 17:30:02'),(495,'Making bamboo fusion paper/fabric','Use unspun dyed bamboo fiber bonded with textile medium to create bamboo paper/fabric for use in art projects and sewing','We will be using unspun dyed bamboo fiber (similar to silk) to create a paper or fabric similar to felted look, but bonded with textile medium. The finished paper/fabric  can be made different thicknesses and is strong enough to be used as you would paper for covering objects, sewn as if fabric, or made thicker for harder wearing uses like book covers. It can also be formed into bowls, lampshades, and other shapes.  The method we\'ll use works with fine loose fibers for hand-spinning such as silk, bamboo, and soy silk. \r\n\r\nWe will be making a couple of flat pieces sufficient to cover a small object or two, be cut up, sewn, etc.  We will also discuss usage ideas.  \r\n\r\nThis class is ONLY for making the paper/fabric. It will need time to dry thoroughly before being used.  You can jump off on your own from there, or come to the project class.\r\n\r\nSEPT 13, there will be a SEPARATE upcoming class to use what you make in this one.  We will be covering a small box in the second class.\r\n\r\nNote: We will likely have time the second part of this class if you want to make additional pieces, for extra materials cost.\r\n\r\n***For initial class project, bring a $5 supply fee and wear old clothes. \r\n\r\n***Bring extra money for additional materials if you will want to make more than initial project ($3-6 should be enough for most extras)\r\n\r\nView attached image for more detail\r\n--upper left is loose bamboo fiber\r\n--lower right is just finished paper \r\n--the book cover was made 15+ years ago, has seen hard wear and has held up well other than dirty :)\r\n--the dark purple/red on right was the background for my 10x10 project from last year\r\n--bottom left is a small box covered in purple/green and what we\'ll be doing in the upcoming project-based class \r\n\r\nFeel free to contact me with questions\r\nkyrithia@hotmail.com \r\ntext 469-831-0916','Wear old clothing\r\n\r\nBring $5 supply fee for initial project\r\n\r\nOptional: bring $3-6 for additional project if you wish','2016-08-31 00:00:00','2016-08-31 02:00:00','2016-08-30 23:30:00','2016-08-31 02:15:00',0.00,NULL,0,0,0,0,0,'2016-08-31 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-19 23:56:09','2016-08-31 02:00:02'),(496,'Covering a small box with bamboo fusion paper/fabric','We are covering a small box in bamboo fusion paper from previous class (some extra available if you missed it)','This class utilizes the bamboo fusion paper we made in a previous class. We will be learning how to work with it to cover a small box, attach neatly, and how to hide seams.\r\n\r\nBring your bamboo paper/fabric you made in the previous class. All other tools and materials provided.\r\n\r\nSupply fee is $2, which covers the box and other materials. You provide your bamboo fusion paper you created previously.\r\n\r\n**If you missed the previous class to make your own paper, there will be a limited amount of bamboo fusion paper available for an additional $2 each, so come anyway :)\r\n\r\n**See attached image for view of the project.  \r\nShown is the bamboo fusion, the finished covered box from a couple views, and initial under-painting. Note, I may pre-paint the boxes for class. But this is a step.\r\n\r\nThis overall technique would work for covering a box in fabric or art paper as well.\r\n\r\nWear old clothes. We\'re playing with glue.\r\n\r\nFeel free to contact me with any questions\r\nkyrithia@hotmail.com\r\nText 469-831-0916','Wear old clothes\r\n\r\nBring $2 supply fee for box, etc\r\n\r\nBring your previously created bamboo fusion paper\r\n\r\nIf you missed that class and don\'t have any, there will be a limited amount of extras for additional $2 each','2016-09-14 00:00:00','2016-09-14 02:00:00','2016-09-13 23:45:00','2016-09-14 02:15:00',0.00,NULL,0,0,0,0,0,'2016-09-14 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-08-20 00:56:13','2016-09-14 02:00:02'),(497,'Laser Basics','Learn to Laser with the LaserSaur, Thunder, & Epilog Zing','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-09-01 00:00:00','2016-09-01 02:00:00','2016-09-01 00:00:00','2016-09-01 02:00:00',0.00,NULL,8,0,1,0,0,'2016-09-01 00:00:00',0,1,0,'completed',11,333,NULL,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-08-20 17:10:27','2016-09-01 02:00:01'),(498,'Lathe Basics','Learn to safely use the lathes in the Woodshop.','Learn to safely use the lathes in the Woodshop.','','2016-08-31 17:00:00','2016-08-31 19:00:00','2016-08-31 16:30:00','2016-08-31 19:00:00',5.00,NULL,0,6,1,16,0,'2016-08-31 17:00:00',0,1,0,'completed',13,48,NULL,NULL,NULL,NULL,NULL,NULL,'talkers',1,0,'2016-08-20 18:49:37','2016-08-31 19:00:01'),(499,'sdf/3wa','watch and discuss  new anime',' 	watch and discuss new anime','','2016-10-15 17:00:00','2016-10-15 22:00:00','2016-10-15 17:00:00','2016-10-15 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 17:00:00',0,1,0,'completed',9,27,NULL,NULL,NULL,NULL,NULL,NULL,'captelensar',1,0,'2016-08-20 19:22:21','2016-10-15 22:00:01'),(500,'sdf/3wa',' 	watch and discuss new anime','new anime from funimation, crunchyroll and others ','','2016-11-19 18:00:00','2016-11-19 23:00:00','2016-11-19 18:00:00','2016-11-19 23:00:00',0.00,NULL,0,0,0,0,0,'2016-11-19 18:00:00',0,1,0,'completed',9,27,NULL,NULL,NULL,NULL,NULL,NULL,'captelensar',1,0,'2016-08-20 19:25:12','2016-11-19 23:00:01'),(501,'Oguz Yetkin\'s going away pot luck party','Oguz Yetkin\'s going away pot luck party','Oguz Yetkin and family is going back to Turkey. Lets give him a going home pot luck party.','','2016-08-21 00:00:00','2016-08-21 04:59:00','2016-08-20 23:30:00','2016-08-21 04:59:00',0.00,NULL,0,0,0,0,0,'2016-08-21 00:00:00',0,1,0,'completed',11,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-20 20:17:04','2016-08-21 05:00:01'),(502,'BattleBots filming (Private)','BattleBots filming (Private)','BattleBots filming (Private)','','2016-08-20 21:00:00','2016-08-20 22:00:00','2016-08-20 21:00:00','2016-08-20 22:00:00',0.00,NULL,0,0,0,0,0,'2016-08-20 21:00:00',0,1,0,'completed',4,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-20 20:45:52','2016-08-20 22:00:02'),(503,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.  Major wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  Basic steps of squaring up a rough piece of lumber will be covered via a hands-on approach by walking and talking through the standard process.','You must be over 18+ to attend this class.  Appropriate eye protection is required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.  Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.','2016-08-31 17:00:00','2016-08-31 20:00:00','2016-08-31 17:00:00','2016-08-31 20:00:00',5.00,NULL,0,6,1,18,0,'2016-08-29 17:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-08-21 03:46:01','2016-08-31 20:00:02'),(504,'Fabric cutting, sewing, and serging marathon','Private event-msking stuff for a con artist alley','We\'re gonna be making a big bunch of pillows, throws, and quilts out of flannel and fleece.  Private event, but feel free to stop by and chat...','','2016-09-05 15:00:00','2016-09-06 04:00:00','2016-09-05 15:00:00','2016-09-06 04:00:00',0.00,NULL,1,0,1,0,1,'2016-09-04 15:00:00',0,1,0,'completed',8,354,NULL,NULL,NULL,NULL,NULL,NULL,'hardsuit',1,0,'2016-08-21 15:45:47','2016-09-06 04:00:01'),(505,'Fleece and flannel quilting ','Private event-making stuff for a con artist alley','Just working on a lot of quilts, throws, and pillows in fleece and flannel for sale at an upcoming convention','','2016-08-28 16:00:00','2016-08-28 22:30:00','2016-08-28 16:00:00','2016-08-28 22:30:00',0.00,NULL,1,0,0,0,1,'2016-08-28 16:00:00',0,1,0,'completed',11,0,NULL,NULL,NULL,NULL,NULL,NULL,'hardsuit',1,0,'2016-08-21 20:39:47','2016-08-28 22:30:01'),(506,'Jewelry: Silver Ring Fabrication ','This class will be working with sterling silver to fabricate silver rings!','In this entry level silversmithing workshop you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of jewelry making tools and equipment . \r\n\r\nYou first will figure your ring size and then smelt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using 14K white, yellow or rose gold. \r\n\r\nHope to see you there!\r\n','Please wear closed toe shoes and pants. Safety glasses and aprons will be provided.','2016-09-10 19:00:00','2016-09-11 01:00:00','2016-09-10 18:30:00','2016-09-11 01:30:00',75.00,NULL,1,5,0,0,0,'2016-09-10 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-08-22 00:17:39','2016-09-11 01:00:01'),(507,'Creative Arts - Disco Style ','Come by and see demonstrations and explanations of how Creative Arts is woven into the workings of a Makerspace.','Come by and see demonstrations and explanations of how Creative Arts is woven into the workings of a Makerspace. Different demos during the day and at the time of this posting I\'m unsure of that exact schedule. ','','2016-09-17 16:00:00','2016-09-17 18:00:00','2016-09-17 16:00:00','2016-09-17 18:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,1,'completed',5,300,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-22 02:28:22','2016-09-17 18:00:01'),(508,'Creative Arts - Disco Style ','Come by and see demonstrations and explanations of how Creative Arts is woven into the workings of a Makerspace.','Come by and see demonstrations and explanations of how Creative Arts is woven into the workings of a Makerspace. Different demos during the day and at the time of this posting I\'m unsure of that exact schedule. ','','2016-09-17 21:00:00','2016-09-18 00:00:00','2016-09-17 21:00:00','2016-09-18 00:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 21:00:00',0,1,1,'completed',5,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-08-22 02:30:39','2016-09-18 00:00:01'),(509,'DSC - Inspiration, with Special Guest Thomas Manaugh, PhD','Join Dallas Screenwriting Crew for a Workshop on Finding Inspiration, Staying Motivated, and Following Through with Until Completion.','Dallas Screenwriting Crew is hosting the workshop, \"Find Inspiration\" - Harnessing Creative Power.\r\n\r\nThe purpose of this workshop is to explore the discipline, motivation, and dedication required for creative works, how to harness those powers, and how to follow your dreams.\r\n\r\nI have 100\'s of unfinished projects, works of poetry, music, fiction, screenplays, short stories, and the 100\'s which rattle around in my head like flies in a trash can. Stories that beg to be told; visions that remain figments of imagination.\r\n\r\nThis workshop will explore the techniques, strategies, and goals of the creative process: finding the inspiration and motivation to complete great undertakings in any/every discipline.\r\n\r\nAt the end of this workshop, special guest Thomas Manaugh, PhD, will present his documentary for critique and feedback. THIS WILL BE CAPTURED ON VIDEO for future use in film, and a release will be required to participate in his presentation, signed at the beginning of the workshop.\r\n\r\nIf you have questions, please email danwells11@gmail.com.\r\n\r\nThomas Manaugh, PhD, majored in psychology and minored in chemistry and biology as an undergraduate at the University of California at Berkeley. He earned his doctorate in medical psychology with a minor in anatomy from the Oregon Health Sciences University. Post-graduate education has focused on course work (math, physics, and computer science) that facilitated his work as (a) an educator of college students, (b) a consultant to companies selling environmentally responsible products and equipment, and (c) an inventor who has been awarded three patents, including two dealing with production of green energy. He is currently working on two patent applications for devices that facilitate environmentally responsible processes in the production of desalinated water. He has been a member of several national organizations whose mission has been to protect the environment. In 2014 he co-authored an award-winning entry in a contest sponsored by MIT  an international contest that drew entries from 600 contestants who submitted proposals for projects about coping with climate change.','This workshop will be filmed, and a release will be required to sit in and participate.','2016-09-03 18:00:00','2016-09-03 22:00:00','2016-09-03 17:30:00','2016-09-03 22:30:00',0.00,NULL,0,0,0,0,0,'2016-09-03 18:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-22 03:27:50','2016-09-03 22:00:01'),(510,'Lathe - Bowl turning 101 with traditional gouges','This class will teach the process to create a wood bowl from a solid block of wood.  Students will learn how to use the bowl gouge as the primary tool for creating a bowl.','This class will teach the process to create a wood bowl from a solid block of wood.  Students will learn how to use a 1/2\" bowl gouge as the primary tool for creating a bowl.\r\n\r\nTools and wood will be provided.  If you own woodturning tools please bring them to the class.  If time allows I will show you how to properly sharpen them.\r\n\r\nMaximum class size of 4 students.','','2016-09-14 23:30:00','2016-09-15 02:00:00','2016-09-14 23:30:00','2016-09-15 02:00:00',0.00,NULL,4,0,1,13,0,'2016-09-14 23:30:00',0,1,0,'completed',12,192,NULL,NULL,NULL,NULL,NULL,NULL,'mkart',1,0,'2016-08-22 03:53:32','2016-09-15 02:00:01'),(511,'Making an Adult Coloring Book','We are working on making illustrations for the coloring book.','We are in the process of making an Adult Coloring Book, title to be determined. Start making suggestions!!\r\n\r\nIt seems there will be a chapter called Mermaids since we now have three pages of them in the works. Something to consider if you come and don\'t have an idea of what to draw.\r\n\r\nThe plan so far is to use any profits for future art events such as hiring models for life drawing classes (which I really like because I always covered the bulk of the cost).\r\n\r\nWe have 3 methods of making the pages. One draw with a pencil on bristol and I\'ll scan it and clean it up as needed. Two ink the drawing on bristol and I\'ll scan it. Three make your work in Illustrator or some other vector art program and get that file to me.\r\n\r\nYou are still required to show up to the Coloring Book event in order to be able to participate. But once you have shown up you are welcomed to do your illustrations on your own time.','','2016-08-27 00:00:00','2016-08-27 03:00:00','2016-08-27 00:00:00','2016-08-27 03:00:00',0.00,NULL,0,0,0,0,0,'2016-08-27 00:00:00',0,1,0,'completed',4,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-08-22 03:53:46','2016-08-27 03:00:01'),(512,'Life Drawing Class','Life Drawing is the study of a nude model who will do several poses during the class.','We will be having a life drawing class. This will be more of a practice drawing class than a teaching one, however if you would like some tips/suggestions feel welcomed to ask.\r\n\r\nThe model will be nude. The cost of the class ($10) is to help cover the cost of the model.\r\n\r\nPlease bring your own materials. Anything medium is welcome and long as you clean up after yourself. Bring a drop cloth if you wish to paint.\r\n\r\nWe have small table easels but no large standing easels if you have one feel free to bring it.','','2016-09-10 01:00:00','2016-09-10 04:00:00','2016-09-10 00:30:00','2016-09-10 04:30:00',10.00,NULL,15,0,0,0,0,'2016-09-10 01:00:00',0,1,0,'rejected',5,17,NULL,NULL,NULL,NULL,'bscharff',NULL,'artnerdray',0,0,'2016-08-22 04:09:59','2016-08-25 00:25:21'),(513,'Synthetic Biology/Genetic Engineering','Discuss future Synthetic Biology DIY Projects','I am interested in Synthetic Biology/Metabolic/Genetic Engineering in plants and bacteria. Hoping to find like minds by posting here on Dallas Maker Space, we can start to build a community. \r\nI have several projects in mind, but we can start small like tissue culture, there are CRISPR kits available and I used one recently at the DIY group in Austin, will be going to GenSpace in NYC next month. \r\n\r\nJ.r.melnick@gmail.com\r\n\r\nhttp://www.meetup.com/Dallas-Synthetic-Biology/','','2016-08-31 17: