atomy.\r\n\r\nThe model will be nude. The cost of the class ($10) is to help cover the cost of the model.\r\n\r\nPlease bring your own materials. Any medium is welcome as long as you clean up after yourself. Bring a drop cloth if you wish to paint.\r\n\r\nWe have small table easels but no large standing easels if you have one feel free to bring it.','','2016-09-10 01:00:00','2016-09-10 04:00:00','2016-09-10 00:30:00','2016-09-10 04:30:00',0.00,NULL,0,0,0,0,0,'2016-09-10 01:00:00',0,1,0,'cancelled',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',0,0,'2016-08-25 07:02:59','2016-09-01 12:35:52'),(538,'Freeze Dryer Class','Earn your certification to use the freeze dryer','This class will teach you how to use the freeze dryer.','','2016-09-10 14:00:00','2016-09-10 15:00:00','2016-09-10 13:45:00','2016-09-10 15:00:00',0.00,NULL,0,0,1,0,0,'2016-09-10 14:00:00',0,1,0,'completed',18,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',1,0,'2016-08-25 18:47:03','2016-09-10 15:00:01'),(539,'Embedded Workshop Micro-Controllers','Design and build your own Arduino Shield PCB  From Breadboard to Printed Circuit Board. ','Design and build your own Arduino Shield PCB  From Breadboard to Printed Circuit Board. \r\nCome join us as we explore using several different CAD program to create an Arduino Shield PCB.\r\nWe will look at using Fritzing, Autodesk Circuits, and it time permits Eagle Cad.\r\nExplain how to create a Virtual breadboard circuit, then place components on the schematic and finally how to place components on the PCB. Generate and Download Gerber files to PCB manufactures.   \r\nFor more info go here: www.thecains-group.net\r\nWhat to Bring:  \r\nLaptop computer  Windows  Mac - Linux \r\nIf you plan to attend Please register.\r\n','','2016-09-29 00:00:00','2016-09-29 02:00:00','2016-09-28 23:45:00','2016-09-29 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 00:00:00',0,1,0,'completed',8,174,NULL,NULL,NULL,NULL,NULL,NULL,'microrustyc',1,0,'2016-08-26 01:46:47','2016-09-29 02:00:01'),(540,'