 you will decorate and enamel your own pendant on copper','This is a workshop where you will decorate and enamel  a pendant.  I will have a variety of enamels and items to decorate your pieces.  It will be a fun class and perfect whether you have done enameling before or are brand new to it.\r\n\r\n*Kit fee $10.00 payable to instructor in class','We will need to wear dust masks when working with the enamel powders and keep a clean work area.   I will have masks for everyone but please feel free to bring your own.','2016-09-12 18:00:00','2016-09-12 21:00:00','2016-09-12 17:45:00','2016-09-12 21:15:00',0.00,NULL,4,0,0,0,0,'2016-09-12 18:00:00',0,1,0,'completed',26,124,NULL,NULL,NULL,NULL,NULL,NULL,'katiri',1,0,'2016-08-26 18:47:25','2016-09-12 21:00:01'),(545,'Cuttlebone Casting','This is a  workshop where you will carve a design into Cuttlebone and cast your design in Ancient Bronze','This is a workshop where you will learn how to and then carve your own design into Cuttlebone.  When your design is ready we will melt Ancient Bronze and pour your design into metal.  You will finish it up and have your piece or pieces to take home with you.  Its a fun and fast way to cast and create designs.\r\n\r\n*The kit fee is $15.00 payable to instructor in class','If you have shellfish allergies then this class could possibly agitate your allergy so please attend with caution.  You will also need a dust mask and please wear close toed shoes.','2016-09-13 18:00:00','2016-09-13 22:00:00','2016-09-13 17:45:00','2016-09-13 22:15:00',0.00,NULL,4,0,0,0,0,'2016-09-13 18:00:00',0,1,0,'cancelled',26,124,NULL,NULL,NULL,NULL,NULL,NULL,'katiri',0,0,'2016-08-26 18:55:05','2016-08-31 23:12:21'),(546,'Zentangle Essentials','What is Zentangle? Need an outlet to get in your calm zone and create art at the same time? ','Come spend some \"zen\" time with a Certified Zentangle Teacher making art that you create with paper \"tiles\" and a pen. Participants will receive a Zentangle kit and learn a few