our launch date. The Great Science Space Build-up, Bacteria and Nematode Bioreactor, Carbon Nanomaterial Processes\\Sputtering Deposition Chamber, Weather Station Install, Chicken Embryo Interfacing, Monofilament Muscles, Telepresence Robot, and Automated Habitat Housing for the Xenopus Frog.  We\'re looking for people with expertise in woodworking, carpentry, plastics fabrication, machining, design, web interfacing, circuit electronics, Arduinos, Raspberry Pis,  high-voltage power supplies, RFID systems, aesthetics, bacteriology, biology, meteorology, microbiology, bio engineering, and herpetology.\r\n','','2016-09-10 15:30:00','2016-09-10 17:00:00','2016-09-10 15:30:00','2016-09-10 17:00:00',0.00,NULL,0,0,0,0,0,'2016-09-10 15:30:00',0,1,0,'completed',8,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-08-30 15:45:41','2016-09-10 17:00:01'),(566,'Raman Build','Building a Raman Spectrometer for the Space','We\'re starting off by building a proof of concept Raman spectrometer from acrylic pieces, a 532 nm laser, CCD, Raspberry Pi, Peltier coolers, and a lot of other cool little toys.  From there we\'ll zero in on applications around the space and see what we need to build to go from there.','','2016-09-06 00:00:00','2016-09-06 02:00:00','2016-09-06 00:00:00','2016-09-06 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-06 00:00:00',0,1,0,'completed',4,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-08-30 16:14:05','2016-09-06 02:00:01'),(567,'Raman Build','We\'re buiding a Raman Spectrometer for DMS','We\'re starting off by building a proof of concept Raman spectrometer from acrylic pieces, a 532 nm laser, CCD, Raspberry Pi, Peltier coolers, and a lot of other cool little toys.  From there we\'ll zero in on applications around the space and see what we need to build to go from there.','','2016-09-13 00:00:00','2016-09-13 02:00:00','2016-09-13 00:00:00','2016-09-13 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-13 00:00:00',0,1,0,'completed',4,206,NULL,NULL,NULL,NULL,NULL,NULL,'po