ter and Cable router with fixed base and plunge base, and the ICNRA router table.\r\n\r\nIn this class we will also go over the basics of router bits, jigging, guides, and basic maintenance.\r\n\r\nRouter Basics is also a prerequisite for all INCRA joinery classes and any intermediate level router classes. ','','2016-09-13 00:00:00','2016-09-13 01:00:00','2016-09-13 00:00:00','2016-09-13 01:00:00',0.00,NULL,4,0,1,18,0,'2016-09-11 00:00:00',0,1,0,'completed',13,166,NULL,4,NULL,NULL,NULL,NULL,'hawaiianmike',1,0,'2016-08-31 13:54:52','2016-09-13 01:00:01'),(579,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices. Major wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. Basic steps of squaring up a rough piece of lumber will be covered via a hands-on approach by walking and talking through the standard process.','You must be over 18+ to attend this class. Appropriate eye protection is required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own. Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.','2016-09-12 18:00:00','2016-09-12 21:00:00','2016-09-12 18:00:00','2016-09-12 21:00:00',5.00,NULL,0,5,1,18,0,'2016-09-10 18:00:00',0,1,0,'completed',12,166,4,NULL,NULL,NULL,NULL,NULL,'hawaiianmike',1,0,'2016-08-31 14:03:59','2016-09-12 21:00:01'),(580,'Dallas Film Crew #62','Filmmakers Meeting','Workshops, guest speakers, and hands on experience in several Film projects','','2016-09-11 15:30:00','2016-09-11 21:30:00','2016-09-11 15:30:00','2016-09-11 21:30:00',0.00,NULL,0,0,0,0,0,'2016-09-11 15:30:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:03:57','2016-09-11 21:30:01'),(581,'Dallas Film Crew #63','Filmmakers Meeting','Workshops, guest speakers, and hands on experience in several Film projects','','2016-09-18 15:00:00','2016-09-18 22:00:00','2016-09-18 15:00:00','2016-09-18 22:00:00',0.00,NULL,0,0,0,0,0,'2016-09-18 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:06:13','2016-09-18 22:00:01'),(582,'Dallas Film Crew #64','Filmmakers Meeting','Workshops, guest speakers, and hands on experience in several Film projects','','2016-09-25 15:00:00','2016-09-25 22:00:00','2016-09-25 15:00:00','2016-09-25 22:00:00',0.00,NULL,0,0,0,0,0,'2016-09-25 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:12:41','2016-09-25 22:00:01'),(583,'Dallas Film Crew #65','Filmmakers Meeting','Workshops, guest speakers, and hands on experience in several Film projects','','2016-10-02 15:00:00','2016-10-02 22:00:00','2016-10-02 15:00:00','2016-10-02 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-02 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:13:32','2016-10-02 22:00:01'),(584,'Dallas Film Crew #66','Filmmakers Meeting','10:00 AM Preparation and planning\r\n   1:00 PM Show up to meeting at this time.\r\n\r\nGuest Speaker - Arianne \"Tex\" Thompson\r\n\"The Plate Tectonics Theory of Dialogue\" \r\n\r\nWhen it comes to dialogue, a good scene is a \'geologically active\' one. Like pieces of the Earth\'s crust, characters clash, fold, and buckle as they interact (and yes, sometimes even bump and grind!) In this class, we\'ll analyze the features of real human speech, and how to amplify and manipulate them to suit your purpose. Whether your current scene is as subtle as a tremor or as explosive as an earthquake, we\'ll craft dialogue guaranteed to keep your plot moving, your pages turning, and your audience on their toes.\r\n\r\nArianne \"Tex\" Thompson is home-grown Texas success story. After earning a bachelors degree in history and a masters in literature, she channeled her passion for exciting, innovative, and inclusive fiction into the Children of the Drought  an internationally-published epic fantasy Western series from Solaris. Now a professional writing instructor and editor for the DFW Writers Conference, Tex is blazing a trail through conferences, workshops, and fan conventions around the country  as an endlessly energetic, relentlessly enthusiastic one-woman stampede.\r\n\r\nPlease read more about Tex here - http://www.thetexfiles.com/\r\n','','2016-10-09 15:00:00','2016-10-09 22:00:00','2016-10-09 15:00:00','2016-10-09 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-09 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:14:42','2016-10-09 22:00:01'),(585,'Dallas Film Crew #67','Filmmakers Meeting','Setup, planning, and preps: 10:00AM\r\n\r\nFilm Crew Meeting starts at 1:00 P.M.\r\n\r\nHost/Contact: Logan Prendergast\r\nRoom: Interactive Classroom\r\nOutline of event: We will watch all of the completed flash films.\r\nMaterials needed: Bring your flash film on a thumb drive if you were one of the teams.','','2016-10-16 15:00:00','2016-10-16 22:00:00','2016-10-16 15:00:00','2016-10-16 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:15:52','2016-10-16 22:00:01'),(586,'Dallas Film Crew #68','Filmmakers Meeting','Workshops, guest speakers, and hands on experience in several Film projects','','2016-10-23 15:00:00','2016-10-23 22:00:00','2016-10-23 15:00:00','2016-10-23 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-23 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:16:44','2016-10-23 22:00:01'),(587,'Dallas Film Crew #69','Filmmakers Meeting','10:00 AM Preparation and planning\r\n1:00 PM Show up to meeting at this time.\r\n\r\nOutline of event: Divide into teams and create a 25 second horror film with 5 five minute clips.\r\nMaterials needed: Bring/wear your Halloween costume and any other spooky props.','','2016-10-30 15:00:00','2016-10-30 22:00:00','2016-10-30 15:00:00','2016-10-30 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-30 15:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-08-31 16:18:35','2016-10-30 22:00:01'),(588,'Laser Basics','Learn how to use our 3 lasers!','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-09-13 00:00:00','2016-09-13 02:00:00','2016-09-13 00:00:00','2016-09-13 02:00:00',0.00,NULL,8,0,1,0,0,'2016-09-13 00:00:00',0,1,0,'completed',8,333,2,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-09-01 01:44:03','2016-09-13 02:00:01'),(589,'Laser Basics','Learn to use our 3 lasers!','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-09-15 00:00:00','2016-09-15 02:00:00','2016-09-15 00:00:00','2016-09-15 02:00:00',0.00,NULL,8,0,1,0,0,'2016-09-15 00:00:00',0,1,0,'completed',11,333,2,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-09-01 01:45:45','2016-09-15 02:00:01'),(590,'Laser Basics','Learn to use our 3 lasers!','Learn how to Laser, then how to use all our lasers! \r\n