ilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-10-06 00:00:00','2016-10-06 02:00:00','2016-10-06 00:00:00','2016-10-06 02:00:00',0.00,NULL,8,0,1,0,0,'2016-10-06 00:00:00',0,1,0,'completed',11,333,2,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-09-01 02:02:28','2016-10-06 02:00:01'),(597,'DMS Wood Shop Basics ','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','You must be over 18+ to attend this class.\r\n\r\nThere is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own. ','2016-09-13 17:00:00','2016-09-13 20:00:00','2016-09-13 17:00:00','2016-09-13 20:00:00',5.00,NULL,0,6,1,18,0,'2016-09-12 17:00:00',0,1,0,'cancelled',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-01 04:32:29','2016-09-12 23:23:00'),(598,'Life Drawing Class','The study of drawing people (had to cancel and re-add to adjust start time)','We will be having a life drawing class. This will cover the use of basic shapes for the foundation of human anatomy.\r\n\r\nThe model will be nude. The cost of the class ($10) is to help cover the cost of the model.\r\n\r\nPlease bring your own materials. Any medium is welcome as long as you clean up after yourself. Bring a drop cloth if you wish to paint.\r\n\r\nWe have small table easels but no large standing easels if you have one feel free to bring it.','','2016-09-10 00:00:00','2016-09-10 04:00:00','2016-09-09 23:30:00','2016-09-10 04:30:00',0.00,NULL,0,0,0,0,0,'2016-09-10 00:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-09-01 12:39:36','2016-09-10 04:00:01'),(599,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-15 00:00:00','2016-09-15 02:00:00','2016-09-15 00:00:00','2016-09-15 02:00:00',20.00,NULL,0,8,0,16,1,'2016-09-15 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-01 21:07:41','2016-09-15 02:00:01'),(600,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-14 23:00:00','2016-09-15 00:00:00','2016-09-14 22:45:00','2016-09-15 00:00:00',10.00,NULL,0,6,0,16,1,'2016-09-14 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-01 21:10:29','2016-09-15 00:00:01'),(601,'Advanced Spindle Turning One','In this class we\'ll be going over advanced spindle turning techniques. ','In this class we\'ll be going over the use of four different tools and advanced spindle turning techniques which include;\r\n\r\nSpindle gouges\r\nBeads\r\nCoves\r\n\r\nThis class is a prerequisite for Advanced Spindle Turning Two','Tools and wood will be provided. \r\n$10 cash class fee.','2016-09-06 15:30:00','2016-09-06 18:30:00','2016-09-06 15:30:00','2016-09-06 18:30:00',0.00,NULL,3,3,1,18,1,'2016-09-06 15:30:00',0,1,0,'cancelled',13,166,NULL,4,NULL,NULL,NULL,NULL,'hawaiianmike',1,0,'2016-09-01 21:21:59','2016-09-05 16:51:15'),(602,'DMS Welding Processes and Safety','Class will cover welding processes available at DMS and safety procedures associated with welding. ','Class will cover welding processes available at DMS and safety procedures associated with welding. \r\n\r\nThis class is required for participation in the DMS welding classes. There is no charge for this class.\r\n\r\nAvailable for DMS members only. \r\n','','2016-09-10 14:00:00','2016-09-10 15:00:00','2016-09-10 14:00:00','2016-09-10 15:00:00',0.00,NULL,0,0,0,16,0,'2016-09-10 14:00:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-09-02 12:04:32','2016-09-10 15:00:01'),(603,'Introduction to MIG Welding','Welding with Miller 252 MIG Welder','Class will cover: \r\n- The basic setup, operation and maintenance of the Miller 252 Mig welder. \r\n- Welding mild steel\r\n- Tips for setting up and welding your projects\r\n\r\nClass is limited to DMS Members, with a maximum of 8 participants. You must register through Eventbrite to participate in the class. No sitting in or just listening is permitted.\r\n\r\nCost of the class is $30.00. Purchase tickets from Eventbrite: All proceeds go to DMS Metal shop for materials and supplies.\r\n','Participants must have taken welding processes and safety class to enroll in this class. Please wear natural fiber clothing with long sleeves and long pants without cuffs. Closed toes shoes are also required. Long hair needs to be secured. If you have your own welding helmet, gloves and other safety equipment, please bring it. \r\n','2016-09-10 18:00:00','2016-09-10 20:00:00','2016-09-10 17:45:00','2016-09-10 20:15:00',30.00,NULL,0,0,1,16,0,'2016-09-10 18:00:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-09-02 12:14:05','2016-09-10 20:00:01'),(604,'Introduction to TIG Welding','Operation of the Miller 351 TIG welder.','Class will cover:\r\n- The basic setup, operation and maintenance of the Miller 351 TIG welder.\r\nWelding mild steel\r\nTips for setting up and welding your projects\r\n\r\nClass is limited to DMS Members, with a maximum of 8 participants.You must register through Eventbrite to participate in the class. No sitting in or just listening is permitted.\r\n\r\nCost of the class is $40.00. Purchase tickets from Eventbrite:\r\nAll proce