ss and operation of the Miller 252 MIG Welder.','Class will cover: \r\n- The basic setup, operation and maintenance of the Miller 252 Mig welder. \r\n- Welding mild steel\r\n- Tips for setting up and welding your projects\r\n\r\nClass is limited to DMS Members, with a maximum of 8 participants. You must register through Eventbrite to participate in the class. No sitting in or just listening is permitted.\r\n\r\nCost of the class is $30.00. Purchase tickets from Eventbrite:\r\n\r\nAll proceeds go to DMS Metal shop for materials and supplies.\r\n','Participants must have taken welding safety class to enroll in this class. Please wear natural fiber clothing with long sleeves and long pants without cuffs. Closed toes shoes are also required. Long hair needs to be secured. If you have your own welding helmet, gloves and other safety equipment, please bring it. \r\n','2016-09-15 00:30:00','2016-09-15 02:30:00','2016-09-15 00:15:00','2016-09-15 02:45:00',30.00,NULL,0,0,1,16,0,'2016-09-15 00:30:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-09-02 13:13:38','2016-09-15 02:30:01'),(611,'Flash Film Meeting','Planning and Prep','Pre-Production for Flash Film Production','','2016-09-04 15:00:00','2016-09-04 19:00:00','2016-09-04 15:00:00','2016-09-04 19:00:00',0.00,NULL,0,0,0,0,0,'2016-09-04 15:00:00',0,1,0,'completed',11,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-02 13:56:23','2016-09-04 19:00:02'),(612,'Flash Film Meeting','Setup and Prep','Pre-Production for Flash Film Production','','2016-09-10 16:00:00','2016-09-10 21:00:00','2016-09-10 16:00:00','2016-09-10 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-10 16:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-02 14:07:30','2016-09-10 21:00:01'),(613,'3D Printer Building Workshop','A guided workshop for building your own 3D printer!','If you are interested in building a 3D printer, or want an affordable 3D printer that\'s reliable, but don\'t know where to start, now you can build your own!\r\n\r\nThe 3D Printer Build Workshop will be a weekend long workshop/class where you can have guided help through building your own Prusa i3 Mk2 printer. I will also show some techniques for using TinkerCAD, a brief history of RepRap, and basic concepts of 3D printing. \r\n\r\nThe Prusa i3 Mk2 is the latest update of the original design by Josef Prusa (one of the pioneers of RepRap 3D printers). There have been a lot of Chinese clones of the Prusa i3 design, but this is the original using high quality components and new features like auto-leveling and calibration. The printers usable build volume is a respectable 9.84 x 8.3 x 8 in.\r\n\r\nYou can see more details here: \r\nhttp://shop.prusa3d.com/en/3d-printers/59-original-prusa-i3-mk2-kit.html\r\n\r\nThe cost is $750 (paid space reservation), that includes the cost of the printer kit, shipping, and pizza and drinks. I encourage you to bring a friend or family to help you with the build (please have them register for a free space). All the tools are included with the kit, you do not need to bring anything other than a laptop. \r\n\r\nThe deadline for paid registration is 2 weeks before the class which is September 24th, this allows 5 day lead time, and 5 days for shipping for the kits.\r\n\r\n**If you want to bring another 3D printer kit that\'s not the Prusa i3, you can still register and bring it, I can still help. Just please let me know so I can accommodate. \r\n\r\nIf you have any questions about the class please email me: mitch.cerroni@gmail.com','Basic hand tools will be used. Nozzles and the build plate do get hot enough to burn you, so use caution. ','2016-10-08 23:00:00','2016-10-09 05:00:00','2016-10-08 23:00:00','2016-10-09 05:00:00',750.00,NULL,0,5,0,0,0,'2016-09-24 23:00:00',0,1,0,'completed',8,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-09-02 20:21:06','2016-10-09 05:00:01'),(614,'3D Printer Building Workshop','A guided workshop for building your own 3D printer!','If you are interested in building a 3D printer, or want an affordable 3D printer that\'s reliable, but don\'t know where to start, now you can build your own!\r\n\r\nThe 3D Printer Build Workshop will be a weekend long workshop/class where you can have guided help through building your own Prusa i3 Mk2 printer. I will also show some techniques for using TinkerCAD, a brief history of RepRap, and basic concepts of 3D printing. \r\n\r\nThe Prusa i3 Mk2 is the latest update of the original design by Josef Prusa (one of the pioneers of RepRap 3D printers). There have been a lot of Chinese clones of the Prusa i3 design, but this is the original using high quality components and new features like auto-leveling and calibration. The printers usable build volume is a respectable 9.84 x 8.3 x 8 in.\r\n\r\nYou can see more details here: \r\nhttp://shop.prusa3d.com/en/3d-printers/59-original-prusa-i3-mk2-kit.html\r\n\r\nThe cost is $750 (paid space reservation), that includes the cost of the printer kit, shipping, and pizza and drinks. I encourage you to bring a friend or family to help you with the build (please have them register for a free space). All the tools are included with the kit, you do not need to bring anything other than a laptop. \r\n\r\nThe deadline for paid registration is 2 weeks before the class which is September 24th, this allows 5 day lead time, and 5 days for shipping for the kits.\r\n\r\n**If you want to bring another 3D printer kit that\'s not the Prusa i3, you can still register and bring it, I can still help. Just please let me know so I can accommodate. \r\n\r\nIf you have any questions about the class please email me: mitch.cerroni@gmail.com','Basic hand tools will be used. Nozzles and the build plate do get hot enough to burn you, so use caution. ','2016-10-09 23:00:00','2016-10-10 05:01:00','2016-10-09 23:00:00','2016-10-10 05:01:00',750.00,NULL,0,5,0,0,0,'2016-09-25 23:00:00',0,2,0,'approved',8,30,NULL,NULL,613,NULL,NULL,NULL,'themitc