74jvfNKZCETxWL22 so we can print a tag for you \r\n\r\n*I\'m putting the space as the galley but please just place your items in the CA room - I didn\'t want to take up a classroom with this notation* ','Please put your 10X10 somewhere in the CA room. It might get a bit crowded but I\'m hoping we can all live together safely for a day. ','2016-09-10 17:00:00','2016-09-10 18:00:00','2016-09-10 17:00:00','2016-09-10 18:00:00',0.00,NULL,0,0,0,0,0,'2016-09-10 17:00:00',0,1,0,'completed',24,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-09-06 02:31:04','2016-09-10 18:00:01'),(641,'Midnight Makers Pen Edition',' We are making pens in the wee hours of the morning','We will make pens and review the basics, including shop rules and general expectations, and wood working safe/best practices. ** Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories. ** ','>>>>>>>> Prerequisite Required Lathe Basics <<<<<<<','2016-09-16 06:00:00','2016-09-16 07:30:00','2016-09-16 05:45:00','2016-09-16 07:45:00',12.00,NULL,0,5,1,13,0,'2016-09-14 06:00:00',0,1,0,'completed',12,33,NULL,NULL,NULL,NULL,NULL,NULL,'wascheu',1,0,'2016-09-06 21:37:26','2016-09-16 07:30:01'),(642,'Introduction to a Master Knife Maker (Dave McDearmont)','Introduction to a Master Knife Maker (Dave McDearmont)','Meet and Greet for Master Knife Maker Dave McDearmont with the purpose of gauging the interest in a series of classes on Knife Making.','','2016-09-09 00:00:00','2016-09-09 01:00:00','2016-09-09 00:00:00','2016-09-09 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-09 00:00:00',0,1,0,'completed',11,16,NULL,NULL,NULL,NULL,NULL,NULL,'stansimmons',1,0,'2016-09-07 03:37:33','2016-09-09 01:00:01'),(643,'Production Meeting','Planning for Dallas Film Crew','Planning for productions and dallas film crew meetings','','2016-09-22 00:00:00','2016-09-22 03:00:00','2016-09-22 00:00:00','2016-09-22 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-22 00:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-08 03:03:41','2016-09-22 03:00:01'),(644,'Lathe Class','Multi-part Lathe Class','This is the 2nd out of a 10 part class.  Enrollment is closed.','','2016-09-14 15:30:00','2016-09-14 16:30:00','2016-09-14 15:30:00','2016-09-14 16:30:00',0.00,NULL,1,0,1,18,1,'2016-09-14 15:30:00',0,1,1,'completed',12,363,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-08 04:18:20','2016-09-14 16:30:01'),(645,'Making of a Better Man Series: Men Stepping Up','Making a Better Man Discussion Series: A two-night event titled \"Men Stepping Up\" that will call men to courageous manhood.','\r\nMen of all walks come to Dallas Makerspace to make a better mouse trap, some really cool stuff. They work hard to improve DMS. But what about improving the men. What about the making of a better man.\r\n\r\nCalling Men to Courageous Manhood: \r\nA better man is a more courageous man. Today, more than ever, the world needs godly men. Men who will step up and courageously lead at home, at church, at work, and in their communities. Thats the message of Stepping Up. In a world where too many men are shrinking back, Stepping Up gives men vision and tools to live godly, courageous lives.\r\n\r\nThis will be a two night event that will be free to the DMS members and the public.  It will include presentation material prepared and published by Dennis Rainey and Family Life Today.\r\n\r\n','','2016-10-18 23:45:00','2016-10-19 02:00:00','2016-10-18 23:30:00','2016-10-19 02:00:00',0.00,NULL,0,0,0,16,0,'2016-10-18 23:45:00',0,1,0,'rejected',9,362,NULL,NULL,NULL,NULL,'alexrhodes','This class was discussed within the board and we don\'t feel we are the appropriate place for this type of event.   If you have any questions please email us at admin@dallasmakerspace.org  Thank you.  ','kjposter',0,0,'2016-09-08 04:24:22','2016-09-08 06:19:19'),(646,'Making of a Better Man Series: Men Stepping Up','Making a Better Man Discussion Series: A two-night event titled \"Men Stepping Up\" that will call men to courageous manhood.','\r\nMen of all walks come to Dallas Makerspace to make a better mouse trap, some really cool stuff. They work hard to improve DMS. But what about improving the men. What about the making of a better man.\r\n\r\nCalling Men to Courageous Manhood: \r\nA better man is a more courageous man. Today, more than ever, the world needs godly men. Men who will step up and courageously lead at home, at church, at work, and in their communities. Thats the message of Stepping Up. In a world where too many men are shrinking back, Stepping Up gives men vision and tools to live godly, courageous lives.\r\n\r\nThis will be a two night event that will be free to the DMS members and the public.  It will include presentation material prepared and published by Dennis Rainey and Family Life Today.\r\n\r\n','','2016-10-26 00:45:00','2016-10-26 02:00:00','2016-10-26 00:30:00','2016-10-26 02:00:00',0.00,NULL,0,0,0,16,0,'2016-10-26 00:45:00',0,2,0,'rejected',9,362,NULL,NULL,645,NULL,NULL,NULL,'kjposter',0,0,'2016-09-08 04:24:22','2016-09-08 04:24:22'),(647,'Dallas Society of Play: Visiting Speaker Rachel Weil','Rachel Simone Weil is an experimental artist, programmer, historian, and educator based in Austin, Texas.','Rachel Simone Weil is an experimental artist, programmer, historian, and educator based in Austin, Texas. Weil is the founder of FEMICOM Museum, and she also co-organizes Juegos Rancheros, Austin\'s indie games collective.\r\n\r\nWeil creates interactive, glitchable visual art and games for the Nintendo Entertainment System. Her custom software, written in 6502 assembly language, is inspired by Japanese and American animation and comics, demoscene culture, and video games of the 1990s. Weil employs ultra feminine, ahistorical visual elements in her work while evoking feelings of nostalgia and friendship with blocky, colorful animations. Her art and video installations have appeared internationally at venues such as Blip Festival, Vector Game + Art Convergence, GLI.TC/H, the Dallas Museum of Art, and IndieCade.\r\n\r\nWeil will be with us to give an overview of some of her projects, with an emphasis on nostalgia and hacking video game history.','','2016-10-11 00:00:00','2016-10-11 02:00:00','2016-10-10 23:45:00','2016-10-11 02:15:00',0.00,NULL,0,0,0,0,0,'2016-10-11 00:00:00',0,1,0,'completed',9,201,NULL,NULL,NULL,NULL,NULL,NULL,'welchcomp',1,0,'2016-09-08 04:26:05','2016-10-11 02:00:02'),(648,'Making of a Better Man Series: Men Stepping Up','Making a Better Man Discussion Series: A two-night event titled \"Men Stepping Up\" that will call men to courageous manhood.','Men of all walks come to Dallas Makerspace to make a better mouse trap, some really cool stuff. They work hard to improve DMS. But what about improving the men. What about the making of a better man.\r\n\r\nCalling Men to Courageous Manhood: \r\nA better man is a more courageous man. Today, more than ever, the world needs godly men. Men who will step up and courageously lead at home, at church, at work, and in their communities. Thats the message of Stepping Up. In a world where too many men are shrinking back, Stepping Up gives men vision and tools to live godly, courageous lives.\r\n\r\nThis will be a two night event that will be free to the DMS members and the public.  It will include presentation material prepared and published by Dennis Rainey and Family Life Today.\r\n\r\n','','2016-10-18 00:00:00','2016-10-18 02:00:00','2016-10-18 00:00:00','2016-10-18 02:00:00',0.00,NULL,0,0,0,16,0,'2016-10-18 00:00:00',0,1,0,'rejected',9,362,NULL,NULL,NULL,NULL,'alexrhodes','Duplicate event and it has the wrong date.   New Event created and in Queue.  ','kjposter',0,0,'2016-09-08 04:34:51','2016-09-08 05:44:55'),(649,'Making of a Better Man Series: Me