h wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-21 23:00:00','2016-09-22 00:00:00','2016-09-21 22:45:00','2016-09-22 00:00:00',10.00,NULL,0,6,0,16,1,'2016-09-21 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-09 03:30:08','2016-09-22 00:00:01'),(671,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-22 00:00:00','2016-09-22 02:00:00','2016-09-22 00:00:00','2016-09-22 02:00:00',20.00,NULL,0,8,0,16,0,'2016-09-22 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-09 03:32:52','2016-09-22 02:00:01'),(672,'Spooky BYOB Painting Class and Contest!','Acrylic painting class','Come join us on a dark autumn evening for the spookiest painting class we\'ve done yet! As usual, this will be hosted by Drink n\' Draw in partnership with the Dallas Makerspace.\r\n\r\n[[NOTE: Painting topic is TBD & WILL BE DECIDED BY POLL!]]\r\n\r\nBring $10, your imagination, and clothes you don\'t care about. No other supplies needed- everything will be provided!\r\nSpooky clothes and costumes are encouraged, but be warned- we\'ll be working with acrylic paint!\r\n\r\n**PAINTING CONTEST AND PRIZE**\r\nAt the end of the class, we\'ll have a spooky painting contest! The spookiest painting wins a lovely walnut and brass pumpkin carving tool kit! The runner up will receive a random shitty horror DVD, courtesy of Gina. \r\n\r\nProceeds from this class will benefit Citizens\' Climate Education,a non-profit dedicated to educating elected officials about climate changeand pathways to a clean, livable future.\r\nhttp://citizensclimateeducation.org/about-cce/','','2016-10-22 00:00:00','2016-10-22 02:00:00','2016-10-21 23:00:00','2016-10-22 03:00:00',0.00,NULL,35,0,0,0,0,'2016-10-22 00:00:00',0,1,0,'rejected',8,17,NULL,NULL,NULL,NULL,'bscharff','Rejecting honorarium - this is not a class, but a workshop.','artnerdray',0,0,'2016-09-09 09:14:04','2016-09-10 21:12:10'),(673,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.  ','All experience levels welcome!  If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session.  Bring your projects, ideas, questions, answers, tips & tricks.  This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.','','2016-09-18 20:00:00','2016-09-18 21:00:00','2016-09-18 20:00:00','2016-09-18 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-18 20:00:00',0,1,0,'completed',5,54,NULL,NULL,NULL,198,NULL,NULL,'bitta',0,0,'2016-09-09 11:27:12','2016-09-09 11:27:12'),(674,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-09-24 20:00:00','2016-09-24 21:30:00','2016-09-24 19:30:00','2016-09-24 21:45:00',0.00,NULL,0,0,0,0,0,'2016-09-24 20:00:00',0,1,0,'completed',11,54,NULL,NULL,NULL,NULL,NULL,NULL,'bitta',1,0,'2016-09-09 13:11:36','2016-09-24 21:30:01'),(675,'CNC Router Demonstration','Cutting a project on the CNC Router','A demonstration on some of the many uses of the Multicam CNC Router in the woodshop.  \r\n\r\nThis demonstration will center around the construction of a Bat house, using plywood.','All visitors must sign liability waiver in front lobby.','2016-09-17 17:00:00','2016-09-17 18:30:00','2016-09-17 17:00:00','2016-09-17 18:30:00',0.00,NULL,0,0,0,0,0,'2016-09-17 17:00:00',0,1,1,'completed',12,46,NULL,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-09-09 13:38:47','2016-09-17 18:30:01'),(676,'ARTEMIS Spaceship Bridge Simulator night','Come and play this immersive LAN party game!',' It\'s time to play Artemis again!   No experience needed.\r\n\r\nI\'ll be bringing the DMX-controlled lighting that reacts to events in the game, along with other peripherals. \r\n\r\n\"You and your friends assume the jobs of Captain, Helm, Sci