00','2016-09-23 04:00:00','2016-09-22 23:00:00','2016-09-23 04:00:00',0.00,NULL,0,0,0,0,0,'2016-09-22 23:00:00',0,1,0,'rejected',4,74,NULL,NULL,NULL,NULL,'bscharff','Event was submitted as a class - please resubmit without marking it as a Class.','rffalex',0,0,'2016-09-10 18:22:54','2016-09-10 21:29:46'),(683,'Fibers in the 21st Century','Developments and trends of fibers in the 21st century.','Fibers are an important fine art and high tech material.  This presentation will highlight developments and trends of fibers in the 21st century.  \r\n\r\nLecture by Christine Miller, one of the founders of www.explorefiber.com, a collaborative space for teachers, students and fiber artists.  Christine specializes in a number of things including, weaving, basketry, knitting, crochet, sewing, embroidery, needlework embellishment, and 2D & 3D art concepts.','All visitors must sign liability waiver in front lobby.','2016-09-17 16:00:00','2016-09-17 17:00:00','2016-09-17 16:00:00','2016-09-17 17:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,1,'completed',9,371,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-09-10 20:56:39','2016-09-17 17:00:01'),(684,'Exploring Blender','Getting started in 3D computer graphics software program Blender','Blender is a professional free and open-source 3D computer graphics software\r\nprogram used for creating animated films, visual effects, art, and 3D printed models.\r\nJoin us for a look at getting started in Blender, creating your own models and animations.','All visitors must sign liability waiver in front lobby.','2016-09-17 17:00:00','2016-09-17 18:00:00','2016-09-17 17:00:00','2016-09-17 18:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 17:00:00',0,1,1,'completed',9,372,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-09-10 21:06:27','2016-09-17 18:00:01'),(685,' Cosplay and the Dallas Makerspace','Using the Dallas Makerspace or all your cosplaying needs','This presentation will cover all of the possibilities of using the Dallas Makerspace for all of your cosplay needs.  \r\n\r\nRegistration for this event does not guarantee seating.  Please arrive early.','All visitors must sign liability waiver in front lobby.','2016-09-17 18:00:00','2016-09-17 19:00:00','2016-09-17 18:00:00','2016-09-17 19:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 18:00:00',0,1,1,'completed',9,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-09-10 21:17:16','2016-09-17 19:00:01'),(686,'Intellectual Property with Q&A by the USPTO','Intellectual Property with Q&A by the USPTO','Presentation on Intellectual Property and the U.S. Patent and Trademark Office by USPTO Patent Examiner Jacob Choi.\r\n\r\nRegistration for this event does not guarantee seating.  Please arrive early.','All visitors must sign liability waiver in front lobby.','2016-09-17 19:00:00','2016-09-17 20:00:00','2016-09-17 19:00:00','2016-09-17 20:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 19:00:00',0,1,1,'completed',9,373,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-09-10 21:54:17','2016-09-17 20:00:01'),(687,'Show Me the Money: Securing Funding','Securing Funding for your project','Come hear from creators who have gone through the process of trying to secure funding for their projects.  This panel discussion will be moderated by Steve Blanchard and followed by a Q&A session.\r\n\r\nGuests:\r\nColin McGinn\r\nStacy Wylie\r\nStephen Wylie\r\nTyler Sickels\r\n\r\nRegistration for this event does not guarantee seating.  Please arrive early.\r\n','All visitors must sign liability waiver in front lobby.','2016-09-17 20:00:00','2016-09-17 21:00:00','2016-09-17 20:00:00','2016-09-17 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 20:00:00',0,1,1,'completed',9,374,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-09-10 22:06:12','2016-09-17 21:00:01'),(688,'Spooky BYOB Painting Class and Contest!','Learn how to paint with acrylic and have some fun.','Come join us on a dark autumn evening for the spookiest painting class we\'ve done yet! As usual, this will be hosted by Drink n\' Draw in partnership with the Dallas Makerspace- and taught by Gina. \r\n\r\n[[NOTE: Painting topic is TBD & WILL BE DECIDED BY POLL!]]\r\n\r\nBring $10, your imagination, and clothes you don\'t care about. No other supplies needed- everything will be provided!\r\nSpooky clothes and costumes are encouraged, but be warned- we\'ll be working with acrylic paint!\r\n\r\n**PAINTING CONTEST AND PRIZE**\r\nAt the end of the class, we\'ll have a spooky painting contest! The spookiest painting wins a lovely walnut and brass pumpkin carving tool kit! The runner up will receive a random shitty horror DVD, courtesy of Gina. \r\n\r\nProceeds from this class will benefit Citizens\' Climate Education,a non-profit dedicated to educating elected officials about climate changeand pathways to a clean, livable future.\r\nhttp://citizensclimateeducation.org/about-cce/','','2016-10-22 00:00:00','2016-10-22 02:00:00','2016-10-21 23:00:00','2016-10-22 03:00:00',0.00,NULL,35,0,0,0,0,'2016-10-22 00:00:00',0,1,0,'cancelled',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',0,0,'2016-09-11 19:11:35','2016-09-13 15:09:04'),(689,'Rocketry Open Build','Model or high power rocket building workshop','Bring your model or high power rocketry projects and we will build together, sharing stories, techniques, tools and supplies. I will have some of my tools and supplies but do not have enough for everyone; please bring your own to prevent having to wait. Generally, you will be using white or wood (yellow) glue, a hobby knife, masking tape, a pencil, a ruler and some sandpaper (220 to 400 grit.) Model rocket kits are available locally at hobby shops as well as craft stores such as Hobby Lobby.\r\n\r\n The plan is to have these sessions every month on a weekday evening. Kids are welcome if they are interested in rocketry; minors need to have a parent or guardian present. If you are not a member of Dallas Makerspace and need to get in the front door, please call me at 972-985-5034. We are scheduled to 10, but if there is interest and the room is available, we can stay later.  You may ask me questions at deiresearch@earthlink.net','','2016-10-12 00:00:00','2016-10-12 03:00:00','2016-10-12 00:00:00','2016-10-12 03:00:00',0.00,NULL,0,0,0,0,0,'2016-10-12 00:00:00',0,1,0,'completed',11,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',1,0,'2016-09-11 19:12:54','2016-10-12 03:00:01'),(690,'Rocketry Open Build','Model or high power rocket building workshop','Bring your model or high power rocketry projects and we will build together, sharing stories, techniques, tools and supplies. I will have some of my tools and supplies but do not have enough for everyone; please bring your own to prevent having to wait. Generally, you will be using white or wood (yellow) glue, a hobby knife, masking tape, a pencil, a ruler and some sandpaper (220 to 400 grit.) Model rocket kits are available locally at hobby shops as well as craft stores such as Hobby Lobby.\r\n\r\n The plan is to have these sessions every month on a weekday evening. Kids are welcome if they are interested in rocketry; minors need to have a parent or guardian present. If you are not a member of Dallas Makerspace and need to get in the front door, please call me at 972-985-5034. We are scheduled to 10, but if there is interest and the room is available, we can stay later.  You may contact me with any questions at deiresearch@earthlink.net','','2016-11-09 01:00:00','2016-11-09 04:00:00','2016-11-09 01:00:00','2016-11-09 04:00:00',0.00,NULL,0,0,0,0,0,'2016-11-09 01:00:00',0,1,0,'completed',11,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',1,0,'2016-09-11 19:19:25','2016-11-09 04:00:01'),(691,'Work on making an Adult Coloring Book','Spend time sketching or inking you art for the coloring book.','We are back at it again. Come on out to help work on making an Adult coloring book. We have about 15 pages done. I\'d like to have about 50 pages for the book.\r\n\r\nI have bristol paper for the final art for you to draw on. It needs to be a cleaned up drawing in pencil or ink or a 600dpi or vector that would fit on 9\" x 12\".\r\n\r\nMust attend at least one event to be accepted into the book.\r\n\r\nMust be original work, no copies from other artists or copies from other photographers.\r\n\r\nProfits from the book will be going towards more art events.','','2016-09-24 00:00:00','2016-09-24 03:00:00','2016-09-24 00:00:00','2016-09-24 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-24 00:00:00',0,1,0,'completed',5,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-09-11 19:26:32','2016-09-24 03:00:01'),(692,'XM Core BBS Meetup - Come Join the fun','Join in with everyone in the conference to discuss anything and everything from Ingress, coding, vintage computers, and retro bbsing.','The SysOp of XM Core has agreed to host a BBS meetup on his Board and in person at DMS.\r\n\r\nThis month we\'ll be premiering BBS the Documentary, continuing with our keysigning, and if time permitted a nethack challenge before closing out things with the announcement of the monthly Coding Challenge.\r\n\r\nPizza and Drinks will be at the space while we\'re on the conference.\r\n\r\nTelnet: tty.dapla.net  - Web: https://bbs.dapla.net\r\nechomail: Cyberlord on xm core bbs\r\nDMS Talk: Denzuko','','2016-09-30 23:00:00','2016-10-01 00:00:00','2016-09-30 22:45:00','2016-10-01 00:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 23:00:00',0,1,0,'completed',11,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',1,0,'2016-09-11 23:47:08','2016-10-01 00:00:01'),(693,'Science: Committee Meeting - Recruitment! Recruitment! Recruitment','This meeting is about... ... ... Recruitment!','Anybody want to take a guess what the focus of this meeting will be?  It\'s recruitment!\r\n\r\n700-710  hear me talk\r\n710-730  free forum discussion about recruitment  (don\'t be the doofer that shows up late and says what\'s already been said.. that\'s my job around here)\r\n730-800  Want to make a project happen? or Complain at me about stuff, I love it!\r\n800  dismissed. drunkenly happy already','','2016-09-15 00:00:00','2016-09-15 01:00:00','2016-09-15 00:00:00','2016-09-15 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-15 00:00:00',0,1,0,'completed',18,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-09-12 01:03:55','2016-09-15 01:00:01'),(694,'Science Space Build Out Kick-Off','This meeting marks the beginning of the DMS Science Space Build Out. From small beginnings come great things. ','We\'ll start the planning for the DMS Science Space Build Out. Since this is the first meeting we\'ll determine how we want to set up the team and what we think we can do in the time available to get the most bang for the buck. If you have a skill to offer that will be useful then come contribute. If you\'re just curious about what we\'re up to then come see. \r\n\r\n','','2016-09-16 00:30:00','2016-09-16 01:30:00','2016-09-16 00:30:00','2016-09-16 01:30:00',0.00,NULL,0,0,0,0,0,'2016-09-16 00:30:00',0,1,0,'completed',8,119,NULL,NULL,NULL,NULL,NULL,NULL,'hcbonner',1,0,'2016-09-12 02:30:11','2016-09-16 01:30:01'),(695,'Philosophy Meet Up - 42 (43)','All are welcome, open discussion on life, the universe, and everything.','Open discussion. \r\nFind deeper meaning, new perspective, and understanding of the world around us. \r\n\r\nTechnically this is Meet-up 43, but we didn\'t get 42 on the calendar... we can\'t miss out on meeting 42.','','2016-09-29 00:00:00','2016-09-29 03:00:00','2016-09-29 00:00:00','2016-09-29 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 00:00:00',0,1,0,'completed',4,163,NULL,NULL,NULL,NULL,NULL,NULL,'puzzlerf',1,0,'2016-09-12 03:39:59','2016-09-29 03:00:02'),(696,'DMS Battlebots Meeting','Weekly Meeting for DMS Battlebots team','This is a private meeting for the DMS Battlebots team. Meetings are open to observers though.','','2016-09-18 21:00:00','2016-09-19 00:00:00','2016-09-18 21:00:00','2016-09-19 00:00:00',0.00,NULL,0,0,1,18,1,'2016-09-18 21:00:00',0,1,0,'completed',4,97,NULL,NULL,NULL,NULL,NULL,NULL,'morganntho1',1,0,'20