-28 22:30:00','2016-09-29 00:15:00',0.00,NULL,4,0,1,13,0,'2016-09-28 23:00:00',0,1,0,'completed',20,192,NULL,NULL,NULL,NULL,NULL,NULL,'mkart',1,0,'2016-09-12 17:45:49','2016-09-29 00:00:02'),(713,'DFW Grotto: learn about caves and caving','DFW caving group monthly meeting. We will be discussing past and upcoming trips, and will have an educational program that varies month to month.','Meetings are usually held on the second Wednesday of each month. There is no meeting in December; instead there is a holiday party on a date to be determined in the fall.\r\n\r\nMeetings start at 7 p.m. and end just before 9:00 p.m., when members migrate to a local eating establishment for after-meeting dining and socializing.','','2016-10-13 00:00:00','2016-10-13 02:00:00','2016-10-13 00:00:00','2016-10-13 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-13 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-09-12 17:50:13','2016-10-13 02:00:01'),(714,'DFW Grotto: learn about caves and caving','DFW caving group monthly meeting. We will be discussing past and upcoming trips, and will have an educational program that varies month to month.','Meetings are usually held on the second Wednesday of each month. There is no meeting in December; instead there is a holiday party on a date to be determined in the fall.\r\n\r\nMeetings start at 7 p.m. and end just before 9:00 p.m., when members migrate to a local eating establishment for after-meeting dining and socializing.','','2016-11-10 01:00:00','2016-11-10 03:00:00','2016-11-10 01:00:00','2016-11-10 03:00:00',0.00,NULL,0,0,0,0,0,'2016-11-10 01:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,281,NULL,NULL,'julesrmakes',1,0,'2016-09-12 17:51:21','2016-11-10 03:00:01'),(715,'Sewing SIG ','Let\'s work on our sewing projects','Hanging out with sewing machines, serger and embroidery machine.  Cut out patterns, fabric and come up with new projects, get advice and help if needed.  If you want to get sewing, come hang out!  Youngsters welcome with parents.\r\n\r\n','','2016-10-07 00:00:00','2016-10-07 02:00:00','2016-10-06 23:45:00','2016-10-07 02:15:00',0.00,NULL,0,0,0,13,0,'2016-10-07 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-09-12 17:59:07','2016-10-07 02:00:01'),(716,'Introduction to 3D Modeling with Blender. ','Learn how to create 3D Models','Introduction to 3D Modeling with Blender. \r\n\r\nBlender is a professional free and open-source 3D computer graphics software product \r\nused for creating animated films, visual effects, art, and 3D printed models.\r\n\r\nThis is an introduction to 3D Modeling. \r\n1. Blender Interface\r\n2. Customizing the interface\r\n3. Box Modeling\r\n4. Importing reference images\r\n5. Using Modifiers\r\n6. Setting up your camera\r\n\r\nBring your own Laptop and please install Blender before class. \r\nhttps://www.blender.org/\r\n\r\nYou must bring a 3 Button Mouse (Scroll Wheel Click)\r\n\r\nThis is a free class.\r\n','Bring your own Laptop and please install Blender before class. \r\nhttps://www.blender.org/\r\n\r\nYou must bring a 3 Button Mouse (Scroll Wheel Click)\r\n','2016-09-25 19:00:00','2016-09-25 22:00:00','2016-09-25 19:00:00','2016-09-25 22:00:00',0.00,NULL,0,0,0,0,0,'2016-09-25 19:00:00',0,1,0,'completed',9,360,NULL,NULL,NULL,NULL,NULL,NULL,'metaldust',1,0,'2016-09-12 18:11:06','2016-09-25 22:00:01'),(717,'Introduction to C# Programming','Introduction to C# using Microsoft Visual Studio 2015 Community. ','\r\nIntroduction to C# using Microsoft Visual Studio 2015 Community. \r\n\r\nIntroduction to Visual Studio, \r\nHow to use the interface and create a winforms application. \r\n1. Introduction to custom controls.\r\n2. Variables, Local and Global\r\n3. Using a DataGridView\r\n4. Importing and Exporting information.\r\n5. Using DLL files to create a common library.\r\n\r\nThis will be an introductory course, Please bring a laptop\r\nDownload a copy of Visual Studio 2015 community for free. \r\nhttps://beta.visualstudio.com/downloads/\r\n\r\nThis is a free class. \r\n','Please bring a laptop\r\nDownload a copy of Visual Studio 2015 community for free. \r\nhttps://beta.visualstudio.com/downloads/\r\n','2016-10-02 19:00:00','2016-10-02 21:00:00','2016-10-02 19:00:00','2016-10-02 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-02 19:00:00',0,1,0,'completed',9,360,NULL,NULL,NULL,NULL,NULL,NULL,'metaldust',1,0,'2016-09-12 18:15:37','2016-10-02 21:00:01'),(718,'Kumihimo (Japanese braiding)','Learn how to make beautiful and versatile braided cords ','Kumihimo is an ancient Japanese art for cord making. Cording was used to tie kimonos, fasten objects to belts, etc.  Cording was either round (like a rope) or flat like a shoelace.   In this class you will learn how to braid a basic round cord with contemporary tools,  useful for incorporating into other projects. Think drawstrings, purse ties, handles, necklaces for jewelry - the possibilities are endless once you master the basic skill.  Class will be free with the option to purchase supplies ($8) for take-home.','','2016-09-28 00:00:00','2016-09-28 02:00:00','2016-09-27 23:45:00','2016-09-28 02:00:00',0.00,NULL,0,0,0,0,0,'2016-09-28 00:00:00',0,1,1,'completed',5,381,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-09-12 18:17:48','2016-09-28 02:00:01'),(719,'Intro to AutoCAD programming c#','Introduction to AutoCAD programming with Visual Studio and C#','Introduction to AutoCAD programming with Visual Studio and C#\r\n\r\nThis will be an introductory course, Please bring a laptop\r\n\r\nVisual Studio 2015 will not work with real time debugging.\r\n\r\nPlease Download:\r\nMicrosoft Visual Studio Express 2012 for Windows Desktop\r\n\r\nhttps://www.microsoft.com/en-us/download/details.aspx?id=34673\r\n\r\nYou can download a 30 day trial of AutoCAD 2017.\r\nhttp://www.autodesk.com/products/autocad/free-trial \r\n\r\nHow to use the interface and create a winforms application.\r\n1. Introduction to Custom Controls\r\n2. Creating a Palette to dock your program\r\n3. Learn the AutoCAD API\r\n4. Learn Transactions\r\n5. Using Events and Timers\r\n6. Modify parameters in blocks\r\n7. Modify attributes in blocks.\r\n8. Export / Import Attributes.\r\n','Please bring your own laptop if you want to follow along. \r\n\r\nPlease Download:\r\nMicrosoft Visual Studio Express 2012 for Windows Desktop\r\n\r\nhttps://www.microsoft.com/en-us/download/details.aspx?id=34673\r\n\r\nYou can download a 30 day trial of AutoCAD 2017. \r\nhttp://www.autodesk.com/products/autocad/free-trial \r\n','2016-10-02 22:00:00','2016-10-03 01:00:00','2016-10-02 22:00:00','2016-10-03 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-02 22:00:00',0,1,0,'completed',9,360,NULL,NULL,NULL,NULL,NULL,NULL,'metaldust',1,0,'2016-09-12 18:18:55','2016-10-03 01:00:02'),(720,'Art Mess Freeforall','Bring your current project and come hang out','Bring your current project to work on and come hang out with us in the Creative Arts room Thursday night. Starts at 7 and goes until they run us out. Be there or be square.','','2016-09-16 00:00:00','2016-09-16 03:00:00','2016-09-16 00:00:00','2016-09-16 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-16 00:00:00',0,1,0,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-09-12 18:35:50','2016-09-16 03:00:01'),(721,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-09-30 00:00:00','2016-09-30 01:30:00','2016-09-29 23:30:00','2016-09-30 01:45:00',0.00,NULL,0,0,0,0,0,'2016-09-30 00:00:00',0,1,0,'completed',11,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',1,0,'2016-09-12 20:38:30','2016-09-30 01:30:01'),(722,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-10-06 00:30:00','2016-10-06 02:00:00','2016-10-06 00:00:00','2016-10-06 02:15:00',0.00,NULL,0,0,0,0,0,'2016-10-06 00:30:00',0,1,0,'cancelled',8,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',0,0,'2016-09-12 20:40:42','2016-09-15 10:07:22'),(723,'DMS Open House After Party','Play Old Games. Make New Memories. ','Play Old Games. Make New Memories. \r\n\r\nStay after open house and come play video games and hang out. \r\n\r\nPlease contact me if you\'re interesting in bringing classic games (NES, SNES, Sega etc), TV\'s , or board games. \r\n\r\nThere will also be a game tournament on the projector screen. \r\n\r\nWe will be ordering pizza as well so bring cash. ','','2016-09-18 01:00:00','2016-09-18 05:00:00','2016-09-18 01:00:00','2016-09-18 05:00:00',0.00,NULL,0,0,0,0,0,'2016-09-18 01:00:00',0,1,0,'completed',9,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-09-12 21:33:30','2016-09-18 05:00:02'),(724,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.  ','All experience levels welcome!  If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session.  Bring your projects, ideas, questions, answers, tips & tricks.  This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.','','2016-10-16 20:00:00','2016-10-16 21:00:00','2016-10-16 20:00:00','2016-10-16 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 20:00:00',0,1,0,'completed',5,54,NULL,NULL,NULL,198,NULL,NULL,'bitta',0,0,'2016-09-13 03:29:37','2016-09-13 03:29:37'),(725,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-09-20 00:00:00','2016-09-20 02:00:00','2016-09-19 23:45:00','2016-09-20 02:15:00',0.00,NULL,0,0,1,0,0,'2016-09-20 00:00:00',0,1,0,'completed',9,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',0,0,'2016-09-13 04:05:05','2016-09-13 04:05:05'),(726,'The Session-Production Meeting','A production meeting for the short film \"The Session\"','A production meeting for the short film \"The Session\"','','2016-09-18 16:00:00','2016-09-18 19:00:00','2016-09-18 16:00:00','2016-09-18 19:00:00',0.00,NULL,0,0,0,0,1,'2016-09-18 16:00:00',0,1,0,'cancelled',4,316,NULL,NULL,NULL,NULL,NULL,NULL,'serinadennis',0,0,'2016-09-13 13:31:23','2016-09-16 02:39:15'),(727,'Taning Class','Company from seattle is traing michael in medical coding ','Michael needs training for medical codeing training','Work session, for training Michael ','2016-09-16 14:00:00','2016-09-16 22:00:00','2016-09-16 14:00:00','2016-09-16 22:00:00',0.00,NULL,0,0,0,0,0,'2016-09-16 14:00:00',0,1,0,'completed',4,368,NULL,NULL,NULL,NULL,NULL,NULL,'mmith203',1,0,'2016-09-13 16:01:08','2016-09-16 22:00:01'),(728,'Measuring Tree (Casting)','Auditions','Audtions for Short Music Video \"The Measuring Tree\"','','2016-09-22 23:00:00','2016-09-23 04:00:00','2016-09-22 23:00:00','2016-09-23 04:00:00',0.00,NULL,0,0,0,0,0,'2016-09-22 23:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-13 16:35:47','2016-09-23 04:00:01'),(729,'Jewelry: Silver Ring Fabrication ','This class will be working with sterling silver to fabricate silver rings!','In this entry level silversmithing workshop you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of jewelry making tools and equipment . \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nHope to see you there!\r\n','Please wear closed toe shoes and pants. Safety glasses and aprons will be provided.','2016-09-24 19:00:00','2016-09-25 02:00:00','2016-09-24 18:30:00','2016-09-25 02:30:00',75.00,NULL,0,5,0,0,0,'2016-09-24 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,506,NULL,NULL,'nausser915',1,0,'2016-09-14 00:38:12','2016-09-24 04:01:02'),(730,'Spooky BYOB Painting Class and Contest!','Learn how to paint with acrylic and have some fun.','Come join us on a dark autumn evening for the spookiest painting class we\'ve done yet! As usual, this will be hosted by Drink n\' Draw in partnership with the Dallas Makerspace- and taught by Gina. \r\n\r\n[[NOTE: Painting topic is TBD & WILL BE DECIDED BY POLL!]]\r\n\r\nBring $10, your imagination, and clothes you don\'t care about. No other supplies needed- everything will be provided!\r\nSpooky clothes and costumes are encouraged, but be warned- we\'ll be working with acrylic paint!\r\n\r\n**PAINTING CONTEST AND PRIZE**\r\nAt the end of the class, we\'ll have a spooky painting contest! The spookiest painting wins a lovely walnut and brass pumpkin carving tool kit! The runner up will receive a random shitty horror DVD, courtesy of Gina. \r\n\r\nProceeds from this class will benefit Citizens\' Climate Education,a non-profit dedicated to educating elected officials about climate changeand pathways to a clean, livable future.\r\nhttp://citizensclimateeducation.org/about-cce/','','2016-10-22 00:00:00','2016-10-22 02:00:00','2016-10-21 23:00:00','2016-10-22 03:00:00',0.00,NULL,35,0,0,0,0,'2016-10-22 00:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-09-14 03:31:37','2016-10-22 02:00:01'),(731,'Editing Bay being used for Editing','The Editing bay in the Digital Media Room will be used for editing a project from 1-7pm.','The Editing bay in the Digital Media Room will be used for editing a project from 1-7pm ','This is not an event or class. I am reserving the Digital Media Room so that I have access to the editing bay to complete a project. I will need the machine from 1-7pm.','2016-09-17 18:00:00','2016-09-18 00:00:00','2016-09-17 18:00:00','2016-09-18 00:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 18:00:00',0,1,0,'rejected',6,388,NULL,NULL,NULL,NULL,'mellrhodes','Unfortunately, we\'re having our annual Open House on this date and the room needs to be open for tours and activities.  Sorry about that!   Hope you can make it out!   https://www.facebook.com/events/106013966514201/','youmbi56',0,0,'2016-09-14 04:18:05','2016-09-14 21:46:55'),(732,'Paper Circuits ','Make basic electronic circuits on paper using copper tape and components! For all ages!','Make basic electronic circuits on paper using copper tape and components. You will be able to take your circuit home to tinker with. We will have experts to guide you through creating your own circuit. ','','2016-09-17 16:00:00','2016-09-17 20:00:00','2016-09-17 16:00:00','2016-09-17 20:00:00',0.00,NULL,0,0,0,0,0,'2016-09-17 16:00:00',0,1,0,'completed',7,390,NULL,NULL,NULL,NULL,NULL,NULL,'kluper',1,0,'2016-09-14 16:08:10','2016-09-17 20:00:01'),(733,'Lathe Class','Multi-part Lathe Class','This is the 3rd out of a 10 part class.  Enrollment is closed.','','2016-09-20 15:30:00','2016-09-20 18:30:00','2016-09-20 15:30:00','2016-09-20 18:30:00',0.00,NULL,3,0,1,18,1,'2016-09-20 15:30:00',0,1,1,'completed',12,191,NULL,NULL,NULL,644,NULL,NULL,'mblatz',0,0,'2016-09-14 19:30:42','2016-09-14 19:30:42'),(734,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.','You must be over 18+ to attend this class.\r\n\r\nThere is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.','2016-09-19 16:00:00','2016-09-19 19:00:00','2016-09-19 16:00:00','2016-09-19 19:00:00',5.00,NULL,0,6,1,18,0,'2016-09-19 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,526,NULL,NULL,'mblatz',0,0,'2016-09-14 19:47:11','2016-09-14 19:47:11'),(735,'DMS Trebuchet Build - Design Review','DMS is building a trebuchet for Slingfest 2016, time to finalize a design','With 5 weeks to go before the competition, we want to finalize a potential design to order parts and begin full scale construction. Anyone interested in trebuchet design and construction is welcome to attend.\r\n\r\nThis is a DMS group project, with special funding from DMS to use to purchase supplies and build a trebuchet.','','2016-09-18 20:00:00','2016-09-18 21:00:00','2016-09-18 20:00:00','2016-09-18 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-18 20:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,NULL,NULL,NULL,'brandonagr',1,0,'2016-09-14 21:50:10','2016-09-18 21:00:01'),(736,'Jewelry: Silver Ring Fabrication ','This class will be working with sterling silver to fabricate silver rings!','In this entry level silversmithing workshop you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of jewelry making tools and equipment . \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nHope to see you there!\r\n','Please wear closed toe shoes and pants. Safety glasses and aprons will be provided.','2016-10-01 19:00:00','2016-10-02 02:30:00','2016-10-01 18:30:00','2016-10-02 03:00:00',75.00,NULL,0,5,0,0,0,'2016-10-01 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,506,NULL,NULL,'nausser915',0,0,'2016-09-15 01:20:48','2016-09-15 01:20:48'),(737,'Fired Arts - Handbuilding  Pottery','We will begin by teaching pottery via handbuilding (pinch, coil, slab).  At 5, there will be a demo of throwing.  This time I\'ll make sure we\'ve got enough clay for practice.  $10 mat\'l payable at class time.','Handbuilding pottery --\r\nYour best chance at making an item today.  You will have to return after items are bisque fired to glaze them.\r\n5 pm -- throwing demo.  Creating pots via throwing takes practice and skill.  One rarely creates something worth saving the first time you try this technique.\r\nChildren under 13 are allowed with parent.\r\nMake sure you wear clothes that can get messy.\r\nYou\'ll need short fingernails if you plan to practice throwing.','','2016-10-01 19:00:00','2016-10-01 22:00:00','2016-10-01 19:00:00','2016-10-01 22:00:00',0.00,NULL,6,0,0,13,0,'2016-10-01 19:00:00',0,1,0,'cancelled',25,67,NULL,NULL,NULL,518,NULL,NULL,'dryad2b',0,0,'2016-09-15 01:40:47','2016-09-22 21:31:07'),(738,'Numismatic Table Talks','Open discussion of topics related to coin collecting & the art & science of money','An opportunity to discuss numismatics, medallic art, and related subjects, in an informal setting, moderated by the Secretary of Numismatics International, the society for world coin collectors.','','2016-09-22 03:00:00','2016-09-22 04:00:00','2016-09-22 03:00:00','2016-09-22 04:00:00',0.00,NULL,0,0,0,0,0,'2016-09-22 03:00:00',0,1,0,'completed',5,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-09-15 15:25:00','2016-09-22 04:00:01'),(739,'Numismatic Table Talks','Open discussion of topics related to coin collecting & the art & science of money','An opportunity to converse about numismatics, medallic art, & related topics, moderated by the Secretary of Numismatics International, the society for world coin collectors.','','2016-10-20 03:00:00','2016-10-20 04:00:00','2016-10-20 03:00:00','2016-10-20 04:00:00',0.00,NULL,0,0,0,0,0,'2016-10-20 03:00:00',0,1,0,'completed',5,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-09-15 15:27:54','2016-10-20 04:00:02'),(740,'Creative Arts/Wood/Electronics Supply Swap','Have extra stuff you aren\'t using? Bring it to share/trade/gift away ','***This was updated to include woodshop, electronics and whoever wants to come along****\r\n\r\nWe all have items we no longer find a use for but are hanging onto them for that \"this could be useful\" project. Bring your extra fabric, craft supplies and other items that you aren\'t finding useful for a fun little supply swap. \r\n \r\nIf you\'re a smoker please don\'t bring fabric or yarn - people are sensitive \r\n\r\n*other departments are also doing a swap at the same time so it might be a fun day to come out. \r\n\r\nHere are some guidelines I found online that might help us with the implementation of this: \r\nIn a swap, fairness is at the heart of the whole process. That means that swappers should leave with goods that are of roughly equal value to the ones they submitted for barter. To ensure a fair exchange, it\'s important to assess the value of the goods submitted and rate them accordingly. Some swaps use a democratic approach where all the items are considered of equal value, like in a book exchange. Your rules may specify bundled items of roughly equal value to ensure that everyone gets a fair deal. This makes swapping a really simple process, but it may not be flexible enough to accommodate all the items guests want to bring.\r\n\r\nAnother approach is to assign tickets or pennies based on the value of an item. Here\'s how it works: \r\nA guest arrives with an item to swap. You or a helper suggests the item is worth about two pennies (or tickets) on a scale of one to five. You exchange the goods for the pennies and place the item on the two penny table. Now the guest can choose another two penny item, or if she brought two items and has four pennies to play with, can spend them at the four penny table. This requires a good eye for value and some diplomacy. Folks are usually pretty honest about what they have to exchange, though. Waiting until a few guests have arrived to establish a baseline valuation for say, a roll of ribbon as opposed to a fully illustrated book, will get you started.','','2016-10-22 20:30:00','2016-10-22 22:00:00','2016-10-22 20:00:00','2016-10-22 22:15:00',0.00,NULL,0,0,0,0,0,'2016-10-22 20:30:00',0,1,0,'completed',8,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-09-15 15:50:31','2016-10-22 22:00:01'),(741,'Nuclear Science Day at DMS','As part of National Nuclear Science Week, exhibits, demonstrations, and films on atomic energy topics.','Come and learn about topics such as radioactivity and nuclear power, as part of National Nuclear Science Week.  In addition to a variety of physical exhibits, and a video presentation, 16 mm motion pictures will be projected.','Small quantities of radioactive material will be present, in forms such as tritium phials and uranium glass, and radiation-detecting instruments employing high voltages will be in use.  These pose no special health or safety hazard.','2016-10-22 17:00:00','2016-10-23 01:00:00','2016-10-22 16:45:00','2016-10-23 01:15:00',0.00,NULL,0,0,0,0,0,'2016-10-22 17:00:00',0,1,0,'completed',3,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-09-15 15:58:50','2016-10-23 01:00:01'),(742,'Introduction to Atomic Energy','Four lessons on the energy locked up inside the basic building-blocks of matter as we know it, and how humans learned to harness it to our own purposes.','In what ways do atoms break down?\r\nHow did we find that out?\r\nHow does radiation affect living organisms?\r\nWhat kinds of measurements do we make of radiation, and what kinds of instruments do we use to make them?\r\nWhat kinds of sub-atomic changes can we, as humans, cause and control?\r\nWhat practical applications do those changes have?\r\nWhat is an atomic power plant, how is it put together, and how does it work?\r\nWhen and why would we choose to use atomic energy?\r\nAs part of National Nuclear Science Week, a repeat of our well-received lecture-and-demonstration class series covering general topics related to the structure of matter, ionizing radiation, radioactivity, nuclear reactions, and the practical applications of intra-atomic energy.','Small quantities of radioactive material will be present, in forms such as tritium phials and uranium glass, and radiation-detecting instruments employing high voltages will be in use.  These pose no special health or safety hazard.','2016-10-18 01:30:00','2016-10-18 03:30:00','2016-10-18 01:15:00','2016-10-18 03:45:00',0.00,NULL,0,0,0,0,0,'2016-10-18 01:30:00',0,1,0,'cancelled',9,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',0,0,'2016-09-15 16:13:44','2016-09-22 03:48:35'),(743,'Introduction to Atomic Energy','Four lessons on the energy locked up inside the basic building-blocks of matter as we know it, and how humans learned to harness it to our own purposes.','In what ways do atoms break down?\r\nHow did we find that out?\r\nHow does radiation affect living organisms?\r\nWhat kinds of measurements do we make of radiation, and what kinds of instruments do we use to make them?\r\nWhat kinds of sub-atomic changes can we, as humans, cause and control?\r\nWhat practical applications do those changes have?\r\nWhat is an atomic power plant, how is it put together, and how does it work?\r\nWhen and why would we choose to use atomic energy?\r\nAs part of National Nuclear Science Week, a repeat of our well-received lecture-and-demonstration class series covering general topics related to the structure of matter, ionizing radiation, radioactivity, nuclear reactions, and the practical applications of intra-atomic energy.','Small quantities of radioactive material will be present, in forms such as tritium phials and uranium glass, and radiation-detecting instruments employing high voltages will be in use.  These pose no special health or safety hazard.'