 will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.','You must be over 18+ to attend this class.\r\n\r\nThere is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.','2016-09-27 16:00:00','2016-09-27 19:00:00','2016-09-27 16:00:00','2016-09-27 19:00:00',5.00,NULL,0,6,1,18,0,'2016-09-27 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,526,NULL,NULL,'mblatz',0,0,'2016-09-16 00:29:27','2016-09-16 00:29:27'),(748,'Telepresence Kick-off Meeting (Science Committee Project)','Planning meeting for the Telepresence project. ','We will be planning our project goals and milestones as well as upcoming classes for the Telepresence project. \r\n\r\nSome skills needed: video conferencing and web interface programming, mechanical engineering, Raspberry Pi and Arduino experience, and robotics. ','','2016-09-18 18:00:00','2016-09-18 19:00:00','2016-09-18 18:00:00','2016-09-18 19:00:00',0.00,NULL,0,0,0,0,0,'2016-09-18 18:00:00',0,1,0,'completed',3,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-09-16 02:25:41','2016-09-18 19:00:01'),(749,'Introduction to the PHP Programming Language','Beginner Course for Web Development with PHP','Introduction to PHP for the purposes of Web Development\r\n\r\nThis is a class designed for someone who has never written PHP in their life and has minimal experience with other programming languages.\r\n\r\nWe will cover:\r\n- General Programming Basics Refresher & IDEs\r\n- Basic syntax, usage, operations\r\n- How PHP works with the rest of the web (HTML/CSS/JS)\r\n- Databases (MySQL)\r\n- Object Oriented PHP (time/interest permitting)\r\n\r\nThis course is designed as a freeform question-and-answer course.  Feel free to ask questions throughout.  If there is a specific thing within the scope of the course you\'d like to know more about, please ask!\r\n\r\nPlease bring a laptop.','Please bring a Laptop.  If you have an IDE you prefer, please have that installed.  If not, we will suggest some options.','2016-10-02 16:30:00','2016-10-02 19:00:00','2016-10-02 16:30:00','2016-10-02 19:00:00',0.00,NULL,0,0,0,0,0,'2016-10-02 16:30:00',0,1,0,'completed',9,403,NULL,NULL,NULL,NULL,NULL,NULL,'keatonic',1,0,'2016-09-16 02:29:56','2016-10-02 19:00:01'),(750,'Prusa i3 MK2 Build Live Stream','I will be live streaming a 3D printer build. ','I am live streaming the build of my Prusa i3 MK2 3D printer kit for the upcoming workshop on October 8-9th. If you want to participate i\'ll be answering questions on my stream live on my Youtube channel (https://www.youtube.com/channel/UChFapZLUw2WLMcq8nl8sW9Q)','','2016-09-19 00:00:00','2016-09-19 07:00:00','2016-09-19 00:00:00','2016-09-19 07:00:00',0.00,NULL,0,0,0,0,0,'2016-09-19 00:00:00',0,1,0,'completed',4,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-09-16 02:36:23','2016-09-19 07:00:01'),(751,'Private Event - Thunder Laser','Marathon use of the Thunder Laser to cut and engrave special items','Marathon use of the Thunder Laser to cut and engrave special items','','2016-09-24 15:00:00','2016-09-25 04:00:00','2016-09-24 15:00:00','2016-09-25 04:00:00',0.00,NULL,1,0,0,0,1,'2016-09-24 15:00:00',0,1,0,'cancelled',16,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',0,0,'2016-09-16 03:51:00','2016-09-16 03:52:25'),(752,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-09-29 00:00:00','2016-09-29 02:00:00','2016-09-29 00:00:00','2016-09-29 02:00:00',20.00,NULL,0,8,0,16,1,'2016-09-29 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-16 03:54:18','2016-09-29 02:00:01'),(753,'Automated Farm Bot','Discuss and plan for the 10 week project to build and automated farming device.','At this meeting we will be discussing and planning for the 10 week project to design and build an automated farming device.  We have two initial concepts we will be selecting from: a vertical automated farm or augmenting the aquaponics with an open sources CNC farming tool.  Once we have our concept selected, we will be building a schedule and budget as well as assigning roles and tasks.  Lastly we will be picking 4 topics related to our project that we will teach about in future classes.\r\n\r\nNo experience is necessary, just a willingness to learn and participate.  I hope to see you there.','','2016-09-18 16:30:00','2016-09-18 17:30:00','2016-09-18 16:30:00','2016-09-18 17:30:00',0.00,NULL,0,0,0,0,0,'2016-09-18 16:30:00',0,1,0,'completed',18,404,NULL,NULL,NULL,NULL,NULL,NULL,'renkessa',1,0,'2016-09-16 05:14:33','2016-09-18 17:30:01'),(754,'NEIWG Project Planning','We will be discussing our main initiatives and how we can divide the tasks to produce demonstration by December','We will be discussing our main initiatives and how we can divide the tasks to produce demonstration by December.  Please join us if you are interested in learning about are contributing to one of our prosthetics and electromyography(EMG) projects.','','2016-09-22 01:30:00','2016-09-22 03:30:00','2016-09-22 01:30:00','2016-09-22 03:30:00',0.00,NULL,0,0,0,0,0,'2016-09-22 01:30:00',0,1,0,'completed',8,404,NULL,NULL,NULL,NULL,NULL,NULL,'renkessa',1,0,'2016-09-16 05:20:23','2016-09-22 03:30:02'),(755,'Designing for the Multicam','In this class we will be going over the basics of CAD design in Solidworks, will talk about strategies for designing for the Multicam, import our design into Vcarve, and prepare files for the router.','In this class we will be going over the basics of CAD design in Solidworks, will talk about strategies for designing for the Multicam, import our design into Vcarve, and prepare files for the router. There are no prerequisites for this class, but you need to have taken the CNC Router class to access Vcarve and use the router if you plan on using these skills.\r\n\r\nIn this class we will be creating a basic stool. This class assumes no knowledge of CAD design. Attendees will leave with:\r\n-Ability to design and create assemblies in Solidworks. (Basics of the software)\r\n-Strategies and considerations for designing for the Multicam.\r\n-Examples of CNC joints\r\n-Knowledge of how to prepare designs in Vcarve and generate files ready for the router.\r\n\r\nNote: This class will cover \"Flat-Pack\" design. We will not be doing 3D paths on the router.','','2016-10-06 00:00:00','2016-10-06 01:30:00','2016-10-05 23:45:00','2016-10-06 01:45:00',0.00,NULL,0,0,0,0,0,'2016-10-06 00:00:00',0,1,0,'completed',9,184,NULL,NULL,NULL,NULL,NULL,NULL,'rshill',1,0,'2016-09-16 15:30:08','2016-10-06 01:30:01'),(756,'Private Event - Thunder Laser - TEST 1','Testing calendar features - test 1','Testing calendar features - test 1','','2016-09-24 17:00:00','2016-09-25 00:00:00','2016-09-24 17:00:00','2016-09-25 00:00:00',0.00,NULL,1,0,0,0,1,'2016-09-24 17:00:00',0,1,0,'cancelled',16,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',0,0,'2016-09-16 16:04:53','2016-09-16 16:26:10'),(757,'Calendar test - serger','Calendar test - serger','Calendar test - serger','','2016-10-09 17:00:00','2016-10-09 18:00:00','2016-10-09 17:00:00','2016-10-09 18:00:00',0.00,NULL,1,0,0,0,1,'2016-10-09 17:00:00',0,1,0,'cancelled',2,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',0,0,'2016-09-16 16:39:15','2016-09-16 16:39:31'),(758,'Holiday Woodcarving (Class is full)','Carving  a holiday Santa Project','Woodcarving a Christmas Santa project that you will learn to carve with a knife and small gouges. Bring a sack lunch and join us for a fun day carving some decorations for your home or to give away. beginning carvers are welcome. Some tools will be available to borrow.  To register please email Sally Miller at smdglo@yahoo.com. Class will be limited to 15 participants to allow the instructor one an one time with the participants.\r\n\r\nCLASS REGISTRATION IS FULL AS OF OCT 10 ','Gloves and Thumb guard are recommended for hand protection ','2016-10-29 15:00:00','2016-10-29 19:00:00','2016-10-29 15:00:00','2016-10-29 19:00:00',0.00,NULL,0,0,0,16,0,'2016-10-29 15:00:00',0,1,1,'completed',11,408,NULL,NULL,NULL,NULL,NULL,NULL,'rabbo47',1,0,'2016-09-17 03:18:58','2016-10-29 19:00:01'),(759,'Weather Station Project Launch ','We will be hammering out the details for installing a weather station at the space','','','2016-09-21 23:00:00','2016-09-22 00:00:00','2016-09-21 23:00:00','2016-09-22 00:00:00',0.00,NULL,0,0,0,0,0,'2016-09-21 23:00:00',0,1,0,'completed',8,401,NULL,NULL,NULL,NULL,NULL,NULL,'brianbterry',1,0,'2016-09-17 07:32:30','2016-09-22 00:00:01'),(760,'FREE Movie Night with Dallas Film Crew','Screening of Short films','In appreciation of the awesome people here at the Dallas MakerSpace, we invite all members to a private screening of the Dallas Film Crew\'s short films. This is an opportunity to see what films are being made by teams at the MakerSpace and to get involved. ','','2016-10-08 01:00:00','2016-10-08 03:00:00','2016-10-08 00:30:00','2016-10-08 03:15:00',0.00,NULL,0,0,0,0,0,'2016-10-08 01:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-17 18:24:37','2016-10-08 03:00:01'),(761,'3d printer basics','Mandatory intro class for 3d fab','This is the mandatory class for using the 3D print lab. Yo will learn the rules and basic operation of the printers and how to slice you files for use with them.','','2016-09-28 18:00:00','2016-09-28 19:00:00','2016-09-28 18:00:00','2016-09-28 19:00:00',0.00,NULL,8,0,1,16,0,'2016-09-28 18:00:00',0,1,0,'completed',1,70,1,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-09-17 22:36:23','2016-09-28 19:00:01'),(762,'test','test','test test test','','2016-10-02 15:00:00','2016-10-02 16:00:00','2016-10-02 15:00:00','2016-10-02 16:00:00',0.00,NULL,0,0,1,0,0,'2016-10-02 15:00:00',0,1,0,'cancelled',4,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',0,0,'2016-09-18 00:45:22','2016-09-18 01:35:21'),(763,'Test class ....  just testing calendar features','Test class ....  just testing calendar features','Test class ....  just testing calendar features.  I will delete this just as soon as I test the feature.','','2016-09-23 17:00:00','2016-09-23 18:00:00','2016-09-23 17:00:00','2016-09-23 18:00:00',0.00,NULL,1,0,0,0,1,'2016-09-23 17:00:00',0,1,0,'cancelled',2,10,NULL,NULL,NULL,NULL,NULL,NULL,'chrismini',0,0,'2016-09-18 02:09:15','2016-09-18 02:09:36'),(764,'Members\' Meeting','Regular Members Meeting, October 2016','October monthly members\' meeting where we discuss the general state of the organization, committees report their activities of the month, and we can all gather in one place for discussion','','2016-10-14 01:00:00','2016-10-14 03:00:00','2016-10-14 00:45:00','2016-10-14 03:15:00',0.00,NULL,0,0,0,0,0,'2016-10-14 01:00:00',0,1,0,'completed',8,66,NULL,NULL,NULL,NULL,NULL,NULL,'eriksmith',1,0,'2016-09-18 06:08:53','2016-10-14 03:00:01'),(765,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','So, who needs this class?  If you are not a pretty experienced leather worker, you probably do even if you have taken a project class or two at the space.  YouTube can\'t teach you our expectations of care, lol.  This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-10-08 20:00:00','2016-10-08 21:30:00','2016-10-08 19:30:00','2016-10-08 21:45:00',0.00,NULL,7,0,0,0,0,'2016-10-08 20:00:00',0,1,0,'completed',11,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',1,0,'2016-09-18 06:49:53','2016-10-08 21:30:01'),(766,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-09-27 00:00:00','2016-09-27 02:00:00','2016-09-26 23:45:00','2016-09-27 02:15:00',0.00,NULL,0,0,1,0,0,'2016-09-27 00:00:00',0,1,0,'completed',9,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',0,0,'2016-09-18 07:52:56','2016-09-18 07:52:56'),(767,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.','You must be over 18+ to attend this class.\r\n\r\nThere is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.','2016-09-27 16:00:00','2016-09-27 19:00:00','2016-09-27 16:00:00','2016-09-27 19:00:00',5.00,NULL,0,6,1,18,0,'2016-09-26 16:00:00',0,1,0,'cancelled',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',0,0,'2016-09-18 13:07:20','2016-09-18 20:25:41'),(768,'3D Printing Training Class','Required training for using the PolyPrinter 3D printers in 3D Fab.','Required training for using the PolyPrinter 3D printers in 3D Fab.','','2016-10-07 02:00:00','2016-10-07 04:00:00','2016-10-07 01:45:00','2016-10-07 04:15:00',0.00,NULL,0,0,1,16,0,'2016-10-07 02:00:00',0,1,0,'completed',9,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-09-18 17:13:29','2016-10-07 04:00:01'),(769,'Dallas Film Crew #70','Filmmakers Meeting','10:00 AM Preparation and planning\r\n1:00 PM Show up to meeting at this time.\r\n\r\nOutline of event: Meet at the Dallas MakerSpace. Head out to Carrollton to film in public. ','','2016-11-06 16:00:00','2016-11-06 22:00:00','2016-11-06 16:00:00','2016-11-06 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-06 16:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-18 18:48:03','2016-11-06 22:00:01'),(770,'Dallas Film Crew #71','Filmmakers Meeting','10:00 AM Preparation and planning\r\n1:00 PM Show up to meeting at this time.\r\n\r\nMeet Texas native Michael D. Brown: a self-taught, award winning writer, producer and director. Brown assumed the name M. Legend when he started directing. He admits to being bitten by the filmmaking bug about ten years ago when he was hired by Milkshake films to write and direct their first film. During the making of that film, Brown realized his love for storytelling. Seeing his words come to life on the silver screen was confirmation of what he was supposed to do the rest of his life.','','2016-11-13 16:00:00','2016-11-13 22:00:00','2016-11-13 16:00:00','2016-11-13 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-13 16:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-18 18:53:22','2016-11-13 22:00:01'),(771,'Dallas Film Crew #72','Filmmakers Meeting','Workshops, Classes, and special events ll related to creating a Motion Picture','','2016-11-20 16:00:00','2016-11-20 22:00:00','2016-11-20 16:00:00','2016-11-20 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-20 16:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-18 18:54:39','2016-11-20 22:00:02'),(772,'Design Your Own Virtual Space','Design a virtual representation of any area of space using Blender software to figure out the best way to arrange equipment in any given area.','We\'ll create a virtual representation of the Science Space in less than an hour using Blender (https://www.blender.org).  I\'ll pass out sheets containing all the hotkeys needed for this exercise and usb stick with the digital photos needed for this exercise.  Then we\'ll get acquainted with the Blender environment and begin building a virtual representation of the Science Space.  Great for figuring out how to arrange items and pieces of equipments within an area when space is lacking.  Please download the Blender software (free) before attending give this video a watch if you want to come prepared: https://www.youtube.com/watch?v=lZe3tGWSy6s','Users should show up with Blender software (free) installed on their laptop.  Software can be download from here: https://www.blender.org/download/\r\nIt\'ll help things along if you watch this YouTube intro video: https://www.youtube.com/watch?v=lZe3tGWSy6s','2016-09-29 00:00:00','2016-09-29 01:00:00','2016-09-29 00:00:00','2016-09-29 01:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 00:00:00',0,1,0,'completed',18,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-09-18 20:01:39','2016-09-29 01:00:01'),(773,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.\r\n','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class.','2016-09-27 16:00:00','2016-09-27 19:00:00','2016-09-27 16:00:00','2016-09-27 19:00:00',5.00,NULL,0,6,1,18,0,'2016-09-26 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0