set of virtual images that represent operating systems and are tasked with finding cybersecurity vulnerabilities within the images and hardening the system while maintaining critical services in a six hour period.  Teams compete for the top placement within their state and region, and the top teams in the nation earn all-expenses paid trips to Baltimore, MD for the National Finals Competition where they can earn national recognition and scholarship money.','This event is for Civil Airpatrol Members who will be participating in CyberPartiot IX.  ','2016-09-24 18:00:00','2016-09-24 21:30:00','2016-09-24 18:00:00','2016-09-24 21:30:00',0.00,NULL,0,0,0,13,1,'2016-09-24 18:00:00',0,1,0,'completed',8,367,NULL,NULL,NULL,NULL,NULL,NULL,'bigdaddycool',1,0,'2016-09-19 00:41:55','2016-09-24 21:30:02'),(782,'Freecode Camp Study group','Free Code Camp is an open source community of busy adults who learn to code, then practice by building projects for nonprofits.','Come code with us as we talk about HTML, CSS, Full-Stack Javascript and all things related. Get help working through the Free Code Camp curriculum. \r\n\r\nBeginners welcome. http://www.freecodecamp.com https://www.facebook.com/groups/free.code.camp.dallas ','','2016-09-24 01:30:00','2016-09-24 02:30:00','2016-09-24 01:15:00','2016-09-24 02:30:00',0.00,NULL,0,0,0,0,0,'2016-09-24 01:30:00',0,1,0,'completed',11,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',1,0,'2016-09-19 14:58:05','2016-09-24 02:30:01'),(783,'JavaScript Introduction','Learn to code and build projects for nonprofits. Build your full stack web development portfolio today','This class will give students a thorough introduction to the JavaScript language. At the end of this class, students will be able to create JavaScript functions that define variables and arrays and that use if statements, switch/case statements, for loops and while loops. Students will be able to work with the Document Object Model (DOM) for manipulating web pages and testing user input in forms. Students will be able to write scripts that create and read cookies and respond to user interaction through mouseovers and clicks. An understanding of HTML/XHTML and programming is useful but not necessary for this course. No software is needed.','Course Outline:\r\n\r\nStudents will create a basic web page that contains JavaScript.\r\nStudents will write JavaScript code, run it and debug it.\r\nStudents will write JavaScript code to get input from the user and display the results.\r\nStudents will write JavaScript code to work numeric and string data and dates.\r\nStudents will write JavaScript code to execute conditionally and to loop.\r\nStudents will write JavaScript code to create and use arrays.\r\nStudents will write JavaScript code to define and use functions.\r\nStudents will write JavaScript code to create and use objects.\r\nStudents will write JavaScript code to validate data and handle errors.\r\nStudents will create a final project using what they learned in the class.\r\n\r\n','2016-10-05 02:00:00','2016-10-05 03:00:00','2016-10-05 02:00:00','2016-10-05 03:00:00',25.00,NULL,0,0,0,0,0,'2016-10-03 02:00:00',0,1,0,'completed',3,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',1,0,'2016-09-19 15:17:08','2016-10-05 03:00:02'),(784,'JavaScript Introduction','Learn to code and build projects for nonprofits. Build your full stack web development portfolio today','This class will give students a thorough introduction to the JavaScript language. At the end of this class, students will be able to create JavaScript functions that define variables and arrays and that use if statements, switch/case statements, for loops and while loops. Students will be able to work with the Document Object Model (DOM) for manipulating web pages and testing user input in forms. Students will be able to write scripts that create and read cookies and respond to user interaction through mouseovers and clicks. An understanding of HTML/XHTML and programming is useful but not necessary