orking through the Free Code Camp curriculum. \r\n\r\nBeginners welcome. http://www.freecodecamp.com https://www.facebook.com/groups/free.code.camp.dallas ','','2016-10-21 13:30:00','2016-10-21 14:30:00','2016-10-21 13:15:00','2016-10-21 14:30:00',0.00,NULL,0,0,0,0,0,'2016-10-21 13:30:00',0,1,0,'completed',11,31,NULL,NULL,NULL,782,NULL,NULL,'denzuko',1,0,'2016-09-19 17:25:03','2016-10-21 14:30:01'),(791,'XM Core BBS Meetup - Come Join the fun','Join in with everyone in the conference to discuss anything and everything from Ingress, coding, vintage computers, and retro bbsing.','The SysOp of XM Core has agreed to host a BBS meetup on his Board and in person at DMS.\r\n\r\nThis month we\'ll be premiering History Of Amiga, continuing with our keysigning, and if time permitted a nethack or zork challenge before closing out things with the announcement of the monthly Coding Challenge.\r\n\r\nPizza and Drinks will be at the space while we\'re on the conference.\r\n\r\nTelnet: tty.dapla.net  - Web: https://bbs.dapla.net\r\nechomail: Cyberlord on xm core bbs\r\nDMS Talk: Denzuko','','2016-10-23 23:00:00','2016-10-24 00:30:00','2016-10-23 22:45:00','2016-10-24 00:30:00',0.00,NULL,0,0,0,0,0,'2016-10-22 23:00:00',0,1,0,'completed',11,31,NULL,NULL,NULL,692,NULL,NULL,'denzuko',1,0,'2016-09-19 17:29:32','2016-10-24 00:30:01'),(792,'VCC: October Coding Challenge','VCC: Proudly Presents Monthly Coding Challenges','Vintage Computer Committee Proudly Presents Monthly Coding Challenge. \r\n\r\nThis month\'s theme is Amiga!\r\n\r\nAssembly, C, and BASIC is the name of the game this time around.\r\n\r\nCheck talk and the wiki for the challenge rules. Submissions are due one week before the XM Core Dial-in meetup.','','2016-10-01 17:00:00','2016-10-31 17:01:00','2016-10-01 17:00:00','2016-10-31 17:01:00',0.00,NULL,0,0,0,0,0,'2016-10-01 17:00:00',0,1,0,'completed',23,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',1,0,'2016-09-19 22:23:31','2016-10-31 17:05:01'),(793,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.','All experience levels welcome and encouraged to attend! If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session. Bring your projects, ideas, questions, answers, tips & tricks. This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.\r\n\r\nTopic of discussion:  GROUP BUYS for leather and supplies.','','2016-10-16 20:00:00','2016-10-16 21:30:00','2016-10-16 20:00:00','2016-10-16 21:30:00',0.00,NULL,0,0,0,0,0,'2016-10-16 20:00:00',0,1,0,'completed',5,54,NULL,NULL,NULL,NULL,NULL,NULL,'bitta',1,0,'2016-09-19 23:18:49','2016-10-16 21:30:01'),(794,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class.','2016-10-04 16:00:00','2016-10-04 19:00:00','2016-10-04 16:00:00','2016-10-04 19:00:00',5.00,NULL,0,6,1,18,0,'2016-10-03 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-20 00:29:47','2016-10-04 19:00:01'),(795,'Cinema Cafe','Watch a foreign film with us and discuss it afterwards!','Cinema Cafe meets occasionally to watch and discuss foreign films. Our tireless leader, Eduardo, never fails to surprise with his interesting choices.','','2016-10-29 00:00:00','2016-10-29 04:00:00','2016-10-29 00:00:00','2016-10-29 04:00:00',0.00,NULL,0,0,0,0,0,'2016-10-29 00:00:00',0,1,0,'completed',9,158,NULL,NULL,NULL,NULL,NULL,NULL,'jhaney',1,0,'2016-09-20 19:11:43','2016-10-29 04:00:02'),(796,'Multi-part Lathe Class','This is the 3rd out of a 10 part class. Enrollment is closed. ','This is the 4th out of a 10 part class. Enrollment is closed. ','','2016-09-28 15:30:00','2016-09-28 18:30:00','2016-09-28 15:30:00','2016-09-28 18:30:00',0.00,NULL,3,0,1,18,1,'2016-09-28 15:30:00',0,1,1,'cancelled',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',0,0,'2016-09-20 23:21:25','2016-09-20 23:28:40'),(797,'Lathe Class','This is the 4th out of a 10 part class. Enrollment is closed.','This is the 4th out of a 10 part class. Enrollment is closed.','','2016-09-28 15:30:00','2016-09-28 18:30:00','2016-09-28 15:30:00','2016-09-28 18:30:00',0.00,NULL,3,0,1,18,1,'2016-09-28 15:30:00',0,1,1,'completed',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-20 23:33:31','2016-09-28 18:30:02'),(798,'Basic Knife Making','Basic knife making class by Master Knifemaker Dave McDearmont','This class will consist of the viewing of the 1987 video \"Basic Knife Making\" by Master Knife Maker Dave McDearmont.  Dave will annotate, explain and expand on the video content.  The student will learn about materials, equipment, methods and techniques to fabricate a basic non folding knife.','','2016-10-07 00:00:00','2016-10-07 02:00:00','2016-10-07 00:00:00','2016-10-07 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-07 00:00:00',0,1,1,'completed',9,424,NULL,NULL,NULL,NULL,NULL,NULL,'schasb',1,0,'2016-09-21 01:57:06','2016-10-07 02:00:01'),(799,'Life Drawing Class','We will teach the basics of getting the anatomy correct','In this class we will be learning to take basic shapes to create the human anatomy.\r\n\r\n$10 cost to help pay for the cost of the model.\r\n\r\nYou are welcomed to bring any medium you\'d like but please clean up after yourself. If you use paint please bring your own drop cloth. No easels are available but you are welcomed to bring your own.\r\n\r\nI specialize in watercolor, pencil, charcoal and pastel so if you want learn one of these mediums please bring it and I\'ll teach you some fund stuff. I also know acrylic and can teach it but I\'m still learning it myself.','','2016-10-08 00:00:00','2016-10-08 03:00:00','2016-10-07 23:00:00','2016-10-08 03:30:00',0.00,NULL,0,0,0,0,0,'2016-10-08 00:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-09-21 04:19:00','2016-10-08 03:00:01'),(800,'North Texas Solidworks Meeting','Meeting with representatives of SolidWorks and other users to review new features and share information','Quarterly meeting of the North Texas SolidWorks 3D modeling user group lead by local distributors of the software with guest lecturers and speakers.','','2016-11-01 23:00:00','2016-11-02 00:00:00','2016-11-01 22:30:00','2016-11-02 00:00:00',0.00,NULL,0,0,0,0,0,'2016-11-01 23:00:00',0,1,1,'completed',9,426,NULL,NULL,NULL,NULL,NULL,NULL,'joelsmithdesigns',1,0,'2016-09-21 16:04:28','2016-11-02 00:00:01'),(801,'Resin casting using colored powders, like mother of pearl','resing casting and achiving colored effects','Colored powders are used to give the finished resin piece a variety of different colors, metal effects, and textures using different types and brands of powders.','wear an apron or old clothes','2016-10-01 20:00:00','2016-10-01 21:00:00','2016-10-01 20:00:00','2016-10-01 21:00:00',0.00,NULL,20,0,0,0,0,'2016-10-01 20:00:00',0,1,0,'rejected',5,70,NULL,NULL,NULL,NULL,'lukeiamyourfather','Complaints have been received in the past regarding a class you taught on casting. The complaints indicated you didn\'t complete the material that was planned and it wasn\'t organized.','maxk68',0,0,'2016-09-21 17:57:19','2016-09-23 17:57:35'),(802,'DMS Trebuchet Build Day','We are building a pumpkin scale trebuchet, come help!','DMS is entering Slingfest 2016 in Plano on October 30th. Any member is welcome to come help build our floating arm trebuchet.','','2016-09-25 20:00:00','2016-09-26 04:00:00','2016-09-25 20:00:00','2016-09-26 04:00:00',0.00,NULL,0,0,1,0,0,'2016-09-25 20:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,NULL,NULL,NULL,'brandonagr',1,0,'2016-09-22 00:32:36','2016-09-26 04:00:01'),(803,'Space Build Out Working Day','Space Build Out Working Day','We will be working out how to implement a clean working area in the Science Area and finalizing the new floor plan.','','2016-09-25 19:00:00','2016-09-25 21:00:00','2016-09-25 19:00:00','2016-09-25 21:00:00',0.00,NULL,0,0,0,0,0,'2016-09-25 19:00:00',0,1,0,'completed',18,119,NULL,NULL,NULL,NULL,NULL,NULL,'hcbonner',1,0,'2016-09-22 01:59:46','2016-09-25 21:00:01'),(804,'Meteorology 101','An Introduction to our atmosphere and the weather','In the lead-up to the installation of a DMS weather station, the science committee would like to introduce some of the basics of meteorology.\r\n\r\nThis class will cover the structure of the atmosphere, global weather systems, air masses and pressure systems.','','2016-10-08 21:00:00','2016-10-08 22:00:00','2016-10-08 21:00:00','2016-10-08 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-08 21:00:00',0,1,0,'completed',9,155,NULL,NULL,NULL,NULL,NULL,NULL,'rcktdr',1,0,'2016-09-22 03:49:08','2016-10-08 22:00:01'),(805,'Introduction to Atomic Energy','Four lessons on the energy locked up inside the basic building-blocks of matter as we know it, and how humans learned to harness it to our own purposes.','As part of National Nuclear Science Week, a repeat of our well-received lecture-and-demonstration class series covering general topics related to the structure of matter, ionizing radiation, radioactivity, nuclear reactions, and the practical applications of intra-atomic energy.\r\nIn what ways do atoms break down?\r\nHow did we find that out?\r\nHow does radiation affect living organisms?\r\nWhat kinds of measurements do we make of radiation, and what kinds of instruments do we use to make them?\r\nWhat kinds of sub-atomic changes can we, as humans, cause and control?\r\nWhat practical applications do those changes have?\r\nWhat is the importance of uranium, thorium, and plutonium?\r\nWhat is an atomic power plant, how is it put together, and how does it work?\r\nWhen and why would we choose to use atomic energy?','Small quantities of radioactive material will be present, in forms such as tritium phials and uranium glass, and radiation-detecting instruments employing high voltages will be in use.  These pose no special health or safety hazard.','2016-10-21 01:30:00','2016-10-21 03:30:00','2016-10-21 01:15:00','2016-10-21 03:45:00',0.00,NULL,0,0,0,0,0,'2016-10-21 01:30:00',0,1,0,'completed',9,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-09-22 08:12:28','2016-10-21 03:30:02'),(806,'Introduction to Atomic Energy','Four lessons on the energy locked up inside the basic building-blocks of matter as we know it, and how humans learned to harness it to our own purposes.','As part of National Nuclear Science Week, a repeat of our well-received lecture-and-demonstration class series covering general topics related to the structure of matter, ionizing radiation, radioactivity, nuclear reactions, and the practical applications of intra-atomic energy.\r\nIn what ways do atoms break down?\r\nHow did we find that out?\r\nHow does radiation affe