ng using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-09-28 23:00:00','2016-09-29 00:00:00','2016-09-28 22:45:00','2016-09-29 00:00:00',10.00,NULL,0,6,0,16,1,'2016-09-28 23:00:00',0,1,0,'completed',21,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-22 20:00:12','2016-09-29 00:00:02'),(810,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-05 23:00:00','2016-10-06 00:00:00','2016-10-05 22:45:00','2016-10-06 00:00:00',10.00,NULL,0,6,0,16,1,'2016-10-05 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-22 20:08:04','2016-10-06 00:00:01'),(811,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.\r\n','','2016-10-06 00:00:00','2016-10-06 02:00:00','2016-10-06 00:00:00','2016-10-06 02:00:00',10.00,NULL,0,8,0,16,1,'2016-10-06 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-09-22 20:14:49','2016-10-06 02:00:01'),(812,'Financial Speaking event (test)','Camera crew test for speaking event','Camera crew test for speaking event','','2016-10-29 01:00:00','2016-10-29 04:00:00','2016-10-29 01:00:00','2016-10-29 04:00:00',0.00,NULL,0,0,1,0,1,'2016-10-29 01:00:00',0,1,0,'completed',11,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-22 20:37:29','2016-10-29 04:00:02'),(813,'Measuring Tree - Casting Call','Casting Call for Actors','Final Casting Call for Actors, Measuring Tree','','2016-09-29 23:00:00','2016-09-30 03:00:00','2016-09-29 23:00:00','2016-09-30 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 23:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-09-22 23:40:32','2016-09-30 03:00:01'),(814,'Casting Call - Measuring Tree','Casting Call for Actors','Final Casting Calls for the Measuring Tree','','2016-09-30 23