-30 16:30:00',0,1,0,'completed',18,404,NULL,NULL,NULL,NULL,NULL,NULL,'renkessa',1,0,'2016-09-23 05:05:04','2016-10-30 18:30:01'),(818,'HSM Walkthrough','Introduction to HSM for HAAS Mill users','Thomas Babb of the Denton Advanced Technology Center will be demonstrating using HSM for the HAAS VMC.\r\n\r\nPlease watch this before attending this event: https://attendee.gotowebinar.com/recording/viewRecording/8194505506017598467/5660976729297586948/tbabb@dentonisd.org','','2016-09-28 00:30:00','2016-09-28 02:30:00','2016-09-28 00:00:00','2016-09-28 02:30:00',0.00,NULL,20,0,0,0,0,'2016-09-28 00:30:00',0,1,0,'completed',9,38,NULL,NULL,NULL,NULL,NULL,NULL,'bryan',1,0,'2016-09-23 13:59:35','2016-09-28 02:30:01'),(819,'September Board Meeting ','September Board Meeting ','Board meeting Agenda:\r\n\r\nhttps://dallasmakerspace.org/wiki/Board_of_Directors_Meeting_20160923','','2016-09-24 00:30:00','2016-09-24 03:30:00','2016-09-24 00:15:00','2016-09-24 03:30:00',0.00,NULL,0,0,0,0,0,'2016-09-24 00:30:00',0,1,0,'completed',8,4,NULL,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-09-23 17:54:24','2016-09-24 03:30:01'),(820,'Laser Basics','Learn how to use our 3 lasers!','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-10-11 00:00:00','2016-10-11 02:00:00','2016-10-11 00:00:00','2016-10-11 02:00:00',0.00,NULL,8,0,1,0,0,'2016-10-11 00:00:00',0,1,0,'completed',11,333,2,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-09-23 20:19:57','2016-10-11 02:00:02'),(821,'Laser Basics','Learn to use our 3 lasers!','Learn how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minu