how to Laser, then how to use all our lasers! \r\nThe LaserSaur! \r\nThe Thunder! \r\nThe Epilog Zing! \r\nWe will spend 45-60 minutes talking about lasers work, about the file types for vectors and rastering, what materials you can etch, raster, and cut. Then we walk thru the process for each machine.\r\n\r\nDocumentation is avail at dallas.ms/wiki. Search for Laser Committee.','','2016-11-03 00:00:00','2016-11-03 02:00:00','2016-11-03 00:00:00','2016-11-03 02:00:00',0.00,NULL,8,0,0,0,0,'2016-11-03 00:00:00',0,1,0,'completed',11,333,2,NULL,NULL,NULL,NULL,NULL,'patrickpleez1',1,0,'2016-09-23 20:38:35','2016-11-03 02:00:01'),(828,'October Board Meeting','October Board Meeting','October Board Meeting','','2016-10-22 00:30:00','2016-10-22 03:30:00','2016-10-22 00:00:00','2016-10-22 03:45:00',0.00,NULL,0,0,0,0,0,'2016-10-22 00:30:00',0,1,0,'completed',11,51,NULL,NULL,NULL,NULL,NULL,NULL,'lukeiamyourfather',1,0,'2016-09-24 02:59:55','2016-10-22 03:30:02'),(829,'Jewelry Making: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n\r\nHope to see you there!\r\n','Closed toe shoes and jeans are recommended. Eye protection, aprons, and dust masks will be provided, along with all other supplies and materials. ','2016-10-01 19:00:00','2016-10-02 02:00:00','2016-10-01 18:30:00','2016-10-02 02:30:00',0.00,NULL,0,0,0,0,1,'2016-10-01 19:00:00',0,1,0,'rejected',26,21,NULL,NULL,NULL,NULL,'bscharff','Event must use calendar system\'s payment processor - not an outside system.','nausser915',0,0,'2016-09-24 19:02:18','2016-09-26 17:28:46'),(830,'Jewelry Making: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n\r\nHope to see you there!','Please wear closed-toe shoes and pants. Eye protection, dust masks, and aprons will be provided 