 available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-10-13 23:30:00','2016-10-14 01:00:00','2016-10-13 23:00:00','2016-10-14 01:15:00',0.00,NULL,7,0,0,0,0,'2016-10-13 23:30:00',0,1,0,'completed',11,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',1,0,'2016-09-26 03:21:06','2016-10-14 01:00:01'),(839,'DMS Trebuchet Build Day','We are building a pumpkin scale trebuchet, come help!','DMS is entering Slingfest 2016 in Plano on October 30th. Any member is welcome to come help build our floating arm trebuchet. See Talk thread for more info, https://talk.dallasmakerspace.org/t/trebuchet-sig-meetings-sundays/12213\r\n','','2016-10-02 20:00:00','2016-10-03 04:00:00','2016-10-02 20:00:00','2016-10-03 04:00:00',0.00,NULL,0,0,1,0,0,'2016-10-02 20:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,802,NULL,NULL,'brandonagr',1,0,'2016-09-26 09:24:19','2016-10-03 04:00:01'),(840,'Beginner Stained Glass','Learn the basics of stained glass while making a small sun catcher','We will all make a small pumpkin sun catcher like the one in the link \r\n\r\nYou will learn how to:\r\n- cut glass\r\n- use a glass grinder\r\n- apply copper foil\r\n- solder','Please wear closed toe shoes and bring safety glasses if you have them.','2016-10-08 15:00:00','2016-10-08 19:00:00','2016-10-08 14:45:00','2016-10-08 19:15:00',20.00,NULL,0,3,0,0,0,'2016-10-06 15:00:00',0,1,0,'completed',25,155,NULL,NULL,NULL,NULL,NULL,NULL,'rcktdr',1,0,'2016-09-26 14:39:49','2016-10-08 19:00:01'),(841,'Production Meeting-Wilderness The Film','A production meeting for the short film Wilderness','This is a production meeting for the short film Wilderness.','','2016-10-01 16:00:00','2016-10-01 20:00:00','2016-10-01 16:00:00','2016-10-01 20:00:00',0.00,NULL,0,0,0,0,1,'2016-10-01 16:00:00',0,1,0,'rejected',4,316,NULL,NULL,NULL,NULL,'bscharff','This appears to be an attempt to privately reserve a room.','serinadennis',0,0,'2016-09-26 17:48:37','2016-09-27 14:26:51'),(842,'EPSON 7880 Wide Format Printer Training','Required Training for the EPSON 7880 wide format printer','Required training for using the EPSON 7880 Wide Format Printer located in the Creative Arts Room. We will cover the basics of loading sheet and roll paper, precautions and maintenance concerns as well as printer driver settings and tips for getting good results. This is a free class and sign up is not required.','','2016-11-03 00:00:00','2016-11-04 01:00:00','2016-11-02 23:45:00','2016-11-04 01:00:00',0.00,NULL,0,0,0,0,0,'2016-11-03 00:00:00',0,1,0,'completed',5,341,NULL,NULL,NULL,788,NULL,NULL,'pandabob',1,0,'2016-09-26 17:57:57','2016-11-04 01:00:02'),(843,'EPSON 7880 Wide Format Printer Training','Required Training for the EPSON 7880 wide format printer','Required training for using the EPSON 7880 Wide Format Printer located in the Creative Arts Room. We will cover the basics of loading sheet and roll paper, precautions and maintenance concerns as well as printer driver settings and tips for getting good results. This is a free class and sign up is not required.','','2016-12-07 23:30:00','2016-12-08 00:30:00','2016-12-07 23:15:00','2016-12-08 00:30:00',0.00,NULL,0,0,0,0,0,'2016-12-07 23:30:00',0,1,0,'approved',5,341,NULL,NULL,NULL,788,NULL,NULL,'pandabob',0,0,'2016-09-26 18:04:51','2016-09-28 18:05:13'),(844,'Clear Resin Casting for  a Glass-Like Apperance ','basic tips for casting with CLEAR resins','This will be a hands on class showing how to use various tools to make your clear resin cast come out airbubble free and clear.','','2016-10-08 19:00:00','2016-10-08 20:00:00','2016-10-08 19:00:00','2016-10-08 20:00:00',0.00,NULL,0,0,0,0,0,'2016-10-08 19:00:00',0,1,0,'rejected',5,70,NULL,NULL,NULL,NULL,'alexrhodes','We informed you that the last class you taught had a complaint.  We would like to know more about what you plan to teach and how you plan to teach it.   This class submission has no additional information.  ','maxk68',0,0,'2016-09-26 18:26:51','2016-09-29 17:47:55'),(845,'Casting Resin with Specialty  (non metallic) Powders','Special Resin Casting','Using different powders to get different effect in casting, like mother or pearl, iridescent colors, wood, yes casting rubber molds with wood for antique repair. We will also discuss other special effects that can be used with resin.','','2016-10-08 20:00:00','2016-10-08 21:00:00','2016-10-08 20:00:00','2016-10-08 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-08 20:00:00',0,1,0,'rejected',5,70,NULL,NULL,NULL,NULL,'bscharff','This is clearly an extension of class \"Clear Resin Casting for a Glass-Like Apperance\" that immediately precedes this one.  Don\'t try to double-dip.','maxk68',0,0,'2016-09-26 18:36:37','2016-09-27 14:24:51'),(846,'EPSON 7880 Wide Format Printer Training ','Required Training for the EPSON 7880 wide format printer','This class covers the types of prints this printer can make as well as the basics for using the printer. Special attention is given to understanding the difference between printing on sheets versus paper that comes on rolls. We\'ll also cover the fee structure and a few important maintenance topics that will help keep the printer running smoothly. This is the required class for using the EPSON 7880 printer.\r\n\r\nNOTE! This is the new date and time for the class that was originally scheduled for October 5th.','','2016-10-04 22:30:00','2016-10-04 23:30:00','2016-10-04 22:15:00','2016-10-04 23:30:00',0.00,NULL,0,0,1,0,0,'2016-10-04 22:30:00',0,1,0,'completed',5,341,NULL,NULL,NULL,NULL,NULL,NULL,'pandabob',1,0,'2016-09-26 19:09:06','2016-10-04 23:30:01'),(847,'Vinyl Cutter Basics','Get up to speed cutting out your graphics on the Vinyl Cutter','Creative Arts has a new Vinyl Cutter!\r\n\r\nCome learn the basics of the new cutter.   We\'ll go over how to prep your files,  get the cutter set up, cut your files out, and apply them!   No charge for the class, but freewill donations are accepted in the Vinyl Cutter funds box!','','2016-10-07 00:00:00','2016-10-07 01:00:00','2016-10-06 23:45:00','2016-10-07 01:00:00',0.00,NULL,8,0,0,0,0,'2016-10-07 00:00:00',0,1,0,'completed',5,3,NULL,NULL,NULL,NULL,NULL,NULL,'adamoas',1,0,'2016-09-26 19:24:42','2016-10-07 01:00:01'),(848,'Blender Study Hall. ','Work on projects, start Modeling and commiserate with your co workers.','Work on projects, start Modeling\r\nand commiserate with your co workers. \r\n\r\nIf you need help or just want to get started, stop on by.\r\n\r\nBring a laptop and a Three Button Mouse!!!!!! Touch pads will not work well,. \r\n\r\nDownload and install the software\r\nhttp://www.blender.org/download/ \r\n\r\nIf your new to Blender watch the video\'s below. it\'s free\r\n\r\nhttps://cgcookie.com/archive/blender-basics-introduction-for-beginners/','','2016-10-13 00:00:00','2016-10-13 02:00:00','2016-10-13 00:00:00','2016-10-13 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-13 00:00:00',0,1,0,'completed',4,360,NULL,NULL,NULL,NULL,NULL,NULL,'metaldust',1,0,'2016-09-26 20:36:42','2016-10-13 02:00:01'),(849,'Creativity Workshop','This class is a guided workshop meant to inspire creativity in people. Everyone and every kind of creative is welcome!','The Creativity Workshop will have two parts to it.\r\n\r\nThe inspiration section...and\r\nThe creative time.\r\n\r\nThe inspirational section will hopefully build and inspire the students to come up with ideas and conversations within themselves and their own minds to start working on during the second half of the class. \r\n\r\nThere are lots of different types of inspiration we will go through during this first part.\r\n\r\nThe second part will have lots of options to be creative and many different ideas, assignments, and topics will be covered. Students will be encouraged to try two different kinds of creative outlet during this time. \r\n\r\nThe $8 fee is for supplies. But let me know if you need help. \r\n\r\nThere will be more classes like this and more information given at the workshop that will let you know what other opportunities like this are available. Thank you!','','2016-10-15 19:00:00','2016-10-15 21:00:00','2016-10-15 18:45:00','2016-10-15 21:15:00',8.00,NULL,0,15,0,13,0,'2016-10-13 19:00:00',0,1,0,'completed',11,449,NULL,NULL,NULL,NULL,NULL,NULL,'lstrehlow',1,0,'2016-09-26 22:03:26','2016-10-15 21:00:01'),(850,'Media Meet up','Media meet up ','MEDIA MEET UP','','2016-09-29 23:00:00','2016-09-30 03:00:00','2016-09-29 23:00:00','2016-09-30 03:00:00',0.00,NULL,0,0,0,0,0,'2016-09-29 23:00:00',0,1,0,'rejected',6,450,NULL,NULL,NULL,NULL,'bscharff','This appears to be an attempt to privately reserve a room.','rippedhousin',0,0,'2016-09-27 03:07:06','2016-09-27 14:26:10'),(851,'Jewelry Making: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nAll materials, supplies, tools and equipment will be included in the cost of the class.\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n\r\nHope to see you there!','Closed-toe shoes and pants are recommended ','2016-09-30 19:00:00','2016-10-01 02:00:00','2016-09-30 18:30:00','2016-10-01 02:30:00',0.00,NULL,0,0,0,0,0,'2016-09-30 19:00:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-09-27 17:27:38','2016-09-27 17:49:34'),(852,'Jewelry Making: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nAll materials, supplies, tools and equipment will be included in the cost of the class.\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n\r\nHope to see you there!','Please wear closed-toe shoes and pants.  Aprons, eye protection, and dust masks will be provided.','2016-10-08 19:00:00','2016-10-09 02:00:00','2016-10-08 18:30:00','2016-10-09 02:30:00',0.00,NULL,0,0,0,0,0,'2016-10-08 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-09-27 17:29:29','2016-10-09 02:00:01'),(853,'Jewelry: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nAll materials, supplies, tools and equipment will be included in the cost of the class.\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n','','2016-10-01 19:00:00','2016-10-02 02:00:00','2016-10-01 18:30:00','2016-10-02 02:30:00',0.00,NULL,0,0,0,0,0,'2016-10-01 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-09-27 17:52:07','2016-10-02 02:00:01'),(854,'How to Silk Screen a T-shirt (bring a t-shirt)','Many members didn\'t get a chance to create a DMS t-shirt or bag at Open House. I\'ll give a quick introduction on how to use the silk screen setup here at DMS and we will take turns creating t-shirts or bags. See description for further information. ','We will be learning how to setup the DMS silkscreen tools, how to mix ink, how to properly screen a shirt, how to use the new flash dryer, and how to clean up (for those who will stick around to help cleanup) \r\n\r\nPlease bring your own t-shirt to this event if you would like to print one. Michaels, Hobby Lobby, Joannes, even Dollar Tree have t-shirts you can print on. The ink will be black so plan accordingly. Please come with a $3 donation for ink/ new flash dryer. \r\n\r\nIf you would like to get a DMS bag please bring $5 donation (goes to PR) and you will walk away with a tote at the end of the night. \r\n\r\nIf you just want to come and learn how to print and not bring something along we will have some paper for you to experiment with. This class won\'t be covering how to burn screens! ','Please wear clothing that can get mess on them. Ink is horribly sticky stuff. We will be in the warehouse - please wear closed shoes. ','2016-10-19 00:00:00','2016-10-19 01:00:00','2016-10-18 23:15:00','2016-10-19 01:30:00',0.00,NULL,0,0,0,0,0,'2016-10-19 00:00:00',0,1,0,'completed',21,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-09-27 20:55:54','2016-10-19 01:00:01'),(855,'CA meeting for October ','Let\'s get together to talk over all the changes and make some decisions ','Sorry for the weeknight meeting I just don\'t know when else I can do it. \r\nDeciding about non-member usage will be the big discussion. \r\nVoting for the CA chair for next year. \r\nTalking over the annex and delegating some stuff out. \r\nWood show. \r\nNext year. \r\n','Feel free to bring snacks. Snacks are good. ','2016-10-13 00:30:00','2016-10-13 01:30:00','2016-10-13 00:30:00','2016-10-13 01:30:00',0.00,NULL,0,0,0,0,0,'2016-10-13 00:30:00',0,1,0,'completed',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-09-28 01:50:57','2016-10-13 01:30:01'),(856,'DMS Wood Shop Basics ','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw.  You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach.  Other power tools will be introduced and quickly demonstrated.','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots.  NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended.  DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class.','2016-10-11 16:00:00','2016-10-11 19:00:00','2016-10-11 16:00:00','2016-10-11 19:00:00',5.00,NULL,0,6,1,18,0,'2016-10-10 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-28 04:14:43','2016-10-11 19:00:01'),(857,'Lathe Class','This is the 5th out of a 10 part class. Enrollment is closed.','This is the 5th out of a 10 part class. Enrollment is closed.','','2016-10-05 15:30:00','2016-10-05 19:30:00','2016-10-05 15:30:00','2016-10-05 19:30:00',0.00,NULL,3,0,1,18,1,'2016-10-05 15:30:00',0,1,1,'completed',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-09-28 04:24:13','2016-10-05 19:30:01'),(858,'Lathe Class','This is the 6th out of a 10 part class. Enrollment is close