er Class (Wood Only)','Learn the Multicam CNC Router in the Woodshop. (wood only)','Learn the Multicam CNC Router in the Woodshop. This class will go over the basics in the Vcarve software and how to operate the machine. You must be a DMS member to take the class. Once the class is completed you will need to follow up at a later date with a test project. Once the test project is completed you will have full access to the machine. ','','2016-10-18 23:30:00','2016-10-19 03:00:00','2016-10-18 23:15:00','2016-10-19 03:00:00',50.00,NULL,0,13,1,16,0,'2016-10-17 23:30:00',0,1,0,'completed',9,4,3,NULL,NULL,355,NULL,NULL,'alexrhodes',1,0,'2016-10-01 02:40:06','2016-10-19 03:00:01'),(875,'Jewelry Techniques - Tab Setting','A short class focused on helping people set stones (especially irregular ones) without soldering.','This class will help participants learn sawing skills in order to design and create copper pendants that include stones or glass pieces that are set without any fire or heat.  Participants will be provided with materials and supplies for the class.  \r\n\r\nThere is a $10 kit fee (payable to the instructor) to cover the cost of disposables (such as saw blades) and materials (copper and stones for setting).','','2016-10-21 17:00:00','2016-10-21 21:00:00','2016-10-21 16:45:00','2016-10-21 21:15:00',0.00,NULL,4,0,0,0,0,'2016-10-21 17:00:00',0,1,0,'completed',26,420,NULL,NULL,NULL,NULL,NULL,NULL,'purpleporpoise',1,0,'2016-10-01 05:43:54','2016-10-21 21:00:01'),(876,'Jewelry Techniques - Air Chased Copper Cuff','A class designed to teach participants how to create textured cuff bracelets from copper tubing','Participants will learn how to use air chasing techniques to transform copper tubing into beautiful cuff bracelets.  Participants will need to be able to handle and hit with relatively heavy hammers in order to successfully create their piece.\r\n\r\nThere is a $10 materials fee, payable to the instructor, for supplies and materials.','','2016-10-28 17:00:00','2016-10-28 21:00:00','2016-10-28 16:45:00','2016-10-28 21:15:00',0.00,NULL,0,0,0,0,0,'2016-10-28 17:00:00',0,1,0,'completed',26,420,NULL,NULL,NULL,NULL,NULL,NULL,'purpleporpoise',1,0,'2016-10-01 05:55:13','2016-10-28 21:00:01'),(877,'Laser Training Class (Filled for Students)','Onboard Laser Training for HS Students','Training for HS Students ','','2016-10-02 16:00:00','2016-10-02 20:00:00','2016-10-02 16:00:00','2016-10-02 20:00:00',0.00,NULL,1,0,1,21,1,'2016-10-02 16:00:00',0,1,0,'completed',11,4,2,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-10-01 06:55:41','2016-10-02 20:00:01'),(878,'Machine Shop Committee Meeting','Next chair discussion/vote','Meeting to discuss the next chairman and the state of the machine shop.','','2016-10-15 16:00:00','2016-10-15 17:00:00','2016-10-15 16:00:00','2016-10-15 17:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 16:00:00',0,1,0,'cancelled',8,38,NULL,NULL,NULL,NULL,NULL,NULL,'bryan',0,0,'2016-10-01 13:17:20','2016-10-01 13:19:44'),(879,'Mchine Shop Committee Meeting','Discuss/vote on next chair','Meeting to discuss the next chairman and the state of the machine shop.','','2016-10-16 16:00:00','2016-10-16 17:00:00','2016-10-16 16:00:00','2016-10-16 17:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 16:00:00',0,1,0,'completed',9,38,NULL,NULL,NULL,NULL,NULL,NULL,'bryan',1,0,'2016-10-01 13:21:47','2016-10-16 17:00:01'),(880,' (Full)','3D Printer Training','3D Printer Training','','2016-10-02 16:00:00','2016-10-02 20:00:00','2016-10-02 15:30:00','2016-10-02 20:30:00',0.00,NULL,1,0,1,0,1,'2016-10-02 16:00:00',0,1,0,'completed',6,51,1,NULL,NULL,NULL,NULL,NULL,'lukeiamyourfather',1,0,'2016-10-01 20:19:25','2016-10-02 20:00:01'),(881,'Linux Install Project & Users Group Monthly Meeting ','The Linux Install Project helps people install Linux operating systems and the monthly meeting includes discussion and presentations.','The Linux Install Project (9AM-11AM) provides assistance to people who want to install Linux operating systems on laptops, desktops, and servers. Almost any computer can run some form of Linux. Bring that old SP machine to the meeting and give it a new lease on life! Please see our website at www.ntlug.org for information on what to do if you want to install Linux.\r\n\r\nThe monthly meeting (11AM-12PM) includes discussion and presentations on Linux systems.','','2016-11-19 15:00:00','2016-11-19 18:01:00','2016-11-19 15:00:00','2016-11-19 18:01:00',0.00,NULL,0,0,0,0,0,'2016-11-19 15:00:00',0,1,0,'completed',8,25,NULL,NULL,NULL,NULL,NULL,NULL,'dallasmagna',1,0,'2016-10-01 20:21:54','2016-11-19 18:05:02'),(882,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-12 23:00:00','2016-10-13 00:00:00','2016-10-12 22:45:00','2016-10-13 00:00:00',10.00,NULL,0,6,0,16,1,'2016-10-12 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-10-01 20:25:44','2016-10-13 00:00:01'),(883,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-13 00:00:00','2016-10-13 02:00:00','2016-10-13 00:00:00','2016-10-13 02:00:00',20.00,NULL,0,8,0,16,0,'2016-10-13 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-10-01 20:29:25','2016-10-13 02:00:01'),(884,'Artober Potluck Party!!','art, costumes, potluck and party','Artober Potluck Party!\r\n\r\nWe will be having a Costume/Art Potluck Party. Everyone is welcome!\r\n\r\nHere are a few of the activities we will have:\r\nPaint a Block on a Halloween Quilt\r\n	A large Canvas divided into squares and each person can paint one .  Painting to be auctioned off at  the party\r\nCostumed Models\r\n	The people who dress up (or not) can  volunteer to take a turn at posing to be drawn by the artists.\r\nCrazy Jack \r\n	Wear a blind fold and draw a Jack O Lantern.\r\nPumpkin Painting\r\n  Just what it says!\r\nArt Puzzles\r\n	Printed puzzles to solve.\r\nPartying, supper and music! All Free! SIGN UP NOW.\r\nBYOB!!','','2016-10-30 23:00:00','2016-10-31 03:00:00','2016-10-30 22:00:00','2016-10-31 04:00:00',0.00,NULL,0,0,0,0,0,'2016-10-30 23:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-10-01 22:04:00','2016-10-31 03:00:01'),(885,'Logistics Committee Meeting','Logistics Bi-Annual Meeting (or \"let\'s select a chair\")','It is time for our bi-annual Chair selection process.  The current chair of Logistics would like to take a break this term, but expects to be available for assistance should someone else wish to take on the role.','Warning: Logistics Committee has the tendency to induce ill will in the membership, particularly around 6:01PM the first Saturday of the month then again around 4:01PM the second Saturday of the month.  You\'ll probably need to become a procurement officer, love driving around in full size trucks, and start roaming DMS with a scowl on your face looking for stray tools.','2016-10-16 18:30:00','2016-10-16 19:30:00','2016-10-16 18:30:00','2016-10-16 19:30:00',0.00,NULL,0,0,0,0,0,'2016-10-16 18:30:00',0,1,0,'completed',4,66,NULL,NULL,NULL,NULL,NULL,NULL,'eriksmith',1,0,'2016-10-01 22:50:13','2016-10-16 19:30:02'),(886,'Spinning and Fiberarts','Learn to spin your own yarn, use various fiber tools, and great ways to use the yarn you create.  You can also bring your current project and get help or inspiration.','Come join us in learning to spin your own yarn and related fiber arts! \r\n\r\nThis is a multi-level ongoing class where you can jump in at any point. Learn to spin yarn and work with various fibers and tools, check out whatever other related educational topic we\'re covering, or just bring your current fiber project, get help or hang out with like-minded folks. We also can help with troubleshooting or growing skills we\'ve offered in other classes (like inkle weaving, knit, crochet, needle felting, and more). \r\n\r\nIf you\'re learning to spin, I have beginner cd drop-spindle and fiber kits for $5. Also, some topics for any session may have modest supply fees. Of course, you\'re welcome to bring your own tools and supplies. \r\n\r\nIf you have questions, want to follow our online discussions, or curious what fiber topic we\'re covering that session (I post details a day or two before class), check out the Facebook group \"Dallas Makerspace Fiberholics\".   \r\n\r\nYou can also contact me directly  \r\nkyrithia@hotmail.com or text 469-831-0916','','2016-10-12 00:00:00','2016-10-12 02:00:00','2016-10-11 23:45:00','2016-10-12 02:15:00',0.