  This box of bisqued items is going to be stored in Fired Arts for 3 months, so you\'ll have a bit more time.  But!  It\'s not forever!  Now is better than then!!','','2016-10-07 00:00:00','2016-10-07 01:30:00','2016-10-07 00:00:00','2016-10-07 01:30:00',0.00,NULL,0,0,0,0,0,'2016-10-07 00:00:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-10-02 23:02:14','2016-10-07 01:30:01'),(895,'Lathe Class','This is the 6th out of a 10 part class. Enrollment is closed.','This is the 6th out of a 10 part class. Enrollment is closed.','','2016-10-19 15:30:00','2016-10-19 19:30:00','2016-10-19 15:30:00','2016-10-19 19:30:00',0.00,NULL,3,0,1,18,1,'2016-10-19 15:30:00',0,1,1,'completed',12,191,NULL,NULL,NULL,858,NULL,NULL,'mblatz',1,0,'2016-10-02 23:55:31','2016-10-19 19:30:01'),(896,'Infrastructure Committee Meeting','Finalize Committee Chair recommendation for BOD meeting','Finalize Committee Chair recommendation for BOD meeting','','2016-10-17 00:00:00','2016-10-17 00:30:00','2016-10-17 00:00:00','2016-10-17 00:30:00',0.00,NULL,0,0,1,0,0,'2016-10-17 00:00:00',0,1,0,'completed',11,42,NULL,NULL,NULL,NULL,NULL,NULL,'bscharff',1,0,'2016-10-03 00:22:04','2016-10-17 00:30:02'),(897,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-10-18 00:00:00','2016-10-18 02:00:00','2016-10-17 23:45:00','2016-10-18 02:15:00',0.00,NULL,0,0,0,0,0,'2016-10-18 00:00:00',0,1,0,'cancelled',9,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',0,0,'2016-10-03 01:24:48','2016-10-03 19:55:14'),(898,'Amazon PPC Training Workshop','Training for Amazon PPC(Paid Event)','Paid Workshop For Amazon PPC advertising. Ticket must be purchased in advance and space is limited. See our meetup group for more details and ticketing.  https://www.meetup.com/DFW-Amazon-Sellers','','2016-10-29 18:00:00','2016-10-30 00:00:00','2016-10-29 17:00:00','2016-10-30 01:00:00',0.00,NULL,1,0,0,0,1,'2016-10-29 18:00:00',0,1,0,'rejected',9,118,NULL,NULL,NULL,NULL,'bscharff','Event must use calendar system\'s payment processor - not an outside system.','patrickm',0,0,'2016-10-03 02:07:27','2016-10-03 18:15:07'),(899,'Blacksmith Introduction and Open Forge','Learn to forge steel into useful and beautiful objects','Join us to learn the basics of making hand forged iron and steel objects, no experience required.\r\nEach class will have a project to make with experienced instructors showing you the techniques required to build the project and take it home with you.\r\nAll tools and equipment are provided, so come out and have some fun building a new skill.\r\nSuggested donation of $10 to cover the cost of materials and fuel.\r\nIf you have some experience and would like to work on your own projects you can also come out for some open forge time.\r\n','Wear clothing appropriate for outdoor work, including closed toed shoes and natural fiber clothing.  Safety glasses, ear muffs, and aprons are available though you can bring your own if you\'d rather.','2016-10-09 16:00:00','2016-10-09 21:00:00','2016-10-09 15:00:00','2016-10-09 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-09 16:00:00',0,1,0,'completed',2,18,NULL,NULL,NULL,NULL,NULL,NULL,'jhaskins',1,0,'2016-10-03 03:35:06','2016-10-09 21:00:01'),(900,'Fume Hood Meeting','Describing project plans for the fume hood install.','Discussing contractor and material quotes.','','2016-10-08 19:00:00','2016-10-08 20:00:00','2016-10-08 19:00:00','2016-10-08 20:00:00',0.00,NULL,0,0,0,0,1,'2016-10-08 19:00:00',0,1,0,'completed',4,84,NULL,NULL,NULL,NULL,NULL,NULL,'ebony',1,0,'2016-10-03 16:05:54','2016-10-08 20:00:01'),(901,'Automotive Committee SemiAnnual Meeting','Discuss automotive committee and see if anyone wants to take it over','Discuss automotive committee and see if anyone else wants to take it over','','2016-10-14 01:00:00','2016-10-14 02:00:00','2016-10-14 01:00:00','2016-10-14 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-14 01:00:00',0,1,0,'cancelled',14,49,NULL,NULL,NULL,NULL,NULL,NULL,'brandonagr',0,0,'2016-10-03 18:00:29','2016-10-05 17:35:37'),(902,'DMS Trebuchet Build Day','We are building a pumpkin scale trebuchet, come help!','DMS is entering Slingfest 2016 in Plano on October 30th. Any member is welcome to come help build our floating arm trebuchet. See Talk thread for more info, https://talk.dallasmakerspace.org/t/trebuchet-sig-meetings-sundays/12213\r\n','','2016-10-09 20:00:00','2016-10-10 03:00:00','2016-10-09 20:00:00','2016-10-10 03:00:00',0.00,NULL,0,0,1,0,0,'2016-10-09 20:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,802,NULL,NULL,'brandonagr',1,0,'2016-10-03 18:00:59','2016-10-10 03:00:01'),(903,'DMS Trebuchet Build Day','We are building a pumpkin scale trebuchet, come help!','DMS is entering Slingfest 2016 in Plano on October 30th. Any member is welcome to come help build our floating arm trebuchet. See Talk thread for more info, https://talk.dallasmakerspace.org/t/trebuchet-sig-meetings-sundays/12213\r\n','','2016-10-04 17:00:00','2016-10-05 00:00:00','2016-10-04 17:00:00','2016-10-05 00:00:00',0.00,NULL,0,0,1,0,0,'2016-10-04 17:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,802,NULL,NULL,'brandonagr',1,0,'2016-10-03 18:01:26','2016-10-05 00:00:01'),(904,'DMS Trebuchet Build Day','We are building a pumpkin scale trebuchet, come help!','DMS is entering Slingfest 2016 in Plano on October 30th. Any member is welcome to come help build our floating arm trebuchet. See Talk thread for more info, https://talk.dallasmakerspace.org/t/trebuchet-sig-meetings-sundays/12213\r\n','','2016-10-11 17:00:00','2016-10-12 00:00:00','2016-10-11 17:00:00','2016-10-12 00:00:00',0.00,NULL,0,0,1,0,0,'2016-10-11 17:00:00',0,1,0,'completed',13,49,NULL,NULL,NULL,802,NULL,NULL,'brandonagr',1,0,'2016-10-03 18:01:46','2016-10-12 00:00:02'),(905,'3D Printing Training Class','3d printing class for learning the dms printers. ','Required training for using the PolyPrinter 3D printers in 3D Fab.','','2016-10-14 02:00:00','2016-10-14 04:00:00','2016-10-14 01:45:00','2016-10-14 04:15:00',0.00,NULL,0,0,1,16,0,'2016-10-14 02:00:00',0,1,0,'completed',9,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-10-03 18:07:53','2016-10-14 04:00:01'),(906,'3D Printing Training Class','3d printing class for learning the dms printers. ','Required training for using the PolyPrinter 3D printers in 3D Fab.','','2016-10-21 02:00:00','2016-10-21 04:00:00','2016-10-21 01:45:00','2016-10-21 04:15:00',0.00,NULL,5,0,1,16,0,'2016-10-21 02:00:00',0,1,0,'completed',1,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-10-03 18:12:21','2016-10-21 04:00:01'),(907,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-10-18 00:00:00','2016-10-18 02:00:00','2016-10-18 00:00:00','2016-10-18 02:00:00',0.00,NULL,25,0,0,0,0,'2016-10-18 00:00:00',0,1,0,'completed',9,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',1,0,'2016-10-03 19:58:11','2016-10-18 02:00:01'),(908,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-10-25 00:00:00','2016-10-25 02:00:00','2016-10-25 00:00:00','2016-10-25 02:00:00',0.00,NULL,5,0,0,0,0,'2016-10-25 00:00:00',0,1,0,'completed',6,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',1,0,'2016-10-03 20:02:54','2016-10-25 02:00:01'),(909,'Vinyl Cutter Basics','Get up to speed cutting out your graphics on the Vinyl Cutter','Creative Arts has a new Vinyl Cutter!\r\n\r\nCome learn the basics of the new cutter.   We\'ll go over how to prep your files,  get the cutter set up, cut your files out, and apply them!   No charge for the class, but freewill donations are accepted in the Vinyl Cutter funds box!','','2016-10-13 23:30:00','2016-10-14 01:00:00','2016-10-13 23:15:00','2016-10-14 01:00:00',0.00,NULL,8,0,0,0,0,'2016-10-13 23:30:00',0,1,0,'completed',5,3,NULL,NULL,NULL,847,NULL,NULL,'adamoas',1,0,'2016-10-03 20:38:22','2016-10-14 01:00:02'),(910,'HSM Training','HSM Q&A','This is a Q & A session for HSM being given by Thomas Babb of the Denton ATC.','','2016-10-05 00:30:00','2016-10-05 02:30:00','2016-10-05 00:30:00','2016-10-05 02:30:00',0.00,NULL,0,0,0,0,0,'2016-10-05 00:30:00',0,1,0,'cancelled',9,38,NULL,NULL,NULL,NULL,NULL,NULL,'bryan',1,0,'2016-10-03 20:39:26','2016-10-04 16:24:22'),(911,'VECTOR Committee meeting ( new chair voting )','vote in chair person and talk about TPF and other events ','Vector Chair voting and talking about TPF   \r\n\r\n Voting can be done in person or proxies only ','','2016-10-15 22:00:00','2016-10-15 23:00:00','2016-10-15 22:00:00','2016-10-15 23:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 22:00:00',0,1,0,'completed',11,110,NULL,NULL,NULL,NULL,NULL,NULL,'dallas0606',1,0,'2016-10-04 13:56:59','2016-10-15 23:00:01'),(912,'HSM Walkthrough  for HAAS Mill','Q&A session for HSM','Thomas Babb will be on hand to answer questions about using HSM for CNC milling.\r\n\r\nPlease watch this video before attending: https://attendee.gotowebinar.com/recording/viewRecording/8194505506017598467/5660976729297586948/tbabb@dentonisd.org','','2016-10-13 00:00:00','2016-10-13 02:00:00','2016-10-12 23:30:00','2016-10-13 02:30:00',0.00,NULL,0,0,1,0,0,'2016-10-13 00:00:00',0,1,0,'completed',9,38,NULL,NULL,NULL,NULL,NULL,NULL,'bryan',1,0,'2016-10-04 16:27:45','2016-10-13 02:00:01'),(913,'Thin turned bowls on the Wood Lathe','This class will teach the process to create a thin walled wood bowl from a solid block of wood.  Students should already be familiar with the process to complete a bowl using a chuck.','This class will teach the process to create a thin wall wood bowl from a solid block of wood.  Students should already be familiar with the process to complete a bowl using a chuck and how to use a bowl gouge.\r\n\r\nStudents will learn the process to create a bowl with a wall thickness of 1/8\" or less.  They will also further their knowledge and ability of how to use a bowl gouge.','','2016-10-20 23:30:00','2016-10-21 02:00:00','2016-10-20 23:00:00','2016-10-21 02:15:00',0.00,NULL,4,0,1,13,0,'2016-10-20 23:30:00',0,1,0,'cancelled',12,192,NULL,7,NULL,NULL,NULL,NULL,'mkart',0,0,'2016-10-04 16:49:23','2016-10-09 00:38:20'),(914,'Fired Arts Handbuilt Pottery','The three basic handbuilding techniques will be demonstrated and students can make an item of their choosing.  ','Pinch pots, coil-building, and slabs will be demonstrated.\r\nPlease have an idea of what you want to make.\r\nAt 5 pm, there will be a demonstration and discussion of throwing pots on the wheels.\r\nWell-behaved children between 8 and 13 welcome with attending parent.\r\n','Wear clothes you can get dirty.  Short fingernails are recommended.  If you plan to throw, remove any artificial nails.','2016-10-22 19:00:00','2016-10-22 23:00:00','2016-10-22 19:00:00','2016-10-22 23:00:00',0.00,NULL,6,0,0,13,0,'2016-10-22 19:00:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-10-05 01:00:29','2016-10-22 23:00:01'),(915,'Fired Arts Committee Meeting','Committee meeting','Committee meeting.','','2016-10-13 00:30:00','2016-10-13 01:30:00','2016-10-13 00:30:00','2016-10-13 01:30:00',0.00,NULL,0,0,0,0,0,'2016-10-13 00:30:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-10-05 01:02:26','2016-10-13 01:30:01'),(916,'DPRG Monthly Meeting','The Dallas Personal Robotics Group monthly membership meeting','The Dallas Personal Robotics Group monthly meeting. Visitors are always welcome. We usually have a guest speaker, member show-and-tell, and handle any pending club business.','','2016-10-08 17:00:00','2016-10-08 21:00:00','2016-10-08 17:00:00','2016-10-08 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-08 17:00:00',0,1,0,'completed',8,53,NULL,NULL,NULL,NULL,NULL,NULL,'sedwards',1,0,'2016-10-05 02:40:42','2016-10-08 21:00:01'),(917,'Automotive Committee SemiAnnual Meeting','Meet to discuss auto committee area and if anyone wants to take over','Meet to discuss auto committee area and if anyone wants to take over','','2016-10-14 00:45:00','2016-10-14 01:45:00','2016-10-14 00:45:00','2016-10-14 01:45:00',0.00,NULL,0,0,0,0,0,'2016-10-14 00:45:00',0,1,0,'completed',14,49,NULL,NULL,NULL,NULL,NULL,NULL,'brandonagr',1,0,'2016-10-05 17:39:43','2016-10-14 01:45:01'),(918,'Embedded Workshop Microcontrollers','Design and build your own Shield PCB Part 2  From Breadboard to Printed Circuit Board. ','Design and build your own Shield PCB Part 2  From Breadboard to Printed Circuit Board. \r\nCome join us for Part 2 using several different CAD program to create an  PCB.\r\nWe will look at using Fritzing to create a Wemos D1 Mini Weather Station PCB.\r\nExplain how to create a breadboard circuit, then place components on the schematic and finally how to place components on the PCB. Generate and Download Gerber files to PCB manufactures.   \r\nFor more info go here: www.thecains-group.net\r\nWhat to Bring:  Laptop computer  Windows  Mac - Linux \r\n','','2016-10-27 00:00:00','2016-10-27 02:00:00','2016-10-26 23:45:00','2016-10-27 02:15:00',0.00,NULL,0,0,0,0,0,'2016-10-27 00:00:00',0,1,0,'completed',8,174,NULL,NULL,NULL,NULL,NULL,NULL,'microrustyc',1,0,'2016-10-06 02:23:24','2016-10-27 02:00:01'),(919,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-10-18 16:00:00','2016-10-18 19:00:00','2016-10-18 16:00:00','2016-10-18 19:00:00',5.00,NULL,0,6,1,18,0,'2016-10-17 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-10-06 14:54:25','2016-10-18 19:00:01'),(920,'Dallas Screenwriting Crew','Workshop & If you have a work-in-progress, please bring up to 10 pages, in standard Hollywood format, for table read and critique.','\"Elena Ferrante is the author of several novels. There is nothing mysterious about her, given how she manifests herself  perhaps even too much  in her own writing, the place where her creative life transpires in absolute fullness. What I mean is that the author is the sum of the expressive strategies that shape an invented world, a concrete world that is populated with people and events. The rest is ordinary private life.\"\r\n-    An interview with The Guardian, Feb, 2016\r\nThe recently uncovered anonymous Italian author Elena Ferrante writes anonymously for many reasons. It is believed that her willingness to remain anonymous gives her the ability to see and say what others think; to express opinions that are otherwise left undiscussed. The raw truth of the relationships her female characters explore; the complexity and constant struggle; the opinions she, in anonymity, is able to express, unlike we that struggle to maintain the paper-thin frailty of our relationships.\r\nWhether we sit down at our desks and put pen to paper, or strike keys on screen, were putting a little of ourselves, one line at a time, into our work, and submitting ourselves as open books, in printed words, and offer our feedback. We cannot afford the anonymity of Elena Ferrante  we are self-conscious, invested in the little pieces of ourselves we leave in our work.\r\nFor this workshop, I want to discuss effective criticism. As we mark lines through little pieces of each other, argue over whether those little pieces would be better off here or there, sometimes we forget that those little pieces are still attached  and sometimes, we must wear gloves to handle them.\r\nIf you have a work-in-progress, please bring up to 10 pages, in standard Hollywood format, for table read and critique.','','2016-10-15 18:00:00','2016-10-15 22:00:00','2016-10-15 17:45:00','2016-10-15 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 18:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-10-06 23:27:42','2016-10-15 22:00:01'),(921,'Jewelry Committee Meeting','New chair vote, committee update.','We will meet in the Jewelry/Small Metals area at 7pm to vote for the chair person, discuss classes/teaching and review upcoming equipment purchases. All are welcome, no registration/ticket needed. ','','2016-10-20 00:00:00','2016-10-20 01:00:00','2016-10-20 00:00:00','2016-10-20 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-20 00:00:00',0,1,0,'completed',26,498,NULL,NULL,NULL,NULL,NULL,NULL,'annegullett',1,0,'2016-10-06 23:42:25','2016-10-20 01:00:01'),(922,'Woodshop Committee  Meeting','Discuss matters pertaining to the Woodshop','Meeting Agenda:\r\n\r\n- Welcome new members\r\n- Discuss current and future classes offered\r\n- Discuss new ducting install plan and set an install date as well as shop cleanup and maintenance \"party\"\r\n- Clamp clean up party!\r\n- New plan for tool and clamp storage\r\n- Signage campaign\r\n- DMS wood show\r\n- Wood shop chair election\r\n\r\nPlease contact andrew.zalaket@dallasmakerspace.org if you would like to add any additional items to the agenda.\r\n\r\n\r\n\r\n\r\n\r\n','','2016-10-12 00:00:00','2016-10-12 02:00:00','2016-10-12 00:00:00','2016-10-12 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-12 00:00:00',0,1,0,'completed',9,499,NULL,NULL,NULL,NULL,NULL,NULL,'azalaket',1,0,'2016-10-07 00:41:58','2016-10-12 02:00:01'),(923,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-19 23:00:00','2016-10-20 00:00:00','2016-10-19 22:45:00','2016-10-20 00:00:00',10.00,NULL,0,6,0,16,1,'2016-10-19 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-10-07 00:48:26','2016-10-20 00:00:02'),(924,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-20 00:00:00','2016-10-20 02:00:00','2016-10-20 00:00:00','2016-10-20 02:00:00',20.00,NULL,0,8,0,16,1,'2016-10-20 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,NULL,NULL,NULL,'hans',1,0,'2016-10-07 00:50:36','2016-10-20 02:00:03'),(925,'Public Relations Committee Meeting','Public Relations Committee Meeting','Public Relations Committee Meeting to elect a new chairperson.  Will also discuss upcoming events, promotional materials, social media, etc.\r\n\r\nAll members welcome! ','','2016-10-18 00:00:00','2016-10-18 01:00:00','2016-10-18 00:00:00','2016-10-18 01:00:00',0.00,NULL,0,0,1,0,0,'2016-10-18 00:00:00',0,1,0,'completed',4,34,NULL,NULL,NULL,NULL,NULL,NULL,'mellrhodes',1,0,'2016-10-07 01:02:22','2016-10-18 01:00:01'),(926,'Build a radio transmitter (Michigan Mighty Mite)','In this class you will receive a sandwich bag of nine parts and use them to assemble your own half watt radio transmitter.','>> There will be a fee of $10 to cover the cost of the parts. All proceeds will go toward parts, and any balance will be donated to the Electronics Committee. <<\r\n\r\nhttps://dallasmakerspace.org/wiki/MichiganMightyMite\r\n\r\nIn this class you will receive a sandwich bag of nine parts and use them to assemble your own half watt radio transmitter. Since this transmitter will be connected to a \'dummy load\' (two of the parts), you do not need to be a licensed Amateur Radio operator to build and operate this transmitter. But it can transmit to a nearby (within a few feet) radio receiver to allow you to hear the Morse code! \r\n\r\nIf you are a licensed operator we will be discussing the modifications you can make to put the radio on the air and make contacts with others across the globe! The class will provide introduction to the basics of radio transmitter operation, Manhattan circuit building (a technique for prototyping analog circuits), soldering, and using a test bench (oscilloscope, meter, etc...) to test and characterize your circuits.\r\n','','2016-10-21 00:00:00','2016-10-21 03:00:00','2016-10-21 00:00:00','2016-10-21 03:00:00',10.00,NULL,0,6,0,13,0,'2016-10-21 00:00:00',0,1,0,'completed',7,86,NULL,NULL,NULL,NULL,NULL,NULL,'zmetzing',1,0,'2016-10-07 03:19:43','2016-10-21 03:00:01'),(927,'Science Committee Meeting','1) Hold election for Committee Chair  2) Appoint committee officers  3) Review finances & projects 4) Discuss creation of Brewing, Automated Habitats, Automated Plant Nurseries, Raman Spectrometer, and Synthetic Bio SIGs','1) Hold election for Committee Chair\r\n2) Appoint committee officers  \r\n3) Review finances & projects \r\n4) Discuss creation of Brewing, Automated Habitats, Automated Plant Nurseries, Raman Spectrometer, and Synthetic Bio SIGs','','2016-10-16 19:00:00','2016-10-16 20:00:00','2016-10-16 19:00:00','2016-10-16 20:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 19:00:00',0,1,0,'completed',11,206,NULL,NULL,NULL,NULL,NULL,NULL,'porky',1,0,'2016-10-07 13:43:17','2016-10-16 20:00:02'),(928,'Python For Beginners','Learn to program with the Python language.','ATTN: This event occurs on the 9th of October, starts at 7PM and ends at 8PM. Please do not show up on the 10th at 3AM expecting a class on beginning Python. Thanks.','Please try to bring a computer.','2016-10-10 08:00:00','2016-10-10 09:00:00','2016-10-10 08:00:00','2016-10-10 09:00:00',0.00,NULL,0,0,0,0,0,'2016-10-10 08:00:00',0,1,0,'rejected',11,502,NULL,NULL,NULL,NULL,'bscharff','You set the event for 3am but then in the description said a different time...  Please enter your event correctly.  -Brooks','alanlu',0,0,'2016-10-08 03:29:57','2016-10-09 18:58:51'),(929,'Life Drawing','The study of human anatomy, I\'ll be teaching how to use skeleton shapes to build poses.','This will be the last life drawing class of the year. I\'m taking a break for the holidays and will get back to it next year.\r\n\r\n$10 for the class.\r\n\r\nWe will go with the common setup of having some short warm up poses at the beginning and then some longer poses as we progress. I\'ll be teaching how to use a very basic skeleton to capture the pose as well as the perspective.\r\n\r\nI have two easels I\'ll bring, if you have your own, please bring it and we can set up some space for you otherwise we have a few small table easels and tables to draw on.\r\n\r\nFeel free to bring any medium you\'d like but please bring a drop cloth for messy mediums.','','2016-11-05 00:00:00','2016-11-05 03:00:00','2016-11-04 23:30:00','2016-11-05 04:00:00',0.00,NULL,0,0,0,0,0,'2016-11-05 00:00:00',0,1,0,'completed',5,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-10-08 11:05:29','2016-11-05 03:00:01'),(930,'Learning Watercolor Painting','We will be learning how to paint Poinsettias.','Please bring $5 to help cover the cost of the supplies. Also bring a pencil. Paint and paper will be supplied.\r\n\r\nWe will be going over how to paint with watercolors with a focus on making a painting of Poinsettias.\r\n\r\nSome drawing skills would be helpful as there will not be any teaching for that.\r\n','','2016-10-16 00:00:00','2016-10-16 02:00:00','2016-10-15 23:00:00','2016-10-16 03:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 00:00:00',0,1,0,'completed',8,17,NULL,NULL,NULL,NULL,NULL,NULL,'artnerdray',1,0,'2016-10-08 14:53:23','2016-10-16 02:00:01'),(931,'Event Testing','Short Event Test','testing\r\n\r\ntest','','2016-10-19 17:00:00','2016-10-19 18:00:00','2016-10-19 17:00:00','2016-10-19 18:00:00',0.00,NULL,0,0,0,0,0,'2016-10-19 17:00:00',0,1,0,'cancelled',9,39,NULL,NULL,NULL,NULL,NULL,NULL,'elorentz',0,0,'2016-10-08 18:00:36','2016-10-08 18:00:50'),(932,'Crochet Beyond the Basics: Skull Scarf (appliqu into squares)','Crochet Beyond the Basics--learn how to create a crocheted appliqu motif, then adapt the irregular shape to be the center of a square.  You will also learn various joining methods to transform a set of squares into scarves, throws, and other items.','Ready to take your crochet to the next level with some new skills? \r\n\r\nIn this class, we\'ll playing with a skull motif since Halloween is coming up!  However, this technique is adaptable to thousands of other shapes.\r\n\r\nCrocheted appliqu pieces are usually irregular interesting shapes (i.e. hearts, flowers, animals, etc) that are made and later attached to the surface of another piece of crochet like a bag, blanket, or hat.\r\n\r\nYou will be learning to make an appliqu piece, BUT instead of attaching it to another larger crocheted piece, you\'ll learn how to take that irregular shape and adapt it to become PART of the center of a square. Then those square motifs can be combined many ways to create other items like scarves, throws, pillows, runners, bags, and more. \r\n\r\nWe will also be covering important related skills:\r\n\r\nCreating appliqu motifs\r\nCreate squares around irregular shapes\r\nChanging colors\r\nCrocheting in the round\r\nJoining methods for square motifs\r\nReading a pattern chart\r\n\r\nFor this class, you do need to know basic crochet stitches (single and double crochet). \r\n\r\nIF YOU NEED basics (like learning or brushing up on beginning crochet), come to a Tuesday night Spinning and Fiberarts class and we\'ll get you up to speed.\r\n\r\nAll practice materials provided free (hooks/yarn). Then after class you can buy for your project.\r\n\r\nIf you want to dive in from the start on a scarf or pillow or whatever and want to bring your own project yarn, get worsted weight afghan yarn and a size H hook. Recommend solid colors and not highly textured or fuzzy for the motif to show up well.\r\n\r\nPattern is provided for free (and with permission), courtesy of Robin Brzozowski of Crochet Nirvana. \r\n\r\nClass size limited to 8, so be sure to register\r\n\r\nSEE ATTACHED IMAGE FOR SAMPLE OF FINISHED SKULL SQUARE\r\n\r\nIf you have any questions or want to stay up to date with the latest fibery goodness, join \"Dallas Makerspace Fiberholics\" on Facebook ','You need to ALREADY know basic crochet stitches (single and double crochet).  \r\n\r\n***If you need help with learning crochet stitch basics or need a refresher, come to the Spinning and Fiberarts class on Tues Oct 11, 7-9 (see separate event to register) and we\'ll get you up to speed\r\n\r\nHooks and practice yarn free for class, but you are welcome to bring your own project yarn if you wish. See details in description.','2016-10-19 00:00:00','2016-10-19 02:00:00','2016-10-18 23:45:00','2016-10-19 02:15:00',0.00,NULL,8,0,0,0,0,'2016-10-19 00:00:00',0,1,1,'completed',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-10-08 23:24:30','2016-10-19 02:00:01'),(933,'Thin turned bowls on the Wood Lathe','This class will teach the process to create a thin walled wood bowl from a solid block of wood.  Students should already be familiar with the process to complete a bowl using a chuck.','This class will teach the process to create a thin wall wood bowl from a solid block of wood.  Students should already be familiar with the process to complete a bowl using a chuck and how to use a bowl gouge.\r\n\r\nStudents will learn the process to create a bowl with a wall thickness of 1/8\" or less.  They will also further their knowledge and ability of how to use a bowl gouge.','','2016-10-20 23:00:00','2016-10-21 02:00:00','2016-10-20 23:00:00','2016-10-21 02:00:00',0.00,NULL,4,0,0,13,0,'2016-10-20 23:00:00',0,1,0,'completed',12,192,NULL,NULL,NULL,NULL,NULL,NULL,'mkart',1,0,'2016-10-09 00:41:21','2016-10-21 02:00:01'),(934,'DMS Wood Shop Basics ',' 	Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-10-25 16:00:00','2016-10-25 19:00:00','2016-10-25 16:00:00','2016-10-25 19:00:00',5.00,NULL,0,6,0,0,0,'2016-10-25 16:00:00',0,1,0,'cancelled',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-10-09 00:56:40','2016-10-25 00:14:31'),(935,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-11-01 00:00:00','2016-11-01 02:00:00','2016-11-01 00:00:00','2016-11-01 02:00:00',0.00,NULL,25,0,0,0,0,'2016-11-01 00:00:00',0,1,0,'completed',9,189,NULL,NULL,NULL,435,NULL,NULL,'eek_kadef',1,0,'2016-10-09 02:04:21','2016-11-01 02:00:01'),(936,'DMS Science Space Build Out Workday','Help us improve the Science Committee workshop space.','We\'re working to improve the Science space in the workshop. Come help and learn more about what we\'re doing. ','','2016-10-23 19:00:00','2016-10-23 21:00:00','2016-10-23 19:00:00','2016-10-23 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-23 19:00:00',0,1,0,'completed',18,119,NULL,NULL,NULL,NULL,NULL,NULL,'hcbonner',1,0,'2016-10-09 21:14:06','2016-10-23 21:00:01'),(937,'Decoding a sewing pattern','Bring a sewing pattern you want to make and we\'ll help you plan your project with it. ','So you already know your way around a sewing machine and you want to take your skills out for a spin. Bring a sewing pattern and we\'ll help you figure out how you can start making your project.  We will go over things like : reading and understanding the information on the back of a pattern, selecting the right fabric and quantity for the project, selecting the size you need and cutting out of pattern pieces. ','Knowing how to use a sewing machine is highly recommended.  ','2016-10-26 00:00:00','2016-10-26 02:00:00','2016-10-25 23:45:00','2016-10-26 02:15:00',0.00,NULL,10,0,0,13,0,'2016-10-24 00:00:00',0,1,0,'rejected',11,11,NULL,NULL,NULL,NULL,'bscharff','Rejecting honorarium - this is not a class, but a workshop.  For honorarium, there needs to be a specific thing you will learn.','julesrmakes',0,0,'2016-10-09 22:55:13','2016-10-09 23:29:02'),(938,'Sewing Basics Class','Learn to use our 5 new sewing machines or bring your own.   Basic sewing techniques,  materials will be provided.','Class is limited since we only have 5 sewing machines.  First come first served, students may need to share a machine if class is full.   If you have your own machine and want to learn the basics of how to use it and the class is full, just bring it and show up.','','2016-10-20 00:00:00','2016-10-20 02:00:00','2016-10-20 00:00:00','2016-10-20 02:15:00',0.00,NULL,7,0,0,13,0,'2016-10-20 00:00:00',0,1,0,'completed',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-10-09 23:03:37','2016-10-20 02:00:03'),(939,'Philosophy Meet Up - 45','All are welcome, open discussion on life, the universe, and everything.','Morals, Ethics, Perspective, Religion, Politics, and every other thing you\'re generally told not to talk to strangers about. ','','2016-10-13 00:00:00','2016-10-13 03:00:00','2016-10-13 00:00:00','2016-10-13 03:00:00',0.00,NULL,0,0,0,0,0,'2016-10-13 00:00:00',0,1,0,'completed',27,163,NULL,NULL,NULL,NULL,NULL,NULL,'puzzlerf',1,0,'2016-10-09 23:23:08','2016-10-13 03:00:01'),(940,'Philosophy Meet Up - 46','All are welcome, open discussion on life, the universe, and everything.','Talk about all those things you\'re told not to talk about with anyone, let alone strangers.\r\n\r\nCome and go as you please. Starts are 7 and goes till the conversation ends. Some people show up at 8, some at 9. ','','2016-10-20 00:00:00','2016-10-20 03:00:00','2016-10-20 00:00:00','2016-10-20 03:00:00',0.00,NULL,0,0,0,0,0,'2016-10-20 00:00:00',0,1,0,'completed',9,163,NULL,NULL,NULL,NULL,NULL,NULL,'puzzlerf',1,0,'2016-10-09 23:25:27','2016-10-20 03:00:02'),(941,'Python for Beginners','Learn Python!','Python is a programming language, and you can learn to program in it!\r\n\r\nHere is a repo for this class: https://github.com/cag/python-for-beginners','','2016-10-14 00:00:00','2016-10-14 01:00:00','2016-10-14 00:00:00','2016-10-14 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-14 00:00:00',0,1,0,'completed',8,502,NULL,NULL,NULL,NULL,NULL,NULL,'alanlu',1,0,'2016-10-10 02:01:20','2016-10-14 01:00:02'),(942,'Python for Beginners','Learn Python!','Python is a programming language, and you can learn to program in it!\r\n\r\nHere is a repo for this class: https://github.com/cag/python-for-beginners','','2016-10-17 00:00:00','2016-10-17 01:00:00','2016-10-17 00:00:00','2016-10-17 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-17 00:00:00',0,2,0,'approved',8,502,NULL,NULL,941,NULL,NULL,NULL,'alanlu',0,0,'2016-10-10 02:01:20','2016-10-12 02:05:01'),(943,'Lathe Basics',' Learn to safely use the lathes in the Woodshop.','This class will introduce/re-introduce you to the lathe, including shop rules and general expectations, and wood working safe/best practices. ',' ** Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories. **','2016-10-28 18:30:00','2016-10-28 20:00:00','2016-10-28 18:00:00','2016-10-28 20:15:00',0.00,NULL,5,0,1,13,0,'2016-10-28 18:30:00',0,1,0,'completed',12,33,NULL,NULL,NULL,562,NULL,NULL,'wascheu',1,0,'2016-10-10 08:19:01','2016-10-28 20:00:01'),(944,' Pen Turning','We\'re making pens. ','We are making pens \r\nYou will be able to write \" Hello World! and HAPPY FRIDAY\" with a hand crafted biro.','','2016-10-28 23:00:00','2016-10-29 00:45:00','2016-10-28 22:30:00','2016-10-29 01:00:00',12.00,NULL,0,5,1,0,0,'2016-10-23 23:00:00',0,1,0,'completed',12,33,NULL,NULL,NULL,563,NULL,NULL,'wascheu',1,0,'2016-10-10 08:22:43','2016-10-29 00:45:01'),(945,'Craft Fair Success: Booth and Display Design','Build craft fair displays that sell your products! This class covers basic principles of branding and booth design to help your small business gain in-person sales.','Craft Fair Success: Booth and Display Design\r\nSunday, November 6, 2016 - 2 PM\r\nInstructor: Michelle Gruben\r\nLecture Hall\r\n\r\nIf you sell products at festivals or craft fairs, youre always looking for ways to make your booth stand out from the rest of the row. In this free class, well cover the basics of designing a display with serious walk-up appeal. A successful booth will both look good and work smoothly for you and your customers.\r\n\r\nThis class is suitable for all craft fair vendors, whether youre just getting started or want to fine-tune an existing booth setup. Youll learn easy, low-cost solutions to showcase your product and snag more sales.\r\n\r\nClass topics include:\r\n\r\nBasics of branding\r\nThe five principles of good booth design\r\nCraft fair booths that work (and some that dont)\r\nBuying, making and adapting display fixtures\r\nThe ten most overused display props\r\n\r\nThe class will be a lecture-style presentation with photo examples. Well follow it with a Q&A and discussion tailored to your products and unique concerns. Bring your display-related questions and walk away with new ideas for your booth. \r\n\r\nClass is free and open to the public. Pre-registration is kindly requested so the instructor (me) and Makerspace can track attendance. If youre not able to pre-register, dont worryjust show up anyway. \r\n\r\nAs a courtesy to those attending, the class will begin promptly at 2:00 PM in the Lecture Hall. Late arrivals are welcome to enter. (The door will be closed to reduce noise from the hallway.)\r\n\r\nAbout the instructor:\r\n\r\nIm a Makerspace member, multi-media artist, and owner of the online shop Grove and Grotto. A chef by profession, I took a leap and started my e-commerce business in 2014. I sell my products at fairs and festivals all over Texas. In 2016, I published the e-book Craft Fair Success: Starting and Growing Your Handmade Business.\r\n\r\nFind out more at www.groveandgrotto.com and www.facebook.com/groveandgrotto. Questions? Reach me at groveandgrotto@gmail.com.\r\n\r\n','','2016-11-06 20:00:00','2016-11-06 22:00:00','2016-11-06 19:45:00','2016-11-06 22:15:00',0.00,NULL,0,0,0,13,0,'2016-11-05 20:00:00',0,1,0,'completed',9,481,NULL,NULL,NULL,NULL,NULL,NULL,'mgruben',1,0,'2016-10-10 15:54:55','2016-11-06 22:00:01'),(946,'Hatcher\'s Workshop Committee Meeting','Committee meeting','Select the committee chair for approval. Discuss the direction that the committee needs to go to grow activity in the committee. Everyone is welcome.','','2016-10-16 21:30:00','2016-10-16 22:30:00','2016-10-16 21:30:00','2016-10-16 22:30:00',0.00,NULL,0,0,0,0,0,'2016-10-16 21:30:00',0,1,0,'completed',11,152,NULL,NULL,NULL,NULL,NULL,NULL,'russellbward',1,0,'2016-10-10 22:30:58','2016-10-16 22:30:01'),(947,'Laser committee meeting','Laser committee will be meeting to talk shop and vote on a chair','Laser committee will be meeting to talk shop and vote on a chair','','2016-10-20 00:30:00','2016-10-20 01:30:00','2016-10-20 00:30:00','2016-10-20 01:30:00',0.00,NULL,0,0,0,0,0,'2016-10-20 00:30:00',0,1,0,'completed',16,516,NULL,NULL,NULL,NULL,NULL,NULL,'canibalcrab',1,0,'2016-10-11 00:41:08','2016-10-20 01:30:01'),(948,'Electronics committee Mtng','Semi-annual mtng to appoint chair','I am willing to stay on as chair.  Let\'s discuss what you would like to see happen in the E Lab.\r\n\r\nVoting is in person or by proxy.\r\n\r\nCan\'t attend  - PM me with your ideas and concerns.','','2016-10-19 00:00:00','2016-10-19 01:00:00','2016-10-19 00:00:00','2016-10-19 01:00:00',0.00,NULL,0,0,1,0,0,'2016-10-18 00:00:00',0,1,0,'completed',7,339,NULL,NULL,NULL,NULL,NULL,NULL,'agivensjr',1,0,'2016-10-11 02:33:49','2016-10-19 01:00:01'),(949,'CNC PlasmaCAM Training','Training for the Metalshop CNC Plasmacutter','This is the long awaited training for the CNC Plasma cutter. We will begin in the classroom to go over the basics then move to the metalshop to get hands on training. You will be instructed on how to use the CNC Plasma cutter in the basic form. You will be cutting out some items for a demo on the plasma cutter.','Please wear appropriate clothing. Do not wear any open toe shoes or shorts, you will be turned away. Please bring your safety glasses. If you have a Pacemaker, the plasma cutter may interfere, Please talk to your DR before hand.','2016-10-25 00:00:00','2016-10-25 02:00:00','2016-10-24 23:45:00','2016-10-25 02:00:00',5.00,NULL,0,8,1,18,0,'2016-10-24 00:00:00',0,1,0,'completed',8,147,NULL,NULL,NULL,NULL,NULL,NULL,'tbjk',1,0,'2016-10-11 03:09:04','2016-10-25 02:00:01'),(950,'\"The Moneyshot\" Editing Session','\"The Moneyshot\" Short FIlm Edit Review','Editing for the Moneyshot, review of color, and sound. anyone welcome to shadow/help/critique','','2016-10-14 23:00:00','2016-10-15 02:00:00','2016-10-14 23:00:00','2016-10-15 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-14 23:00:00',0,1,0,'completed',6,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-10-11 03:57:19','2016-10-15 02:00:01'),(951,'DMS Digital Media committee meeting','Digital Media committee meeting, chair election','Digital Media committee meeting, chair election','','2016-10-22 18:00:00','2016-10-22 19:00:00','2016-10-22 18:00:00','2016-10-22 19:00:00',0.00,NULL,0,0,1,0,0,'2016-10-22 18:00:00',0,1,0,'rejected',6,278,NULL,NULL,NULL,NULL,'alexrhodes','