s or event setting is restricted to DMS members only.','2016-10-29 20:00:00','2016-10-29 21:30:00','2016-10-29 19:30:00','2016-10-29 21:45:00',0.00,NULL,7,0,0,0,0,'2016-10-29 20:00:00',0,1,0,'completed',11,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',1,0,'2016-10-11 17:39:57','2016-10-29 21:30:01'),(954,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.','All experience levels welcome and encouraged to attend! If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session. Bring your projects, ideas, questions, answers, tips & tricks. This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.\r\n\r\n','','2016-11-21 21:00:00','2016-11-21 22:00:00','2016-11-21 21:00:00','2016-11-21 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-21 21:00:00',0,1,0,'cancelled',5,54,NULL,NULL,NULL,793,NULL,NULL,'bitta',0,0,'2016-10-11 17:42:03','2016-10-11 17:42:40'),(955,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.','All experience levels welcome and encouraged to attend! If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session. Bring your projects, ideas, questions, answers, tips & tricks. This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.\r\n\r\n','','2016-11-20 21:00:00','2016-11-20 22:00:00','2016-11-20 21:00:00','2016-11-20 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-20 21:00:00',0,1,0,'cancelled',5,54,NULL,NULL,NULL,793,NULL,NULL,'bitta',0,0,'2016-10-11 17:43:50','2016-10-11 17:44:25'),(956,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.','All experience levels welcome and encouraged to attend! If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session. Bring your projects, ideas, questions, answers, tips & tricks. This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.\r\n\r\n','','2016-11-20 21:00:00','2016-11-20 22:00:00','2016-11-20 21:00:00','2016-11-20 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-20 21:00:00',0,1,0,'completed',5,54,NULL,NULL,NULL,793,NULL,NULL,'bitta',1,0,'2016-10-11 17:45:53','2016-11-20 22:00:02'),(957,'VCC Committee Meeting','(feat) Initial commit. Bootstrapping VCC','Vintage Computer Committee meeting for Bootstrapping and Voting in Committee Chair','','2016-10-14 23:30:00','2016-10-15 00:30:00','2016-10-14 23:30:00','2016-10-15 00:30:00',0.00,NULL,0,0,0,0,0,'2016-10-14 23:30:00',0,1,0,'completed',11,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',1,0,'2016-10-11 21:59:57','2016-10-15 00:30:01'),(958,'BYOP pumpkin decorating','start gutting and get a grinning. ','BRING YOUR OWN PUMPKIN as we cut and gut and make them most festive. real or fake we have loads on hand to make your pumpkin really spooky or really cute. remember if you bring younglings to this event to watch over them (we are not a babysitting service and there will be sharp knives)','sharp knives and utensils will be used. ','2016-10-29 00:00:00','2016-10-29 03:00:00','2016-10-28 23:30:00','2016-10-29 03:30:00',0.00,NULL,0,0,1,0,0,'2016-10-29 00:00:00',0,1,0,'rejected',8,24,NULL,NULL,NULL,NULL,'bscharff','Not a class - this should be marked as an event and is not eligible for honoraium.','axeonos',0,0,'2016-10-12 01:31:35','2016-10-13 17:12:17'),(959,'Digital Media committee meeting election','Meeting for Digital Media chair election','Meeting for Digital Media chair election','','2016-10-15 18:00:00','2016-10-15 19:00:00','2016-10-15 18:00:00','2016-10-15 19:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 18:00:00',0,1,0,'completed',6,278,NULL,NULL,NULL,NULL,NULL,NULL,'jayjohnson',1,0,'2016-10-12 18:26:59','2016-10-15 19:00:01'),(960,'Vinyl Cutter Basics','Get up to speed cutting out your graphics on the Vinyl Cutter','Creative Arts has a new Vinyl Cutter!\r\n\r\nCome learn the basics of the new cutter.   We\'ll go over how to prep your files,  get the cutter set up, cut your files out, and apply them!   No charge for the class, but freewill donations are accepted in the Vinyl Cutter funds box!\r\n\r\nIf you have a file that you\'d like to try, I will be sticking around for a few minutes after class to assist.\r\n\r\n**Note: I am limiting this class to Members Only for the time being, as there are a number of people who want to get checked out on this new machine**','','2016-10-15 18:00:00','2016-10-15 19:30:00','2016-10-15 18:00:00','2016-10-15 19:30:00',0.00,NULL,8,0,1,0,0,'2016-10-15 18:00:00',0,1,0,'completed',5,3,NULL,NULL,NULL,NULL,NULL,NULL,'adamoas',1,0,'2016-10-12 22:36:24','2016-10-15 19:30:01'),(961,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-10-21 00:00:00','2016-10-21 02:00:00','2016-10-21 00:00:00','2016-10-21 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-21 00:00:00',0,1,0,'completed',27,4,NULL,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-10-13 04:41:33','2016-10-21 02:00:01'),(962,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-10-14 00:00:00','2016-10-14 02:00:00','2016-10-14 00:00:00','2016-10-14 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-14 00:00:00',0,1,0,'completed',27,4,NULL,NULL,NULL,961,NULL,NULL,'alexrhodes',1,0,'2016-10-13 04:43:11','2016-10-14 02:00:01'),(963,'Intro & familiarity with Creative Arts room for new & overwhelmed members','Found yourself overwhelmed with DMS? Well, we can\'t offer everything but we can ease your understanding of this corner','This will be a monthly class/event/intro. It is not require but would be helpful for new members or anyone who wants to learn more. \r\n\r\nThe main objective of this class is to familiarize you with some of the procedure and tools within Creative Arts to ease some of the \"member\" jazz hands that happens when the world of DMS and possibilities open. During this introduction to the room we will go into detail on the structure of creative arts, the tools, and the \"norms\" that we hope are followed by members. Our hope is that you walk-away with a better understanding and ease about how to best utilize this room for your needs and get to know each other a bit. \r\n\r\nThis is the first one I\'ve scheduled - but I\'m hoping to make this a monthly occurrence before each committee meeting. \r\n\r\nFormat of the class: \r\nIntroduction of participants to each other \r\nOverview of the committee/SIG (special interest groups) \r\nMajor tool introduction (this will not be a class on the tools just an overview of what can be done) \r\nHow you can get involved\r\nWhere to find smaller tools\r\nConsumables how to use/how to pay \r\nDrawing/ Painting Norms and Tools\r\nSewing Norms and Tools\r\nLeather Norms and Tools\r\nFiber Norms and Tools \r\nCosplay/Costume Norms and Tools \r\nShapeoko \r\nLetterpress\r\nAdobe Suite \r\nVinyl \r\nLarge Format Printer\r\nSmall Tools \r\nConclusion and start of Committee meeting (whew) \r\n','This will be my first time doing this - we need to wrap this up so the Committee meeting can start. ','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-17 00:00:00','2016-11-17 01:00:00',0.00,NULL,0,0,1,0,0,'2016-11-17 00:00:00',0,1,0,'rejected',5,75,NULL,NULL,NULL,NULL,'photomancer','Better classified as an EVENT as it doesn\'t teach use of equipment, specific skill/knowledge unlike say Mandatory Intro to Woodshop, or future Mandatory Safety classes near future for Metal Shop.  Photomancer.','uglyknees',0,0,'2016-10-13 16:25:54','2016-10-14 18:51:49'),(964,'Metal Shop Committee Meeting','Committee meeting elect officers','Monthly meeting elect Chair','','2016-10-15 20:00:00','2016-10-15 21:00:00','2016-10-15 20:00:00','2016-10-15 21:00:00',0.00,NULL,25,0,1,0,0,'2016-10-15 20:00:00',0,1,0,'completed',3,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-10-13 18:12:25','2016-10-15 21:00:01'),(965,'CA November meeting ','Planning, talking, and sharing....usually over snacks and laughs ','Annex update\r\nTool classification\r\nSIG reports\r\nYear in review\r\nYear projection/planning \r\nIssues/Concerns/Comments \r\n\r\nand I\'m sure a few other things ','','2016-11-17 01:15:00','2016-11-17 02:15:00','2016-11-17 01:15:00','2016-11-17 02:15:00',0.00,NULL,0,0,0,0,0,'2016-11-17 01:15:00',0,1,0,'completed',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-10-13 18:21:49','2016-11-17 02:15:01'),(966,'3D Printer Workshop','A Hands-on guide to building a Prusa i3 MK2 3D printer kit and calibration. ','For the people that signed up for the previous 3D printer workshop event and the shipping got delayed. We will be building our Prusa i3 Mk2 kits, calibrating, and doing our first prints. Bring a friend or family to help build it. The kit should take about 10 hours to complete. I will be bringing lunch and drinks. ','','2016-10-16 15:00:00','2016-10-17 04:00:00','2016-10-16 15:00:00','2016-10-17 04:00:00',0.00,NULL,0,0,0,0,0,'2016-10-16 15:00:00',0,1,0,'completed',22,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',1,0,'2016-10-13 20:49:03','2016-10-17 04:00:01'),(967,'Pegasus Rising Robotics Meetup','Meeting of robotics team.','Meeting of robotics team.','','2016-10-16 21:00:00','2016-10-17 00:00:00','2016-10-16 21:00:00','2016-10-17 00:00:00',0.00,NULL,10,0,1,18,1,'2016-10-16 21:00:00',0,1,0,'completed',4,97,NULL,NULL,NULL,NULL,NULL,NULL,'morganntho1',1,0,'2016-10-14 01:44:34','2016-10-17 00:00:01'),(968,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-26 23:00:00','2016-10-27 00:00:00','2016-10-26 22:45:00','2016-10-27 00:00:00',10.00,NULL,0,6,0,16,1,'2016-10-26 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,923,NULL,NULL,'hans',1,0,'2016-10-14 15:49:19','2016-10-27 00:00:01'),(969,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-10-27 00:00:00','2016-10-27 02:00:00','2016-10-27 00:00:00','2016-10-27 02:00:00',20.00,NULL,0,8,0,16,1,'2016-10-27 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,924,NULL,NULL,'hans',1,0,'2016-10-14 15:50:17','2016-10-27 02:00:01'),(970,'Finance Committee Meeting','This is a meeting to elect a chair, talk about issues, divide responsibility, and other great finance stuff.','Come on down to help with money!  Finance wants YOU to help us balance the books and keep DMS running and beautiful and makery!  Join us!  \r\n\r\nWe will be electing the new committee chairperson, discussing various issues including honorarium and accounting, and just being generally fabulous.  \r\n\r\n','','2016-10-19 01:00:00','2016-10-19 02:00:00','2016-10-19 01:00:00','2016-10-19 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-19 01:00:00',0,1,0,'completed',4,243,NULL,NULL,NULL,NULL,NULL,NULL,'calliope1983a',1,0,'2016-10-14 19:20:37','2016-10-19 02:00:01'),(971,'Tool Classification Discussion','Small Group discussing Tools around the space and how to classify.  ','Small Group discussing Tools around the space and how to classify.  ','','2016-10-15 18:30:00','2016-10-15 20:00:00','2016-10-15 18:30:00','2016-10-15 20:00:00',0.00,NULL,0,0,0,0,0,'2016-10-15 18:30:00',0,1,0,'completed',4,4,NULL,NULL,NULL,NULL,NULL,NULL,'alexrhodes',1,0,'2016-10-14 22:56:50','2016-10-15 20:00:01'),(972,'Lathe Class ','This is the 7th out of a 10 part class. Enrollment is closed.','This is the 7th out of a 10 part class. Enrollment is closed. ','','2016-10-26 15:30:00','2016-10-26 18:30:00','2016-10-26 15:30:00','2016-10-26 18:30:00',0.00,NULL,3,0,1,18,1,'2016-10-26 15:30:00',0,1,1,'cancelled',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',0,0,'2016-10-15 02:55:37','2016-10-24 16:42:41'),(973,'Linux Install Project & Users Group Monthly Meeting ','The Linux Install Project helps people install Linux operating systems and the monthly meeting includes discussion and presentations.','The Linux Install Project (9AM-11AM) provides assistance to people who want to install Linux operating systems on laptops, desktops, and servers. Almost any computer can run some form of Linux. Bring that old SP machine to the meeting and give it a new lease on life! Please see our website at www.ntlug.org for information on what to do if you want to install Linux.\r\n\r\nThe monthly meeting (11AM-12PM) includes discussion and presentations on Linux systems.','','2016-12-17 15:00:00','2016-12-17 18:00:00','2016-12-17 15:00:00','2016-12-17 18:00:00',0.00,NULL,0,0,0,0,0,'2016-12-17 15:00:00',0,1,0,'approved',8,25,NULL,NULL,NULL,881,NULL,NULL,'dallasmagna',0,0,'2016-10-15 11:34:45','2016-11-16 22:43:02'),(974,'The basics of Ant-Keeping!','Come learn the basics of ant-keeping, from general ant information, to building your founding formicarium!','Ant-keeping might sound like a strange hobby, but there\'s loads of fun to be had! If taken care of properly, these small creatures can perform some amazing things! Being able to watch it happen from start-to-finish is nearly impossible with an anthill in your yard. Come learn how to care for the little guys, from a single Queen, to a thriving colony of thousands! \r\n\r\nOver this 90-minute course, I\'ll go over everything you need to know, including:\r\n\r\n- When to start looking for your founding Queen Ant\r\n- HOW to find your first Queen Ant(s)\r\n- How to raise a colony through its founding stages\r\n- How to care for ants, covering the common species of Texas\r\n- General knowledge you\'ll need to know about ants.\r\n-What you need to know about a formicarium\r\n\r\nPart of the 90-minute window is to compensate for Q&A during the lesson.\r\n\r\nAn ant formicarium is one of the many projects coming to the Science Committee, and I\'m excited to share what I\'ve learned. Whether it\'s that you want your own formicarium at home, or you want to help with the research and fun of the formicarium coming to the \'Space, this is an opportunity to truly probe everyone\'s interest, as well as summarize the \"need-to-know\" that\'s scattered in hours of documentaries and old forums.\r\n\r\nWhen the ball gets rolling, all sorts of experiments will be conducted, including:\r\n\r\n-The behavior of ants in complicated \'Point A - Point B\' puzzles to find their way home, or to food.\r\n-We\'ll even be sending two ant colonies after each other, to watch what usually happens underneath our feet.\r\n-We\'ll be trying to fabricate or harvest ant pheromones, and lead them down artificial paths.\r\n-We\'re going to harvest their eggs, and do an amount of genetic research. Possibly even modification!\r\n\r\nThere\'s no limit to what we can do, and I know from talking to some of you, that many share the passion! So come on! Friday at 5pm in the Purple Classroom!','I don\'t claim to be an expert, but as a hopeful entomologist and ant-enthusiast, I\'ve got hundreds of hours of research under my belt. I\'m summarizing everything I know into a single \"basics\" crash-course!','2016-11-04 22:00:00','2016-11-04 23:30:00','2016-11-04 21:45:00','2016-11-04 23:45:00',0.00,NULL,16,0,0,0,0,'2016-11-04 22:00:00',0,1,0,'completed',11,195,NULL,NULL,NULL,NULL,NULL,NULL,'justownin',1,0,'2016-10-15 18:27:36','2016-11-04 23:30:02'),(975,'sdf/3wa','	watch and discuss new anime','	watch and discuss new anime','','2016-12-17 18:00:00','2016-12-17 23:00:00','2016-12-17 18:00:00','2016-12-17 23:00:00',0.00,NULL,0,0,0,0,0,'2016-12-17 18:00:00',0,1,0,'approved',9,27,NULL,NULL,NULL,NULL,NULL,NULL,'captelensar',0,0,'2016-10-15 19:58:00','2016-10-17 20:00:01'),(976,'Hackster Halloween Hacks & Snacks: ESP8266 and Sparkfun Blynk Board','October\'s platform is Blynk! Blynk is a drag-n-drop IoT app builder for Arduino, Raspberry Pi, ESP8266, and SparkFun boards. You use an iOS and Android app to build a graphic interface for your project by simply dragging and dropping widgets.','No programming knowledge required to participate! Just bring your Android or iOS phone!\r\n\r\nThe theme of this meetup is Halloween hacks. If you have ideas to make your halloween extra special, let\'s build it together. Even if it\'s adding lights to your Halloween Costume, scary hacks to your Pumpkins, Making skull eyeballs move.. Let\'s have fun together. Bring the kids with you.\r\n\r\nOctober\'s platform is Blynk! Blynk is a drag-n-drop IoT app builder for Arduino, Raspberry Pi, ESP8266, and SparkFun boards. You use an iOS and Android app to build a graphic interface for your project by simply dragging and dropping widgets.\r\n\r\nHere\'s a sample halloween project\r\nhttps://www.sparkfun.com/news/2212 ( https://www.sparkfun.com/news/2212 )\r\n\r\nSparkFun has provided us with ten Blynk Boards to experiment with. We\'ll do a quick walk-through of the board and then split up into teams to see what we can build.\r\n\r\nYou don\'t have to use SparkFun Blynk to participate in our hacks. Just bring your ideas, halloween supplies. We have micro-controller boards, sensors that you can use for your project. Our only request is to document your project at Hackster.io\r\n\r\nWhat to bring:\r\n\r\n1. Your Android or iOS Phone\r\n\r\n2. Hardware components you want to connect to Sparkfun Blynk Board Or other hardware dev kits. Bring some tools.\r\n\r\n3. Your ideas and desire to learn\r\n\r\n4. Bring your Halloween project and showcase your work\r\n\r\nBring your personal projects to demo. Post your hardware projects at Hackster.io ( http://hackster.io/ )\r\n\r\nHere are some Halloween projects at Hackster, You can even get featured at Make Magazine\r\n\r\nhttps://www.hackster.io/halloween/projects\r\n\r\nHackster is also having a Halloween Contest\r\n\r\nhttps://www.hackster.io/contests/make-halloween-2016-contest\r\n\r\nLittlebits have some simple Halloween projects\r\n\r\nhttp://littlebits.cc/inventions/explore?q=halloween&page=1&per_page=9\r\n\r\nVisit the links below if you\'d like to learn more about the board and install the Blynk app before the meetup.\r\n\r\nBlynk\r\n\r\nhttp://www.blynk.cc/\r\n\r\nhttp://www.blynk.cc/getting-started\r\n\r\nSparkFun Blynk Board\r\n\r\nhttps://www.sparkfun.com/products/13794\r\n\r\nhttps://cdn.sparkfun.com/assets/learn_tutorials/4/9/0/bb-01-annotated-2.jpg?mc_cid=bf1935df99&mc_eid=2d53181ea8\r\n\r\nhttps://learn.sparkfun.com/tutorials/getting-started-with-the-sparkfun-blynk-board\r\n\r\nUse Arduino IDE with Blynk Board\r\n\r\nhttps://www.hackster.io/wesee/blynk-board-arduino-development-101-179c24','','2016-10-27 23:00:00','2016-10-28 02:00:00','2016-10-27 22:30:00','2016-10-28 02:30:00',0.00,NULL,0,0,0,0,0,'2016-10-27 23:00:00',0,1,0,'completed',8,2,NULL,NULL,NULL,NULL,NULL,NULL,'rlyle78',1,0,'2016-10-16 20:29:45','2016-10-28 02:00:01'),(977,'Civic Hacking Committee Meeting','Pick a committee chair, hear news updates on technology relating to the Civic Hacking space, and see how to make a mapping website using Google App Engine, Polymer, and Firebase.','Interested in open data, maps, emergency alerts, etc, and the technology behind all that?  Want to make a difference in these spaces?  Then c\'mon out to the Civic Hacking Committee meeting!\r\n\r\nHere\'s our agenda:\r\n1. Pick a committee chair.\r\n2. News & updates on various technology-related aspects pertaining to our mission.\r\n3. Down & Dirty with Google Maps with Polymer  & Firebase.\r\n\r\nRegarding the 3rd point, we will go over code to implement a Web app utilizing a Firebase database consisting of a list of categorized points along with Google Polymer & HTML Web components.  Firebase is a cloud database provided by Google, and Polymer & Web Components facilitate fast Website design & development with minimal coding.  No back-end servers or administration required!','','2016-10-18 23:30:00','2016-10-19 00:30:00','2016-10-18 23:30:00','2016-10-19 00:30:00',0.00,NULL,0,0,0,0,0,'2016-10-18 23:30:00',0,1,0,'completed',11,230,NULL,NULL,NULL,NULL,NULL,NULL,'mrcity',1,0,'2016-10-16 23:07:05','2016-10-19 00:30:01'),(978,'Designing for Multicam (Solidworks)','In this class we will be going over the basics of CAD design in Solidworks, will talk about strategies for designing for the Multicam, import our design into Vcarve, and prepare files for the router.','In this class we will be going over the basics of CAD design in Solidworks, will talk about strategies for designing for the Multicam, import our design into Vcarve, and prepare files for the router. There are no prerequisites for this class, but you need to have taken the CNC Router class to access Vcarve and use the router if you plan on using these skills.\r\n\r\nIn this class we will be creating a basic stool. This class assumes no knowledge of CAD design. Attendees will leave with:\r\n-Ability to design and create assemblies in Solidworks. (Basics of the software)\r\n-Strategies and considerations for designing for the Multicam.\r\n-Examples of CNC joints\r\n-Knowledge of how to prepare designs in Vcarve and generate files ready for the router.\r\n\r\nNote: This class will cover \"Flat-Pack\" design. We will not be doing 3D paths on the router.','','2016-11-03 00:00:00','2016-11-03 01:30:00','2016-11-02 23:45:00','2016-11-03 01:45:00',0.00,NULL,0,0,0,0,0,'2016-11-03 00:00:00',0,1,0,'cancelled',9,184,NULL,NULL,NULL,NULL,NULL,NULL,'rshill',0,0,'2016-10-17 14:06:54','2016-10-19 18:47:00'),(979,'Blacksmithing Committee Meeting','Blacksmithing Committee 