'2016-11-06 23:00:00','2016-11-06 20:00:00','2016-11-06 23:00:00',0.00,NULL,0,0,0,0,0,'2016-11-06 20:00:00',0,1,0,'completed',11,27,NULL,NULL,NULL,NULL,NULL,NULL,'captelensar',1,0,'2016-10-18 03:31:46','2016-11-06 23:00:01'),(984,'Jewelry Making: Silver Ring Fabrication','Introduction to Silversmithing ','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nAll materials, supplies, tools and equipment will be included in the cost of the class.\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142\r\n\r\nHope to see you there!','Please wear closed-toe shoes and pants.  Aprons, eye protection, and dust masks will be provided.','2016-10-22 19:00:00','2016-10-23 02:00:00','2016-10-22 18:30:00','2016-10-23 02:30:00',0.00,NULL,0,0,0,0,0,'2016-10-22 19:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,852,NULL,NULL,'nausser915',1,0,'2016-10-19 00:03:46','2016-10-23 02:00:01'),(985,'Decoding a sewing pattern','Bring a sewing pattern you want to make and we\'ll help you plan your project with it.','Bring a pattern you would like to sew or are working on, and we will help get you on your way to completing your project! We can assist with help decoding the pattern envelope, with material selection, sizing, or with sewing advice if there is a tricky bit for which you need help.  \r\n\r\nBring the materials you have for your project, we will have sewing machines an a serger set out and available. \r\n\r\n\r\n\r\n\r\n\r\n','','2016-10-26 00:00:00','2016-10-26 02:00:00','2016-10-25 23:45:00','2016-10-26 02:15:00',0.00,NULL,8,0,0,16,0,'2016-10-25 00:00:00',0,1,0,'completed',11,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',1,0,'2016-10-19 01:46:07','2016-10-26 02:00:02'),(986,'Rocketry Open Build','Model or high power rocket building workshop','Bring your model or high power rocketry projects and we will build together, sharing stories, techniques, tools and supplies. I will have some of my tools and supplies but do not have enough for everyone; please bring your own to prevent having to wait. Generally, you will be using white or wood (yellow) glue, a hobby knife, masking tape, a pencil, a ruler and some sandpaper (220 to 400 grit.) Model rocket kits are available locally at hobby shops as well as craft stores such as Hobby Lobby.\r\n\r\n The plan is to have these sessions every month on a weekday evening. Kids are welcome if they are interested in rocketry; minors need to have a parent or guardian present. If you are not a member of Dallas Makerspace and need to get in the front door, please call me at 972-985-5034. We are scheduled to 10, but if there is interest and the room is available, we can stay later. You may contact me with any questions at deiresearch@earthlink.net','','2016-12-14 01:00:00','2016-12-14 04:00:00','2016-12-14 01:00:00','2016-12-14 04:00:00',0.00,NULL,0,0,0,0,0,'2016-12-14 01:00:00',0,1,0,'approved',11,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',0,0,'2016-10-19 09:44:46','2016-10-21 09:45:01'),(987,'Serger basics (sewing)','Basic equipment use of the Markerspace Serger (sewing)','Basic equipment us of the Makerspace serger (sewing)','','2016-10-27 01:00:00','2016-10-27 02:00:00','2016-10-27 01:00:00','2016-10-27 02:00:00',0.00,NULL,6,0,0,0,0,'2016-10-27 01:00:00',0,1,0,'completed',5,52,NULL,NULL,NULL,NULL,NULL,NULL,'kriskat30',1,0,'2016-10-19 12:20:11','2016-10-27 02:00:01'),(988,'TEST - \"internal error\" reported on TALK ','Looks like Nicole is having a problem submitting a class ','https://talk.dallasmakerspace.org/t/strange-error-when-trying-to-enter-a-class/13455?u=lisaselk','','2016-10-26 17:00:00','2016-10-26 18:00:00','2016-10-26 17:00:00','2016-10-26 18:00:00',0.00,NULL,0,0,0,0,0,'2016-10-26 17:00:00',0,1,0,'cancelled',5,289,NULL,NULL,NULL,NULL,NULL,NULL,'selk68',0,0,'2016-10-19 14:46:05','2016-10-19 14:46:46'),(989,'Intro & familiarity with Creative Arts room for new & overwhelmed members','Found yourself overwhelmed with DMS? Well, we can\'t offer everything but we can ease your understanding of this corner','This will be a monthly class/event/intro. It is not require but would be helpful for new members or anyone who wants to learn more. \r\n\r\nThe main objective of this class is to familiarize you with some of the procedure and tools within Creative Arts to ease some of the \"member\" jazz hands that happens when the world of DMS and possibilities open. During this introduction to the room we will go into detail on the structure of creative arts, the tools, and the \"norms\" that we hope are followed by members. Our hope is that you walk-away with a better understanding and ease about how to best utilize this room for your needs and get to know each other a bit. \r\nAt the end of the event you will be introduced to the 1\" button machine and taught how to make buttons as part of the intro class. Lots of information and not a whole bunch of time to share it. \r\n\r\nThis is the first one I\'ve scheduled - but I\'m hoping to make this a monthly occurrence before each committee meeting. Limited to 17. \r\n\r\nFormat of the class: \r\nIntroduction of participants to each other \r\nOverview of the committee/SIG (special interest groups) \r\nMajor tool introduction (this will not be a class on the tools just an overview of what can be done) \r\nHow you can get involved\r\nWhere to find smaller tools\r\nConsumables how to use/how to pay \r\nDrawing/ Painting Norms and Tools\r\nSewing Norms and Tools\r\nLeather Norms and Tools\r\nFiber Norms and Tools \r\nCosplay/Costume Norms and Tools \r\nShapeoko \r\nLetterpress\r\nAdobe Suite \r\nVinyl \r\nLarge Format Printer\r\nSmall Tools \r\nButton lesson \r\nConclusion and start of Committee meeting (whew) ','This will be my first time doing this - we need to wrap this up so the Committee meeting can start. ','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-17 00:00:00','2016-11-17 01:00:00',0.00,NULL,17,0,1,0,0,'2016-11-17 00:00:00',0,1,0,'rejected',5,75,NULL,NULL,NULL,963,'alexrhodes','I am sorry but I have to reject this.   This is still more of an event.  The only thing added from the last submission is the button maker and it takes like 2 minutes for a 5 year old.  Thanks for all you do, but I can\'t approve.  -Alex ','uglyknees',0,0,'2016-10-19 14:54:52','2016-10-21 23:25:03'),(990,'Basic Introduction to the National Instruments Virtual Bench','This class will cover the basic use of the virtual bench using its NI software to function like normal bench tools; oscilliscope, multimeter, signal generator, and power supply','The purpose of this class is to provide a quick introduction to using the Virtual Bench in the Electronics Room.  This tool provides an oscilliscope, multi-meter, power supply, signal generator, and digital I/O all in one package.\r\n\r\nThe class will not cover the use of the Lab View programming environment with the virtual bench, but rather the use of the NI Virtual Bench software to use the box as if it were the standard tools used on the other benches in the Electronics Room.','','2016-11-02 00:00:00','2016-11-02 01:00:00','2016-11-01 23:45:00','2016-11-02 01:15:00',0.00,NULL,6,0,1,16,0,'2016-11-02 00:00:00',0,1,0,'completed',7,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-10-19 15:16:41','2016-11-02 01:00:01'),(991,'3D Scanning Using the NextEngine Scanner!','The down and dirty on how to acquire a great 3Dscan using the NextEngine 3D Scanner','Often seen but never used.  Wanting love but always hated.  The NextEngine 3D scanner has had a often maligned reputation for poor 3D scans that can take a millennium to acquire.  Not anymore.  The beast has been tamed.  \r\nYou will learn.\r\n1.  The proper technique for setting up your object to be scanned!\r\n2.  How to scan the greatest area with the fewest scans!\r\n3.  Why you don\'t need to set the scanner at \"infinite\" resolution to get great workable scans!  Depending on your needs, a lower scan resolution may be all you really need!\r\n4.  How to acquire the software for post processing, so that you can fine tune your scan on your super fast home computer!\r\n5.  How to easily export the .stl file directly to KISSlicer and throw it into a PolyPrinter!\r\n6.  How to 3D scan your face and then use the .stl file to 3D print your face!\r\n7.  But that\'s not all.  Bring a small object to class and I may pick your object to show the class, in real-time, how we set it up to scan, and pick the proper setting for the best scan!\r\n\r\nStart imagining the possibilities of reproducing broken parts in your car or engine and then milling them in the HAAS.  Reproducing parts that you may need more of.  \"Repairing\" broken objects that can put back together in software, then 3D printed or milled for that \"brand new\" feeling!\r\n\r\nMy favorite cookies are Nutter Butters.\r\n\r\nSee you then,\r\nKee','','2016-11-08 01:00:00','2016-11-08 03:00:00','2016-11-08 01:00:00','2016-11-08 03:00:00',0.00,NULL,25,0,0,0,0,'2016-11-08 01:00:00',0,1,0,'cancelled',9,189,NULL,NULL,NULL,435,NULL,NULL,'ee