CNC Router class to access Vcarve and use the router if you plan on using these skills.\r\n\r\nIn this class we will be creating a basic stool. This class assumes no knowledge of CAD design. Attendees will leave with:\r\n-Ability to design and create assemblies in Solidworks. (Basics of the software)\r\n-Strategies and considerations for designing for the Multicam.\r\n-Examples of CNC joints\r\n-Knowledge of how to prepare designs in Vcarve and generate files ready for the router.\r\n\r\nNote: This class will cover \"Flat-Pack\" design. We will not be doing 3D paths on the router.','','2016-11-10 01:00:00','2016-11-10 03:00:00','2016-11-10 00:45:00','2016-11-10 03:15:00',0.00,NULL,0,0,0,0,0,'2016-11-10 01:00:00',0,1,0,'cancelled',9,184,NULL,NULL,NULL,NULL,NULL,NULL,'rshill',1,0,'2016-10-19 18:49:05','2016-11-09 17:13:56'),(996,'Crash Course in Design Thinking From Stanford D.School','This is NOT a lecture & chill kind of event! This IS a hands-on design & build kind of event.','Get your design on! Developed and made accessible from Stanford\'s d.school, you will expand your mind via rapid ideation, iteration, team communication, and challenging assumptions. Project details will be given at the time of the event, and in person! Come as you are, and you will be teamed up with other participants.\r\n\r\nEmail Aaron Kelton at aaron@narify.com if you have any questions.','','2016-10-27 23:30:00','2016-10-28 00:30:00','2016-10-27 23:15:00','2016-10-28 00:45:00',0.00,NULL,20,0,0,0,0,'2016-10-27 23:30:00',0,1,0,'completed',11,548,NULL,NULL,NULL,NULL,NULL,NULL,'aaron',1,0,'2016-10-19 21:01:31','2016-10-28 00:30:02'),(997,'NEIWG','Weekly NEIWG meeting to discuss ongoing and fucture projects','At this weeks meeting we will be planning our \"So you want to NEIWG?\" class series.  It will be a series of classes that will cover the fundamentals you would need to help contribute to the NEIWG projects.  The classes will include electrophysiology, machine learning, electronic filter design and more.  Next we will our EMG trade space project where we will compare 3 different EMG builds and examine their applications.  Then we will discuss design concepts and plan the build of our haptic feedback glove.  We will start looking into  EOG(Electrooculography ) or the electrical activity of eye moment, as a means of improving telepresence for conferencing technology.  Lastly, we will be discussing a wearable biosensor.\r\n\r\nFeel free to join us to contribute or even just to listen in.  No experience is necessary.','','2016-10-27 01:30:00','2016-10-27 03:30:00','2016-10-27 01:30:00','2016-10-27 03:30:00',0.00,NULL,0,0,0,0,0,'2016-10-27 01:30:00',0,1,0,'completed',9,404,NULL,NULL,NULL,NULL,NULL,NULL,'renkessa',1,0,'2016-10-19 22:14:27','2016-10-27 03:30:01'),(998,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-02 23:00:00','2016-11-03 00:00:00','2016-11-02 22:45:00','2016-11-03 00:00:00',10.00,NULL,0,6,0,16,1,'2016-11-02 23:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,923,NULL,NULL,'hans',1,0,'2016-10-20 19:15:22','2016-11-03 00:00:01'),(999,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-03 00:00:00','2016-11-03 02:00:00','2016-11-03 00:00:00','2016-11-03 02:00:00',20.00,NULL,0,8,0,16,1,'2016-11-03 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,924,NULL,NULL,'hans',1,0,'2016-10-20 19:16:38','2016-11-03 02:00:01'),(1000,'M. Coles LP Meeting','LP Planning','Setting up the Series, LP, and other info from Mike Coles','','2016-10-23 21:00:00','2016-10-24 00:00:00','2016-10-23 21:00:00','2016-10-24 00:00:00',0.00,NULL,0,0,0,0,0,'2016-10-23 21:00:00',0,1,0,'completed',4,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',1,0,'2016-10-21 13:03:12','2016-10-24 00:00:02'),(1001,'Blacksmith Introduction and Open Forge','Learn to forge steel into useful and beautiful objects','Join us to learn the basics of making hand forged iron and steel objects, no experience required.\r\nEach class will have a project to make with experienced instructors showing you the techniques required to build the project and take it home with you.\r\nAll tools and equipment are provided, so come out and have some fun building a new skill.\r\nSuggested donation of $10 to cover the cost of materials and fuel is requested in cash.\r\nIf you have some experience and would like to work on your own projects you can also come out for some open forge time.','','2016-10-23 16:00:00','2016-10-23 20:00:00','2016-10-23 15:00:00','2016-10-23 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-23 16:00:00',0,1,0,'completed',2,18,NULL,NULL,NULL,NULL,NULL,NULL,'jhaskins',1,0,'2016-10-21 13:44:35','2016-10-23 20:00:01'),(1002,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated.','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-11-01 16:00:00','2016-11-01 19:00:00','2016-11-01 16:00:00','2016-11-01 19:00:00',5.00,NULL,0,6,1,18,0,'2016-10-31 16:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-10-21 15:25:00','2016-11-01 19:00:01'),(1003,'Jewelry & Small Metals Area Orientation','Tools & equipment safety training','An overview with basic need-to-know maintenance and safety info for the proprietary equipment in the jewelry and small metals area.\r\n-Flexshaft rotary drill\r\n-Rolling mill\r\n-Metal shear\r\n-Buffing Machine\r\n- Ultrasonic cleaner\r\n-Etc.. ','','2016-11-04 00:00:00','2016-11-04 01:00:00','2016-11-04 00:00:00','2016-11-04 01:00:00',0.00,NULL,0,0,0,0,0,'2016-11-04 00:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-10-21 23:31:47','2016-11-04 01:00:02'),(1004,'Jewelry-Polishing with the buffing machine','Learn how to polish small metals with high speed buffing machine and various compounds','Learn the basics to use the high-speed buffing machine with various compounds and wheels to create various finishes on precious metals, such as gold and silver. Each person will get to practice polishing 1 piece of silver. ','','2016-11-11 01:15:00','2016-11-11 03:15:00','2016-11-11 01:15:00','2016-11-11 03:15:00',0.00,NULL,0,0,1,18,0,'2016-11-11 01:15:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-10-21 23:43:23','2016-11-11 03:15:01'),(1005,'3d printing class','3d printing class for learning the dms printers.','Required training for using the PolyPrinter 3D printers in 3D Fab.','','2016-11-04 02:00:00','2016-11-04 04:00:00','2016-11-04 01:30:00','2016-11-04 04:15:00',0.00,NULL,0,0,1,16,0,'2016-11-04 02:00:00',0,1,0,'completed',9,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',1,0,'2016-10-22 01:38:56','2016-11-04 04:00:01'),(1006,'November Board Meeting','November Board Meeting','November Board Meeting','','2016-11-19 01:30:00','2016-11-19 05:30:00','2016-11-19 01:15:00','2016-11-19 05:30:00',0.00,NULL,0,0,0,0,0,'2016-11-19 01:30:00',0,1,0,'completed',8,51,NULL,NULL,NULL,NULL,NULL,NULL,'lukeiamyourfather',1,0,'2016-10-22 03:40:42','2016-11-19 05:30:01'),(1007,'Digital Media Committee Meeting','The future of Digital Media at Dallas Makerspace','Digital Media is having a committee meeting.  \r\nEveryone is welcome.  \r\nThis will become a monthly event.\r\nCome help us decide the future of Digital Media.\r\n\r\nPlease sign up here','','2016-10-29 21:00:00','2016-10-29 22:00:00','2016-10-29 20:45:00','2016-10-29 22:00:00',0.00,NULL,0,0,0,0,0,'2016-10-29 21:00:00',0,1,0,'completed',6,496,NULL,NULL,NULL,NULL,NULL,NULL,'draco',1,0,'2016-10-22 08:56:58','2016-10-29 22:00:01'),(1008,'Pegasus Rising Robotics Meetup','Battlebot design and construction','DMS members welcome to attend','','2016-11-04 16:00:00','2016-11-04 17:00:00','2016-11-04 16:00:00','2016-11-04 17:00:00',0.00,NULL,0,0,0,0,0,'2016-11-04 16:00:00',0,1,0,'completed',4,219,NULL,NULL,NULL,NULL,NULL,NULL,'philluetchford',1,0,'2016-10-23 00:15:25','2016-11-04 17:00:01'),(1009,'Pegasus Rising Robotics Meetup','Battlebot design and construction','DMS members welcome to attend.','','2016-10-30 21:00:00','2016-10-31 01:00:00','2016-10-30 21:00:00','2016-10-31 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-30 21:00:00',0,1,0,'completed',4,219,NULL,NULL,NULL,NULL,NULL,NULL,'philluetchford',1,0,'2016-10-23 00:20:51','2016-10-31 01:00:02'),(1010,'CNC PlasmaCAM Training','Training for the Metalshop CNC Plasmacutter','This is the long awaited training for the CNC Plasma cutter. We will begin in the classroom to go over the basics then move to the metalshop to get hands on training. You will be instructed on how to use the CNC Plasma cutter in the basic form. You will be cutting out some items for a demo on the plasma cutter.','Please wear appropriate clothing. Do not wear any open toe shoes or shorts, you will be turned away. Please bring your safety glasses. If you have a Pacemaker, the plasma cutter may interfere, Please talk to your DR before hand.','2016-11-08 01:00:00','2016-11-08 03:00:00','2016-11-08 00:45:00','2016-11-08 03:00:00',5.00,NULL,0,8,1,18,0,'2016-11-07 01:00:00',0,1,0,'completed',11,147,NULL,NULL,NULL,949,NULL,NULL,'tbjk',1,0,'2016-10-24 02:37:03','2016-11-08 03:00:01'),(1011,'Fired Arts Organization and Work Day','We will be working over the Fired Arts area, and incorporating a couple of new ideas.','Things.  We\'ll be doing Things.  Come prepared to get dirty, of course.  The goal will be to maximize what we\'ve got.  Labeling of areas and equipment will occur.  Bring your muscles and your ideas.','','2016-11-06 20:30:00','2016-11-06 21:30:00','2016-11-06 20:30:00','2016-11-06 21:30:00',0.00,NULL,0,0,0,0,0,'2016-11-06 20:30:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-10-24 04:27:00','2016-11-06 21:30:01'),(1012,'Introduction to the Creative Arts room for new & information seeking members','Now that you\'ve joined how does this all work? This will be a monthly class/introduction to CA designed to be integrate new members or any member who wants to learn more about the scope of CA learning opportunities, equipment/tools available','CA Introduction will familiarize you with the procedures for tool use that require training within Creative Arts so that you can begin working and using tools as quickly as possible.  The Introduction l go into detail on the structure of creative arts  such as Special Interest Groups, the tools, required training on certain tools, consumables and the \"norms\" that we expect to be followed by members so you walk-away with a better understanding and feel at ease about how to best utilize Creative Arts resources for your needs and get to know each other a bit. \r\n\r\nAt the end of the event you will be trained, qualified on the use to the 1\" and 2 button machine, making your first buttons (bring any special small pictures youd like made into a button.)   Lots of information.  Class starts promptly at 6PM.   Class is limited to 17.\r\n\r\nThis is a monthly class and generally will be scheduled before each committee meeting.','','2016-11-16 12:00:00','2016-11-16 13:00:00','2016-11-16 12:00:00','2016-11-16 13:00:00',0.00,NULL,20,0,1,0,0,'2016-11-16 12:00:00',0,1,0,'cancelled',5,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',0,0,'2016-10-24 15:03:08','2016-10-24 16:05:26'),(1013,'Print a DMS shirt and learn how to use the flash dryer (bring your own shirt)','Many members didn\'t get a chance to create a DMS t-shirt or bag at Open House. I\'ll give a quick introduction on how to use the silk screen setup here at DMS and we will take turns creating t-shirts or bags. See description for further information. ','We will be learning how to setup the DMS silkscreen tools, how to mix ink, how to properly screen a shirt, how to use the new flash dryer, and how to clean up (for those who will stick around to help cleanup) \r\n\r\nPlease bring your own t-shirt to this event if you would like to print one. Michaels, Hobby Lobby, Joannes, even Dollar Tree have t-shirts you can print on. The ink will be black so plan accordingly. Please come with an optional $3 donation for ink {per shirt}/ new flash dryer. \r\n\r\nIf you would like to get a DMS bag please bring $5 donation (goes to PR) and you will walk away with a tote at the end of the night. \r\n\r\nIf you just want to come and learn how to print and not bring something along we will have some paper for you to experiment with. \r\n\r\nThis class won\'t be covering how to burn screens! Please understand that\'s is on it\'s way! \r\n\r\nPlease wear clothing that can get mess on them. Ink is horribly sticky stuff. We will be in the warehouse - please wear closed shoes.\r\n','Please wear clothing that can get mess on them. Ink is horribly sticky stuff. We will be in the warehouse - please wear closed shoes.','2016-11-16 00:30:00','2016-11-16 02:30:00','2016-11-16 00:00:00','2016-11-16 03:00:00',0.00,NULL,20,0,0,0,0,'2016-11-16 00:30:00',0,1,0,'completed',21,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',1,0,'2016-10-24 15:52:34','2016-11-16 02:30:01'),(1014,'Introduction to the Creative Arts room for new & information seeking members','Now that you\'ve joined how does this all work? This will be a monthly class/introduction to CA designed to be integrate new members or any member who wants to learn more about the scope of CA learning opportunities, equipment/tools available','CA Introduction will familiarize you with the procedures for tool use that require training within Creative Arts so that you can begin working and using tools as quickly as possible.  The Introduction l go into detail on the structure of creative arts  such as Special Interest Groups, the tools, required training on certain tools, consumables and the \"norms\" that we expect to be followed by members so you walk-away with a better understanding and feel at ease about how to best utilize Creative Arts resources for your needs and get to know each other a bit. \r\n\r\nAt the end of the event you will be trained, qualified on the use to the 1\" and 2 button machine, making your first buttons (bring any special small pictures youd like made into a button.)   Lots of information.  Class starts promptly at 6PM.   Class is limited to 17.\r\n\r\nThis is a monthly class and generally will be scheduled before each committee meeting.\r\n\r\n\r\nhttp://prezi.com/ruxzqe5kt9fl/?utm_campaign=share&utm_medium=copy','This will be my first time teaching this. I appreciate any information/guidance on how to make this event more informative. We will be rocking and rolling with it. ','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-16 23:45:00','2016-11-17 01:00:00',0.00,NULL,17,0,1,0,0,'2016-11-17 00:00:00',0,1,0,'rejected',5,75,NULL,NULL,NULL,NULL,'alexrhodes','I have discussed this with others and we don\'t believe there is much more to this than what is covered in the tour.   There needs to be a teaching element to receive honorarium and the button maker is not enough.   -Alex','uglyknees',0,0,'2016-10-24 16:10:10','2016-10-25 21:44:19'),(1015,'Creative Arts Media Room Wall','Collecting materials and breaking ground on the Creative Arts Media Room','Time to break ground on the Creative Arts Media Room.\r\n\r\nWe will be making a trip to get materials to frame the wall. If time allows, will get some drywall up as well.\r\n\r\nNo help required, but if you want to stop by and lend a hand with labor you\'re welcome!\r\n\r\n','There will be 2x4\'s in motion, as well as power tools.  Enter at ye own risk.','2016-10-29 15:00:00','2016-10-29 21:00:00','2016-10-29 15:00:00','2016-10-29 21:00:00',0.00,NULL,0,0,0,0,0,'2016-10-29 15:00:00',0,1,0,'completed',8,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',1,0,'2016-10-25 03:23:18','2016-10-29 21:00:01'),(1016,'Airbrushing 101','Learn how to use and clean airbrushes','We will be learning how to take airbrushes apart (and reassemble) and also how to clean them properly.\r\n\r\nWill also be learning some basic airbrushing painting techniques!\r\n\r\n','','2016-11-10 01:30:00','2016-11-10 03:00:00','2016-11-10 01:30:00','2016-11-10 03:00:00',0.00,NULL,5,0,1,0,0,'2016-11-10 01:30:00',0,1,0,'completed',5,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',1,0,'2016-10-25 03:32:09','2016-11-10 03:00:01'),(1017,'Python for Beginners (continued)','Learn to Python','Let\'s look at applying Python to something?','','2016-10-28 00:00:00','2016-10-28 01:00:00','2016-10-28 00:00:00','2016-10-28 01:00:00',0.00,NULL,0,0,0,0,0,'2016-10-28 00:00:00',0,1,0,'completed',3,502,NULL,NULL,NULL,NULL,NULL,NULL,'alanlu',1,0,'2016-10-25 04:58:40','2016-10-28 01:00:01'),(1018,'Python for Beginners (continued)','Learn to Python','Let\'s look at applying Python to something?','','2016-10-31 00:00:00','2016-10-31 01:01:00','2016-10-31 00:00:00','2016-10-31 01:01:00',0.00,NULL,0,0,0,0,0,'2016-10-31 00:00:00',0,2,0,'approved',3,502,NULL,NULL,1017,NULL,NULL,NULL,'alanlu',0,0,'2016-10-25 04:58:40','2016-10-27 05:00:01'),(1019,'Python for Beginners (continued)','Learn to Python more','Aaaaaahhhh','','2016-11-07 01:00:00','2016-11-07 02:00:00','2016-11-07 01:00:00','2016-11-07 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-07 01:00:00',0,1,0,'rejected',11,502,NULL,NULL,NULL,NULL,'bscharff','\"Aaaaaahhhh\" is not sufficient information.  Please resubmit event with MUCH more detail, and if possible, a syllabus.','alanlu',0,0,'2016-10-25 05:08:41','2016-10-25 21:41:55'),(1020,'Python for Beginners (continued)','Learn to Python mor