228,NULL,NULL,'eriksmith',1,0,'2016-10-25 22:15:18','2016-11-07 00:00:02'),(1025,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-11-08 17:00:00','2016-11-08 20:00:00','2016-11-08 17:00:00','2016-11-08 20:00:00',5.00,NULL,0,6,1,18,0,'2016-11-07 17:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-10-26 00:02:25','2016-11-08 20:00:01'),(1026,'Introduction to MIG Welding','The class with provide instruction on Setup, use and care of the Miller 252 Mig Welder. ','Class will cover the basic setup, operation and maintenance of the Miller 252 Mig welder, welding mild steel and tips for setting up and welding your projects. Class is limited to DMS Members, with a maximum of 8 participants. Participants must have taken a Welding Processes and Safety Class to enroll in this class. Please wear natural fiber clothing with long sleeves and long pants without cuffs. Closed toes shoes are also required. Long hair needs to be secured. If you have your own welding helmet, gloves and other safety equipment, please bring it. Cost of the class is $30.00. Purchase tickets from Eventbrite. All proceeds go to DMS Metal shop for materials and supplies.','','2016-11-13 19:00:00','2016-11-13 21:00:00','2016-11-13 18:30:00','2016-11-13 21:30:00',30.00,NULL,0,8,0,16,0,'2016-11-10 19:00:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-10-26 17:29:47','2016-11-13 21:00:02'),(1027,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-10-28 00:00:00','2016-10-28 02:00:00','2016-10-28 00:00:00','2016-10-28 02:00:00',0.00,NULL,0,0,0,0,0,'2016-10-28 00:00:00',0,1,0,'completed',27,4,NULL,NULL,NULL,961,NULL,NULL,'alexrhodes',1,0,'2016-10-26 17:35:21','2016-10-28 02:00:01'),(1028,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-11-04 00:00:00','2016-11-04 02:00:00','2016-11-04 00:00:00','2016-11-04 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-04 00:00:00',0,1,0,'completed',27,4,NULL,NULL,NULL,961,NU