ntbrite: All proceeds go to DMS Metal shop for materials and supplies. ',' Please wear natural fiber clothing with long sleeves and long pants without cuffs. Closed toes shoes are also required. Long hair needs to be secured. If you have your own welding helmet, gloves and other safety equipment, please bring it. ','2016-11-13 22:00:00','2016-11-14 00:00:00','2016-11-13 21:30:00','2016-11-14 00:30:00',40.00,NULL,0,0,0,16,0,'2016-11-10 22:00:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-10-26 17:45:18','2016-11-14 00:00:01'),(1032,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-12-02 01:00:00','2016-12-02 03:00:00','2016-12-02 01:00:00','2016-12-02 03:00:00',0.00,NULL,0,0,0,0,0,'2016-12-02 01:00:00',0,1,0,'approved',27,4,NULL,NULL,NULL,961,NULL,NULL,'alexrhodes',0,0,'2016-10-26 17:47:36','2016-10-26 17:47:56'),(1033,'DMS Welding Processes and Safety','Class will cover welding processes available at DMS and safety procedures associated with welding. This class is required for participation in the DMS welding classes.','Class provides a brief introduction into Arc, MIG, TIG and Spot Welding equipment and processes. The class also provides the student with a description of the hazards associated with the welding processes and how to protect themselves and other members from those hazards. \r\n\r\nThe class is free. No need to enroll, just show up.\r\n','','2016-11-13 16:00:00','2016-11-13 17:30:00','2016-11-13 15:45:00','2016-11-13 17:45:00',0.00,NULL,0,0,1,0,0,'2016-11-13 16:00:00',0,1,0,'completed',10,346,NULL,NULL,NULL,NULL,NULL,NULL,'leecjones',1,0,'2016-10-26 17:48:45','2016-11-13 17:30:01'),(1034,'Introduction to the Creative Arts room for new & information seeking members','Now that you\'ve joined how does this all work? This will be a monthly class/introduction to CA designed to be integrate new members or any member who wants to learn more about the scope of CA learning opportunities, equipment/tools available','CA Introduction will familiarize you with the procedures for tool use that require training within Creative Arts so that you can begin working and using tools as quickly as possible.  The Introduction l go into detail on the structure of creative arts  such as Special Interest Groups, the tools, required training on certain tools, consumables and the \"norms\" that we expect to be followed by members so you walk-away with a better understanding and feel at ease about how to best utilize Creative Arts resources for your needs and get to know each other a bit. \r\n\r\nAt the end of the event you will be trained, qualified on the use to the 1\" and 2 button machine, making your first buttons (bring any special small pictures youd like made into a button.)   Lots of information.  Class starts promptly at 6PM.   Class is limited to 17.\r\n\r\nThis is a monthly class and generally will be scheduled before each committee meeting.\r\n\r\n\r\nhttp://prezi.com/ruxzqe5kt9fl/?utm_campaign=share&utm_medium=copy','This will be my first time teaching this. I appreciate any information/guidance on how to make this event more informative. We will be rocking and rolling with it. ','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-16 23:45:00','2016-11-17 01:00:00',0.00,NULL,17,0,1,0,0,'2016-11-17 00:00:00',0,1,0,'completed',5,75,NULL,NULL,NULL,1014,NULL,NULL,'uglyknees',1,0,'2016-10-26 20:18:41','2016-11-17 01:00:01'),(1035,'CNC Plasma Cutter Training','Training for the Metal Shop CNC Plasma Cutter','This is the required training to use the CNC Plasma Cutter. The first half of this class (~45 minutes) will be a classroom introduction to the procedures, rules, and software for this machine. The second half of this class will be hands-on experience with the software and actually running a cut. Every student must complete a cut to qualify to use the CNC plasma cutter.\r\n\r\nThis class is limited to 6 seats so that each student can complete hands-on training with the software.\r\n\r\nThe class fee goes toward consumables on the plasma cutter. The instructor is volunteering his time.\r\n','Please wear appropriate clothing: long sleeve natural-fiber shirt (NO synthetics!), jeans or slacks (again, NO synthetics), and work shoes.  Do not wear any open toe shoes or shorts, as you will be turned away. \r\n\r\nIf you own safety glasses, bring them. Otherwise, you\'ll have to use the scratched-up ones which are provided in the workshop.\r\n\r\nIf you have a pacemaker, the plasma cutter may interfere with it. Please talk to your doctor before signing up or attending this class.','2016-11-04 00:00:00','2016-11-04 02:30:00','2016-11-04 00:00:00','2016-11-04 02:30:00',5.00,NULL,0,6,1,16,0,'2016-11-04 00:00:00',0,1,0,'completed',8,86,10,NULL,NULL,NULL,NULL,NULL,'zmetzing',1,0,'2016-10-26 20:24:43','2016-11-04 02:30:01'),(1036,'DMS Tour Night','Weekly Tour nights for people to come and check out the space.   Ask questions and get acclimated with the community. ','If you have never been to the Dallas MakerSpace, Thursday nights are our only nights we open the doors to the public for tours.    Come ask questions and get acclimated with the community. \r\n\r\nIf you decide to sign up this is the only night we guarantee to get you set up with a badge and set up with a membership.   ','','2016-12-09 01:00:00','2016-12-09 03:00:00','2016-12-09 01:00:00','2016-12-09 03:00:00',0.00,NULL,0,0,0,0,0,'2016-12-09 01:00:00',0,1,0,'approved',27,4,NULL,NULL,NULL,961,NULL,NULL,'alexrhodes',0,0,'2016-10-26 20:24:52','2016-10-26 20:25:43'),(1037,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-10 01:00:00','2016-11-10 03:00:00','2016-11-10 01:00:00','2016-11-10 03:00:00',20.00,NULL,0,8,0,16,1,'2016-11-10 01:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,924,NULL,NULL,'hans',1,0,'2016-10-27 03:45:55','2016-11-10 03:00:01'),(1038,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-10 00:00:00','2016-11-10 01:00:00','2016-11-09 23:45:00','2016-11-10 01:00:00',10.00,NULL,0,6,0,16,1,'2016-11-10 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,923,NULL,NULL,'hans',1,0,'2016-10-27 03:47:23','2016-11-10 01:00:01'),(1039,'Babylock Embroidery Instruction (CLASS FULL)','Using the Babylock Embroidery machine','Learn how to set-up and use the Babylock Embroidery machine.  Partly demonstration with some hands-on.   After this class you should be comfortable using the machine on your own.\r\n\r\nWe will embroider the DMS logo on a Creative Arts apron.  Each attendee will \"hoop\" the fabric, thread the machine, and stitch part of the design.  \r\n\r\nPlease be prompt.   The class starts with setting up the machine, and I will show where all the \"goodies\" are stored.  \r\n\r\n(We will not actually use the Photo printer.  We will use that computer for about 10 minutes to transfer the embroidery file onto the sewing machine\'s data card).  \r\n\r\n\r\n\r\n','We will be moving around some in the Creative Arts Studio so plan to be on your feet for much of this time.  Bring glasses suitable for a distance of 3-4 feet if needed.   \r\n\r\nPLEASE NOTE THAT THIS DATE IS THE TRANSITION DATE FOR DAYLIGHT SAVINGS TIME!   ','2016-11-06 18:00:00','2016-11-06 20:00:00','2016-11-06 18:00:00','2016-11-06 20:15:00',0.00,NULL,4,0,1,13,0,'2016-11-04 18:00:00',0,1,0,'completed',5,10,NULL,NULL,NULL,195,NULL,NULL,'chrismini',1,0,'2016-10-27 04:11:22','2016-11-06 20:00:01'),(1040,'ANIMARATHON! Election Night','Don\'t watch exit polls.  Watch anime instead.','Cast your vote, then join us as we forget, for a little while, the nightmare our political system has dissolved into, with the help of classic Japanese animation from the 1980s & 1990s, played back from LaserDisc.','Japanese animated programs are known to include themes and content which may not be appropriate for the immature of any age.  Subtitled presentations may cause confusion in the susceptible.','2016-11-08 18:00:00','2016-11-09 06:00:00','2016-11-08 18:00:00','2016-11-09 06:00:00',0.00,NULL,0,0,0,0,0,'2016-11-08 18:00:00',0,1,0,'completed',9,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-10-27 06:32:18','2016-11-09 06:00:01'),(1041,'Poinsettia Cupcakes','Come learn how to make beautiful & delicious cupcakes for the holidays!','Learn how to make cupcakes that look like Poinsettias; guaranteed to be a hit for the holidays!\r\n\r\nWe will start with white frosting and learn how to create the colors needed, fill piping bags,  and how to do basic piping. From there you will learn how to turn those basics in to beautiful flowers!\r\n\r\nI will bring cupcakes and buttercream frosting. If you have any dietary concerns, such as a wheat allergy or being vegan, please shoot me an email at megandrew1918@gmail.com and I will do my best to accommodate!\r\n\r\nSee the attached picture for an idea of what your cupcakes will look like!\r\n\r\nThe $5 is payable in cash at class and is just to help cover the cost of ingredients. ','Frosting can sometimes get messy so be sure to wear a shirt that can get dirty or bring an apron!','2016-11-30 01:00:00','2016-11-30 03:00:00','2016-11-30 00:30:00','2016-11-30 03:30:00',5.00,NULL,1,10,0,13,0,'2016-11-29 01:00:00',0,1,0,'cancelled',11,391,NULL,NULL,NULL,NULL,NULL,NULL,'mandrew',0,0,'2016-10-27 16:16:05','2016-11-01 18:15:13'),(1042,'3D Printer Basics','This is the prerequisite class for using the 3D printers','This is a simple class on how to use and not break the 3D printers using the 3D Fab printer basics Syllabus.','','2016-11-07 19:00:00','2016-11-07 20:00:00','2016-11-07 19:00:00','2016-11-07 20:00:00',0.00,NULL,0,0,1,18,0,'2016-11-07 19:00:00',0,1,0,'completed',1,70,1,NULL,NULL,NULL,NULL,NULL,'maxk68',1,0,'2016-10-27 21:30:14','2016-11-07 20:00:01'),(1043,'3D Printer Basics','Mandatory intro class for 3d fab','This is a simple class on how to use and not break the 3D printers using the 3D Fab printer basics syllabus.','','2016-11-14 19:00:00','2016-11-14 20:00:00','2016-11-14 19:00:00','2016-11-14 20:00:00',0.00,NULL,0,0,0,16,0,'20