','','2016-11-26 23:00:00','2016-11-27 04:00:00','2016-11-26 22:15:00','2016-11-27 04:45:00',0.00,NULL,0,0,1,0,1,'2016-11-26 23:00:00',0,1,0,'approved',6,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-10-27 22:31:46','2016-10-29 22:35:01'),(1049,'Wave Beaded Bracelet','Make a wave-beaded bracelet - great for holiday gifts!','This bracelet looks complicated, but is very easy to make, and is a perfect project for beginners. Once you learn the technique, it can be easily adapted to make necklaces.\r\nThere is a $10 supply fee, payable in cash at the class, that covers beads, findings and a detailed instruction handout.\r\n \r\n\r\n','','2016-11-13 18:30:00','2016-11-13 20:30:00','2016-11-13 18:00:00','2016-11-13 21:00:00',0.00,NULL,10,0,0,0,0,'2016-11-13 18:30:00',0,1,0,'completed',11,171,NULL,NULL,NULL,NULL,NULL,NULL,'rpnotme',1,0,'2016-10-28 16:37:10','2016-11-13 20:30:02'),(1050,'Dye Sub 101 - BYOS (Bring your own shirt)','Learn to decorate with full-color dye sublimation. We will teach you how to use the dye sub equipment that we have, and help you decorate a few items to take with you.','Learn what dye sublimation is, what can be decorated with dye sublimation, and how to use the equipment the Dallas Makerspace has for dye sublimation. \r\n\r\nThis class includes a hands-on portion where you will be able to decorate items yourself. If you would like to decorate a shirt, bring your own. We recommend 100% polyester, but a 50/50 poly/cotton blend will work with some fading of the image transferred. We recommend that you bring a white shirt, but any light color can be used with some limitations, which we will talk about during the class. Dark colored shirts will not work with dye sublimation. We will have coffee mugs, mouse pads, coasters, and possibly other blanks available for purchase at the class. We will be able to accept cash or card for blank items.\r\n\r\nBring your own images to put on items. To give you an idea of the size of the images that you want to use follow these guidelines. Images are not limited to the number of colors they can contain. Photographs can be excellent with dye sublimation.\r\n\r\nShirt - large front or back: Max image size 8\" x 10-1/2\" (or 10-1/2\" x 8\") at 150 dpi (1200px by 1575px)\r\nShirt - pocket area: about 4\" x 4\" at 150dpi (600px x 600px)\r\nCoffee Mug, 11oz: printable area 8\" x 3-1/2\", image size 8\" x 4\" to allow image to go all the way from top to bottom at 300 dpi (2400px by 1200 px)\r\nCoaster, round: printable area 3-3/4\" diameter, image size 4\" for edge-to-edge cover at 300 dpi (1200px by 1200 px)\r\nMouse pad: printable area 9-1/4\" x 7-3/4\", image size 9-1/2\" x 8\" for edge to edge coverage at 150 dpi (1425px by 1200 px)','We will be using heat presses that will exceed 350 degrees Fahrenheit, and can present a burn and crush hazard.','2016-11-19 01:00:00','2016-11-19 04:00:00','2016-11-19 00:30:00','2016-11-19 04:30:00',5.00,NULL,0,6,1,0,0,'2016-11-18 01:00:00',0,1,0,'completed',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',1,0,'2016-10-28 19:42:44','2016-11-19 04:00:01'),(1051,'Dye Sub 101 - BYOS (Bring your own shirt)','Learn to decorate with full-color dye sublimation. We will teach you how to use the dye sub equipment that we have, and help you decorate a few items to take with you.','Learn what dye sublimation is, what can be decorated with dye sublimation, and how to use the equipment the Dallas Makerspace has for dye sublimation. \r\n\r\nThis class includes a hands-on portion where you will be able to decorate items yourself. If you would like to decorate a shirt, bring your own. We recommend 100% polyester, but a 50/50 poly/cotton blend will work with some fading of the image transferred. We recommend that you bring a white shirt, but any light color can be used with some limitations, which we will talk about during the class. Dark colored shirts will not work with dye sublimation. We will have coffee mugs, mouse pads, coasters, and possibly other blanks available for purchase at the class. We will be able to accept cash or card for blank items.\r\n\r\nBring your own images to put on items. To give you an idea of the size of the images that you want to use follow these guidelines. Images are not limited to the number of colors they can contain. Photographs can be excellent with dye sublimation.\r\n\r\nShirt - large front or back: Max image size 8\" x 10-1/2\" (or 10-1/2\" x 8\") at 150 dpi (1200px by 1575px)\r\nShirt - pocket area: about 4\" x 4\" at 150dpi (600px x 600px)\r\nCoffee Mug, 11oz: printable area 8\" x 3-1/2\", image size 8\" x 4\" to allow image to go all the way from top to bottom at 300 dpi (2400px by 1200 px)\r\nCoaster, round: printable area 3-3/4\" diameter, image size 4\" for edge-to-edge cover at 300 dpi (1200px by 1200 px)\r\nMouse pad: printable area 9-1/4\" x 7-3/4\", image size 9-1/2\" x 8\" for edge to edge coverage at 150 dpi (1425px by 1200 px)','We will be using heat presses that will exceed 350 degrees Fahrenheit, and can present a burn and crush hazard.','2016-11-29 01:00:00','2016-11-29 04:00:00','2016-11-29 00:30:00','2016-11-29 04:30:00',5.00,NULL,0,6,1,0,0,'2016-11-28 01:00:00',0,1,0,'approved',5,56,NULL,NULL,NULL,NULL,NULL,NULL,'caryf300',0,0,'2016-10-28 19:45:50','2016-10-31 19:50:01'),(1052,'Learn to create your own breakout board with KiCAD','We will cover creating a breakout for a surface mount chip so that you can prototype with it','The purpose of this class is to teach how to use the Open Source package KiCAD to produce a breakout board for parts for which you can not find a commercial board.  The skills learned will allow you to produce such boards on your own, as well as use the same skills to produce more complicated pc boards.\r\n\r\nWe will all be creating the same breakout board for a part I choose for the class.  Prior to class you NEED to install the current version 4.0.4 on your laptop, which you will bring with you to class.  If you don\'t have the software installed before class, we will not wait for you to get it installed.  You can download the software from http://kicad-pcb.org/download/ for Windows, Max, and most flavors of Linux','Must bring working laptop with KiCAD 4.0.4 installed to class.','2016-11-17 00:31:00','2016-11-17 03:29:00','2016-11-17 00:01:00','2016-11-17 03:59:00',0.00,NULL,10,0,0,16,0,'2016-11-17 00:31:00',0,1,0,'completed',8,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-10-28 21:41:13','2016-11-17 03:30:01'),(1053,'Actor Taping','Taping an actress, video audition for film.','Will be recording an actress for video audition.  Closed event.','','2016-10-31 15:00:00','2016-10-31 18:00:00','2016-10-31 15:00:00','2016-10-31 18:00:00',0.00,NULL,0,0,0,0,0,'2016-10-31 15:00:00',0,1,0,'completed',6,351,NULL,NULL,NULL,NULL,NULL,NULL,'erichanson',1,0,'2016-10-29 00:31:15','2016-10-31 18:00:01'),(1054,'Crochet Beyond the Basics: Tapestry Crochet Technique (cellphone cover/pouch)','Take your basic crochet skills to the next level by learning how to manipulate complex color changes to produce striking patterns without needing to weave in lots of ends','Take your basic crochet skills to the next level by learning how to manipulate complex color changes to produce striking patterns without needing to weave in lots of ends.\r\n\r\nIn this class, we will be making a cell phone cover or small pouch to learn the basics of tapestry crochet.\r\n\r\nTapestry crochet is sometimes called jacquard crochet, intarsia, mosaic, fair isle, and colorwork, (techniques vary). Since the yarns are switched back and forth to create motifs, tapestry crochet fabric looks more like it was woven on a loom than crocheted with a hook.\r\n\r\nYou will learn:\r\n\r\n1.  How to change colors mid-row\r\n\r\n2.  To carry another color, without having to weave in ends for each color change.\r\n\r\nPattern is easily adjustable to fit any size cell phone or tablet, or to be adapted to a small pouch or bag.\r\n\r\nSee examples of tapestry crochet and sample project in attached images.\r\n\r\nYarn and crochet hooks available at class, or feel free to bring two contrasting colors of your favorite yarn with you.\r\n\r\nIMPORTANT\r\nYou will need to know basic stitches - chain stitch, single crochet, and slip stitch.  \r\n\r\nIF YOU NEED BASIC CROCHET HELP, come to the Spinning and Fiberarts class on Tuesday, November 1, and we\'ll get you up to speed.\r\n\r\nInstructor: Donna Duran\r\n\r\nQuestions or need help, check out our Facebook group:\r\nDallas Makerspace Fiberholics','IMPORTANT\r\nYou will need to know basic stitches - chain stitch, single crochet, and slip stitch.  \r\n\r\nIF YOU NEED BASIC CROCHET HELP, come to the Spinning and Fiberarts class on Tuesday, November 1, and we\'ll get you up to speed.','2016-11-09 01:00:00','2016-11-09 03:00:00','2016-11-09 00:45:00','2016-11-09 03:15:00',0.00,NULL,10,0,0,0,0,'2016-11-09 01:00:00',0,1,1,'completed',5,568,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',1,0,'2016-10-29 04:09:12','2016-11-09 03:00:01'),(1055,'Lathe Basics',' Learn to safely use the lathes in the Woodshop.','This class will introduce/re-introduce you to the lathe, including shop rules and general expectations, and wood working safe/best practices. ',' ** Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories. **','2016-11-09 17:15:00','2016-11-09 19:15:00','2016-11-09 16:45:00','2016-11-09 19:30:00',0.00,NULL,5,0,1,13,0,'2016-11-09 17:15:00',0,1,0,'completed',12,33,7,NULL,NULL,562,NULL,NULL,'wascheu',1,0,'2016-10-29 05:26:46','2016-11-09 19:15:01'),(1056,' Pen Turning','We\'re making pens. ','We are making pens \r\nYou will be able to write \" Hello World! and HAPPY WEDNESDAY\" with a hand crafted biro.','','2016-11-09 20:00:00','2016-11-09 23:00:00','2016-11-09 19:30:00','2016-11-09 23:15:00',12.00,NULL,0,5,1,13,0,'2016-11-04 20:00:00',0,1,0,'completed',12,33,NULL,7,NULL,563,NULL,NULL,'wascheu',1,0,'2016-10-29 05:31:12','2016-11-09 23:00:01'),(1057,' Modified Pen Turning','We\'re making pens. ','We are making MODIFIED SLIMLINE PENS!!!\r\nYou will be able to thank our Veterans by writing them a note and or giving them your  hand crafted biro.','','2016-11-12 00:00:00','2016-11-12 03:00:00','2016-11-11 23:30:00','2016-11-12 03:15:00',12.00,NULL,0,5,1,13,0,'2016-11-07 00:00:00',0,1,0,'cancelled',12,33,NULL,7,NULL,563,NULL,NULL,'wascheu',0,0,'2016-10-29 05:38:05','2016-10-29 18:03:34'),(1058,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','So, who needs this class?  If you are not a pretty experienced leather worker, you probably do even if you have taken a project class or two at the space.  YouTube can\'t teach you our expectations of care, lol.  This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing options\r\nInformational resources\r\nHands-on demonstration of various tools and techniques by interest\r\n','While you do not have to be a DMS member to attend this class, general use of these tools and supplies outside of this or any DMS leatherworking class or event setting is restricted to DMS members only.','2016-11-10 01:30:00','2016-11-10 03:00:00','2016-11-10 01:00:00','2016-11-10 03:15:00',0.00,NULL,10,0,0,0,0,'2016-11-10 01:30:00',0,1,0,'cancelled',11,54,NULL,NULL,NULL,674,NULL,NULL,'bitta',0,0,'2016-10-29 18:06:04','2016-10-30 18:53:47'),(1059,' Modified Pen Turning','We\'re making pens. ','We are making pens \r\nYou will be able to write \" Hello World! and HAPPY SUNDAY\" with a hand crafted biro.','','2016-11-13 19:00:00','2016-11-13 22:00:00','2016-11-13 18:30:00','2016-11-13 22:15:00',15.00,NULL,0,5,1,13,0,'2016-11-08 19:00:00',0,1,0,'completed',12,33,NULL,7,NULL,563,NULL,NULL,'wascheu',1,0,'2016-10-29 18:07:50','2016-11-13 22:00:01'),(1060,'Advanced 3d printing','We will be covering the more advanced aspects of 3d printing not covered in the basic class - slicing options, troubleshooting, finishing, etc.','We will be covering the more advanced aspects of 3d printing not covered in the basic class. You can see each of these techniques used in the parts of my Halloween costume in the images attached. I was able to take screenshots from the show and print the objects.\r\n\r\nmodelling - modelling objects made from basic polygons, modelling objects from photographs, etc.\r\nslicing options - how to optimize slicing for different models\r\ntroubleshooting - why prints have failed and how to get them to print\r\nfinishing - multiple part builds, acetone bath, painting, etc.','','2016-11-29 01:00:00','2016-11-29 03:00:00','2016-11-29 00:45:00','2016-11-29 03:15:00',0.00,NULL,0,0,1,0,0,'2016-11-29 01:00:00',0,1,0,'approved',8,329,NULL,NULL,NULL,NULL,NULL,NULL,'thetarrasque',0,0,'2016-10-29 21:02:44','2016-11-11 04:08:30'),(1061,'Wood Lathe Basics','How to use Woodshop Lathes','Intro to woodshop lathes, basic tools, and safe turning practices for both spindle and faceplate mounted work (think candlesticks and bowls).  While you won\'t leave with anything but wood shavings, you should have the confidence and knowledge to begin turning and experimenting on your own.  \r\n\r\nNo experience necessary!  Woodshop Basics class preferred but not required.  Should have some confidence working with power tools.\r\n\r\nCLASS SIZE LIMITED TO INSURE PARTICIPANTS GET ADEQUATE PRACTICE.\r\n\r\n','Although we will cover safety, avoid loose clothing, jewelry, etc.  Unless you like sawdust between your toes,  closed toe shoes recommended.','2016-11-12 16:00:00','2016-11-12 18:00:00','2016-11-12 15:30:00','2016-11-12 18:30:00',5.00,NULL,0,6,0,0,0,'2016-11-10 16:00:00',0,1,0,'completed',13,570,9,NULL,NULL,NULL,NULL,NULL,'jlcourtman',1,0,'2016-10-29 22:53:29','2016-11-12 18:00:02'),(1062,'Wood Lathe Basics','How to use Woodshop Lathes','Intro to woodshop lathes, basic tools, and safe turning practices for both spindle and faceplate mounted work (think candlesticks and bowls).  While you won\'t leave with anything but wood shavings, you should have the confidence and knowledge to begin turning and experimenting on your own.  \r\n\r\nNo experience necessary!  Woodshop Basics class preferred but not required.  Should have some confidence working with power tools.\r\n\r\nCLASS SIZE LIMITED TO INSURE PARTICIPANTS GET ADEQUATE PRACTICE.\r\n\r\n','Although we will cover safety, avoid loose clothing, jewelry, etc.  Unless you like sawdust between your toes,  closed toe shoes recommended.','2016-11-05 15:00:00','2016-11-05 17:00:00','2016-11-05 14:30:00','2016-11-05 17:30:00',5.00,NULL,0,6,0,0,0,'2016-11-03 15:00:00',0,1,0,'completed',13,570,9,NULL,NULL,NULL,NULL,NULL,'jlcourtman',1,0,'2016-10-29 22:55:51','2016-11-05 17:00:01'),(1063,'Leatherworking Basics','Orientation required for access to the leatherworking tools & supplies at DMS','So, who needs this class?  If you are not a pretty experienced leather worker, you probably do even if you have taken a project class or two at the space.  YouTube can\'t teach you our expectations of care, lol.  This overview class will meet the TRAINING REQUIRED to use the leatherworking tools and supplies in the Creative Arts Studio at DMS and our rules on the use of consumables.\r\n\r\nWe will cover topics including:  \r\nOverview of leatherworking in general\r\nCare of the tools available at DMS and their safe use\r\nExpectations regarding the responsible use of consumables\r\nBuying leather - what to buy, where to buy and purchasing option