ool\" class covering relays, steppers, and reels.','VECTOR will be hosting a hands-on \"pinball school\" class covering relays, steppers, and reels. This will be an introductory class for learning how to work on electro-mechanical (EM) pinball machines. Tools and materials will be provided.','','2016-11-05 22:00:00','2016-11-06 00:30:00','2016-11-05 22:00:00','2016-11-06 00:30:00',0.00,NULL,0,0,0,0,0,'2016-11-05 22:00:00',0,1,0,'completed',8,36,NULL,NULL,NULL,NULL,NULL,NULL,'nickdangerous',1,0,'2016-10-31 21:03:27','2016-11-06 00:30:01'),(1088,'Vector Committee Meeting','Meeting to discuss Vector Committee business','Meeting to discuss Vector committee business','','2016-11-06 22:00:00','2016-11-06 23:00:00','2016-11-06 22:00:00','2016-11-06 23:00:00',0.00,NULL,0,0,1,0,0,'2016-11-06 22:00:00',0,1,0,'completed',8,421,NULL,NULL,NULL,NULL,NULL,NULL,'schasb',1,0,'2016-11-01 04:25:13','2016-11-06 23:00:01'),(1089,'Test Class Delete Me','Test Class for deletion','This is a test class for deletion.','','2016-11-24 06:00:00','2016-11-24 07:00:00','2016-11-24 06:00:00','2016-11-24 07:00:00',0.00,NULL,12,0,0,0,0,'2016-11-24 06:00:00',0,1,0,'rejected',5,178,NULL,NULL,NULL,NULL,'alexrhodes','Test class. -Alex','jphelps',0,0,'2016-11-01 12:15:11','2016-11-01 12:56:53'),(1090,'Poinsettia Cupcakes','Come learn how to make beautiful & delicious cupcakes for the holidays!','Learn how to make cupcakes that look like Poinsettias; guaranteed to be a hit for the holidays!\r\n\r\nWe will start with white frosting and learn how to create the colors needed, fill piping bags,  and how to do basic piping. From there you will learn how to turn those basics in to beautiful flowers!\r\n\r\nI will bring cupcakes and buttercream frosting. If you have any dietary concerns, such as a wheat allergy or being vegan, please shoot me an email at megandrew1918@gmail.com and I will do my best to accommodate!\r\n\r\nSee the attached picture for an idea of what your cupcakes will look like!\r\n\r\nThe $5 is payable in cash at class and is just to help cover the cost of ingredients.\r\n','Frosting can be messy so bring clothes that can get dirty or an apron!','2016-11-30 01:00:00','2016-11-30 03:00:00','2016-11-30 00:30:00','2016-11-30 03:30:00',0.00,NULL,10,0,0,13,0,'2016-11-29 01:00:00',0,1,0,'rejected',11,391,NULL,NULL,NULL,NULL,'wandrson','You requested a personal honorarium (as opposed donation to commitee) at the same time your requesting expense.  If you have the expenses handled through committee you are eiligble for honoraiurm, but not if you handle yourself.  ','mandrew',0,0,'2016-11-01 18:19:58','2016-11-01 21:22:30'),(1091,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-17 01:00:00','2016-11-17 03:00:00','2016-11-17 01:00:00','2016-11-17 03:00:00',20.00,NULL,0,8,0,16,1,'2016-11-17 01:00:00',0,1,0,'rejected',20,13,NULL,NULL,NULL,924,'wandrson','You have a class fee, which precludes the teacher from receiving a honorarium in our current rules.  You can resubmit without the honorarium request or donate the honorarium to committee','hans',0,0,'2016-11-01 20:36:29','2016-11-01 21:24:00'),(1092,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-16 23:45:00','2016-11-17 01:00:00',10.00,NULL,0,6,0,16,1,'2016-11-17 00:00:00',0,1,0,'rejected',20,13,NULL,NULL,NULL,923,'wandrson','You have a class fee, which precludes the teacher from receiving a honorarium in our current rules.  You can resubmit without the honorarium request or donate the honorarium to committee','hans',0,0,'2016-11-01 20:37:11','2016-11-01 21:24:09'),(1093,'Dallas Screenwriting Crew - Week 1 of 8 - Writing for the Screen','The first of eight workshops, an 8-week course on writing for the screen','One year ago, Dallas Screenwriting Crew was established to accomplish three goals:\r\n\r\n\r\n1. Give storytellers the opportunity for their stories to be told through film.\r\n\r\n2. Improve the storytelling of the films produced within Dallas Film Crew.\r\n\r\n3. Recruit talented storytellers, to learn how to write screenplays.\r\n\r\n\r\nToday, we kick off the fourth official round of pitch session prep!\r\n\r\n\r\nOn January 29th, our screenwriters--having written screenplays 10-15 pages in length--will stand before a group of their peers, pitch their story to Dallas Film Crew, and after they have cast their votes, three winners will be decided.\r\n\r\n\r\nOur goal is to prepare you for it.\r\n\r\n\r\nOver the next eight meetings, Dallas Screenwriting Crew will help you to develop your story from the ground up. From Screenwriting 101, to Pitch execution and preparation. Are you ready for your story to be made into film?\r\n\r\n\r\nFor this meeting, we will discuss writing for film: what to expect, how to get started, and an overview of Standard Hollywood Format for screenplays.\r\n\r\n\r\nAs always, if you have a work in progress, please bring up to 10 pages for table read and critique, in Standard Hollywood Format, for table reads and critique. ','','2016-11-12 19:00:00','2016-11-12 22:00:00','2016-11-12 18:30:00','2016-11-12 22:00:00',0.00,NULL,0,0,0,0,0,'2016-11-12 19:00:00',0,1,0,'completed',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-11-01 23:10:18','2016-11-12 22:00:01'),(1094,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','Please note that there is  $20 fee for the class that can be paid in advance or at the time of the class. The Makerspace calendar only allows payment at time of registration. Therefore, if you choose one of the \"free space\" registrations, you can pay at the time of the class. Thank you.','2016-11-17 01:00:00','2016-11-17 03:00:00','2016-11-17 01:00:00','2016-11-17 03:00:00',20.00,NULL,7,1,0,16,1,'2016-11-17 01:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,924,NULL,NULL,'hans',1,0,'2016-11-02 01:20:55','2016-11-17 03:00:01'),(1095,'Introduction to Traditional Woodcarving','An introduction to wood carving using traditional hand tools','The class in intended to introduce those new to woodcarving primarily using traditional mallet and gouge techniques. Instruction will tool safety, how to work with wood grain and tool handling techniques.\r\n\r\nThe class will be available for up to 6 students. Wood and tools will be provided for those who do not have their own.\r\n\r\nThe class is followed by an ongoing traditional woodcarving class which students are welcome to observe.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $10 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','Please note that there is $10 fee for the class that can be paid in advance or at the time of the class. The Makerspace calendar only allows payment at time of registration. Therefore, if you choose one of the \"free space\" registrations, you can pay at the time of the class. Thank you.','2016-11-17 00:00:00','2016-11-17 01:00:00','2016-11-16 23:45:00','2016-11-17 01:00:00',10.00,NULL,5,1,0,16,1,'2016-11-17 00:00:00',0,1,0,'completed',20,13,NULL,NULL,NULL,923,NULL,NULL,'hans',1,0,'2016-11-02 01:29:01','2016-11-17 01:00:01'),(1096,'Shapeoko 2 Basic','An introduction to the Shapeoko 2 in Creative Arts','This class will cover basic operation and safety for the Creative Arts Shapeoko 2. Upon completion attendee\'s will be certified to use the Shapeoko 2 on their own.','','2016-11-12 17:00:00','2016-11-12 18:00:00','2016-11-12 17:00:00','2016-11-12 18:00:00',0.00,NULL,8,0,1,0,0,'2016-11-12 17:00:00',0,1,0,'completed',5,178,NULL,NULL,NULL,NULL,NULL,NULL,'jphelps',1,0,'2016-11-02 03:41:27','2016-11-12 18:00:02'),(1097,'Shapeoko 2 Basic','An introduction to the Shapeoko 2 in Creative Arts','This class will cover basic operation and safety for the Creative Arts Shapeoko 2. Upon completion attendee\'s will be certified to use the Shapeoko 2 on their own.','','2016-11-14 17:00:00','2016-11-14 18:00:00','2016-11-14 17:00:00','2016-11-14 18:00:00',0.00,NULL,8,0,0,0,0,'2016-11-14 17:00:00',0,1,0,'cancelled',5,178,NULL,NULL,NULL,NULL,NULL,NULL,'jphelps',0,0,'2016-11-02 03:42:36','2016-11-02 03:43:19'),(1098,'Shapeoko 2 Basic','An introduction to the Shapeoko 2 in Creative Arts','This class will cover basic operation and safety for the Creative Arts Shapeoko 2. Upon completion attendee\'s will be certified to use the Shapeoko 2 on their own.','','2016-11-15 01:30:00','2016-11-15 02:30:00','2016-11-15 01:30:00','2016-11-15 02:30:00',0.00,NULL,8,0,1,0,0,'2016-11-15 01:30:00',0,1,0,'completed',5,178,NULL,NULL,NULL,NULL,NULL,NULL,'jphelps',1,0,'2016-11-02 03:44:43','2016-11-15 02:30:02'),(1099,'Poinsettia Cupcakes','Come learn how to make beautiful & delicious cupcakes for the holidays!','Learn how to make cupcakes that look like Poinsettias; guaranteed to be a hit for the holidays!\r\n\r\nWe will start with white frosting and learn how to create the colors needed, fill piping bags, and how to do basic piping. From there you will learn how to turn those basics in to beautiful flowers!\r\n\r\nI will bring cupcakes and buttercream frosting. If you have any dietary concerns, such as a wheat allergy or being vegan, please shoot me an email at megandrew1918@gmail.com and I will do my best to accommodate!\r\n\r\nSee the attached picture for an idea of what your cupcakes will look like!\r\n','Frosting can sometimes get messy so be sure to wear a shirt that can get dirty or bring an apron!','2016-11-30 01:00:00','2016-11-30 03:00:00','2016-11-30 00:30:00','2016-11-30 03:30:00',5.00,NULL,0,10,0,13,0,'2016-11-29 01:00:00',0,1,0,'approved',11,391,NULL,NULL,NULL,NULL,NULL,NULL,'mandrew',0,0,'2016-11-02 13:15:43','2016-11-07 20:37:51'),(1100,'DMS Wood Shop Basics ','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-11-15 17:00:00','2016-11-15 20:00:00','2016-11-15 17:00:00','2016-11-15 20:00:00',5.00,NULL,0,6,1,18,0,'2016-11-15 17:00:00',0,1,0,'completed',12,191,4,NULL,NULL,NULL,NULL,NULL,'mblatz',1,0,'2016-11-02 14:22:39','2016-11-15 20:00:01'),(1101,'test','test','test','','2016-11-05 03:01:00','2016-11-05 04:01:00','2016-11-05 03:01:00','2016-11-05 04:01:00',0.00,NULL,0,0,0,0,0,'2016-11-05 03:01:00',0,1,0,'rejected',6,16,NULL,NULL,NULL,NULL,'stansimmons','test','stansimmons',0,0,'2016-11-02 19:02:49','2016-11-02 19:03:04'),(1102,'Actor Taping','Recording an actor for video audition','Taping an actor for a film audition.','','2016-11-04 15:00:00','2016-11-04 16:30:00','2016-11-04 15:00:00','2016-11-04 16:30:00',0.00,NULL,0,0,0,0,0,'2016-11-04 15:00:00',0,1,0,'completed',6,351,NULL,NULL,NULL,NULL,NULL,NULL,'erichanson',1,0,'2016-11-02 20:13:31','2016-11-04 16:30:01'),(1103,'Jewelry: Cuff Link Creation','Make a pair of custom, sterling silver cuff links in this beginners level silversmithing workshop.  ','\'Tis the season for gifts, and or to accessorize your wardrobe with a pair of cuff links for an upcoming holiday party! Making a pair of cuff links is a fun and easy project for any beginner interested in silversmithing.\r\n\r\nAll materials will be provided for you to fabricate a custom pair of Sterling Silver cuff links in this 4-5 hour workshop. You will be guided through the process start to finish and leave at the end of the workshop with a completed pair of quality made cuff links. During the process of fabrication, you will be coached to cut, shape, stamp, texture, soldier, and polish 925 sterling silver using basic jewelry tools and fabrication techniques. \r\n\r\n**PURCHASE YOUR TICKET THROUGH THE LINK BELOW**\r\n https://laprong.acuityscheduling.com/schedule.php?appointmentType=1592535\r\n\r\n','Closed-toe shoes and pants are recommended. Aprons, dust masks, and eye protection are provided as necessary.','2016-11-12 18:00:00','2016-11-12 23:00:00','2016-11-12 17:45:00','2016-11-12 23:15:00',0.00,NULL,1,0,0,16,0,'2016-11-12 18:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',1,0,'2016-11-03 02:04:06','2016-11-12 23:00:01'),(1104,'Casting PennySaved Crew','Casting ','Meeting with actors so we can put together a short film','','2016-11-05 12:00:00','2016-11-05 16:00:00','2016-11-05 12:00:00','2016-11-05 16:00:00',0.00,NULL,0,0,0,0,0,'2016-11-05 12:00:00',0,1,0,'completed',11,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-11-03 03:25:06','2016-11-05 16:00:01'),(1105,'Introduction to the Colchester Bantam 2000 Metal Lathe ','Learn about the operational basics of the machine shop\'s Colchester Batam 2000 lathe, capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe includes:\r\n\r\nUser safety warnings\r\nDescription of the various parts of this lathe\r\nThe MIT Machine Shop Videos \r\nLoading the work piece\r\nSelecting and loading the cutting tools: What is \"turning\",\" facing\" and \"boring\"\r\nSelecting and setting the rotational direction and speed of the spindle\r\nUses of the tail stock\r\nChanging the head stock chucks\r\nLubricating the work piece and cutting tool\r\nHow to set the auto feeds for the saddle and cross slide\r\nHow to set the angle of the compound\r\nThe use of the micrometers\r\n\r\nThe class will include a bit of class room time followed by mostly time at lathe side ','Safety glasses must be worn in the machine shop whenever machinery is in use.  Generic protective glasses are available in the DMS.  NOTE:  The machine shop area can be a bit grimy.','2016-11-13 16:00:00','2016-11-13 18:00:00','2016-11-13 15:45:00','2016-11-13 18:00:00',0.00,NULL,0,0,0,0,0,'2016-11-13 16:00:00',0,1,0,'completed',11,235,NULL,NULL,NULL,NULL,NULL,NULL,'bobkarnaugh',1,0,'2016-11-03 14:47:36','2016-11-13 18:00:01'),(1106,'Introduction to the Colchester Bantam 2000 Metal Lathe for day timers','Learn about the operational basics of the machine shop\'s Colchester Batam 2000 lathe, capabilities and limitations and where to find a variety of attachments.','Introduction to the Colchester Bantam 2000 metal lathe includes:\r\n\r\nUser safety warnings\r\nDescription of the various parts of this lathe\r\nThe MIT Machine Shop Videos \r\nLoading the work piece\r\nSelecting and loading the cutting tools: What is \"turning\",\" facing\" and \"boring\"\r\nSelecting and setting the rotational direction and speed of the spindle\r\nUses of the tail stock\r\nChanging the head stock chucks\r\nLubricating the work piece and cutting tool\