3 19:20:55','2016-11-03 21:38:58'),(1111,'Woodshop Basics','Requirements class for using power tools in Woodshop','This is the class required to use the power tools in the woodshop. We cover the appropriate and safe use of most of the tools in the shop.\r\n\r\nWe do permit stand-bys, but be aware this does not guarantee you will be admitted to class.','Please bring eye protection, or plan to borrow it from Space.  Hair should be pinned up.  Short sleeve shirts, close-toed shoes, no dangling jewelry.','2016-11-10 01:00:00','2016-11-10 03:30:00','2016-11-10 01:00:00','2016-11-10 03:30:00',5.00,NULL,0,5,1,18,0,'2016-11-08 01:00:00',0,1,0,'cancelled',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',0,0,'2016-11-03 19:45:21','2016-11-03 19:49:59'),(1112,'Woodshop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices. Major wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. Basic steps of squaring up a rough piece of lumber will be covered via a hands-on approach by walking and talking through the standard process.','You must be over 18+ to attend this class. Appropriate eye protection is required. DMS does make necessary protective gear available, but feel free to bring your own. Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with cuffs rolled above elbow), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories, or gloves.','2016-11-10 01:00:00','2016-11-10 03:30:00','2016-11-10 01:00:00','2016-11-10 03:30:00',5.00,NULL,0,5,1,18,0,'2016-11-07 01:00:00',0,1,0,'completed',12,46,4,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-11-03 19:56:03','2016-11-10 03:30:01'),(1113,'Introduction to Bridgeport, Part 1','Introduction to Bridgeport, Part 1 Classroom','Introduction to use of Bridgeport, classroom portion.  Second portion after a short 15 break will be at Bridgeport . \r\n Please review https://dallasmakerspace.org/wiki/Bridgeport101 \r\nbefore attending 15 minute break between classroom and at Bridgeport','1. Safety Glasses (available in shop)\r\n2. Closed Toed Shoes\r\n3. No shorts \r\n4. If you have long hair you need some way to tie back or wear a hat.\r\n','2016-11-15 01:00:00','2016-11-15 02:00:00','2016-11-15 00:45:00','2016-11-15 02:15:00',0.00,NULL,8,0,0,0,0,'2016-11-15 01:00:00',0,1,0,'completed',11,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-11-03 23:57:48','2016-11-15 02:00:02'),(1114,'DIY Genetic Engineering/Synthetic Biology ','First discussion on Biohacking for Dallas Group, will discuss plans for the coming months, starting IGEM team, possibilities, Plant Tissue Culture, CRISPR, Agrobacterium biohacking, PCR, Gel Electrophoresis, Gene Drives and any other questions','Plan to build up resources for BioHacking in Dallas area, will work on plant techniques, beginning with Plant Tissue Culture and acquiring AgroBacterium for the space to create transgenic plants (probably tobacco); ecoli CRISPR kit has been ordered and will work on as soon as arrives. \r\nCan talk about latest developments in the industry, introduction to Synthetic Biology and how many modern biologics are produced, discuss Bolt Threads spider silk, IGEM, BioBricks, etc. \r\nMy initial plan is to learn Plant Tissue Culture, then work with AgroBacterium and a reporter gene to prove efficacy of the technique, from there we can discuss possibilities for transgenic plants. \r\nhere is a video of Brooklyn GenSpace I attended last month in NYC\r\nhttps://www.youtube.com/watch?v=I90Fo0otToM','Introductory Meeting','2016-12-10 21:00:00','2016-12-10 22:00:00','2016-12-10 21:00:00','2016-12-10 22:00:00',0.00,NULL,0,0,0,0,0,'2016-12-10 21:00:00',0,1,0,'approved',9,301,NULL,NULL,NULL,NULL,NULL,NULL,'melnick',0,0,'2016-11-04 03:15:07','2016-11-04 03:33:14'),(1115,'Woodshop Instructors Meeting','Meeting of people teaching classes, or wanting to teach classes, in the Woodshop','A meeting for people currently teaching classes, or who are interested in teaching classes in the DMS woodshop.  We will discuss scheduling, the new calendar system,  addition of new classes, etc.','','2016-11-16 01:00:00','2016-11-16 02:30:00','2016-11-16 01:00:00','2016-11-16 02:30:00',0.00,NULL,0,0,1,0,0,'2016-11-16 01:00:00',0,1,0,'completed',9,46,NULL,NULL,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-11-04 15:55:43','2016-11-16 02:30:01'),(1116,'Make a Leather Belt Buckle project class','build your leatherworking skill by hand crafting an oval belt buckle from leather and lace.  Add a design and lace it up.  Adds the introduction to using a shop press for clicking and an arbor press for stamping.','This project class will help build leatherworking skill by handcrafting an oval belt buckle from leather and lace.  Adds to the skills taught in the basic leatherworking class by cutting, stamping, lacing, staining and finishing leather.  Adds the introduction of using a shop press for clicking and an arbor press for stamping. Attendees will walk away with a completed project and learn to build the buckle internals thru the use of a buckle back and template.\r\n\r\nvarious embossing stamp designs will be made available to decorate the buckle. Further instuction will cover hand carving  or laser a design on the leather.\r\n\r\nclass format and consumables are attached in the files.  All tools and materials will be provided. class fee pays for materials.','Due to fumes- only a provided water based contact cement will be used in constructing your project.','2016-12-03 19:00:00','2016-12-03 22:00:00','2016-12-03 18:45:00','2016-12-03 22:15:00',10.00,NULL,0,6,0,16,0,'2016-12-01 19:00:00',0,1,0,'approved',8,57,NULL,NULL,NULL,NULL,NULL,NULL,'nicksilva',0,0,'2016-11-04 16:13:08','2016-11-07 16:15:02'),(1117,'Introduction to Bridgeport, Part 2 at Bridgeport','Introduction to the Bridgeport at Machine','This is the second part of this class at the Machine requires:\r\n1. Safety Glasses (available in shop)\r\n2. Closed Toed Shoes\r\n3. No shorts \r\n4. If you have long hair you need some way to tie back or wear a hat.\r\n','This is the second part of this class at the Machine requires:\r\n1. Safety Glasses (available in shop)\r\n2. Closed Toed Shoes\r\n3. No shorts \r\n4. If you have long hair you need some way to tie back or wear a hat.\r\n','2016-11-15 02:15:00','2016-11-15 03:45:00','2016-11-15 01:45:00','2016-11-15 04:15:00',0.00,NULL,8,0,1,0,0,'2016-11-15 02:15:00',0,1,0,'completed',17,19,NULL,NULL,NULL,NULL,NULL,NULL,'photomancer',1,0,'2016-11-04 18:00:43','2016-11-15 03:45:01'),(1118,'Pegasus Rising Robotics Meetup','Battlebot design and construction','Battlebot Design and construction.\r\nDMS members welcome to attend.','','2016-11-10 00:00:00','2016-11-10 04:00:00','2016-11-10 00:00:00','2016-11-10 04:00:00',0.00,NULL,0,0,0,0,0,'2016-11-10 00:00:00',0,1,0,'completed',4,219,NULL,NULL,NULL,NULL,NULL,NULL,'philluetchford',1,0,'2016-11-04 18:23:07','2016-11-10 04:00:01'),(1119,'CNC Router Class (Wood Only)','Learn the Multicam CNC Router in the Woodshop. (wood only)','Learn the Multicam CNC Router in the Woodshop. This class will go over the basics in the Vcarve software and how to operate the machine. You must be a DMS member to take the class. Once the class is completed you will need to follow up at a later date with a test project. Once the test project is completed you will have full access to the machine. ','','2016-11-22 00:30:00','2016-11-22 04:00:00','2016-11-22 00:15:00','2016-11-22 04:00:00',50.00,NULL,0,13,1,16,0,'2016-11-22 00:30:00',0,1,0,'approved',8,4,3,NULL,NULL,355,NULL,NULL,'alexrhodes',1,0,'2016-11-05 15:02:24','2016-11-21 00:30:10'),(1120,'CNC Plasma Cutter Training','Training for the Metal Shop CNC Plasma Cutter','This is the required training to use the CNC Plasma Cutter. The first half of this class (~45 minutes) will be a classroom introduction to the procedures, rules, and software for this machine. The second half of this class will be hands-on experience with the software and actually running a cut. Every student must complete a cut to qualify to use the CNC plasma cutter.\r\n\r\nThis class is limited to 6 seats so that each student can complete hands-on training with the software.\r\n\r\nThe class fee goes toward consumables on the plasma cutter. The instructor is volunteering his time.\r\n','Please wear appropriate clothing: long sleeve natural-fiber shirt (NO synthetics!), jeans or slacks (again, NO synthetics), and work shoes.  Do not wear any open toe shoes or shorts, as you will be turned away. \r\n\r\nIf you own safety glasses, bring them. Otherwise, you\'ll have to use the scratched-up ones which are provided in the workshop.\r\n\r\nIf you have a pacemaker, the plasma cutter may interfere with it. Please talk to your doctor before signing up or attending this class.','2016-12-02 01:00:00','2016-12-02 03:30:00','2016-12-02 01:00:00','2016-12-02 03:30:00',5.00,NULL,0,6,1,16,0,'2016-12-02 01:00:00',0,1,0,'cancelled',8,86,10,NULL,NULL,1035,NULL,NULL,'zmetzing',0,0,'2016-11-06 01:54:16','2016-11-07 16:17:23'),(1121,'dfgdfg','dfgdfg','dfgdfg','','2016-11-16 18:00:00','2016-11-17 18:01:00','2016-11-16 18:00:00','2016-11-17 18:01:00',0.00,NULL,0,0,0,0,0,'2016-11-16 18:00:00',0,1,0,'cancelled',1,39,NULL,NULL,NULL,NULL,NULL,NULL,'elorentz',0,0,'2016-11-06 08:54:27','2016-11-06 08:55:13'),(1122,'TESTING','sdfdsf','sdfdfsdfs','','2016-11-30 18:00:00','2016-11-30 19:00:00','2016-11-30 18:00:00','2016-11-30 19:00:00',0.00,NULL,0,0,0,0,0,'2016-11-30 18:00:00',0,1,1,'cancelled',1,589,NULL,NULL,NULL,NULL,NULL,NULL,'elorentz',0,0,'2016-11-06 09:21:30','2016-11-06 09:21:47'),(1123,'Test Event (Lampy)','Black Powder Rockets','Test - Event\r\nLearn how to make 1lb Black Powder Rockets','Need to bring your own personal protective equipment (PPE). Safety glasses, hard hat and close toed shoes. Recommend cotton clothing, synthetics will melt to your skin.','2016-11-25 18:00:00','2016-11-25 21:00:00','2016-11-25 17:00:00','2016-11-25 22:00:00',25.00,NULL,0,20,1,16,1,'2016-11-24 18:00:00',0,1,0,'rejected',23,41,NULL,NULL,NULL,NULL,'stansimmons','Test failed. -Stan','lampy',0,0,'2016-11-06 14:27:27','2016-11-07 22:00:14'),(1124,'Woodshop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices. Major wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. Basic steps of squaring up a rough piece of lumber will be covered via a hands-on approach by walking and talking through the standard process.','You must be over 18+ to attend this class. Appropriate eye protection is required. DMS does make necessary protective gear available, but feel free to bring your own. Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with cuffs rolled above elbow), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories, or gloves.','2016-12-01 01:00:00','2016-12-01 03:00:00','2016-12-01 01:00:00','2016-12-01 03:00:00',5.00,NULL,0,5,1,18,0,'2016-12-01 01:00:00',0,1,0,'approved',12,4,4,NULL,NULL,627,NULL,NULL,'alexrhodes',0,0,'2016-11-06 15:53:55','2016-11-09 15:55:01'),(1125,'Cutting Board Class','Learn how to build your own cutting board!','In this class you will learn everything you need to know to design and make your own cutting board. We will discuss the differences between types of woods, grain patterns, glues, and finishing options. \r\n\r\nWe ill be using the power tools in the woodshop, so completion of the woodshop basics course is required.\r\n\r\nMaterials are included in the price of the class. Each person will leave with a cutting board of your own!\r\n\r\n','','2016-11-22 00:30:00','2016-11-22 03:00:00','2016-11-22 00:30:00','2016-11-22 03:30:00',30.00,NULL,5,5,1,18,0,'2016-11-21 00:30:00',0,1,0,'approved',12,499,NULL,4,NULL,NULL,NULL,NULL,'azalaket',1,0,'2016-11-06 16:22:24','2016-11-20 00:30:05'),(1126,'Hospice 101','A detailed conversation about hospice knowledge that we all need at any age. ','A detailed conversation about hospice knowledge that we all need at any age. \r\n\r\nWe will talk about DNR\'s, disease progression, medical power of attorney, Medicare regulations for hospice, and more.\r\n\r\nInformation to help support those who care for persons who\'s health is declining or are turning toward their final stage of life. ','','2016-12-10 23:00:00','2016-12-11 01:00:00','2016-12-10 23:00:00','2016-12-11 01:00:00',0.00,NULL,0,0,0,0,0,'2016-12-10 23:00:00',0,1,0,'approved',9,30,NULL,NULL,NULL,NULL,NULL,NULL,'themitch22',0,0,'2016-11-07 07:00:31','2016-11-10 07:05:01'),(1127,'Pre-Hackathon Event sponsored by the AT&T Developer Program!','The AT&T Developer Program will be sponsoring Tour Night on Nov 17th for a Pre-Hackathon Event!','Pre-Hackathon Event sponsored by the AT&T Developer Program!\r\nThursday, November 17th at the \'Space beginning at 7:00 PM\r\n\r\nThe AT&T Developer Program has invited the full Dallas Makerspace community, the Dallas Personal Robotics Group, and anyone who has a passion for IoT, hardware and technology.\r\n\r\nRefreshments will be provided and a representative will be on site!\r\n\r\n#ATTHACK #hackathon #IoT #mechatronics #robotics #WomenInTech #LEARN #HACK #MAKE','','2016-11-18 00:59:00','2016-11-18 03:01:00','2016-11-18 00:59:00','2016-11-18 03:01:00',0.00,NULL,0,0,0,0,0,'2016-11-18 00:59:00',0,1,1,'completed',3,590,NULL,NULL,NULL,NULL,NULL,NULL,'selk68',1,0,'2016-11-07 11:35:13','2016-11-18 03:05:01'),(1128,'Test event','This is only a test.','This is a test.  This in only a test.','','2016-12-10 18:00:00','2016-12-10 19:00:00','2016-12-10 18:00:00','2016-12-10 19:00:00',1000000.00,NULL,0,0,0,0,0,'2016-12-10 18:00:00',0,1,0,'cancelled',2,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',0,0,'2016-11-07 11:56:25','2016-11-07 12:00:14'),(1129,'Cinema Cafe presents: Akira Kurosawa Marathon','Watch several films from the classic Japanese filmmaker Akira Kurosawa','Cinema Cafe is looking forward to sharing several of the classic films of Japanese filmmaker Akira Kurosawa. Discover some of the great films of the past, or watch them again with us.','','2016-12-03 22:00:00','2016-12-04 06:00:00','2016-12-03 22:00:00','2016-12-04 06:00:00',0.00,NULL,0,0,0,0,0,'2016-12-03 22:00:00',0,1,0,'approved',9,158,NULL,NULL,NULL,NULL,NULL,NULL,'jhaney',0,0,'2016-11-07 13:06:21','2016-11-09 13:10:01'),(1130,'This is a test','This is a test.','This is a test.  This is only a test.','','2016-12-10 18:00:00','2016-12-10 19:00:00','2016-12-10 18:00:00','2016-12-10 19:00:00',0.00,NULL,0,0,0,0,0,'2016-12-10 18:00:00',0,1,0,'rejected',2,23,NULL,NULL,NULL,NULL,'bill','This was only a test.','bill',0,0,'2016-11-07 13:45:26','2016-11-07 13:46:14'),(1131,'CNC Plasma Cutter Training','Training for the Metal Shop CNC Plasma Cutter','This is the required training to use the CNC Plasma Cutter. The first half of this class (~45 minutes) will be a classroom introduction to the procedures, rules, and software for this machine. The second half of this class will be hands-on experience with the software and actually running a cut. Every student must complete a cut to qualify to use the CNC plasma cutter.\r\n\r\nThis class is limited to 6 seats so that each student can complete hands-on training with the software.\r\n\r\nNo-show or cancellation within 1 day forfeits the class fee and you will need to sign up and pay again.\r\n\r\nThe class fee goes toward consumables on the plasma cutter. The instructor is volunteering his time.\r\n','Please wear appropriate clothing: long sleeve natural-fiber shirt (NO synthetics!), jeans or slacks (again, NO synthetics), and work shoes.  Do not wear any open toe shoes or shorts, as you will be turned away. \r\n\r\nIf you own safety glasses, bring them. Otherwise, you\'ll have to use the scratched-up ones which are provided in the workshop.\r\n\r\nIf you have a pacemaker, the plasma cutter may interfere with it. Please talk to your doctor before signing up or attending this class.','2016-12-09 01:00:00','2016-12-09 03:30:00','2016-12-09 01:00:00','2016-12-09 03:30:00',5.00,NULL,0,6,1,16,0,'2016-12-08 01:00:00',0,1,0,'approved',8,86,10,NULL,NULL,1035,NULL,NULL,'zmetzing',0,0,'2016-11-07 16:20:21','2016-11-10 16:25:01'),(1132,'8bitty Classic fix-a-thon','8-bit computer repair workshop','A Classic Fix-A-Thon is a pc maintenance clinic where enthusiasts  can bring their retro and vintage PCs to get a quick repair and maintenance check, learn to preform repairs, and upgrades depending on the supplies available. \r\n\r\nFor STEM students wish to attend this event can occur during the school day as an elective activity, or outside of school hours as a separate event.\r\n\r\nAttendees will  bring their own classic pc to the event and we assist them with doing maintenance,  work with them to make needed adjustments and basic repairs. The attendee is expected to assist the mentor in a hands on fashion instead of drop off their machine and return later when it is done. \r\n\r\nAlthough the attendee would not be expected doing most of the technical work, they will learn about what parts of the vintage computer are not working, how that impacts the usability and, how to repair it,  so one can avoid having the issue occur in the future.\r\n\r\nMore technical knowledge attendees are encouraged to peer off with the less skilled attendees as a mentor.','','2016-12-10 00:30:00','2016-12-10 01:30:00','2016-12-10 00:30:00','2016-12-10 01:30:00',0.00,NULL,0,0,0,16,0,'2016-12-10 00:30:00',0,1,0,'approved',3,31,NULL,NULL,NULL,NULL,NULL,NULL,'denzuko',0,0,'2016-11-07 23:49:01','2016-11-09 23:50:02'),(1133,'FAP Team 1','Run through','Table read and run through of blocking for short film project.','','2016-11-11 16:00:00','2016-11-11 19:00:00','2016-11-11 16:00:00','2016-11-11 19:00:00',0.00,NULL,0,0,0,0,1,'2016-11-11 16:00:00',0,1,0,'completed',11,594,NULL,NULL,NULL,NULL,NULL,NULL,'gmt5248',1,0,'2016-11-08 00:17:11','2016-11-11 19:00:02'),(1134,'Hands-On With Machine Learning APIs','Join Civic Hacking as we explore Google\'s machine-learning services. Stay after the presentation to solicit help on the examples or your own projects.','Need a kickstart to your next (or first) machine learning project?  Lots of tasks are now made simple by APIs offered by various vendors including Microsoft, Google, HP, and Amazon.\r\n\r\nThis class will walk you through services offered by Google such as TensorFlow, the Mobile Vision API, and the Cloud Natural Language API.  We will interact with these services live through the browser, see compelling demos, and you will learn how to make requests to them through your own application.  Come prepared with an idea or something that\'s been stumping you, because after the presentation, we will have workshop time where we will be free to collaborate and ask questions of each other.\r\n\r\nBefore the class, it is recommended that you have established an account on Google Developer Console (https://console.developers.google.com) and have some sort of RESTful client such as Postman to facilitate sending more advanced HTTP requests than you can do easily in the browser.','','2016-11-18 01:00:00','2016-11-18 03:30:00','2016-11-18 01:00:00','2016-11-18 03:30:00',0.00,NULL,0,0,0,0,0,'2016-11-18 01:00:00',0,1,0,'completed',8,230,NULL,NULL,NULL,NULL,NULL,NULL,'mrcity',1,0,'2016-11-08 00:22:07','2016-11-18 03:30:01'),(1135,'VCC Committee Meeting','Agenda Item Discussion and Classes submittion','Vintage Computer Committee meeting','','2016-11-12 01:00:00','2016-11-12 02:00:00','2016-11-12 01:00:00','2016-11-12 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-12 01:00:00',0,1,0,'completed',3,31,NULL,NULL,NULL,957,NULL,NULL,'denzuko',1,0,'2016-11-08 01:05:31','2016-11-12 02:00:02'),(1136,'Test class - testing new template','Using the Babylock Embroidery machine','Learn how to set-up and use the Babylock Embroidery machine.\r\n\r\nThis class is a hands-on class.  \r\n\r\nYou will learn safety, how to use the equipment, how to hoop fabric, transfer design files, thread the machine, and how to stitch the design.   After this class you should be comfortable using the machine on your own\r\n\r\nDuring the hands-on portion, you will learn by participating in a group project.  We will embroider the DMS logo on a Creative Arts apron. Each attendee will \"hoop\" the fabric, thread the machine, and stitch part of the design.   The completed project will remain at The Space. \r\n\r\nAll tools and supplies will be provided.  If you bring a small sharp scissors for trimming thread (optional) it will be useful.\r\n','We will be moving around some in the Creative Arts Studio so plan to be on your feet for much of this time.  Bring glasses suitable for a distance of 3-4 feet if needed.   \r\n\r\nPlease be prompt. The class starts with setting up the machine, and I will show where everything is stored. ','2016-12-01 07:00:00','2016-12-01 09:00:00','2016-12-01 07:00:00','2016-12-01 09:15:00',0.00,NULL,4,0,1,13,0,'2016-11-29 07:00:00',0,1,0,'cancelled',5,10,NULL,NULL,NULL,195,NULL,NULL,'chrismini',0,0,'2016-11-08 18:28:12','2016-11-08 18:28:37'),(1137,'Wood Lathe Basics','How to use Woodshop Lathes','Intro to woodshop lathes, basic tools, and safe turning practices for both spindle and faceplate mounted work (think candlesticks and bowls). While you won\'t leave with anything but wood shavings, you should have the confidence and knowledge to begin turning and experimenting on your own. \r\n\r\nNo experience necessary! Woodshop Basics class preferred but not required. Should have some confidence working with power tools.\r\n\r\nCLASS SIZE LIMITED TO INSURE PARTICIPANTS GET ADEQUATE PRACTICE.\r\n\r\nAge 16- 17: parent must be co-participant\r\n','Although we will cover safety, avoid loose clothing, jewelry, etc. Unless you like sawdust between your toes, closed toe shoes recommended.','2016-11-19 01:00:00','2016-11-19 04:00:00','2016-11-19 00:30:00','2016-11-19 04:30:00',5.00,NULL,0,6,1,16,0,'2016-11-17 01:00:00',0,1,0,'completed',13,570,8,NULL,NULL,NULL,NULL,NULL,'jlcourtman',1,0,'2016-11-08 20:08:34','2016-11-19 04:00:02'),(1138,'CNC PlasmaCAM Training','Training for the Metalshop CNC Plasmacutter','This is the long awaited training for the CNC Plasma cutter. We will begin in the classroom to go over the basics then move to the metalshop to get hands on training. You will be instructed on how to use the CNC Plasma cutter in the basic form. You will be cutting out some items for a demo on the plasma cutter.','Please wear appropriate clothing. Do not wear any open toe shoes or shorts, you will be turned away. Please bring your safety glasses. If you have a Pacemaker, the plasma cutter may interfere, Please talk to your DR before hand.','2016-11-23 01:00:00','2016-11-23 03:30:00','2016-11-23 00:45:00','2016-11-23 03:30:00',5.00,NULL,0,8,1,18,0,'2016-11-22 01:00:00',0,1,0,'approved',11,147,NULL,NULL,NULL,949,NULL,NULL,'tbjk',1,0,'2016-11-08 23:00:35','2016-11-21 01:00:13'),(1139,'Python for Beginners (continued)','Continue learning how to Python.','Python is a general purpose programming language.\r\n\r\nClass stuff is here: https://github.com/cag/python-for-beginners','','2016-11-11 01:00:00','2016-11-11 02:00:00','2016-11-11 01:00:00','2016-11-11 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-11 01:00:00',0,1,0,'completed',8,502,NULL,NULL,NULL,NULL,NULL,NULL,'alanlu',1,0,'2016-11-09 00:47:57','2016-11-11 02:00:01'),(1140,'Python for Beginners (continued)','Continue learning how to Python.','Python is a general purpose programming language.\r\n\r\nClass stuff is here: https://github.com/cag/python-for-beginners','','2016-11-21 01:00:00','2016-11-21 02:00:00','2016-11-21 01:00:00','2016-11-21 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-21 01:00:00',0,2,0,'approved',8,502,NULL,NULL,1139,NULL,NULL,NULL,'alanlu',0,0,'2016-11-09 00:47:57','2016-11-09 00:47:57'),(1141,'Python for Beginners (continued)','Continue learning how to Python.','Python is a general purpose programming language.\r\n\r\nClass stuff is here: https://github.com/cag/python-for-beginners','','2016-11-25 01:00:00','2016-11-25 02:00:00','2016-11-25 01:00:00','2016-11-25 02:00:00',0.00,NULL,0,0,0,0,0,'2016-11-25 01:00:00',0,3,0,'approved',8,502,NULL,NULL,1139,NULL,NULL,NULL,'alanlu',0,0,'2016-11-09 00:47:57','2016-11-09 00:47:57'),(1142,'Storage Committee meeting','Project Storage extensions and general Logistics Committee discussion','Logistics Committee\'s monthly storage committee meeting.  The usual topics will be project storage and general Logistics Committee issues.\r\n\r\nIf you would like to extend project storage, attend this meeting (or send an agent).  Note that this is the *ONLY* way to extend project storage.\r\n\r\nNote that the meeting is scheduled for 2 hours, but typically breaks up after 15-30 minutes.  The Logistics Chair plans to be on-site for the duration of the scheduled time to issue extensions.','','2016-12-04 22:00:00','2016-12-05 00:00:00','2016-12-04 21:45:00','2016-12-05 00:00:00',0.00,NULL,0,0,0,0,0,'2016-12-04 22:00:00',0,1,0,'approved',11,66,NULL,NULL,NULL,228,NULL,NULL,'eriksmith',0,0,'2016-11-09 03:51:19','2016-11-10 17:01:03'),(1143,'Jewelry Monthly Committee Meeting','November committee meeting','Agenda:\r\n-Committee member recognition-Nadira\r\n-Review past month, plans for coming month\r\n-Proposal has been made to share JSM area with lamp/glass working, install hood\r\n-Review JSM orientation material, add/delete-Please review in advance (pdf attached)\r\n-Area needs/wants\r\n-Open discussion ','','2016-11-17 00:30:00','2016-11-17 02:00:00','2016-11-17 00:30:00','2016-11-17 02:00:00',0.00,NULL,0,0,1,0,0,'2016-11-17 00:30:00',0,1,0,'cancelled',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-11-09 18:04:29','2016-11-15 04:13:29'),(1144,'Machine Shop Committee','Meet to elect a new committee chair','Meeting to discuss future of Machine Shop and elect a new committee chair','','2016-11-18 02:00:00','2016-11-18 03:00:00','2016-11-18 02:00:00','2016-11-18 03:00:00',0.00,NULL,0,0,0,0,0,'2016-11-18 02:00:00',0,1,0,'completed',11,58,NULL,NULL,NULL,NULL,NULL,NULL,'wandrson',1,0,'2016-11-09 19:19:54','2016-11-18 03:00:01'),(1145,'Millennium Technology Science Discussion','Discussion of science and technology that is not normally covered in the media or taught in school.  Bring your info to share or just join in on the discussion.  Open to all.','Discussion of science and technology that is not normally covered in the media or taught in school.  Bring your info to share or just join in on the discussion.  Open to all.','','2016-11-18 01:00:00','2016-11-18 02:00:00','2016-11-18 00:45:00','2016-11-18 02:15:00',0.00,NULL,0,0,0,0,0,'2016-11-18 01:00:00',0,1,0,'completed',9,273,NULL,NULL,NULL,NULL,NULL,NULL,'benhere',1,0,'2016-11-09 20:46:42','2016-11-18 02:00:01'),(1146,'DFW Grotto: learn about caves and caving','DFW caving group monthly meeting. We will be discussing past and upcoming trips, and will have an educational program that varies month to month.','Meetings are usually held on the second Wednesday of each month. There is no meeting in December; instead there is a holiday party on a date to be determined in the fall.\r\n\r\nMeetings start at 7 p.m. and end just before 9:00 p.m., when members migrate to a local eating establishment for after-meeting dining and socializing.','','2016-12-15 01:00:00','2016-12-15 03:00:00','2016-12-15 00:45:00','2016-12-15 03:15:00',0.00,NULL,0,0,0,0,0,'2016-12-15 01:00:00',0,1,0,'approved',8,11,NULL,NULL,NULL,NULL,NULL,NULL,'julesrmakes',0,0,'2016-11-10 01:52:23','2016-11-10 17:03:28'),(1147,'Fired Arts Make-the-Ornaments-for-a-class ','We\'ll be cutting out ornaments for a painting class that will be held in December.','We\'ll be cutting out ornaments to fire.  They\'ll be painted (acrylic paint) in a class in early December.  Bring your cookie cutters -- be aware that they\'ll be full of clay when we\'re done.  It\'s not toxic -- it\'s just fancy mud.  Wear clothes that can get muddy.','','2016-11-26 20:00:00','2016-11-26 23:00:00','2016-11-26 20:00:00','2016-11-26 23:00:00',0.00,NULL,0,0,0,0,0,'2016-11-26 20:00:00',0,1,0,'approved',22,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',0,0,'2016-11-10 03:42:48','2016-11-10 17:02:06'),(1148,'Fired Arts discussion meeting -- Throwing class','We will be discussing preferred times to hold a throwing class.','This is a preliminary meeting to decide when the best time to hold a Throwing Class will be.  The Throwing class will be a 3-part class which will be held on a repeating evening or weekend.  If you can\'t make this discussion, please e-mail me your availability -- dryad2b@yahoo.com','','2016-11-19 20:00:00','2016-11-19 21:00:00','2016-11-19 20:00:00','2016-11-19 21:00:00',0.00,NULL,0,0,0,0,0,'2016-11-19 20:00:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-11-10 03:46:59','2016-11-19 21:00:01'),(1149,'Fired Arts -- Handbuilding Pottery','The 3 basic types of handbuilding pottery will be discussed and taught.','Pinch pots, coil-building and slab-building will be demonstrated.\r\nHave an idea of what you want to make.  (Cup?  Bowl? Box?)\r\nWear clothes you can get dirty.\r\nKids 10-13 welcome with attending parent.','Wear clothes you can get dirty','2016-11-20 20:00:00','2016-11-20 23:00:00','2016-11-20 20:00:00','2016-11-20 23:00:00',0.00,NULL,6,0,0,13,0,'2016-11-20 20:00:00',0,1,0,'completed',25,67,NULL,NULL,NULL,NULL,NULL,NULL,'dryad2b',1,0,'2016-11-10 03:56:33','2016-11-20 23:00:01'),(1150,'Eventbrite Testing','Dev testing for eventbrite','Eventbrite enabled event.','','2016-11-29 18:00:00','2016-11-29 19:00:00','2016-11-29 18:00:00','2016-11-29 19:00:00',0.00,'https://eventbrite.com/1',15,0,0,0,0,'2016-11-29 18:00:00',0,1,0,'rejected',1,39,NULL,NULL,NULL,NULL,'alexrhodes','RICKY BOBBY!!!!','elorentz',0,0,'2016-11-10 08:15:19','2016-11-11 19:15:23'),(1151,'Airbrushing 101 (IGNORE - DEBUGGING)','Learn how to use and clean airbrushes','We will be learning how to take airbrushes apart (and reassemble) and also how to clean them properly.\r\n\r\n\r\nWill also be learning some basic airbrushing painting techniques','','2016-11-23 01:30:00','2016-11-23 03:30:00','2016-11-23 01:30:00','2016-11-23 03:30:00',0.00,'',5,0,1,0,0,'2016-11-23 01:30:00',0,1,0,'cancelled',5,39,NULL,NULL,NULL,NULL,NULL,NULL,'elorentz',0,0,'2016-11-11 19:07:44','2016-11-11 19:07:57'),(1152,'Advanced CNC Router','	Advanced topics in CNC Routing.','This course covers advanced topics in CNC routing, and is required in order to cut plastics or use the Diamond Drag bit.\r\nAttendees must have taken the Basic CNC Routing Class, and have been tested/Have their key. This will be checked at the start of class.','Please bring or borrow eye protection.','2016-11-23 01:00:00','2016-11-23 03:00:00','2016-11-23 01:00:00','2016-11-23 03:00:00',10.00,'',0,15,1,18,0,'2016-11-20 01:00:00',0,1,0,'approved',9,46,NULL,3,NULL,NULL,NULL,NULL,'tapper',1,0,'2016-11-11 19:18:37','2016-11-19 01:00:03'),(1153,'ESEB Writers meeting','ESEB Writers meeting','ESEB Writers meeting','','2016-11-14 01:00:00','2016-11-14 04:00:00','2016-11-14 01:00:00','2016-11-14 04:00:00',0.00,'',0,0,0,0,1,'2016-11-14 01:00:00',0,1,0,'completed',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',1,0,'2016-11-11 22:57:46','2016-11-14 04:00:01'),(1154,'Jewelry: Cuff Link Creation','Make a pair of custom, sterling silver cuff links in this beginners level silversmithing workshop.  ','\'Tis the season for gifts, and or to accessorize your wardrobe with a pair of cuff links for an upcoming holiday party! Making a pair of cuff links is a fun and easy project for any beginner interested in silversmithing.\r\n\r\nAll materials will be provided for you to fabricate a custom pair of Sterling Silver cuff links in this 4-5 hour workshop. You will be guided through the process start to finish and leave at the end of the workshop with a completed pair of quality made cuff links. During the process of fabrication, you will be coached to cut, shape, stamp, texture, soldier, and polish 925 sterling silver using basic jewelry tools and fabrication techniques. \r\n\r\n**PURCHASE YOUR TICKET THROUGH THE LINK BELOW**\r\n https://laprong.acuityscheduling.com/schedule.php?appointmentType=1592535\r\n\r\n','Closed-toe shoes and pants are recommended. Aprons, dust masks, and eye protection are provided as necessary.','2016-11-19 18:00:00','2016-11-19 22:00:00','2016-11-19 17:45:00','2016-11-19 22:15:00',0.00,'',5,0,0,16,0,'2016-11-19 18:00:00',0,1,0,'completed',26,21,NULL,NULL,NULL,1103,NULL,NULL,'nausser915',1,0,'2016-11-11 23:47:18','2016-11-19 22:00:01'),(1155,'Jewelry Making: Silver Ring Fabrication','This class will be working with sterling silver to fabricate silver rings!','In this entry level silversmith workshop, you will work with raw sterling silver casting grain and transform it into a classic style band, much like a wedding band, using a variety of basic jewelry making tools, equipment, and techniques. \r\n\r\nYou first will figure your ring size and then melt the silver to create an ingot. From there we will roll out your ingot into a half round ring using the rolling mill. From there you will form, shape, and solder together. You then can stamp, and, polish, your ring to your desired level of finish. Most common finishes are a hammered texture, high polish, or a brushed Florentine finish.\r\n\r\nThis is a small class so everyone will be allowed enough time and attention to complete their ring by the end of the class. Total time to complete this project is approximately 6 to 7 hours, but will vary depending on your desired level of finish. If you are looking for something more durable than silver contact me about using gold.\r\n\r\nAll materials, supplies, tools and equipment will be included in the cost of the class.\r\n**PLEASE PURCHASE YOUR TICKETS THROUGH THE LINK BELOW**\r\nhttps://laprong.acuityscheduling.com/schedule.php?appointmentType=1899142','Please wear pants and closed-toe shoes. Aprons and dust masks will be provided.','2016-11-26 18:00:00','2016-11-27 00:00:00','2016-11-26 17:30:00','2016-11-27 00:30:00',0.00,'',4,0,0,0,0,'2016-11-26 18:00:00',0,1,0,'approved',26,21,NULL,NULL,NULL,NULL,NULL,NULL,'nausser915',0,0,'2016-11-12 00:05:34','2016-11-12 21:31:14'),(1156,'Practical Real World Tools and Techniques for Digital Privacy','A lecture/discussion on the tools and techniques to stay safe in the Age of Information.','We will discuss the tools and techniques for how you can maintain privacy on your computer and on the Internet.  This will include how the technologies work as well as how to apply them in real world scenarios.  \r\n\r\nNOTE: All the tools and techniques that will be discussed are LEGAL.  You and you alone (i.e. not the lecturer) are responsible for the data you are protecting with these tools and techniques.\r\n\r\nCourse topics include:\r\n-How privacy and security are sabotaged by various entities\r\n-Threat modeling\r\n-Physical security\r\n-Low-level software security (BIOS, Full-Disk Encryption, etc.)\r\n-Choosing a secure OS\r\n-Virtual machines and live disks related to privacy\r\n-Radio-frequency (i.e. Wi-Fi) security and privacy\r\n-Network security (VPNs, Tor, I2P, etc.)\r\n-Chaining privacy-enhancing services together\r\n-Privacy-oriented social networks\r\n-Browser security and privacy\r\n-Email security and privacy\r\n-Mobile security and privacy\r\n-Password security\r\n-Bitcoin and other methods of enhancing privacy in financial transactions\r\n-General good privacy/security practices and tips for \"street smarts\"\r\n-AND MORE!!!\r\n\r\n\r\n','','2016-12-08 01:00:00','2016-12-08 02:30:00','2016-12-08 00:45:00','2016-12-08 02:45:00',0.00,'',0,0,0,0,0,'2016-12-08 01:00:00',0,1,0,'cancelled',9,602,NULL,NULL,NULL,NULL,NULL,NULL,'grandlizard',0,0,'2016-11-12 01:08:00','2016-11-12 21:59:03'),(1157,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated.','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class.','2016-11-23 17:00:00','2016-11-23 20:00:00','2016-11-23 17:00:00','2016-11-23 20:00:00',5.00,'',0,5,0,0,0,'2016-11-22 17:00:00',0,1,0,'approved',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',0,0,'2016-11-12 01:50:21','2016-11-15 01:55:01'),(1158,'Philosophy Meet Up - 49','All are welcome, open discussion on life, the universe, and everything.','All are welcome, open discussion on life, the universe, and everything.','','2016-11-17 01:00:00','2016-11-17 04:00:00','2016-11-17 01:00:00','2016-11-17 04:00:00',0.00,'',0,0,0,0,0,'2016-11-17 01:00:00',0,1,0,'completed',4,163,NULL,NULL,NULL,NULL,NULL,NULL,'puzzlerf',1,0,'2016-11-12 03:23:25','2016-11-17 04:00:01'),(1159,'Philosophy Meet Up - 50','All are welcome, open discussion on life, the universe, and everything.','All are welcome, open discussion on life, the universe, and everything.','','2016-11-24 01:00:00','2016-11-24 04:00:00','2016-11-24 01:00:00','2016-11-24 04:00:00',0.00,'',0,0,0,0,0,'2016-11-24 01:00:00',0,1,0,'approved',4,163,NULL,NULL,NULL,NULL,NULL,NULL,'puzzlerf',0,0,'2016-11-12 03:24:12','2016-11-12 21:31:51'),(1160,'Rocketry Open Build','Model or high power rocket building workshop','Bring your model or high power rocketry projects and we will build together, sharing stories, techniques, tools and supplies. I will have some of my tools and supplies but do not have enough for everyone; please bring your own to prevent having to wait. Generally, you will be using white or wood (yellow) glue, a hobby knife, masking tape, a pencil, a ruler and some sandpaper (220 to 400 grit.) Model rocket kits are available locally at hobby shops as well as craft stores such as Hobby Lobby.\r\n\r\n The plan is to have these sessions every month on a weekday evening. Kids are welcome if they are interested in rocketry; minors need to have a parent or guardian present. If you are not a member of Dallas Makerspace and need to get in the front door, please call me at 972-985-5034. We are scheduled to 10, but if there is interest and the room is available, we can stay later. You may contact me with any questions at deiresearch@earthlink.net','','2017-01-11 01:00:00','2017-01-11 04:00:00','2017-01-11 01:00:00','2017-01-11 04:00:00',0.00,'',0,0,0,0,0,'2017-01-11 01:00:00',0,1,0,'approved',11,23,NULL,NULL,NULL,NULL,NULL,NULL,'bill',0,0,'2016-11-12 05:55:44','2016-11-12 21:32:02'),(1161,'3d fab committee meeting','committee meeting for the 3d fab','committee meeting for 3d fab for going over whats going on. please come and voice your opinion and what you believe should be talked about. ','','2016-12-04 02:00:00','2016-12-04 04:00:00','2016-12-04 02:00:00','2016-12-04 04:00:00',0.00,'',0,0,0,0,0,'2016-12-04 02:00:00',0,1,0,'approved',4,24,NULL,NULL,NULL,NULL,NULL,NULL,'axeonos',0,0,'2016-11-12 08:15:02','2016-11-12 21:32:13'),(1162,'Learn to use the Kingsley Hot foil embossing machine','An informal gathering to learn to setup and use the donated Kingsley embossing machine','The Kingsley hot foil embossing machine is an old school method of bonding a gold or colored metallic foil to various non-metalic materials (leather, paper, fabrics, wood, etc).  I am donating this vintage machine to the creative arts section. This informal gathering will be made available to anyone who wants to learn how to use it and for anyone who may want to take on the mantel of a trainer for it.  It\'s very easy.  I will show:\r\nset up\r\ntemperature control\r\nSetting up the letters in the tool holder.\r\nusing the foil on various materials. \r\n\r\ncome and have fun with us.','','2016-11-18 00:00:00','2016-11-18 01:45:00','2016-11-17 23:45:00','2016-11-18 02:00:00',0.00,'',0,0,0,0,0,'2016-11-18 00:00:00',0,1,0,'completed',5,57,NULL,NULL,NULL,NULL,NULL,NULL,'nicksilva',1,0,'2016-11-12 16:31:01','2016-11-18 01:45:01'),(1163,'Practical Real World Tools and Techniques for Digital Privacy','A lecture/discussion on the tools and techniques to stay safe in the Age of Information.','We will discuss the tools and techniques for how you can maintain privacy on your computer and on the Internet.  This will include how the technologies work as well as how to apply them in real world scenarios.  \r\n\r\nNOTE: All the tools and techniques that will be discussed are LEGAL.  You and you alone (i.e. not the lecturer) are responsible for the data you are protecting with these tools and techniques.\r\n\r\nCourse topics include:\r\n-How privacy and security are sabotaged by various entities\r\n-Threat modeling\r\n-Physical security\r\n-Low-level software security (BIOS, Full-Disk Encryption, etc.)\r\n-Choosing a secure OS\r\n-Virtual machines and live disks related to privacy\r\n-Radio-frequency (i.e. Wi-Fi) security and privacy\r\n-Network security (VPNs, Tor, I2P, etc.)\r\n-Chaining privacy-enhancing services together\r\n-Privacy-oriented social networks\r\n-Browser security and privacy\r\n-Email security and privacy\r\n-Mobile security and privacy\r\n-Password security\r\n-Bitcoin and other methods of enhancing privacy in financial transactions\r\n-General good privacy/security practices and tips for \"street smarts\"\r\n-AND MORE!!!\r\n\r\n\r\n','','2016-12-08 18:00:00','2016-12-08 19:00:00','2016-12-08 17:45:00','2016-12-08 19:15:00',0.00,'',0,0,0,0,0,'2016-12-08 18:00:00',0,1,0,'cancelled',9,602,NULL,NULL,NULL,NULL,NULL,NULL,'grandlizard',0,0,'2016-11-12 22:02:32','2016-11-12 22:07:57'),(1164,'Practical Real World Tools and Techniques for Digital Privacy','A lecture/discussion on the tools and techniques to stay safe in the Age of Information.','We will discuss the tools and techniques for how you can maintain privacy on your computer and on the Internet.  This will include how the technologies work as well as how to apply them in real world scenarios.  \r\n\r\nNOTE: All the tools and techniques that will be discussed are LEGAL.  You and you alone (i.e. not the lecturer) are responsible for the data you are protecting with these tools and techniques.\r\n\r\nCourse topics include:\r\n-How privacy and security are sabotaged by various entities\r\n-Threat modeling\r\n-Physical security\r\n-Low-level software security (BIOS, Full-Disk Encryption, Hidden Volumes, etc.)\r\n-Choosing a secure OS\r\n-Virtual machines and live disks related to privacy\r\n-Radio-frequency (i.e. Wi-Fi) security and privacy\r\n-Network security (VPNs, Tor, I2P, etc.)\r\n-Chaining privacy-enhancing services together\r\n-Privacy-oriented social networks\r\n-Browser security and privacy\r\n-Email security and privacy\r\n-Mobile security and privacy\r\n-Password security\r\n-Bitcoin and other methods of enhancing privacy in financial transactions\r\n-General good privacy/security practices and tips for \"street smarts\"\r\n-AND MORE!!!\r\n\r\n\r\n','','2016-12-09 01:00:00','2016-12-09 02:30:00','2016-12-09 00:45:00','2016-12-09 02:45:00',0.00,'',0,0,0,0,0,'2016-12-09 01:00:00',0,1,0,'approved',9,602,NULL,NULL,NULL,NULL,NULL,NULL,'grandlizard',0,0,'2016-11-12 22:08:18','2016-11-14 01:40:54'),(1165,'CLASS FULL: Turning a METAL pen on the Colchester metal Lathe','Turning a metal body for use with pen kits','Pen turning is a very popular hobby among wood turners. But did you know you can do the same thing in metal?  This class will show how to make a metal body pen and utilize the same pen kit parts available for making the wooden pens. This class will demonstrate a practical application and safe use of the Colchester metal lathe and is a great way for new members to gain confidence on the lathe.\r\n\r\nTurning the metal pen class includes:\r\nBasic Safety overview:\r\n- User safety warnings and shop safety rules\r\n- Description of the various parts of this lathe\r\n- EMERGENCY STOP\r\n- selecting speeds for this project\r\n- Loading the work piece on the 3 jaw chuck\r\n- Distractions\r\n\r\nBasic Operations needed to make the pen:\r\n- facing\r\n- turning a smooth pen body\r\n- drilling (center drill and thru hole)\r\n- parting\r\n- Lubricating the work piece\r\n- Using a bushing for sizing\r\n- Using the live center for support\r\n- deburring\r\n\r\nAdditional discussion:\r\n- Materials - Brass or aluminum\r\n- Knurling the pen body\r\n- assembly of the pen kit\r\n- Using Cermark to add figures to the pen on the laser (time and machine permitting)\r\n\r\nThis class helps to fulfill the DMS mission of: \r\nPromoting  artistic advancement\r\nCollaborate on craft in new and interesting ways.\r\nFreely share what is learned to teach others.\r\n\r\n','Class will meet at the lathe in the machine shop. \r\nStandard shop rules apply. Safety glasses at all times, no open toed shoes or shorts. \r\nSorry, due to space restrictions around the lathe, only 6 students at a time can be accommodated. No unregistered students will be allowed.','2016-12-10 00:30:00','2016-12-10 02:30:00','2016-12-10 00:30:00','2016-12-10 02:30:00',0.00,'',6,0,1,16,0,'2016-12-08 00:30:00',0,1,0,'approved',17,57,NULL,NULL,NULL,NULL,NULL,NULL,'nicksilva',0,0,'2016-11-13 16:33:59','2016-11-17 15:10:08'),(1166,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2016-11-21 01:00:00','2016-11-21 04:00:00','2016-11-21 01:00:00','2016-11-21 04:00:00',0.00,'',0,0,0,0,1,'2016-11-21 01:00:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',1,0,'2016-11-13 19:58:07','2016-11-20 01:00:02'),(1167,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2016-11-27 19:58:00','2016-11-27 20:58:00','2016-11-27 19:58:00','2016-11-27 20:58:00',0.00,'',0,0,0,0,1,'2016-11-27 19:58:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-11-13 19:59:04','2016-11-15 20:00:01'),(1168,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2016-12-05 01:00:00','2016-12-05 04:00:00','2016-12-05 01:00:00','2016-12-05 04:00:00',0.00,'',0,0,0,0,1,'2016-12-05 01:00:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-11-13 19:59:32','2016-11-15 20:00:01'),(1169,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2017-01-01 23:00:00','2017-01-02 00:00:00','2017-01-01 23:00:00','2017-01-02 00:00:00',0.00,'',0,0,0,0,1,'2017-01-01 23:00:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-11-13 20:00:54','2016-11-15 20:05:01'),(1170,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2017-01-09 01:00:00','2017-01-09 04:00:00','2017-01-09 01:00:00','2017-01-09 04:00:00',0.00,'',0,0,0,0,1,'2017-01-09 01:00:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-11-13 20:01:19','2016-11-15 20:05:01'),(1171,'ESEB Writers Meeting','ESEB Writers Meeting','ESEB Writers Meeting','','2017-01-15 23:00:00','2017-01-16 02:00:00','2017-01-15 23:00:00','2017-01-16 02:00:00',0.00,'',0,0,0,0,1,'2017-01-15 23:00:00',0,1,0,'approved',4,563,NULL,NULL,NULL,NULL,NULL,NULL,'esebommeid3',0,0,'2016-11-13 20:01:52','2016-11-15 20:05:01'),(1172,'TEST EVNET','Test','Test','','2016-12-31 07:00:00','2016-12-31 08:00:00','2016-12-31 06:30:00','2016-12-31 08:00:00',0.00,'',0,0,0,0,0,'2016-12-31 07:00:00',0,1,0,'rejected',5,34,NULL,NULL,NULL,NULL,'stansimmons','Not a real class. :) Stan','mellrhodes',0,0,'2016-11-13 22:51:02','2016-11-13 23:37:18'),(1173,'Airbrushing 101','Learn how to use and clean airbrushes','We will be learning how to take airbrushes apart (and reassemble) and also how to clean them properly.\r\n\r\nWill also be learning some basic airbrushing painting techniques','','2016-12-01 01:00:00','2016-12-01 03:00:00','2016-12-01 01:00:00','2016-12-01 03:00:00',0.00,'',5,0,1,0,0,'2016-12-01 01:00:00',0,1,0,'approved',5,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',0,0,'2016-11-14 02:40:18','2016-11-17 02:45:01'),(1174,'Airbrushing 101','Learn how to use and clean airbrushes','We will be learning how to take airbrushes apart (and reassemble) and also how to clean them properly.\r\n\r\nWill also be learning some basic airbrushing painting techniques','','2016-12-15 01:00:00','2016-12-15 03:00:00','2016-12-15 01:00:00','2016-12-15 03:00:00',0.00,'',5,0,1,0,0,'2016-12-13 01:00:00',0,1,0,'approved',5,71,NULL,NULL,NULL,NULL,NULL,NULL,'mreynolds',0,0,'2016-11-14 02:43:38','2016-11-17 02:45:01'),(1175,'DFW PErl Mongers','Monthly Perl Mongers mtg: Gentle intro to Perl on OpenShift','DFW Perl Mongers will be livestreaming our monthly meeting on youtube, with an introductory presentation on how to deploy Perl applications and microservices on Red Hat OpenShift (DevOps with Docker at cloud scale).\r\n\r\nPRESENTATION: A Gentle Introduction to Perl on OpenShift\r\n\r\nLIVESTREAM: https://www.youtube.com/watch?v=-g-ACui1Geo\r\n\r\nONLINE PARTICIPATION\r\nIf you plan to attend online interactively with us, please install the hangouts app/plugin from google.com/hangouts and send your google ID in advance to dfw.perlmongers [at] gmail.com and we\'ll add you to the online classroom.','There will be opportunity for hacking, so bring laptops if you have the need!','2016-11-15 01:01:00','2016-11-15 03:01:00','2016-11-15 00:46:00','2016-11-15 03:01:00',0.00,'',20,0,0,0,0,'2016-11-15 01:01:00',0,1,0,'completed',8,22,NULL,NULL,NULL,NULL,NULL,NULL,'jfields',1,0,'2016-11-14 18:52:40','2016-11-15 03:05:01'),(1176,'Numismatic Table Talks','Open discussion of topics related to coin collecting & the art & science of money','An opportunity to discuss numismatics, medallic art, and related subjects, in an informal setting, moderated by the Secretary of Numismatics International, the society for world coin collectors.','','2016-11-17 04:00:00','2016-11-17 05:00:00','2016-11-17 04:00:00','2016-11-17 05:00:00',0.00,'',0,0,0,0,0,'2016-11-17 04:00:00',0,1,0,'completed',5,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',1,0,'2016-11-14 18:54:19','2016-11-17 05:00:01'),(1177,'NEIWG','Weekly NEIWG Meeting','The three main topics will be the haptic feedback VR trainer and the linear actuator project.\r\n1) Continue planning the haptic feedback VR trainer project and check progress on all tasks.\r\n2)Discuss the role of rotational speed in fabricating a nylon based linear actuator.\r\n3)We made contact with a theoretical materials physicist at UNT and we would like to invite him to a meeting.  We will compile a list of questions and topics we would like to discuss with our guest. ','','2016-11-17 02:30:00','2016-11-18 04:30:00','2016-11-17 02:30:00','2016-11-18 04:30:00',0.00,'',0,0,0,0,0,'2016-11-17 02:30:00',0,1,0,'completed',7,404,NULL,NULL,NULL,NULL,NULL,NULL,'renkessa',1,0,'2016-11-14 19:07:39','2016-11-18 04:30:01'),(1178,'On Writing Synopses  Group Story-Building and Concept Development','Workshop and Discussion on member\'s outlines and synopsises.','In Dallas Film Crews meeting last Sunday, local independent filmmaker M. Legend Brown said that, in a way, filmmakers are like God; we have the ability to only show what we want to show through camera lenses; through the vision of the director and the operation of the cinematographer. As storytellers and screenwriters, we control the world in which our characters live, the individual wants and needs of our characters, and what happens to those characters.\r\nIn this way, stories are a lot like a winding river. We create the rhythmic ebb and flow; at parts the river widens and thins, displaces and erodes large chunks of earth to carve a new path, with the power to uproot trees, and displace millions of tons of sediment where their journey ends. Other times, the laziness of a river allows for open air naps, the quiet which allows intimacy, encourages comfort, and foreshadows the roar of a waterfall that is up ahead.\r\nWhether your viewer is travelling down roaring rapids, falling over a waterfall, or struggling under an overturned boat, its your creation.\r\nFor this session, our focus will be on outlining the river, in order to find the answers to these three questions:\r\n1.	What does each bend in the river, each roaring rapid, each turn accomplish? \r\n2.	What is the Human Question of this story? And does the story represent the development of that question?\r\n3.	What are the best starting point, middle, and end, of this story?\r\nFor a synopsis, any format is acceptable to bring which has a beginning, middle and end. For example:\r\n	Mary and John went to the market for a 12-pack to hold them over until Tuesday. They grab the beer and go up to pay, but a man enters with a gun to hold up the register. John is ex-military, but he does nothing. Hes just getting his. Once the robber leaves, the man behind the counter cries, quits his job and leaves. John leaves a $5 on the counter and leaves. Mary confronts John in the parking lot, calling him a coward. Flashback to John getting shot, starring up at his friend who had to leave him behind. Flash forward back to them at home. Mary, disgusted, leaves. John cries.\r\nIf you have a WIP (work-in-progress), please bring up to 10-pages, in standard Hollywood format, with at least enough copies for speaking roles.\r\n','','2016-11-19 19:00:00','2016-11-19 22:00:00','2016-11-19 19:00:00','2016-11-19 22:00:00',0.00,'',0,0,0,0,0,'2016-11-19 19:00:00',0,1,0,'completed',8,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-11-15 13:16:55','2016-11-19 22:00:01'),(1179,'Auditions - The Measuring Tree - Dallas Film Crew','Auditions for a Music Video','Please contact daniel@luzpictura.com if you have any questions! This is a closed audition, but we will take considerations.','','2016-11-18 00:00:00','2016-11-19 04:00:00','2016-11-18 00:00:00','2016-11-19 04:00:00',0.00,'',0,0,0,0,0,'2016-11-18 00:00:00',0,1,0,'completed',4,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-11-15 13:20:57','2016-11-19 04:00:02'),(1180,'Auditions - The Measuring Tree - Dallas Film Crew','Second Round of Auditions for The Measuring Tree - Dallas Film Crew.','This is a closed auditions. Please email daniel@luzpictura.com if you have any questions or considerations.','','2016-11-21 00:00:00','2016-11-21 04:00:00','2016-11-21 00:00:00','2016-11-21 04:00:00',0.00,'',0,0,0,0,0,'2016-11-21 00:00:00',0,1,0,'approved',9,74,NULL,NULL,NULL,NULL,NULL,NULL,'rffalex',1,0,'2016-11-15 13:23:05','2016-11-20 00:00:01'),(1181,'Temari Spheres','How to embroider Temari spheres','Learn to embroider Temari Spheres.  These lovely decorative items are associated with good luck and are often given as gifts. The sphere is wrapped in thread then segmented with colorful decorative thread. a design is then embroidered onto the sphere.','','2016-12-07 01:00:00','2016-12-07 03:00:00','2016-12-07 00:45:00','2016-12-07 03:00:00',0.00,'',10,0,0,0,0,'2016-12-07 01:00:00',0,1,0,'approved',5,52,NULL,NULL,NULL,NULL,NULL,NULL,'kriskat30',0,0,'2016-11-16 04:29:17','2016-11-19 04:30:02'),(1182,' Lets make Bottle Stoppers for Wine Time!',' We will be turning Bottle stoppers complete with stainless steel bottoms','As the holidays approach many of us will have a need for bottle stoppers. Some of us won\'t but  I digress.  We will turn bottle stoppers place them on stainless steel bottoms and  polish them to your liking. If time permits, we will discuss other holiday gift possibilities from the lathe','Appropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\n Appropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n','2016-12-03 00:00:00','2016-12-03 01:20:00','2016-12-02 23:30:00','2016-12-03 01:50:00',20.00,'',0,4,1,0,0,'2016-11-28 00:00:00',15,1,0,'approved',12,33,NULL,7,NULL,NULL,NULL,NULL,'wascheu',0,0,'2016-11-16 06:10:57','2016-11-18 06:15:01'),(1183,'Atomic Energy Reading Room','Come and educate yourself!','A wide variety of books, pamphlets, and papers on atomic energy topics will be available for perusal and reading on-site.  Materials will cover a broad range of subject matter, and levels of education and interest from casual to professional.','','2016-12-02 20:00:00','2016-12-03 02:30:00','2016-12-02 20:00:00','2016-12-03 02:30:00',0.00,'',0,0,0,0,0,'2016-12-02 20:00:00',0,1,0,'approved',8,162,NULL,NULL,NULL,NULL,NULL,NULL,'publius',0,0,'2016-11-16 06:46:52','2016-11-17 06:18:45'),(1184,'Nuclear Science Movie Night','16 mm films on atomic energy topics, projected for your information and enjoyment','16 mm educational films, on atomic energy and related topics, from the 1950s through the 1970s, projected for your edification and amusement.  If things go badly, you may learn something interesting about film projection equipment, as well.\r\nYes, we will be watching the \"thermonuclear fracking\" film!','','2016-12-03 02:30:00','2016-12-03 04:00:00','2016-12-03 02:30:00','2016-12-03 04:00:00',0.00,'',0,0,0,0,0,'2016-12-03 02:30:00',0,1,0,'rejected',8,162,NULL,NULL,NULL,NULL,'calliope1983a','This sounds more like a really fun event than an honorarium class.  Movie nights are discouraged by the current rules, and there\'s no clear idea of the skills you\'re teaching here.  It does sound super fun!  Sorry!  Amelia Young','publius',0,0,'2016-11-16 06:51:45','2016-11-16 14:45:17'),(1185,'Learn How to Make 1\" and 2.25\" Buttons at the \'Space! November Theme: \"Autumn\"','Learn how to use software to design 1\" and 2.25\" buttons, and how to use the button making equipment at Dallas Makerspace to make your button ideas come to life! The Button Making Class Theme for November 2016 is: \"Autumn\".','Come learn how to use various methods to design your 1\" and 2.25\" buttons, including: using templates that can be used in applications available at Dallas Makerspace, and using a free online button design site that makes adding curved text to your buttons a breeze! \r\n\r\nEveryone will have the opportunity to make one 1\" pin-back button and one 2.25\" pin-back button during the class to give you a chance to become familiar with the various types of tools we have available to help make your button making dreams come true!  \r\n\r\nWe will also go over the steps on how to make a 2.25\" magnetic button. \r\n\r\nAt the end of the class, you will be trained and qualified to use both button making machines and associated cutting tools. \r\n\r\nAll attendees will have a chance to make two buttons during the class (a 1\" button and a 2.25\" button).  Basic materials to make the two pin-back buttons made during the class will be provided. ','Feel free to bring some small pictures/images, if you would like to use them in your buttons! \r\n\r\nBring cash if you want to make more buttons after class.  The prices are as follows: \r\n\r\n* 1\" Pin-back buttons are six (6) buttons for one dollar ($1.00)\r\n* 2.25\" Pin-back buttons are six (6) buttons for one dollar ($1.00)\r\n* 2.25\" Magnetic buttons are two (2) buttons for one dollar ($1.00)\r\n\r\n\r\n- Non-members are allowed to take any classes offered to the public, including this one. \r\n- All visitors must sign liability waiver in front lobby, and must stay with the teacher or a member.\r\n- Visitors are ONLY allowed to use the tools within the class setting. \r\n\r\nDallas Makerspace Members have 24/7 access and will be able to use the button maker tools after completing the class.','2016-11-27 01:00:00','2016-11-27 02:00:00','2016-11-27 01:00:00','2016-11-27 02:00:00',0.00,'',10,0,0,0,0,'2016-11-27 01:00:00',20,1,0,'rejected',5,289,NULL,NULL,NULL,NULL,'mellrhodes','We\'re going to have to reject this class for honorarium. Teaching the use of this machine takes minimal time. Also, what you can do by using it incorrectly is slight damage to the tool over time, not really break it or harm yourself or others. -Mell ','selk68',0,0,'2016-11-16 11:47:36','2016-11-17 21:59:51'),(1186,'DMS Wood Shop Basics','Fulfills training requirement to be able to use large power tools in the Wood Shop','This class will introduce you to the Dallas Makerspace Wood Shop, including shop rules and general expectations, and wood working safe/best practices.\r\n\r\nMajor wood working tools will be covered, including use of the jointer, thickness planer, table saw, and miter saw. You will walked/talked through the standard steps of squaring up a rough piece of lumber via a hands-on approach. Other power tools will be introduced and quickly demonstrated. ','There is a lot of material to cover in the 2.5 hours, so this will class start on time; there will be a 5 minute grace period, but no more and no exceptions.\r\n\r\nAppropriate work shop attire is required including long pants/jeans, short sleeve shirt/top (or long sleeves with close fitting cuffs), and sturdy closed-toe shoes or work boots. NO: overly loose fitting (i.e. baggy) clothing; unbound long hair; dangling/swinging jewelry and other accessories.\r\n\r\nAppropriate eye protection will be required; dust and hearing protection is recommended. DMS does make necessary protective gear available, but feel free to bring your own.\r\n\r\nYou must be over 18+ to attend this class. ','2016-11-29 17:00:00','2016-11-29 20:30:00','2016-11-29 17:00:00','2016-11-29 20:30:00',5.00,'',0,5,0,0,0,'2016-11-28 17:00:00',0,1,0,'approved',12,191,NULL,NULL,NULL,NULL,NULL,NULL,'mblatz',0,0,'2016-11-16 16:32:07','2016-11-19 16:35:01'),(1187,'Traditional Woodcarving','Wood carving using traditional hand tools','The class is part of an ongoing series that focuses on learning woodcarving primarily using traditional mallet and gouge techniques. Instruction will be available for all stages of the process including developing a design, tool safety, sharpening, carving technique and finishing.\r\n\r\nNew students are encouraged to take \"Introduction to Tradition Woodcarving\" prior to taking this class.\r\n\r\nThe class will be available for up to 8 students. Each student will work on a project of their own choosing at their own pace.\r\n\r\nMore information regarding the instructor can be found at:\r\n\r\nhttp://www.texaswoodcarving.com/\r\n\r\nClass fee is $20 and can be paid via cash or check at the time of the class. To register or for more information, please email hans@msdesigns.net.','Please note that there is  $20 fee for the class that can be paid in advance or at the time of the class. The Makerspace calendar only allows payment at time of registration. Therefore, if you choose one of the \"free space\" registrations, you can pay at the time of the class. Thank you.','2016-12-01 01:00:00','2016-12-01 03:00:00','2016-12-01 01:00:00','2016-12-01 03:00:00',20.00,'',7,1,0,16,1,'2016-12-01 01:00:00',0,1,0,'approved',20,13,NULL,NULL,NULL,924,NULL,NULL,'hans',0,0,'2016-11-16 21:54:58','2016-11-19 21:55:01'),(1188,'3D Printing Training Class','	3d printing class for learning the dms printers.','Required training for using the PolyPrinter 3D printers in 3D Fab.','','2016-12-02 03:00:00','2016-12-02 05:00:00','2016-12-02 02:30:00','2016-12-02 05:30:00',0.00,'',0,0,0,16,0,'2016-12-02 03:00:00',30,1,0,'approved',9,24,1,NULL,NULL,NULL,NULL,NULL,'axeonos',0,0,'2016-11-17 01:13:37','2016-11-20 01:15:01'),(1189,'December Pot Luck: Festavus celebration ','Food is good. Friends are better. ','Follow the link to a simple food sign-up: https://docs.google.com/spreadsheets/d/1TI40HM9R625AAH4G6ztqe2HBgfIbqlNuwBbeftOicHg/edit?usp=sharing\r\n\r\nIf you choose to - you can \"play along\" by bringing a pair of christmas socks stuffed with goodies (under $10) to exchange I\'ve created a pinterest board to help with ideas: https://www.pinterest.com/uglyknees/festivus-and-sock-exchange-at-dms/4\r\n\r\nCome together to build some community. \r\nWe\'ve grown a bunch - and it\'s always nice to take a minute to reflect. \r\nIf you don\'t have the means to contribute with food come early to help setup or stay later to help clean-up. ','Please use the sign up to help make a nice night of balanced meal for people ','2016-12-18 01:00:00','2016-12-18 04:00:00','2016-12-18 00:30:00','2016-12-18 04:30:00',0.00,'',0,0,0,0,0,'2016-12-18 01:00:00',0,1,0,'approved',8,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',0,0,'2016-11-17 03:34:26','2016-11-17 21:21:48'),(1190,'Jewelry Monthly Committee Meeting','November committee meeting','Agenda:\r\n-Committee member recognition-Nadira\r\n-Review past month, plans for coming month\r\n-Proposal has been made to share JSM area with lamp/glass working, install hood\r\n-Review JSM orientation material, add/delete-Please review in advance (pdf attached)\r\n-Area needs/wants\r\n-Open discussion ','','2016-11-24 00:30:00','2016-11-24 01:30:00','2016-11-24 00:30:00','2016-11-24 01:30:00',0.00,'',0,0,1,0,0,'2016-11-24 00:30:00',30,1,0,'approved',26,21,NULL,NULL,NULL,1143,NULL,NULL,'nausser915',0,0,'2016-11-17 04:50:43','2016-11-17 06:19:13'),(1191,'Please come pick up your 10X10 from Creative Arts','If you donate your piece it will be moved to a display area.','If you noted that you wanted to donate your piece I\'m not really talking to you - but if you want your piece back please come pick it up. Putting the room down as the lobby so I don\'t block up a room but please pick them up in the CA room. ','','2016-12-03 18:00:00','2016-12-03 19:00:00','2016-12-03 18:00:00','2016-12-03 19:00:00',0.00,'',0,0,0,0,0,'2016-12-03 18:00:00',0,1,0,'approved',27,75,NULL,NULL,NULL,NULL,NULL,NULL,'uglyknees',0,0,'2016-11-17 21:19:49','2016-11-18 16:23:02'),(1192,'Private/Closed Short Film Set ','John Bergsten record film Monday,  the 21st of November','John Bergsten and associates will be recording in the adjoining  digital media/film cyclorama room to the main communal computer workspace.','','2016-11-21 17:00:00','2016-11-22 08:00:00','2016-11-21 17:00:00','2016-11-22 08:00:00',0.00,'',0,0,0,0,0,'2016-11-21 17:00:00',0,1,0,'approved',6,571,NULL,NULL,NULL,NULL,NULL,NULL,'forf',1,0,'2016-11-17 22:33:08','2016-11-20 17:00:01'),(1193,'Rejection test','sdfsdf ','sdfsdf dsf','','2016-11-29 18:00:00','2016-11-29 19:00:00','2016-11-29 18:00:00','2016-11-29 19:00:00',0.00,'',0,0,0,0,0,'2016-11-29 18:00:00',0,1,0,'rejected',1,39,NULL,NULL,NULL,NULL,'elorentz','Testing rejection emails','elorentz',0,0,'2016-11-18 00:41:55','2016-11-18 00:42:07'),(1194,'Dallas Ethereum Developers Meetup','Join us for an evening of blockchain! Ethereum\'s John from ethembedded will be with us in person.','Dallas Ethereum Developers Meetup!  \r\nJohn from Ethembedded will be with us in person and will be showing us IoT hardware examples and applications. \r\n\r\nAlso!  A Devcon2 recap, Dynamis\' latest project, and open discussion!  \r\n\r\n','','2016-12-02 00:30:00','2016-12-02 03:30:00','2016-12-02 00:30:00','2016-12-02 03:30:00',0.00,'',0,0,0,0,0,'2016-12-02 00:30:00',0,1,0,'approved',8,308,NULL,NULL,NULL,NULL,NULL,NULL,'conradjohnson',0,0,'2016-11-18 00:42:27','2016-11-18 16:22:48'),(1195,'Pinball school continued - EM tech - relays, steppers, and mechs','A \"hands on\" EM pinball class will be held covering relays, steppers, and score reels.','Come join VECTOR for another \"hands on\" pinball class covering EM tech (relays, steppers, and score reels). Gain the knowledge to work your way through your own electro-mechanical pinball project... it\'s fun and free! All tools will be provided.','','2016-11-28 01:00:00','2016-11-28 03:00:00','2016-11-28 01:00:00','2016-11-28 03:00:00',0.00,'',0,0,0,0,0,'2016-11-28 01:00:00',0,1,0,'approved',8,36,NULL,NULL,NULL,NULL,NULL,NULL,'nickdangerous',0,0,'2016-11-18 00:43:53','2016-11-21 00:45:01'),(1196,'\"Test Rejection Email\"','testing','testing','','2016-12-07 18:00:00','2016-12-07 19:00:00','2016-12-07 18:00:00','2016-12-07 19:00:00',0.00,'',0,0,0,0,0,'2016-12-07 18:00:00',0,1,0,'rejected',1,39,NULL,NULL,NULL,NULL,'elorentz','Testing rejection emails','elorentz',0,0,'2016-11-18 00:46:19','2016-11-18 00:46:38'),(1197,'TESTING How to Make 1\" and 2.25\" Buttons at the \'Space! November Theme: \"Autumn\"','testing','testing','','2016-12-07 18:00:00','2016-12-07 19:00:00','2016-12-07 18:00:00','2016-12-07 19:00:00',0.00,'',0,0,0,0,0,'2016-12-07 18:00:00',0,1,0,'rejected',3,39,NULL,NULL,NULL,NULL,'elorentz','Testing rejection emails','elorentz',0,0,'2016-11-18 00:52:40','2016-11-18 00:52:54'),(1198,'Embedded Workshop Microcontrollers','Exploring GPIO pins using I2C ','Jim Merkle will be presenting how to use GPIO and I2C on Raspberry Pi & BeagleBone.\r\nWhat to Bring:  \r\n Raspberry pi any model or BeagleBone a long your monitor, Keyboard & mouse. Don\'t forget your power cords and your laptop.','','2016-12-01 01:00:00','2016-12-01 02:00:00','2016-12-01 00:45:00','2016-12-01 02:15:00',0.00,'',0,0,0,0,0,'2016-12-01 01:00:00',0,1,1,'pending',8,174,NULL,NULL,NULL,NULL,NULL,NULL,'microrustyc',0,0,'2016-11-18 02:48:50','2016-11-18 02:48:50'),(1199,'Ninjaflex Training Class','Learn how to print Ninjaflex.','Learn how to print Ninjaflex flexible TPU material on the Polyprinter. \r\n\r\n','','2016-11-29 03:00:00','2016-11-29 04:00:00','2016-11-29 03:00:00','2016-11-29 04:00:00',0.00,'',0,0,1,0,0,'2016-11-29 03:00:00',0,1,0,'pending',1,30,NULL,1,NULL,NULL,NULL,NULL,'themitch22',0,0,'2016-11-18 03:18:48','2016-11-18 03:18:48'),(1200,'Turning a METAL pen on the Colchester metal Lathe','Turning a metal body for use with pen kits','Pen turning is a very popular hobby among wood turners. But did you know you can do the same thing in metal? This class will show how to make a metal body pen and utilize the same pen kit parts available for making the wooden pens. This class will demonstrate a practical application and safe use of the Colchester metal lathe and is a great way for new members to gain confidence on the lathe.\r\n\r\nTurning the metal pen class includes:\r\nBasic Safety overview:\r\n- User safety warnings and shop safety rules\r\n- Description of the various parts of this lathe\r\n- EMERGENCY STOP\r\n- selecting speeds for this project\r\n- Loading the work piece on the 3 jaw chuck\r\n- Distractions\r\n\r\nBasic Operations needed to make the pen:\r\n- facing\r\n- turning a smooth pen body\r\n- drilling (center drill and thru hole)\r\n- parting\r\n- Lubricating the work piece\r\n- Using a bushing for sizing\r\n- Using the live center for support\r\n- deburring\r\n\r\nAdditional discussion:\r\n- Materials - Brass or aluminum\r\n- Knurling the pen body\r\n- assembly of the pen kit\r\n- Using Cermark to add figures to the pen on the laser (time and machine permitting)\r\n\r\nThis class helps to fulfill the DMS mission of: \r\nPromoting artistic advancement\r\nCollaborate on craft in new and interesting ways.\r\nFreely share what is learned to teach others.','Class will meet at the lathe in the machine shop. \r\nStandard shop rules apply. Safety glasses at all times, no open toed shoes or shorts. \r\nSorry, due to space restrictions around the lathe, only 6 students at a time can be accommodated. No unregistered students will be allowed.','2016-12-16 00:30:00','2016-12-16 02:30:00','2016-12-16 00:15:00','2016-12-16 02:45:00',0.00,'',6,0,1,16,0,'2016-12-14 00:30:00',0,1,0,'pending',17,57,NULL,NULL,NULL,NULL,NULL,NULL,'nicksilva',0,0,'2016-11-18 16:10:32','2016-11-18 16:20:31'),(1201,'Wood Lathe Basics','Introduction to Wood Lathes and Easy Wood Tools','Intro to woodshop lathes, basic tools, and safe turning practices for both spindle and faceplate mounted work (think candlesticks and bowls). While you won\'t leave with anything but wood shavings, you should have the confidence and knowledge to begin turning and experimenting on your own. \r\n\r\nNo experience necessary! Woodshop Basics class preferred but not required. Should have some confidence working with power tools.\r\n\r\nCLASS SIZE LIMITED TO INSURE PARTICIPANTS GET ADEQUATE PRACTICE.\r\n\r\nAge 16- 17: parent must be co-participant\r\n\r\nIf you want to get a jump start on learning the Easy Wood Tool system, here is a link to multiple videos:  https://www.youtube.com/playlist?list=PLC872DE1CEB3B9E12','Although we will cover safety, avoid loose clothing, jewelry, etc. Unless you like sawdust between your toes, closed toe shoes recommended.','2016-12-03 16:00:00','2016-12-03 18:00:00','2016-12-03 15:30:00','2016-12-03 18:30:00',5.00,'',0,6,1,16,0,'2016-11-30 16:00:00',0,1,0,'pending',13,570,NULL,NULL,NULL,NULL,NULL,NULL,'jlcourtman',0,0,'2016-11-18 16:57:52','2016-11-18 16:57:52'),(1202,'Find A Penny, Pick It Up - Auditions','Open and closed auditions for the Dallas-based short film \"Find A Penny, Pick It Up\".','We will be hosting open and closed auditions for the Dallas-based short film \"Find A Penny, Pick It Up\".','','2016-11-20 14:00:00','2016-11-20 22:00:00','2016-11-20 14:00:00','2016-11-20 22:00:00',0.00,'',0,0,0,0,0,'2016-11-20 14:00:00',0,1,0,'completed',11,165,NULL,NULL,NULL,NULL,NULL,NULL,'jmmaker',1,0,'2016-11-18 17:33:52','2016-11-20 22:00:02'),(1203,'Gingerbread House Construction and Decorating!','Come make a gingerbread house that you will actually want to eat!','Come learn how to construct the panels of of a gingerbread house with royal icing and then embrace your inner child to decorate! At the end of the night you will have a beautiful holiday decoration or a tasty snack.\r\n\r\nYou will learn basic construction techniques that can be applied to making other 3D structures out of completely edible components. You will also learn different decorating techniques that you can use to make the gingerbread house of your dreams! \r\n\r\n**Please bring $15 to help pay for materials.**\r\n\r\nFeel free to BYOB as well!','','2016-12-18 01:30:00','2016-12-18 03:00:00','2016-12-18 01:00:00','2016-12-18 03:30:00',0.00,'',15,0,0,13,0,'2016-12-18 01:30:00',0,1,0,'cancelled',11,391,NULL,NULL,NULL,NULL,NULL,NULL,'mandrew',0,0,'2016-11-18 17:39:05','2016-11-18 20:58:06'),(1204,'Fiberholic Fiberfrolic','Fiberarts SIG work night. Bring your fiber project or learn something new','Come join us for a Fiberarts SIG (special interest group) fiberarts worknight!\r\n\r\nBring your own fiberarts project and get help or just hang out with other fibery folks.\r\n\r\nIf you want to pick up the basics of something, we can help with that.  It\'ll depend a little on who is there that night what we can help with, but usually one or several of us can help with most things below. If you have a specific interest, feel free to contact us below in the Fiberholics fb group.\r\n\r\nWe have tools/supplies for:\r\nCrochet\r\nKnitting\r\nInkle weaving \r\nNeedle felting \r\nKumihimo\r\nTatting \r\nSpinning\r\n  -drop spindling\r\n  -wheel spinning\r\nFiber prep\r\n  -drumcarder\r\n  -blending board\r\n  -wool combs\r\n  -random really useful tools (wool and cotton handcards, flicker, lazy kate, umbrella swift, ball winder, large and small niddy noddy, warping board)\r\n \r\nWe can help you with, but you\'ll need to bring your own tools and project:\r\nNeedlework (lots of kinds)\r\nSmall loom weaving (rigid heddle loom, frame loom, tapestry, triloom)\r\n\r\nNOTE:\r\nThis is also a good night to come by if you need training on one of the Fiberarts training required tools (spinning wheel, drumcarder, wool combs) so you can use them any time.\r\n\r\nSome items may have a modest consumable fee payable to the CA box in the room.\r\n\r\nSmall fee: fiber (for spinning, blending, or needlefelting), or weaving thread (for inkle weaving that\'s in the cabinet)  Fees vary, if not sure, ask.\r\n\r\nFree: yarn in blue tub on top of cabinet (although small donations of replacement yarn or money are appreciated)\r\n\r\nHope you can make it!\r\n\r\nQuestions or want to connect with us? \r\nPost in Facebook group \"Dallas Makerspace Fiberholics\"\r\n','','2016-11-23 01:00:00','2016-11-23 03:00:00','2016-11-23 01:00:00','2016-11-23 03:00:00',0.00,'',0,0,0,0,0,'2016-11-23 01:00:00',0,1,0,'approved',5,8,NULL,NULL,NULL,NULL,NULL,NULL,'kyrithia',0,0,'2016-11-18 18:14:17','2016-11-19 14:47:51'),(1205,'So you want to NEIWG','An overview of the NEIWG projects, how you can get invovled and where you can go to learn more','This class will provide a broad overview of the projects the Neural Electric Working Group (NEIWG) is working on.  We will discuss each project and provide a general understanding of the scientific and engineering principles that apply to each.  At the end of the presentation  we will discuss how to get involved in the projects and review the up coming classes that will dive deeper into the the specific areas of expertise.','','2016-12-01 02:30:00','2016-12-01 04:30:00','2016-12-01 02:30:00','2016-12-01 04:30:00',0.00,'',0,0,0,0,0,'2016-12-01 02:30:00',0,1,0,'rejected',9,404,NULL,NULL,NULL,NULL,'bscharff','This sounds like a showcase of projects an interest group is working on.  Please resubmit with description of what items are discussed and what attendees will learn.','renkessa',0,0,'2016-11-18 19:47:50','2016-11-19 22:50:02'),(1206,'Gingerbread House Construction and Decorating!','Come make a gingerbread house that you will actually want to eat!','Come learn how to construct the panels of of a gingerbread house with royal icing and then embrace your inner child to decorate! At the end of the night you will have a beautiful holiday decoration or a tasty snack.\r\n\r\nYou will learn basic construction techniques that can be applied to making other 3D structures out of completely edible components. You will also learn different decorating techniques that you can use to make the gingerbread house of your dreams! \r\n\r\n**Please bring $15 to help pay for materials.**\r\n\r\nFeel free to BYOB as well!','','2016-12-17 01:30:00','2016-12-17 03:00:00','2016-12-17 01:00:00','2016-12-17 03:30:00',0.00,'',15,0,0,0,0,'2016-12-17 01:30:00',0,1,0,'approved',8,391,NULL,NULL,NULL,NULL,NULL,NULL,'mandrew',0,0,'2016-11-18 21:00:01','2016-11-20 02:21:15'),(1207,'Nuclear Science Movie Night','16 mm films on atomic energy topics, projected for your information and enjoyment','As a continuation of the preceding \"Atomic Energy Reading Room\" event, 16 mm educational films from the 1960s and \'70s, on atomic energy and related topics, will be projected for your amusement and edification, with context, commentary, and an opportunity for discussion.  Topics covered will include basic nuclear science ;  the nature and growth of demand for energy in home and industry ;  the merits and disadvantages of various means of meeting that demand ;  the peaceful applications of nuclear explosives (yes, we will be watching the \"thermonuclear fracking\" film!) ; and the interaction between science and ideology in the formation of public policy.\r\n\r\nThere will also be an opportunity to learn about motion-picture films and the equipment used to reproduce sound and picture from them.\r\n','','2016-12-03 02:31:00','2016-12-03 04:00:00','2016-12-03 02:31:00','2016-12-03 04:00:00',0.00,'',0,0,0,0,0,'2016-12-03 02:31:00',0,1,0,'rejected',8,162,NULL,NULL,NULL,1184,'bscharff','Please use a different event title.  This is not strictly a movie night, so it would be best if it were renamed to \"Nuclear Science Lecture + Educational Movie\" or something like that.','publius',0,0,'2016-11-19 00:21:23','2016-11-19 22:48:21'),(1208,'Monthly Board Meeting','Monthly Board Meeting','Monthly Board Meeting','','2016-12-18 01:30:00','2016-12-18 05:30:00','2016-12-18 01:15:00','2016-12-18 05:30:00',0.00,'',0,0,0,0,0,'2016-12-18 01:30:00',0,1,0,'approved',9,51,NULL,NULL,NULL,NULL,NULL,NULL,'lukeiamyourfather',0,0,'2016-11-19 05:29:55','2016-11-19 14:47:30'),(1209,'Leather SIG Meeting','This us an open format meeting of the Leather Special Interest Group.','All experience levels welcome and encouraged to attend! If you are interested in working with leather or have a current project in the works, please join us for an open format discussion/work session. Bring your projects, ideas, questions, answers, tips & tricks. This is where we get input for upcoming classes and tools/materials acquisition suggestions and also serves as a hands-on training opportunity to learn to use the Pfaffenbeast or Rex sewing machines.\r\n\r\nWe will also be showing of the newly donated hot foil printing machine!  So if you would like to learn how to use it, please come hand out with us.\r\n\r\n','','2016-12-18 21:00:00','2016-12-18 22:00:00','2016-12-18 21:00:00','2016-12-18 22:00:00',0.00,'',0,0,0,0,0,'2016-12-18 21:00:00',0,1,0,'approved',5,54,NULL,NULL,NULL,793,NULL,NULL,'bitta',0,0,'2016-11-19 08:56:05','2016-11-19 14:47:06'),(1210,'sdf/3wa','	watch and discuss new anime','	watch and discuss new anime','','2017-01-21 18:00:00','2017-01-21 23:00:00','2017-01-21 18:00:00','2017-01-21 23:00:00',0.00,'',0,0,0,0,0,'2017-01-21 18:00:00',0,1,0,'approved',9,27,NULL,NULL,NULL,NULL,NULL,NULL,'captelensar',0,0,'2016-11-19 23:34:38','2016-11-20 02:21:05'),(1211,'CNC PlasmaCAM Training','Training for the Metalshop CNC Plasmacutter','This is the long awaited training for the CNC Plasma cutter. We will begin in the classroom to go over the basics then move to the metalshop to get hands on training. You will be instructed on how to use the CNC Plasma cutter in the basic form. You will be cutting out some items for a demo on the plasma cutter.','Please wear appropriate clothing. Do not wear any open toe shoes or shorts, you will be turned away. Please bring your safety glasses. If you have a Pacemaker, the plasma cutter may interfere, Please talk to your DR before hand.','2016-12-06 01:00:00','2016-12-06 03:30:00','2016-12-06 00:45:00','2016-12-06 03:30:00',5.00,'',0,8,1,18,0,'2016-12-05 01:00:00',0,1,0,'pending',8,147,NULL,NULL,NULL,949,NULL,NULL,'tbjk',0,0,'2016-11-20 22:14:07','2016-11-20 22:14:07');
